INSERT INTO `nest_admin_email` VALUES (1,'2016-04-27 17:56:18','EML_JOIN','회원가입 환영 메일','[오지랖] 가입을 환영합니다','<h1 style=\"text-align: center; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: rgb(181, 203, 216); padding: 15px 0px 10px; margin: 0px; background-color: rgb(221, 232, 238);\"><a href=\"https://www.ozr.kr\" target=\"_blank\" alt=\"오지랖\" style=\"border:0px solid #fff; text-decoration:none; border:0px; color:#434343; cursor:pointer;\"></a>www.ozr.kr</h1><br><p>회원 가입해주셔서 감사합니다.</p><p style=\"margin-top:30px; line-height:1.6em;\"><strong>스스로 동기를 부여하고 도전 과제를 정해 새로운 만들기를 이끄는 제작자</strong>, 메이커(Maker).<br><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">오지랖은 당신의 새로운 프로젝트를 시작하는 곳입니다.<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">당신이 무엇에 열중하는지, 무엇을 이루려고 하는지에 공감하는 (Backer).<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">오지랖은 그들의 후원/투자 자금(crowd funding)이 모여 프로젝트를 완성하는 곳입니다.<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\"><br>프로젝트 성공이 끝이 아니라당신의 진짜 시작임을 아는 가장 신뢰할만한 곳입니다.<br></span><span style=\"line-height: 1.6em; background-color: initial;\"><br>감사합니다.</span></p>','신규회원',1,1),(2,'2016-04-27 17:56:41','EML_RESET','비밀번호 초기화 메일','[오지랖] 비밀번호 재설정 확인','<h1 style=\"text-align: center; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: rgb(181, 203, 216); padding: 15px 0px 10px; margin: 0px; background-color: rgb(221, 232, 238);\"><a href=\"https://www.ozr.kr\" target=\"_blank\" alt=\"오지랖\" style=\"border:0px solid #fff; text-decoration:none; border:0px; color:#434343; cursor:pointer;\"></a>www.ozr.kr</h1><p style=\"margin-top:30px; line-height:1.6em;\"><strong style=\"color:#color:#000;\">{NAME}</strong>님, 안녕하세요.<br><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">오지랖를 이용해 주셔서 감사합니다.<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">고객님의 계정의 비밀번호를 재설정 합니다.<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">아래 링크를 누른 뒤 비밀번호를 다시 설정해 주시기 바랍니다.<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\"><br>고객님의 개인정보를 항상 소중히 하는 오지랖이 되겠습니다.</span></p><p><a href=\"{URL}\" target=\"_blank\"><label><input type=\"submit\" value=\"오지랖 비밀번호 재설정\" style=\"font-weight:700; background-color:#ec901f; border:0; border-radius:3px; width:195px; color:#fff; height:40px; text-align:center; margin:15px 0 15px 0; &nbsp;cursor:pointer;\"></label></a></p><p style=\"margin-top:5px; line-height:1.6em;\">감사합니다.<br>오지랖 팀 드림</p>','회원',1,1),(3,'2016-04-27 17:57:22','EML_VERIFY','이메일 인증요청 메일','[오지랖] 이메일 인증 요청','<h1 style=\"text-align: center; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: rgb(181, 203, 216); padding: 15px 0px 10px; margin: 0px; background-color: rgb(221, 232, 238);\"><a href=\"https://www.ozr.kr\" target=\"_blank\" alt=\"오지랖\" style=\"border:0px solid #fff; text-decoration:none; border:0px; color:#434343; cursor:pointer;\"></a>www.ozr.kr</h1><p style=\"margin-top:30px; line-height:1.6em;\"><strong style=\"color:#color:#000;\">{NAME}</strong>님, 안녕하세요.<br><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">오지랖에 오신 것을 환영합니다!<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">고객님의 이메일 소유 여부를 인증하려고 합니다.<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">아래 링크를 누르면 이메일 인증을 할 수 있습니다.</span></p><p><a href=\"{URL}\" target=\"_blank\"><label><input type=\"submit\" value=\"오지랖 이메일 주소 인증\" style=\"font-weight:700; background-color:#ec901f; border:0; border-radius:3px; width:195px; color:#fff; height:40px; text-align:center; margin:15px 0 15px 0; cursor:pointer;\"></label></a></p><p style=\"margin-top:5px; line-height:1.6em;\">고객님의 개인정보를 항상 소중히 하는 오지랖이 되겠습니다.<br><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\"><br>감사합니다.<br></span><span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 1.6em; background-color: initial;\">오지랖 팀 드림</span></p>','회원',1,1);
