INSERT INTO `nest_contents` VALUES (1,'service','1.0','2016-04-27 17:53:07',1,'<p class=\"terms-con_subtit\">제 1조 목적</p>\r\n<p class=\"terms-con_txt\">\r\n이 약관은 ㈜더네스트(이하 ‘회사’라 한다)가 운영하는 인터넷사이트(이하 ‘사이트’라 한다)에서 제공하는 인터넷 관련 서비스(이하 ‘서비스’라 한다)를 이용함에 있어 이용자의 권리·의무 및 책임사항을 규정함을 목적으로 합니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 2 조 용어의 정의</p>\r\n<p class=\"terms-con_txt\">\r\n이 약관에서 사용하는 용어의 정의는 다음과 같습니다. 이 약관에서 명시되지 않은 용어는 거래 관행 및 관계 법령을 따릅니다.<br>\r\n1. ‘회사’ 란 ㈜더네스트를 말합니다.<br>\r\n2. ‘서비스’란 컴퓨터와 모바일기기 등의 정보통신기기를 통해 이용자들에게 제공되는 오지랖의 관련 제반 서비스를 말합니다.<br>\r\n3. ‘사이트’란 ‘회사’가 컴퓨터와 모바일기기 등의 정보통신기기를 통해 이용자들에게 제품 또는 용역을 거래할 수 있도록 설정한 가상의 영업장을 말합니다.<br>\r\n4. ‘이용자’란 ‘사이트’에 접속하여 이 약관에 따라 ‘사이트’에서 제공하는 서비스를 받는 회원 및 비회원을 말합니다.<br>\r\n5. ‘회원’이란 ‘사이트’에서 개인정보를 제공하고 ‘회사’와 이용계약을 체결하여 회원등록을 한 개인 또는 법인으로써, ‘사이트’의 정보를 지속적으로 제공받으며, ‘사이트’에서 제공하는 서비스를 계속적으로 이용할 수 있는 개인 또는 법인을 말합니다.<br>\r\n6. ‘비회원’이란 회원에 가입하지 않고 ‘사이트’에서 제공하는 제한된 서비스를 이용하는 개인 또는 법인을 말합니다.<br>\r\n7. ‘프로젝트’란 회원이 다른 회원들에게 제품 또는 서비스를 제공하고 후원을 받기 위한 목적으로, ‘회사’가 제공하는 ‘사이트’ 내에 만든 서비스를 말합니다.<br> &nbsp;\r\n8. ‘개설자(또는 Maker)’란 ‘회사’가 제공하는 ‘사이트’를 통해서 프로젝트를 만든 회원을 말합니다.<br>\r\n9. ‘후원자(또는 Backer)’란 ‘회사’가 제공하는 ‘사이트’를 통해서 제공된 프로젝트에 ‘보상품’과 ‘금액’을 결정하여 ‘개설자’에게 후원하는 회원을 말합니다.<br>&nbsp;\r\n10. ‘보상품’이란 ‘개설자’가 ‘후원자’에게 제공하기로 약속한 제품 또는 서비스를 말합니다.<br>\r\n11. ‘아이디(ID)’란 회원들을 식별하고 서비스를 이용하기 위하여 회원이 설정하고 회사가 승인한 이메일을 말합니다.<br>\r\n12. ‘비밀번호’란 회원의 권익 및 비밀보호를 위하여 회원 스스로가 설정하여 회사에 등록한 영문 또는 숫자의 조합을 말합니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 3 조 약관의 명시와 개정</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회사는 이 약관의 내용과 상호, 대표자 성명, 영업소 소재지 주소, 사업자 등록번호, 전화번호 등을 이용자가 쉽게 알 수 있도록 사이트의 초기 서비스 화면에 게시합니다. 다만, 약관의 구체적 내용은 이용자가 연결화면을 통하여 볼 수 있도록 할 수 있습니다.<br>\r\n2. 회사는 『전자상거래 등에서의 소비자보호에 관한 법률』, 『약관의 규제에 관한 법률』, 『전자문서 및 전자거래기본법』, 『전자금융거래법』, 『전자서명법』, 『정보통신망 이용촉진 및 정보보호 등에 관한 법률』, 『소비자기본법』 등 관련법령을 위배하지 않는 범위에서 이 약관을 개정할 수 있습니다.<br>\r\n3. 회사는 약관을 개정할 경우에는 적용일자 및 개정사유를 명시하여 현행약관과 함께 사이트의 초기화면에 그 적용일자 7일이전부터 적용일자 전일까지 공지합니다. 다만, 이용자에게 불리하게 약관내용을 변경하는 경우에는 최소한 30일 이상의 사전 유예기간을 두고 공지합니다.<br>&nbsp;\r\n4. 제4항에 따라 공지된 적용일자 이후에 회원이 회사의 서비스를 계속 이용하는 경우에는 개정된 약관에 동의하는 것으로 봅니다. 개정된 약관에 동의하지 아니하는 회원은 언제든지 자유롭게 서비스 이용계약을 해지할 수 있습니다. 유료서비스를 이용하는 회원이 약관의 개정에 동의하지 아니하여 해지할 경우 회사가 정한 환불정책에 따릅니다.<br>\r\n5. 이 약관에서 정하지 아니한 사항과 이 약관의 해석에 관하여는 전자상거래 등에서의 소비자보호에 관한 법률, 약관의 규제 등에 관한 법률, 공정거래위원회가 정하는 전자상거래 등에서의 소비자 보호지침 및 관계법령 또는 상관례에 따릅니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 4 조 서비스의 제공</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회사가 제공하는 서비스는 회원들간의 제품 또는 서비스의 거래를 활성화하고, 거래가 원활히 이루어질 수 있도록 지원하는 온라인 플랫폼입니다.<br> &nbsp;\r\n2. 회원간 성립된 거래에 대해서는 거래당사자들이 스스로 책임을 져야 합니다. 다만, 회사는 회원들 간에 발생한 문제를 해결하기 위해 사용되는 문서 등은 관계법령이 허용하는 범위 내에서 제공할 수 있습니다.<br>&nbsp;\r\n3. 회사의 업무상 또는 기술상의 장애로 인하여 서비스를 개시하지 못하거나 일시 중지되는 경우, 회사는 사전 또는 사후에 관련 사항을 공시하거나 회원에게 이를 공지합니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 5 조 서비스의 중단 </p>\r\n<p class=\"terms-con_txt\">\r\n1. 천재지변, 전쟁, 국가비상사태 등 회사가 정상적인 서비스 제공이 불가능할 경우 일시적으로 서비스를 제한, 정지시킬 수 있으며 사전 또는 사후 회원에게 중지사유 및 기간을 공지합니다.<br>\r\n2. 회사의 사정으로 서비스를 영구적으로 중단하여야 할 경우에 서비스 중지 1주일 전에 통지 하고 서비스를 중지할 수 있습니다.<br>&nbsp;\r\n3. 회사는 회사의 업무상, 기술상의 장애, 또는 정보통신설비의 보수점검·교체 및 고장, 통신의 두절 등의 사유가 발생한 경우에는 서비스의 제공을 일시적으로 중단할 수 있습니다.<br>\r\n4. 회사는 제3항의 사유로 서비스의 제공이 일시적으로 중단됨으로 인하여 이용자 또는 제3자가 입은 손해에 대하여 배상합니다. 단, 회사가 고의 또는 과실이 없음을 입증하는 경우에는 그러하지 아니합니다.<br>\r\n5. 사업종목의 전환, 사업의 포기, 업체간의 통합 등의 사유로 회사가 서비스를 영구적으로 중단하여야 할 경우에는 이용자에게 이를 통지합니다.<br>\r\n6. 회사는 사전 공지 후 서비스를 일시적으로 수정, 변경 및 중단할 수 있으며, 이에 대하여 회원 또는 제 3자에 어떠한 책임도 부담하지 않습니다.<br>\r\n7. 회사는 회원이 이 약관의 내용에 위배되는 행동을 한 경우, 임의로 서비스 사용을 제한 및 중지하거나 본인의 동의 없이 이용계약을 해지할 수 있습니다.<br>&nbsp;\r\n8. 장기간 사이트 접속 기록이 없는 장기 휴면 회원인 경우, 해당 회원의 서비스 사용 제한 내용을 1주일간 사이트에 공지하거나 안내 메일을 발송하여 서비스 사용을 중지할 수 있습니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 6 조 회원에 대한 통지</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회사가 회원에 대한 통지를 하는 경우, 회사는 회원이 제공한 이메일 주소 또는 SMS 등으로 통지 할 수 있습니다.<br>&nbsp;\r\n2. 회사는 불특정다수 회원에 대한 통지의 경우 1주일이상 회사 사이트에 게시함으로써 개별 통지에 갈음할 수 있습니다. 다만, 회원 본인의 거래와 관련하여 중대한 영향을 미치는 사항에 대하여는 개별통지를 합니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 7 조 회원 가입</p>\r\n<p class=\"terms-con_txt\">\r\n1. 이용자는 회사가 정한 가입 양식에 따라 회원정보를 기입한 후 이 약관에 동의한다는 의사표시를 함으로서 회원가입을 신청합니다.<br>\r\n2. 회사는 제1항과 같이 회원으로 가입할 것을 신청한 이용자 중 다음 각호에 해당하지 않는 한 회원으로 등록합니다.<br>\r\n　　가. 회원 가입신청자가 이용 약관 제9조 제3항에 의해서 회원자격을 상실한 적이 있는 경우. 다만, 제9조 제3항에 의해서 회원자격 상실 후 3년이 경과한 자로서 회사의 회원재가입 승낙을 얻은 경우에는 예외로 한다.<br>\r\n　　나. 이미 가입된 회원과 이메일 주소가 동일한 경우<br>\r\n　　다. 회원 정보를 허위 기입, 기재누락, 오기가 있는 경우<br>\r\n　　라. 다른 사람의 명의를 임의 사용하여 신청한 경우<br>\r\n　　마. 기타 회원으로 등록하는 것이 회사의 기술상 현저히 지장이 있다고 판단되는 경우<br>\r\n　　바. 회원가입 및 전자상거래상의 계약에 관한 서비스는 만 19세 이상인 자에 한함<br>\r\n3. 회원가입계약의 성립시기는 회사의 승낙이 회원에게 도달한 시점으로 합니다.<br>\r\n4. 회원은 회원가입시 등록한 사항에 변경이 있는 경우, 상당한 기간 이내에 회사에 대하여 회원정보 수정 등의 방법으로 그 변경사항을 알려야 합니다.<br>\r\n5. 회사는 회원에 대하여 청소년 보호법 등에 따른 등급 및 연령준수를 위해 이용제한이나 등급별 제한을 할 수 있습니다.<br>\r\n6. 회사는 서비스 용량 부족 및 기술 장애로 인하여 회원가입을 일시적으로 유보할 수 있습니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 8 조 회원 ID 부여 및 비밀번호 관리</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회원 ID는 회원이 회원가입시에 등록한 이메일 주소이며, 이메일 주소 변경은 인증절차를 통해 변경할 수 있습니다.<br>\r\n2. 회원은 회원 ID와 비밀번호를 관리할 책임이 있습니다. 회원의 정보 관리 소홀로 인하여 제3자가 이를 이용하여 서비스 이용에 따른 손해 또는 부정 이용 등에 대한 책임은 전적으로 회원에게 있습니다.<br>\r\n3. 회원은 본인의 회원 ID와 비밀번호가 제3자에 의해 부정하게 사용된 것을 인지한 경우, 이를 즉시 회사에 신고해야 합니다. <br>\r\n4. 제3항에 해당하는 회원이 회사에 그 사실을 신고하지 않거나, 신고하였지만 안내에 따르지 않아 발생한 모든 손해에 대한 책임은 회원에게 있습니다.<br>&nbsp;\r\n5. 회원은 회사 사이트 사용 종료 시마다 로그아웃 해야 하며, 로그아웃 하지 아니하여 제3자가 회원에 관한 정보를 도용하는 등의 결과로 인해 발생하는 손해 또는 손실에 대하여 회원에게 책임이 있습니다.<br>\r\n6. 회사는 회원의 계정을 통해서 개인 정보를 유출할 가능성이 있거나, 회사 및 사이트 운영자로써 오인할 가능성이 있는 경우, 타인에게 혐오감을 주거나 미풍약속이 어긋나는 경우, 해당 계정의 이용을 제한할 수 있습니다.<br>\r\n7. 회사가 제공하는 회원 ID는 회원의 동의 하에 회사가 운영하는 다른 사이트의 ID로 연결되어 사용될 수 있습니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 9 조 회원 탈퇴 및 자격 상실</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회원은 회사에 탈퇴를 요청할 수 있으며, 회원탈퇴를 유보하는 경우를 제외하면 회사는 회원의 요청에 따라 회원탈퇴를 처리합니다.<br>\r\n2. 다음 각호의 경우 회사는 회원의 회원탈퇴 처리를 유보할 수 있습니다. <br>\r\n　가. 프로젝트 개설자로써 프로젝트 ‘보상품’ 배송을 완료하지 않은 경우<br>\r\n　나. 프로젝트 후원자로써 프로젝트 ‘보상품’에 해당하는 제품 또는 서비스를 받지 않은 경우<br>&nbsp;\r\n3. 회원이 다음 각호의 사유에 해당하는 경우, 회사는 회원자격을 제한 또는 정지시킬 수 있고 자격이 제한 또는 정지된 회원이 게시한 내용의 전부 또는 일부를 임의로 삭제 할 수 있습니다.<br>\r\n　가. 가입 신청시 허위 내용을 등록한 경우<br>\r\n　나. 다른 사람의 사이트 이용을 방해하거나 그 정보를 도용하는 등 전자상거래 질서를 위협하는 경우<br>\r\n　다. 사이트를 이용하여 법령 또는 이 약관이 금지하는 행위를 하는 경우<br>\r\n4. 회사가 회원 자격을 제한·정지 시킨 후, 동일한 행위가 2회 이상 반복되거나 15일 이내에 그 사유가 시정되지 아니하는 경우, 회사는 그 회원의 회원자격을 상실시킬 수 있습니다.<br>\r\n5. 회사는 회원자격을 상실한 이용자 정보를 즉시 말소합니다. 다만, 관계 법령에 따라 보전기간이 정해진 정보는 법률에 따라 보존됩니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 10 조 이용자의 서비스 이용 제한</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회사는 다음 각 호에 해당하는 사유가 발생할 경우 회원의 서비스 이용을 제한 또는 중지시킬 수 있습니다. 이로 인해 발생하는 불이익에 대해서 회사는 책임지지 않습니다.<br>\r\n　가. 이용자가 제공하는 정보의 내용이 허위로 판명되거나, 허위가 있다고 의심할 만한 합리적인 사유가 발생할 경우<br>\r\n　나. 이용자가 회원이 회사 서비스 운영을 고의 또는 과실로 방해하는 등의 행동을 한 경우<br>\r\n　다. 한 회원이 하나 이상의 계정을 가지는 경우<br>\r\n　라. 미풍양속을 저해하는 비속한 이름 또는 ID를 사용한 경우<br>\r\n　마. 관련 행정관청 또는 공공기관의 시정 요구 등이 있는 경우<br>\r\n　바. 타인의 정보를 도용하거나 부정한 행위로 거래를 하는 경우<br>\r\n　사. 본 약관 14조 3항에 위배되는 행위를 하는 경우\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 11 조 개인정보보호 의무</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회사는 이용자가 회원 등록시, 이용자의 동의 하에 제공한 정보를 통해 회원 정보를 수집합니다. 개인정보의 보호 및 사용에 대해서는 회사의 개인정보취급방침 및 관련법이 적용됩니다.<br>&nbsp;\r\n2. 회사는 회원의 개인정보를 본 이용계약의 이행과 본 이용계약상의 서비스제공을 위한 목적으로 이용합니다.<br>\r\n3. 제공된 개인정보는 당해 이용자의 동의 없이 목적 외의 이용이나 제3자에게 제공할 수 없으며 상업적 목적으로 사용할 수 없습니다. 다만, 다음 각 호의 경우에는 예외로 합니다.<br>&nbsp;\r\n　가. 배송업무상 배송업체에게 배송에 필요한 최소한