btit\">제 14 조 이용자의 의무</p>\r\n<p class=\"terms-con_txt\">\r\n1. 이용자는 회원 등록시 현재 사실과 일치하는 정보로 회원 가입을 해야 하며, 제공된 정보가 변경 되는 경우 이를 즉시 갱신해야 합니다.<br>\r\n2. 회원은 본인의 ID와 비밀번호 관리를 위해 제8조 회원 ID 부여 및 비밀번호 관리 사항을 준수하여야 합니다. <br>\r\n3. 회원은 다음 각 호에 해당하는 행위를 해서는 안됩니다.<br>\r\n　가. 회원가입신청 또는 변경 시 허위내용을 등록하는 행위<br>\r\n　나. 다른 회원의 아이디(ID)와 비밀번호 등을 도용하거나 제 3자로 사칭하는 행위<br>\r\n　다. 타인의 명예나 프라이버시를 침해할 수 있는 내용을 전송, 게시, 이메일 등으로 타인에게 유포하는 행위<br>\r\n　라. 제 3자의 명예를 손상, 희롱 또는 위협하거나, 특정 이용자에게 지속적으로 불편을 주는 행위<br>\r\n　마. 회사의 명시적인 동의 없이 서비스의 이용권한, 기타 이용계약상의 지위를 타인에게 양도, 증여, 담보로 제공하는 행위<br>&nbsp;\r\n　바. 회사, 다른 회원 등 제3자의 지적재산권을 침해하거나, 침해하는 내용을 전송, 게시, 이메일 등을 통해 타인에게 유포하는 행위<br>\r\n　사. 회사로부터 적합한 권리를 부여 받지 않고 회사의 프로그램을 임의로 변경하거나, 회사의 서버를 해킹하거나, 사이트에 게시된 정보를 부분 또는 전체를 임의로 변경하는 행위<br>\r\n　아. 컴퓨터 소프트웨어, 하드웨어, 전기통신 장비를 파괴, 방해, 기능을 제한하기 위한 소프트웨어 바이러스를 게재하거나 메시지 또는 이메일로 보내는 행위<br>\r\n　자. 회사가 서비스를 제공하는 것을 고의로 방해하거나, 회사의 업무를 방해하는 행위 및 회사의 명예를 손상시키는 행위<br>\r\n　차. 공공질서 및 미풍양속에 위반되는 저속, 음란한 내용의 정보를 전송, 게시, 이메일 등을 통해 타인에게 유포하는 행위<br>\r\n　카. 회사와 다른 회원들의 승인을 받지 않고 다른 회원의 개인정보를 수집 또는 저장하는 행위<br>\r\n　타. 자기 또는 타인에게 재산상의 이익을 주거나 타인에게 손해를 가할 목적으로 허위의 정보를 유통시키는 행위<br>\r\n　파. 불필요하거나 승인되지 않은 광고, 판촉물을 게재하는 행위<br>\r\n　하. 기타 불법적이거나 부당한 행위<br>\r\n3. 회원은 관계법령, 이 약관의 규정, 기타 회사가 정한 제반 규정, 서비스 이용안내, 공지사항 등 회사가 통지하는 사항 등을 준수하여야 합니다.\r\n</p>\r\n&nbsp;\r\n<p class=\"terms-con_subtit\">제 15 조 게시물의 관리 운영</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회원이 작성하여 게재한 정보 및 자료 등의 내용에 대한 책임과 권리는 이를 게시한 회원에게 있습니다.<br>&nbsp;\r\n2. 회사는 다음 각 호에 해당하는 내용이 포함된 게시물이나 자료에 대해 회원의 등록을 거부하거나, 사전통지 없이 삭제, 게시 보류, 이동 할 수 있습니다.<br>&nbsp;\r\n　가. 본 이용 약관에 위배되거나 불법, 음란, 저속하다고 판단되는 내용을 게시하거나 그러한 내용을 담은 사이트와 링크시킨 경우<br>\r\n　나. 범죄 행위와 결부된다고 인정되는 경우 <br>\r\n　다. 불법복제 또는 해킹을 조장하는 내용인 경우<br>\r\n　라. 회사, 다른 회원, 제3자의 저작권 등의 기타 권리를 침해한 경우<br>\r\n　마. 영리 목적의 광고나 스팸성 게시물을 올린 경우<br>\r\n　바. 다른 회원 또는 제3자에게 심한 모욕을 주거나 명예를 손상시키는 내용<br>\r\n　사. 등록하고자 하는 내용이 게시의 목적에 부합하지 않는 경우<br>\r\n　아. 기타 회사의 제반 규정이나 관계법령에 위배되는 경우<br>\r\n3. 회원이 게시한 내용이 타인의 저작권을 침해한 경우, 이에 대한 법적 책임은 전적으로 그 내용을 게시한 회원에게 있습니다.<br>\r\n4. 회사는 게시된 내용이 일정기간 이상 경과되어 게시물의 효력이 상실된 경우, 1주일 간의 통지기간을 거쳐 해당 게시물을 삭제할 수 있습니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 16 조 게시물에 관한 권리</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회사가 작성한 저작물에 대한 저작권 및 기타 지적재산권은 회사에 귀속됩니다.<br>\r\n2. 회원이 사이트에 게시한 게시물의 저작권 및 기타 지적재산권은 게시한 회원에게 귀속됩니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 17 조 프로젝트 페이지 생성과 수정 및 취소</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회원은 회사의 이용 약관에 동의해야 프로젝트 개설을 시작할 수 있습니다.<br>&nbsp;\r\n2. 회원이 개설을 요청한 프로젝트는 회사 심사팀이 검토한 후 최종 승인 후 등록할 수 있습니다.<br>\r\n3. 프로젝트를 게시할 회원은 신뢰할 수 있는 사실을 바탕으로 프로젝트 내용을 작성해야 하며 프로젝트 내용에 허위 사실, 오기 등이 있어서는 안됩니다. 이 사항을 준수하지 않아 다른 회원이 손해를 입게 되는 경우 프로젝트 게시한 회원이 이에 대한 책임을 집니다.<br>\r\n4. 프로젝트 이행 가능 여부 판단을 위해 제품의 시제품을 제출하여야 하며 단순 아이디어 수준의 프로젝트는 진행할 수 없습니다.<br>\r\n5. 회원이 작성하여 게재한 정보 및 자료 등의 내용에 대한 책임과 권리는 이를 게시한 회원에게 있습니다.<br>&nbsp;\r\n6. 회사는 다음 각 호에 해당하는 내용이 프로젝트의 내용에 포함되어 있다고 판단되는 경우, 프로젝트의 승인을 거부하거나, 사전통지 없이 삭제, 게시 중지, 이동 할 수 있습니다.<br>&nbsp;\r\n　가. 본 이용 약관에 위배되거나 불법, 음란, 저속하다고 판단되는 내용을 게시하거나 그러한 내용을 담은 사이트와 링크시킨 경우<br>\r\n　나. 통신 판매업으로 허가되지 않는 제품으로 후원을 받으려고 하는 경우<br>\r\n　다. 범죄 행위와 결부된다고 인정되는 경우<br>&nbsp;\r\n　라. 불법복제 또는 해킹을 조장하는 내용인 경우<br>\r\n　마. 회사, 다른 회원, 제3자의 저작권 등의 기타 권리를 침해한 경우<br>\r\n　바. 다른 회원 또는 제3자에게 심한 모욕을 주거나 명예를 손상시키는 내용이 포함된 경우<br>\r\n　사. 회원이 프로젝트의 정보를 적합한 절차를 통하지 아니하고 변경하거나 조작한 경우<br>\r\n　아. 기타 회사의 제반 규정이나 관계법령에 위배되는 경우<br>\r\n7. 회원은 프로젝트가 게시되면 회원과 다른 회원, 회원과 이용자, 회원과 제 3자 간의 약속, 보상품, 거래, 서비스 제공, 계약, 보증에 관하여 이행의 의무가 있으며, 이를 이행하지 않아 발생하는 불이익에 대한 책임은 회원에게 있습니다.<br>\r\n8. 위 항으로 이유로 발생한 분쟁과 관련하여, 회원은 회사와 회사의 자회사, 관계사 그리고 에이전시 및 그 임원 및 직원에게 책임 및 손해 배상을 요구할 수 없습니다.<br>\r\n9. 회원은 프로젝트가 게시된 후 30분 내에 수정 가능합니다. 30분 이후 모든 내용을 변경, 삭제, 취소할 수 없습니다. 변경, 삭제, 취소가 금지된 내용을 회원이 적합하지 않은 경로로 수정하여 다른 회원에게 손해를 입힌 경우 이에 대한 책임은 전적으로 이를 행한 회원에게 있습니다. 회사는 이에 대한 책임을 지지 않습니다.&nbsp;\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 18 조 프로젝트 후원금 지급 정책</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회사는 프로젝트 개설자인 회원이 설정한 목표금액과 모집 기간 내에 다른 회원들로부터 후원 받아서 모집 기간이 마감된 시점에 목표금액 이상으로 후원을 받은 경우 프로젝트를 성공한 것으로 판단하고, 미만인 경우 실패로 판단합니다.<br>\r\n2. 개설자가 프로젝트를 성공한 경우 모집 기간 내에 받은 후원금을 수수료를 제외하고 받을 수 있습니다. 후원금을 지급 받은 회원은 법인세법, 소득세법, 부가가치세법 상 과세대상에 해당하는 경우 수입금액에 대하여 세금을 신고 및 납부해야 합니다.<br>\r\n3. 프로젝트의 최종 후원금은 모집 기간 마감 전에 회원들의 취소 및 변경 신청이 반영될 수 있습니다.<br>&nbsp;\r\n4. 최종 후원금이 일천만원 이상인 경우, 회사는 해당 금액만큼 개설자에게 이행보증보험 가입을 요청할 수 있으며 회원은 이에 동의해야 후원금을 받을 수 있습니다.<br>\r\n5. 회사는 프로젝트를 성공한 경우, 프로젝트 기간 마감일로부터 사이트 또는 이메일를 통해 회원에게 최종 후원금과 수수료 내역을 최대 15일 이내에 통보합니다.<br>\r\n6. 프로젝트가 목표금액 달성에 실패하거나 프로젝트를 중도 철회하는 경우, 개설자는 모집 기간 내 후원된 금액을 받을 수 없을 뿐만 아니라 그 후원금에 대해서 어떠한 권리도 주장할 수 없습니다.<br>\r\n7. 회사는 실패한 프로젝트에 대해 프로젝트 기간 마감일로부터 영업일 기준 최대 15일 이내에 후원금액 결제예약을 취소합니다. 이 결제예약 취소에 따라 결제 환불이 발생할 경우, 환불 처리 완료 기간은 카드사 등 금융기간의 기준에 따릅니다.<br>\r\n8. 프로젝트를 성공한 개설자는 수령한 금액을 후원해준 회원들과 약속한 대로 프로젝트 수행에 필요한 경비로 사용해야 합니다.<br>\r\n9. 개설자가 자신이 공지한 약속을 이행하지 않고 고의로 게시한 내용과 다르게 이행하거나 일부만 이행하여 회원들에게 손해를 입힌 경우, 이로 인한 모든 민형사상의 책임을 져야 합니다.<br>\r\n10. 프로젝트를 성공한 개설자는 프로젝트의 진행 사항을 게시판에 공지해야 합니다. 또한 후원한 회원들의 문의사항에 성실하게 답변할 의무와 책임이 있습니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 19조 결제수단</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회사는 회원들이 안심하고 사용할 수 있는 결제 수단(신용카드, 계좌이체 등)를 제공하고 회원들은 이 결제 수단을 사용하여 결제 할 수 있습니다.<br>\r\n2. 회사는 안전하고 신뢰할 수 있는 결제 처리를 위해, 결제 서비스를 이용하는 회원의 정보를 결제 대행사에 제공합니다. 이 정보는 결제 이외에 사용되지 않습니다.<br>\r\n3. 회사가 정한 결제 수단은 변경 및 추가 될 수 있습니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">제 20 조 수수료</p>\r\n<p class=\"terms-con_txt\">\r\n1. 회원의 사이트 가입은 무료이며, 특정 서비스 이용 시에만 수수료가 부과됩니다.<br>\r\n2. 서비스 수수료 정책은 회사 서비스에서 정의한 규칙에 따르며, 회원은 서비스 이용에 대한 수수료를 부담해야 합니다.<br>\r\n3. 서비스 수수료 정책은 회사의 사정에 따라 변경될 수 있으며, 회사는 사전에 사이트를 통해 변경내용을 고지합니다.<br>\r\n4. 회원은 회사의 서비스 수수료 외에 결제수단 (신용카드, 계좌이체 등)이용에 따른 수수료를 부담해야 합니다.<br>\r\n5. 회사의 서비스 이용에 따라 회원에게 부과되는 모든 세금을 성실하게 신고하고 납부할 의무와