적이 달성된 개인정보의 경우 별도의 DB (문서의 경우 별도의 보관함)에 옮겨져 내부규정 및 관련 법령을 준수하여 안전하게 보관되며, 정해진 기간이 종료되었을 때, 지체없이 파기됩니다. 이 때, 별도의 DB로 옮겨진 개인정보는 여러분 각자가 동의한 목적을 초과하거나 법률에 정한 경우가 아니고서는 다른 목적으로 이용되지 않습니다.\r\n<br>\r\n②	파기방법\r\n- 전자적 파일 형태의 정보는 기록을 재생할 수 없는 기술적 방법을 사용합니다.\r\n- 종이에 출력된 개인정보는 분쇄기로 분쇄하거나 소각을 통하여 파기합니다\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">\r\n4. 회사는 서비스의 제공 또는 법령에 정해진 책임의 준수를 위해 보관하고 있는 개인정보를원칙적으로 외부에 제공하지 않습니다.다만,아래의 경우에는 예외로 합니다.\r\n</p>\r\n<p class=\"terms-con_txt\">\r\n①	후원과 결제가 이루어진 경우, 상담 및 배송 등의 원활한 거래이행을 위하여 관련된 정보를 필요한 범위 내에서 배송 책임자(제3자)에게 전달합니다<br>\r\n</p><table class=\"terms-common-table\">\r\n<thead>\r\n<tr>\r\n<th style=\"width:15%;\">제공 받는자</th>\r\n<th style=\"width:20%;\">제공목적</th>\r\n<th style=\"width:35%;\">제공정보</th>\r\n<th style=\"width:30%;\">보유 및 이용기간</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>\r\n배송 상품 책임자\r\n</td>\r\n<td>\r\n서비스 제공,수취인 확인 및 상담 등\r\n</td>\r\n<td>\r\n성명, 휴대전화번호, 배송지주소, 이메일<br>\r\n※후원자와 수취인이 다를 경우에는 수취인의 정보가 수집될 수 있습니다.\r\n※ 글로벌 상품의 경우에는 세관통과를 위하여 주민등록번호 또는 개인고유통관부호가 수집될 수 있습니다.\r\n</td>\r\n<td>\r\n재화 또는 서비스의 제공이 완료된 즉시 파기<br>\r\n(단, 관계법령에 정해진 규정에 따라 법정기간 동안 보관)\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table><p>\r\n②	재화 등의 거래에 따른 대금정산을 위하여 필요한 경우</p><p>\r\n③	법령의 규정에 의거하거나,수사 목적으로 법령에 정해진 절차와 방법에 따라 수사기관의 요구가 있는 경우</p><p>\r\n④	통계작성,학술연구 또는 시장조사를 위하여 필요한 경우로서 특정 개인을 식별할 수 없는 형태로 가공하여 제공하는 경우</p>\r\n<br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">\r\n5. 회사는 원활한 서비스 제공과 효과적인 업무처리를 위하여 다음과 같이 개인정보를 처리 위탁하고 있습니다.\r\n</p>\r\n<p class=\"terms-con_txt\">\r\n회사는 수탁자들이 개인정보를 안전하게 처리하고 있는지 지속적으로 관리 감독하고 있으며, 수탁업무가 종료된 때에 수탁자가 보유하고 있는 개인정보는 즉시 파기하게 하고 있습니다.\r\n</p><table class=\"terms-common-table\">\r\n<thead>\r\n<tr>\r\n<th style=\"width:15%;\">구분</th>\r\n<th style=\"width:50%;\">수탁자</th>\r\n<th style=\"width:35%;\">위탁업무</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>\r\n본인확인\r\n</td>\r\n<td>\r\nKG모빌리언스\r\n</td>\r\n<td>\r\n실명확인,본인 인증\r\n</td>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</tr>\r\n<tr>\r\n<td>\r\n결제처리, SMS발송\r\n</td>\r\n<td>\r\nNICE정보통신\r\n</td>\r\n<td>\r\n신용카드, 계좌이체 등을 통한 결제처리, SMS 발송\r\n</td>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</tr>\r\n</tbody>\r\n</table>\r\n<br><p>\r\n※ 배송 서비스는 프로젝트 개설자가 계약을 통하여 사용하는 업체로, 회사가 직접 개인정보 취급위탁을 하지 않습니다\r\n</p><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">\r\n6. 회사의 서비스를 이용하는 여러분들은 정보주체로서 다음과 같은 권리를 행사할 수 있습니다.\r\n</p>\r\n<p class=\"terms-con_txt\">\r\n이용자 (회원 및 법정 대리인)는 언제든지 등록되어 있는 자신 또는 대리자의 개인정보를 조회하거나 수정할 수 있으며, 회원탈퇴절차를 통해 가입해지를 요청할 수도 있습니다.\r\n<br>	\r\n이용자의 개인정보 조회, 수정을 위해서는 홈페이지의 \'마이페이지\' 내의 \'정보변경\'을, 가입해지 (동의철회)를 성명, 아이디(가입 시 기재한 이메일) 등의 정보를 탈퇴의사와 함께 문의하기에 게시하거나, 동일한 내용을 기재하여help@5giraffe.com로 이메일을 보내면 탈퇴하실 수 있습니다. 이 외에도, 회사의 개인정보관리책임자에게 서면, 전화 또는 이메일로 연락하시면 지체 없이 조치하겠습니다.\r\n<br><br>\r\n회사는이용자의 요청에 의해 해지 또는 삭제된 개인정보는 회사가 수집하는 “개인정보의 보유 및 이용기간”에 명시된 바에 따라 처리하고 그 외의 용도로 열람 또는 이용할 수 없도록 처리하고 있습니다.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">\r\n7. 자동 정보 수집 장치(쿠키)의 설치,운영 및 그 거부에 대해 알려 드립니다.\r\n</p>\r\n<p class=\"terms-con_txt\">\r\n회사는 회원들에게 보다 적절하고 유용한 서비스를 제공하기 위하여 회원의 정보를 수시로 저장하고 불러오는 ‘쿠키(cookie)’를 사용합니다.&nbsp;\r\n<br>\r\n①	쿠키(Cookie)의 정의<br>\r\n쿠키(Cookie)는 웹사이트를 운영하는데 이용되는 서버가 이용자의 컴퓨터로 전송하는 아주 작은 텍스트 파일로서 이용자의 컴퓨터 하드디스크에 저장되고 있습니다. 따라서 여러분 스스로가 쿠키의 설치 및 수집에 대해 자율적으로 선택할 수 있으므로 수집을 거부할 수 있습니다. 다만, 쿠키의 저장을 거부할 경우 로그인이 필요한 일부 서비스의 이용에 제한이 생길 수 있습니다.\r\n<br>\r\n②	쿠키 설정 거부 방법<br>\r\n1) Internet Explorer의 경우<br>\r\n웹 브라우저 상단의 “도구” 메뉴 &gt; “인터넷 옵션” 메뉴 &gt; “개인정보” 탭 &gt; 직접 설정<br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n2) Chrome의 경우<br>\r\n웹 브라우저 우측 상단의 아이콘 선택 &gt; “설정”선택 &gt; 화면 하단의 “고급 설정 표시” 선택 &gt;개인정보 섹션의 “콘텐츠 설정” 버튼 &gt; 쿠키 섹션에서 직접 설정<br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">\r\n8. 회사는여러분의 안전한 개인정보 보호를 위해 아래와 같이 법령에서 요구하는 기준의 준수 외에 아래와 같은 노력을 함께 이루어가고 있습니다.\r\n</p>\r\n<p class=\"terms-con_txt\">\r\n①	개인정보 취급 직원의 최소화 및 교육<br>\r\n개인정보를 취급하는 직원을 지정하고 있으며, 개인정보 처리 업무를 고려한 담당자를 최소화 하며, 지속적인 개인정보보호 교육을 통해 개인정보의 안전한 관리를 위해 최선의 노력을 기하고 있습니다.<br>\r\n<br>\r\n②	내부관리계획의 수립 및 시행<br>\r\n개인정보의 안전한 처리를 위하여 내부관리계획을 수립하고 시행하고 있습니다.<br>\r\n<br>\r\n③	개인정보의 암호화<br>\r\n여러분의 개인정보는 법에서 정하는 기준에 따라 암호화되어 저장, 관리되고 있으며, 또한 파일 및 전송 데이터를 암호화 등 별도 보안기능을 사용하고 있습니다.<br>\r\n<br>\r\n④	해킹 등에 대비한 기술적 대책<br>\r\n회사는 해킹이나 컴퓨터 바이러스 등에 의한 개인정보 유출 및 훼손을 막기 위하여 보안프로그램을 설치하고 주기적인 갱신, 점검을 하며 외부로부터 접근이 통제된 구역에 시스템을 설치하고 기술적/물리적으로 감시 및 차단하고 있습니다.\r\n<br>\r\n⑤	문서보안을 위한 잠금장치 사용<br>\r\n개인정보가 포함된 서류, 보조저장매체 등을 잠금 장치가 있는 안전한 장소에 보관하고 있습니다\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">\r\n9.회사는 귀하의 안전한 개인정보 보호를 위해 개인정보 관리책임자를 지정하고 있습니다.\r\n</p>\r\n<p class=\"terms-con_txt\">\r\n개인정보 처리에 관한 업무를 총괄해서 책임지고, 개인정보 처리와 관련한 이용자의 불만처리 및 피해구제 등을 위하여 아래와 같이 개인정보 관리책임자를 지정하고 있습니다.<br>\r\n<br>\r\n성명:장태선 (Director)<br>\r\n연락처:02-548-1510<br>\r\n이메일:help@ozr.kr<br>\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"terms-con_subtit\">\r\n10.개인정보 취급방침 변경에 관한 정책은 다음과 같습니다.\r\n</p>\r\n<p class=\"terms-con_txt\">\r\n이 개인정보 취급방침은 시행일로부터 적용되며, 법령 및 방침에 따른 변경내용의 추가, 삭제 및 정정이 있는 경우에는 변경사항의 시행 7일 전부터 공지사항을 통하여 고지할 것입니다. 그러나 개인정보의 수집 및 활용, 제3자 제공 등과 같이 이용자의 권리에 중요한 변경의 사유가 발생하는 경우 최소 14일 전에 공지합니다. 또한 관련 법령이나 회사정책의 변경으로 불가피하게 취급방침을 변경해야 하는 경우, 웹사이트 공지사항을 통해 빠르게 알려드리고 있으니 참고하여 주시기 바랍니다.<br>\r\n<br>\r\n개인정보취급방침 버전 번호 :1.0<br>\r\n현재 개인정보취급방침 공고일자 : 2016년 01월11일<br>\r\n현재 개인정보취급방침 시행일자 : 2016년 01월11일<br>\r\n</p>','개인정보 보호정책','2016-01-11');
