INSERT INTO `nest_help` VALUES (1,'오지랖 이용하기','이용하기',NULL,'오지랖은 무엇인가요?','오지랖은 제품을 만드는 창장작인 메이커와 후원자들을 서로 연결해주는 크라우드 펀딩 플랫폼입니다. 메이커가 새로운 제품들을 만들기 위한 최소한의 필요 자금을 얻는 대안을 제시하고, 그들의 열정에 공감하며 새로운 제품을 가장 먼저 접하기 원하는 후원자들이 만나는 곳입니다','2016-03-25 00:17:57','Y'),(2,'오지랖 이용하기','이용하기',NULL,'크라우드펀딩(Crowdfunding)은 무엇인가요?','크라우드펀딩은 대중을 의미하는 크라우드(Crowd)와 자금 모금을 의미하는 펀딩(funding)이 합쳐진단어로, 다수의 대중으로부터 자금을 모금한다는 의미입니다. 주로 개인 창작자 혹은 스타트업들이 온라인을 통해 자신의 제품과 서비스를 알려 소규모 후원을 받거나, 새로운 제품의 홍보와 마케팅을 하기 위한 방법으로 활용됩니다.','2016-03-25 00:17:57','Y'),(3,'오지랖 이용하기','이용하기',NULL,'내계정에 반영된 이메일 주소를 바꿀 수 있나요?','로그인을 하신 후 우측 상단 내 ‘내 페이지’ 에 들어가세요. 거기서 ‘내계정설정’을 통해 이메일 인증과 수정을하실수있습니다.','2016-03-25 00:17:57',''),(4,'오지랖 이용하기','이용하기',NULL,'비밀번호를 잊어버렸습니다.','로그인 창 하단의 \'비밀번호 찾기\'를 클릭하시면, 가입하신 이메일을 통해 비밀번호를 다시 설정하실 수 있습니다','2016-03-25 00:17:57',''),(5,'오지랖 이용하기','이용하기',NULL,'계정을 삭제하려면 어떻게 해야 하나요?','크라우드 펀딩의 특성 때문에, 현재 임의의 계정 삭제는 불가하도록 해 두었습니다. 계정 삭제를 원하시면, support@orz.kr로 문의해 주세요. 운영진이 직접 처리해 드리겠습니다.','2016-03-25 00:17:57',''),(6,'오지랖 이용하기','이용하기',NULL,'뉴스 레터 수신 설정은 어디서 할 수 있나요?','로그인 하신 후 \'마이 페이지\'를 통해 설정 하실 수 있습니다','2016-03-25 00:17:57',''),(7,'프로젝트 후원하기','후원하기',NULL,'후원은 어떻게 참여할 수 있을까요?','후원하실 프로젝트를 발견하셨군요! 먼저 프로젝트 페이지의 ‘결제 예약하기’ 클릭하세요. 그리고 원하는 보상품을 선택하시고, 결제 수단 정보를 입력하시면 됩니다.','2016-03-25 00:17:57','Y'),(8,'프로젝트 후원하기','후원하기',NULL,'내가 후원한 프로젝트가 목표를 달성한 것을 어떻게 알수 있나요?','프로젝트 진행기간 동안 모금된 금액이 100% 이상이 되면 목표를 달성한 것입니다. 목표 금액이 달성되면, 프로젝트 목표 달성 안내 메일이 발송됩니다','2016-03-25 00:17:57',''),(9,'프로젝트 후원하기','후원하기',NULL,'내가 후원한 금액이 얼마인지 표시되나요?','내 후원 금액이 얼마인지는 다른 사람에게 표시되지 않습니다. 각 프로젝트 후원자 목록에는 후원자 목록만 표시 됩니다. 후원 금액이 얼마인지는 해당 프로젝트의 진행자와 후원 당사자만 알 수 있으며,내 페이지의 후원 프로젝트 현황에 들어가면 자세히 볼 수 있습니다.','2016-03-25 00:17:57',''),(10,'프로젝트 후원하기','후원하기',NULL,'후원을 할 때, 프로젝트 개설자에게 어떤 정보가 제공되나요?','프로젝트 개설자는 모금 진행 중에 후원자의 성함과 후원 금액, 선택한 보상품만 알 수 있게 되어 있습니다. 마감시에 모금액 목표를 달성하면 그때 비로소 개설자에게 후원자의 배송주소와 연락처가 전달되고이외에 개인 정보는 일체 제공되지 않습니다.','2016-03-25 00:17:57',''),(11,'프로젝트 후원하기','후원하기',NULL,'관심은 있지만, 후원을 결정하지 못한 프로젝트가 있어요','\'킵(Keep)해 두기\'를 이용해 보세요. 해당 프로젝트의 업데이트 상황과 목표 달성 여부와 함께, 종료 3일전 알림 메일을 받아 보실 수 있습니다','2016-03-25 00:17:57',''),(12,'프로젝트 후원하기','후원하기',NULL,'하나의 프로젝트에 여러 번 후원하는 것도 가능한가요?','아쉽지만 가능하지 않습니다.후원은 한 프로젝트에 한번씩만 할 수 있게 되어 있습니다.이는 한 사람이 특정 프로젝트를 독점하는 것을 방지하고,여러 사람들이 함께프로젝트를 후원할 수 있도록 하기 위함입니다.','2016-03-25 00:17:57',''),(13,'프로젝트 후원하기','후원하기',NULL,'후원 내용을 변경하고 취소하고 싶은데 가능한가요?','프로젝트가 진행되고 있는 기간 동안은 언제든지 후원 내용을 변경하거나 취소할 수 있습니다.내 페이지의 ‘후원 프로젝트’을 통해 현재까지 후원한 내용들을 보고, 변경 또는 취소하면됩니다. 단 프로젝트가 종료되고 난 후에는 더 이상 후원 변경 및 취소가 불가능하므로, 이 단계에서는 프로젝트 개설자와 직접 연락하셔서 변경사항을 협의하셔야 합니다.','2016-03-25 00:17:57',''),(14,'프로젝트 후원하기','후원하기',NULL,'해외에 거주하고 있는데, 프로젝트에 참여할 수 있나요?','아쉽지만 현재는 국내 신용/체크 카드를 이용하여, 국내의 배송지로 전달하는 형태만이 가능합니다.따라서 대다수의 해외 거주 고객님은 이용하시기 힘드시겠지만, 국내 카드가 있으시고,국내에서 대신 받아주실 분이 있으신 분들은 충분히 이용하실 수 있습니다.','2016-03-25 00:17:57',''),(15,'프로젝트 후원하기','후원하기',NULL,'프로젝트 진행과 관련된 질문이 있을 때 어떻게 해야 하나요?','프로젝트 페이지에는 개설자에게 직접 문의할 수 있는 ‘메시지 보내기’ 버튼이 있습니다. 궁금하신 점이 있으시면 이 버튼을 통해 바로 바로 문의하시면 됩니다','2016-03-25 00:17:57',''),(16,'프로젝트 후원하기','결제하기',NULL,'후원금 결제는 무엇으로 할 수 있나요?','현재 국내 신용카드와 체크카드로 프로젝트를 후원해주실 수 있습니다. 해외 신용카드와 모바일 결제, 계좌 이체 등의 결제 수단은 아직 준비중에 있습니다.','2016-03-25 00:17:57','Y'),(17,'프로젝트 후원하기','결제하기',NULL,'결제 시점은 언제인가요?','결제 예약하기\'를 통해 프로젝트 후원을 완료하시면, 예약하신 후원 금액은 해당 프로젝트가 100% 목표 금액을 달성했을 경우, 마감일 다음날 일괄적으로 결제가 진행됩니다. 목표금액을 달성하지 못한 프로젝트는 결제가 진행되지 않습니다.','2016-03-25 00:17:57','Y'),(18,'프로젝트 후원하기','결제하기',NULL,'결제 정보는 안전하게 관리되는 건가요?','오지랖은 회원님들의 결제 정보를 안전하게 처리하고자 특별히 노력하고 있습니다. 모든결제 정보는 결제 파트너사에서 암호화하여 안전하게 관리하고 있기 때문에, 안심하시고 진행하셔도 됩니다.','2016-03-25 00:17:57',''),(19,'프로젝트 후원하기','결제하기',NULL,'내 후원과 결제 진행 사항은 어떻게 확인할 수 있나요?','오지랖에 로그인을 하시면 우측 상단에 이모티콘을 통해 ‘내 페이지’에접속할 수 있습니다. 거기서 후원 프로젝트 탭으로 들어가면 그동안 후원한 모든 프로젝트들에 대한 진행과 결제 상황을 한 눈에 볼 수 있습니다.','2016-03-25 00:17:57',''),(20,'프로젝트 후원하기','결제하기',NULL,'후원한 프로젝트의 마감일이 되기 전에 결제 정보를 변경하고 싶으면 어떻게 하죠?','로그인 후 \'후원 프로젝트\' 메뉴에서 결제 및 배송 정보를 수정하실 수 있습니다','2016-03-25 00:17:57',''),(21,'프로젝트 후원하기','보상품 받기',NULL,'프로젝트 이행 약속에 대한 책임은 누구에게 있는 건가요?','프로젝트 이행에 대한 책임은 프로젝트 개설자에게 있습니다. 이를 위해 오지랖은 프로젝트를 개설하는 모든 사람이 본인 인증 절차를 거치도록 하고 있으며, 필요할 경우 제3기관을 통해 개설자가 자기의 책임을 다하도록 하고 있습니다. 또한, 오지랖은 프로젝트개설자가 본인의페이스북, 카카오와같은 SNS를활용하여 자신의 프로젝트 홍보 및 네트워크 효과를 누릴 수 있도록 권장하고 있습니다.적극적으로 자신의 네트워크를 활용할수록 그만큼 프로젝트 내용을 속이는 일은 쉽지 않기 때문에, 이를 통해 개설자의 신뢰도를 평가하시면 도움이 될 수 있습니다.','2016-03-25 00:17:57',''),(22,'프로젝트 후원하기','보상품 받기',NULL,'프로젝트 메이커에게 배송 관련 정보(색상, 사이즈 등)를 어떻게 알려 줘야 하나요?','색상,사이즈 등 보상품의 선택 사항에 대한 특별한 정보들은 프로젝트 개설자의 요청에 따라 서베이나 이메일을 통해 정보를 받도록 하고 있습니다. 이 단계는 보통 프로젝트가 마감되고 나서 진행이 되기 때문에 프로젝트가 진행이 되는 동안은 잠시 기다리셔도 좋습니다. 만약 궁금한 사항이 있다면 개설자에게 메시지를 보내서 문의하시면 됩니다.','2016-03-25 00:17:57',''),(23,'프로젝트 후원하기','보상품 받기',NULL,'프로젝트 보상품이 언제 배송되는지 어떻게 알 수 있나요?','보상품 배송시기에 관한 정보는 프로젝트 페이지에 표현하도록 하고 있습니다.그외에 현재 진행되고 있는 최신내용은 업데이트 페이지에 공지하도록 가이드 하고 있으며 좀 더 상세한 정보는 개설자에게 직접 문의하시면 됩니다.','2016-03-25 00:17:57',''),(24,'프로젝트 후원하기','보상품 받기',NULL,'아직 보상품을 받지 못했는데, 어떻게 해야 하나요?','보상품은 프로젝트 진행 계획에 따라,프로젝트가 종료되고 난 후 수주 혹은 수개월 후에 전달되게 됩니다. 자세한 일정은 프로젝트 페이지 또는 업데이트에서 확인할 수 있습니다. 만약 약속된 기간이 지났는데도 보상품이 오지 않고, 개설자로부터 아무런 연락과 업데이트가 없다면 저희에게 알려주세요.개설자들이 후원자들과의 약속을 이행할 수 있도록 최선을 다해 도와드리겠습니다.','2016-03-25 00:17:57',''),(25,'프로젝트 만들기','기획하기',NULL,'프로젝트 페이지는 어떻게 만드나요?','프로젝트 만들기\'을 통해 몇가지 정보를 작성해 주시면, 오지랖 프로젝트 메니저가 연락을 드리고 프로젝트 만드는 일들을 안내 받을 수 있습니다','2016-03-25 00:17:57',''),(26,'프로젝트 만들기','기획하기',NULL,'목표 금액과 기한은 반드시 설정해야 하나요?','필수입니다. 프로젝트 만들기를 원하는 회원님은 목표 금액과, 최소 7일 ~ 최대 60일 범위 내에서 프로젝트의 후원 기한을 설정해야 합니다\n 프로젝트 성공 - 사전에 설정하신 목표 금액 이상의 후원금이 달성 되었을 경우, 프로젝트 종료와 함께 일괄 결제가 진행 됩니다.  \n 프로젝트 실패 - 목표 금액이 모이지 않았을 경우, 후원자 분들의 후원금은 결제가 진행되지 않습니다','2016-03-25 00:17:57',''),(27,'프로젝트 만들기','기획하기',NULL,'목표 금액을 설정하는 데에 제한이 있나요?','없습니다. 하지만 명심하셔야 할 사항은 목표 금액 100%에 도달하지 못하면, 프로젝트는 실패가 되어 후원금이 지급되지 않습니다. \n목표 금액은 준비중이신 프로젝트를 수행에 필요한 최소 금액으로 설정하는 것을 권해드립니다.','2016-03-25 00:17:58',''),(28,'프로젝트 만들기','기획하기',NULL,'크라우드펀딩이 처음이라 준비가 막막합니다. 구체적인 도움을 받을 수 있을까요?','오지랖 프로젝트 매니저가 메이커님께서 준비하셔야 할 부분들을 안내해 드릴 뿐만 아니라, 구체적인 도움을 드리고 있습니다. 어려움이 있으시면 언제든지 프로젝트 메니져나 Support@ozr.kr로 연락 주시면 됩니다. 오지랖 프로젝트 매니져의 넓은 오지랖을 경험하실 수 있습니다','2016-03-25 00:17:58',''),(29,'프로젝트 만들기','기획하기',NULL,'프로젝트를 최종 제출했습니다. 펀딩은 언제 시작되는 건가요?','아닙니다. 프로젝트 체출하면, 운영진에서 프로젝트 내용을 확인후 3일 내 이메일 회신을 드립니다. 만약 수정 사항이 있다면, 해당 내용을 수정 후 다시 제출 해 주시면 됩니다','2016-03-25 00:17:58',''),(30,'프로젝트 만들기','기획하기',NULL,'프로젝트 기간 중 목표 금액이나 기간을 변경할 수 있을까요?','프로젝트 기간 중에는 절대 불가 합니다.','2016-03-25 00:17:58',''),(31,'프로젝트 만들기','진행하기',NULL,'프로젝트 진행기간 중에 프로젝트를 종료할 수 있나요?','원칙적으로 불가합니다. 다만, 프로젝트 수행에 치명적인 문제가 생길 수 있다고 판단되는 경우, 프로젝트 메니져와 상의하실 수 있습니다.','2016-03-25 00:17:58',''),(32,'프로젝트 만들기','진행하기',NULL,'프로젝트를 오픈 한 후에도 내용을 수정할 수 있나요?','한번 올린 프로젝트 내용은 수정이나 삭제가 불가능합니다. 후원자가 알고 있었던 내용과 후원자의 동의 없이 내용이 변경될 위험이 있기 때문입니다. 만약 수정 사항이 있는 경우 프로젝트 메니져와 상의하시면 됩니다','2016-03-25 00:17:58',''),(33,'프로젝트 만들기','진행하기',NULL,'처음에 약속했던 날짜에 보상품을 제공할 수 없을 것 같습니다. 어떻게 해야 하나요?','보상품 배송 약속은 후원자와의 가장 중요한 약속입니다. 배송이 지연될 것이 인지되면, 지체하지 말고 후원자들에게 알려야 합니다. 배송이 지연되는 솔직한 이유와 변경된 날짜를 업데이트에 공지해 주시고, 프로젝트 메니져의 도움을 받으셔야 합니다\n\n만약, 배송 지연으로 후원자가 후원포기와 환불을 요구할 경우에는 메이커가 직접 환불을 진행하셔야 합니다.','2016-03-25 00:17:58',''),(34,'프로젝트 만들기','진행하기',NULL,'프로젝트가 100% 이상 모금되어 성공하였습니다. 종료 후 프로세스를 알려주세요.','프로젝트 성공을 축하 드립니다 :)\n가장 먼저 프로젝트를 후원해 주신 분들께 감사의 마음을 프로젝트 페이지에 표해 주시는 것이 어떨까요? 이후 프로젝트 향후 진행 사항을 업데이트에 반영해 주세요\n후원금 결제 및 정산은 프로젝트 메니져가 연락 드리고 상세히 안내 드릴 것입니다','2016-03-25 00:17:58',''),(35,'프로젝트 만들기','진행하기',NULL,'제가 올린 프로젝트를 삭제할 수 있나요?','크라우드 펀딩은 \'신뢰\'를 기반으로 동작하는 플랫폼입니다.  \n오지랖 플랫폼의 투명한 운영을 위해, 마감된 프로젝트 페이지는 펀딩 결과와 상관 없이 진행자가 임의로 삭제/수정이 불가합니다. \n프로젝트에 대한 소개는 메이커가 후원자들의 신뢰를 얻는 기본 정보이기 때문입니다','2016-03-25 00:17:58','');
/*!40000 ALTER TABLE `nest_help` ENABLE KEYS */;
