DROP TABLE IF EXISTS `nest_member`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `nest_member` (
  `IDX` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '관리연번',
  `EMAIL` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `EMAIL_YN` varchar(1) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '이메일인증여부',
  `MOBILE` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '핸드폰번호',
  `MOBILE_YN` varchar(1) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '핸드폰인증여부',
  `DT_REG` datetime DEFAULT NULL COMMENT '가입일',
  `DT_LOGIN` datetime DEFAULT NULL COMMENT '최종로그인',
  `DT_BIRTH` date DEFAULT NULL COMMENT '생년월일',
  `NM_FIRST` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '이름(FIRST)',
  `NM_LAST` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '이름(LAST)',
  `PWD` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '비밀번호',
