','2016-01-18 23:19:29','Test',102,1,66),(67,9,5,'2016-01-18 23:16:55','2016-01-18 23:19:29','test',102,3,67),(68,9,5,'2016-01-19 22:05:40','2016-01-20 11:10:58','권 주임님 test입니다 ;;',102,2,68),(69,113,57,'2016-01-20 11:51:23','2016-01-21 12:39:39','사이즈 표기가 없는데 전 95로 주문합니다',103,0,69),(70,157,104,'2016-01-29 09:42:39','2016-01-29 10:11:07','목표 달성 금액이 충족되야 진행되는거죠? \r\n따로 홍보는 하고 계신지 궁금합니다 \r\n마니 알려지면 사실듯 한데 말이죠 \r\n좋은하루 보내세요 ',104,0,70),(71,104,157,'2016-01-29 10:14:37','2016-01-30 08:56:42','김흥용님 문의 감사드립니다.\r\n\r\n말씀 하신 것처럼 목표금액이 달성되어야 후원해 주신 금액도 결제가 이루어지고, 보상품도 받으실 수 있습니다. \r\n^^\r\n\r\n저희들도 최선을 다해 홍보하려고 하고 있지만, 기존 유통 업체들의 마진을 고객분들께 돌려 드리고자 하는 저희 생각에 잘 동의를 해 주지 않아서.. 적극적인 홍보에는 애로가 있습니다.^^;;\r\n\r\n주변 분들께 많은 홍보 부탁드립니다. \r\n\r\n감사합니다. ',104,0,70),(72,6,104,'2016-01-29 10:18:05','2016-01-29 10:18:17','문자 test용',104,1,72),(73,104,6,'2016-01-29 10:18:22','2016-01-29 10:19:47','123',104,0,72),(74,6,104,'2016-01-29 10:20:49','2016-01-29 10:21:02','re test',104,1,74),(75,104,6,'2016-01-29 10:21:13','2016-01-29 11:05:51','123',104,0,74),(76,104,157,'2016-01-29 10:23:03','2016-01-30 08:56:42','김흥용님... 한가지  알려 드리고 싶은 것이 있어서요..<Br>\r\n\r\n내 계정설정에 들어가셔서, 핸드폰 인증을 받으시면 진행 상황에 대해 문자 안내를 받으실 수 있습니다. ^^\r\n<Br>\r\n참고 해 보세요~~',104,0,70),(77,191,104,'2016-02-02 14:00:06','2016-02-02 14:01:16','안녕하세요\r\n\r\n이번에 후원한 꼭미남이라고 합니다.\r\n\r\n목표달성을 하지못하면 취소가 되는 거에요?',104,0,77),(78,104,191,'2016-02-02 14:05:31',NULL,'꼭미남님 우선 후원해 주셔서 감사합니다 ^^<br>\r\n문의하신 것처럼 크라우드펀딩은 목표 금액이 달성되지 못하면, 프로젝트 실패가 되어 결제가 진행되지 않습니다. ㅠㅠ 목표가 달성되면 오지랖 운영팀에서 결제 내역을 문자로 알려 드리는 것으로 알고 있습니다\r\n<br> 내 계정 설정에서 휴대폰 인증을 받으시면 편리하게 진행 사항 알림을 받으실 수 있을 것 같습니다',104,0,77),(79,334,310,'2016-02-22 20:13:02','2016-02-22 20:21:02','후원은 했다고 되있는데 결제는 왜 미결제라고\r\n 되있는거에요?\r\n혹시 미결제면 결제 어떻게 하면 되나요?',105,0,79),(80,310,334,'2016-02-22 20:37:45','2016-02-25 22:26:15','현님. 일단 후원해주셔서 감사합니다. \r\n무나공방을 운영하고 있는 노민환입니다.\r\n\r\n현재 미결제라고 되어 있는 부분과 관련하여 오류가 아님을 먼저 말씀드립니다. \r\n\r\n크라우드 펀딩의 특성상 \r\n현재는 결제예약이 되어 있는 상태입니다.\r\n3월17일에 프로젝트가 성공 (후원금이 목표금액의 100% 이상 도달시) 으로 결정되면 그 때 결제가 이루어지고 그 반대의 경우 프로젝트 실패로 결정되어 결제예약은 철회됩니다.\r\n\r\n그래서 후원해주신 분들에게 기다림에 대한 보상으로 소비자가의 30%~45% 할인된 금액으로 제품을 제공하는 것으로 보시면 됩니다.\r\n\r\n그렇지만 불가피한 사정으로 급하게 제품을 받기를 원하신다면 상세페이지에 명시되어 있는 전화번호나 문자로 언제든지 연락 주시기 바랍니다. \r\n감사합니다.',105,0,79),(81,166,104,'2016-02-23 18:35:25','2016-02-23 18:36:36','제가 결재완료한거 맞지요?',104,0,81),(82,104,166,'2016-02-23 18:43:01',NULL,'조규현님 후원해 주셔서 감사합니다^^\r\n\r\n크라우드펀딩은 후원해 주시면 \'결제 예약\'이라고 보시면 됩니다. 프로젝트가 목표 달성이 되면 펀딩 기간 종료 후 일괄 결제가 됩니다.\r\n\r\n이번 프로젝트는 목표가 달성되었기 때문에 다음주 월요일 아침에 결제 예정입니다. 만약 후원해 주셨는데 결제가 이뤄지지 않으면 오지랖 운영팀에서 연락 드리니 걱정하지 않으셔도 됩니다\r\n\r\n감사합니다',104,0,81),(83,104,322,'2016-03-11 12:07:45',NULL,'test',104,2,83),(84,104,35,'2016-03-11 12:08:24',NULL,'Test',104,2,84),(85,3,9,'2016-03-11 13:43:47','2016-03-11 13:44:05','안녕하세요, 메세지조명입니다.\r\n\r\n먼저 저희 메세지조명을 신뢰해주시고 기다려주시는 후원자 여러분께 진심으로 감사의 인사를 드립니다. 여러분의 후원에 힘입어 가장 좋은 제품을 드리고자 새로 맞춘 메세지조명의 프레임에 조금 문제가 생기게 되었습니다. 그래서 저희들은 고민 끝에, 선물하는 후원자분들의 마음에 누가 되지 않도록 온전한 제품으로 다시 만들자고 마음을 모았습니다. 제품을 다시 만드는만큼 일정이 지연되어, 제작된 메세지조명은 3월 말에 배송될 예정입니다. 기다려주시는 후원자분들께 죄송한 마음을 전합니다. 정성껏 예쁘게 마무리해서 보내드리겠습니다. 감사합니다^^\r\n\r\n※ 기념일 등으로 인하여 조명을 빨리 받으셔야 하는 분들은 아래 연락처로 개별연락 주시기 바랍니다.\r\n\r\n[카카오톡] @헤세드조명 / [문의] 010-2556-5607',102,3,85),(86,3,9,'2016-03-11 13:43:47','2016-03-11 13:44:05','안녕하세요, 메세지조명입니다.\r\n\r\n먼저 저희 메세지조명을 신뢰해주시고 기다려주시는 후원자 여러분께 진심으로 감사의 인사를 드립니다. 여러분의 후원에 힘입어 가장 좋은 제품을 드리고자 새로 맞춘 메세지조명의 프레임에 조금 문제가 생기게 되었습니다. 그래서 저희들은 고민 끝에, 선물하는 후원자분들의 마음에 누가 되지 않도록 온전한 제품으로 다시 만들자고 마음을 모았습니다. 제품을 다시 만드는만큼 일정이 지연되어, 제작된 메세지조명은 3월 말에 배송될 예정입니다. 기다려주시는 후원자분들께 죄송한 마음을 전합니다. 정성껏 예쁘게 마무리해서 보내드리겠습니다. 감사합니다^^\r\n\r\n※ 기념일 등으로 인하여 조명을 빨리 받으셔야 하는 분들은 아래 연락처로 개별연락 주시기 바랍니다.\r\n\r\n[카카오톡] @헤세드조명 / [문의] 010-2556-5607',102,3,85),(87,3,104,'2016-03-14 22:22:48','2016-03-14 22:23:21','test',104,3,87),(88,3,104,'2016-03-14 22:24:33','2016-03-14 22:25:15','test',104,3,88),(89,378,378,'2016-03-23 11:19:59','2016-03-23 11:21:21','오지랖에서 메시지 보냅니다',108,0,89),(90,394,104,'2016-03-28 07:26:23','2016-03-28 07:51:45','캠핑 버너 마에스트로 -동성 해