배송완료라고 나와있는데 저는 아직까지 못받았네요.. 언제쯤 받을 수 있나요?',112,0,123),(124,624,564,'2016-08-04 10:52:04','2016-08-04 13:13:14','9월24일출국인데 그전에받을수있을까요?ㅠㅜ아ㅠㅜ정말기다리고기다리던건데요ㅠㅜ 펀딩금액달성해도 제품생산은 예정된일정대로진행되는거겠죠?ㅠㅜ',122,0,124),(125,564,624,'2016-08-04 13:18:58','2016-08-04 13:36:28','안녕하세요, 크라우드펀딩 오지랖입니다. 먼저 후원 해주신것에 대해 매우 감사드립니다.^^ \r\n현재 제품은 대만에서 양산을 위한 최종 테스트중에 있습니다. Kickstarter 및 전세계적으로 배송은 비슷하게 될 예정입니다. 대만 제조사인 Creation Cell과 이야기 한 결과 8월 말부터 제품 양산에 들어갈 예정이며 후원 해주신분들이 실제로 제품을 받는 일정은 국내 통관 및 안전인증을 위한 기간이 소요되기에 9/20~ 9/31 정도로 예상하고 있습니다.  정확한 배송 일정은 확인되는대로 바로 알려드리도록 하겠습니다. 빨리 받으실 수 있도록 최대한 노력하겠습니다ㅠ 관심가져주셔서 정말 감사합니다.',122,0,124),(126,624,564,'2016-08-04 13:48:55','2016-08-04 13:54:15','계속문의드려서죄송합니다ㅠㅜ혹시제가24일전에받는게불가능하다면주문취소해야해서요ㅠㅠㅠㅠ결제취소하는건언제까지가능한가요?',122,0,126),(127,564,624,'2016-08-04 13:55:29','2016-08-04 23:13:37','취소는 펀딩종료 전에 해주셔야합니다.\r\n펀딩 종료는 8/31일이며 그 전에 후원취소 해주시면 됩니다.9/1일 00:00 를 기점으로 결제가 진행됩니다. ^^',122,0,126),(128,834,564,'2016-08-05 15:07:26','2016-08-05 15:53:04','안녕하세요~\r\n\r\n몇개월전 인터넷에서 보고 캡쳐해 뒀다가 오늘 다시보게 되서 이 페이지에 가입까지 했습니다.\r\n\r\n시판 진공압축팩이랑 호환이 안된다고 하니 아쉽네요ㅠ 집에 진공청소기가 없는 자취생이라서 여행갈때 뿐만 아니라 집에서도 사용하면 참 좋겠다고 생각했는데.... 시판용과 호환되는 제품을 만드실 계획은 없으신가요?\r\n\r\n혹은 진공압축팩을 다양한 사이즈(옷걸이용, 이불용 등등...) 으로 만드실 계획이 있는지 궁금합니다!\r\n\r\n아 그리고... 크라우드 펀딩에 대해서 잘 몰라서 그런데;;\r\n이 제품이 시판되고 나서 펀딩금액보다 더 내려가기도 하나요? ',122,0,128),(129,564,834,'2016-08-05 16:03:59','2016-08-07 16:53:03','안녕하세요, 크라우드펀딩 오지랖입니다. 먼저 제품의 가격은 실제로 시판되면 펀딩금액보다는 높게 책정됩니다. 보통 펀딩가격의 30~50% 이상 가격이 상승하게 됩니다.  \r\n\r\n본 제품은 해외업체에서 제작된 제품이기에 당장은 저희 마음대로 팩을 제작 할 수 없습니다. 제품을 후원해 주신 분들을 위해,\r\n국내안전 인증을 위한 시제품을 받게되면 시중에 판매되고 있는 압축팩과 호환이 되는지 먼저 테스트 해 볼 예정입니다. \r\n\r\n차후 그 결과를 페이지에 업데이트할 예정이오니 내용을 확인 해 보시고 좀 더 고민해보셔도 괜찮지 않을까 싶습니다. 이렇게 까지 관심가져주신데 대하여 정말, 진심으로 감사드립니다. ^^',122,0,128),(130,840,564,'2016-08-06 00:51:54','2016-08-06 10:28:17','압축 팩은 시증에 나와있는 것도 사용 가능한가요?\r\n좀전에 후원 예약했습니다',122,0,130),(131,564,840,'2016-08-06 10:30:51','2016-08-10 14:57:41','안녕하세요, 먼저 관심가져주시고 후원해 주셔서 감사드립니다. 현재 제조사의 말에 따르면 VAGO 전용 압축팩만 사용이 가능하다고 합니다. \r\n아직 실제 제품이 양산 전이기 때문에 양산 바로 직전의 제품을 가져와 국내 통관 및 안전인증을 진행함과 동시에 시중 압축팩이 사용 가능한지 테스트 해 볼 예정입니다. 관심 가져주셔서 정말 감사합니다.^^',122,0,130),(132,840,564,'2016-08-10 14:59:11','2016-08-10 16:21:16','전용압축팩만 사용가능하다면 전 이 제품이 굳이 필요가 없거든요\r\n테스트 내용은 언제 어디서 확인할수있을까요?',122,0,131),(133,564,840,'2016-08-10 16:23:28','2016-08-10 16:38:56','안녕하세요, 크라우드펀딩 오지랖입니다.\r\n테스트 내용은 8월 25~26일쯤 페이지에 업데이트 될 예정입니다. 펀딩 완료는 29일이니 그 전에 확인해 보실 수 있으실 것 같습니다.^^',122,0,132),(134,840,564,'2016-08-10 16:39:15','2016-08-10 16:40:55','네 감사합니다~^^',122,0,133),(135,461,498,'2016-08-10 17:04:32',NULL,'죄송합니다. \r\n금액 입금 후 2~3주 소요 된다고 말씀드렸습니다. \r\n하지만 저희 측에서도 돈이 입금이 안되서 제작을 못하고 있었습니다. 오늘 배송 되었으니 내일이나 내일 모레 받으실 거에요!! 참여해주셔서 감사합니다^^',112,0,123),(136,624,564,'2016-08-15 10:30:03','2016-08-15 23:12:53','안녕하세요~?  진공백추가구매하면서 결제를 할부로구매하고싶은데요ㅠㅜ 결제수단변경에는 없어서요ㅠㅜ 할부로구매하는건불가능한가요?ㅠㅠㅎㅎㅎ',122,0,136),(137,564,624,'2016-08-16 13:16:57','2016-08-18 00:25:01','안녕하세요, 크라우드펀딩 오지랖입니다.\r\n현재 크라우드 펀딩과 사이트의 특징 상 할부구매가 지원되지 않습니다.^^; \r\n이와 관련된 사항에 대하여 양해 부탁드립니다.\r\n감사합니다.',122,0,136),(138,564,624,'2016-08-16 13:16:57','2016-08-18 00:24:51','안녕하세요, 크라우드펀딩 오지랖입니다.\r\n현재 크라우드 펀딩과 사이트의 특징 상 할부구매가 지원되지 않습니다.^^; \r\n이와 관련된 사항에 대하여 양해 부탁드립니다.\r\n감사합니다.',122,0,136),(139,1049,564,'2016-08-18 15:24:25','2016-08-18 15:57:57','35,000원을 결제하면 후원이 되고 구매예약이 되는 건가요~? 12/17일이 신혼여행인데 여행짐 꾸릴 때 굉장히 유용할 꺼 같아요^ ^ 답변 부탁드릴께용',122,0,139),(140,564,1049,'2016-08-18 16:02:54','2016-08-23 12:20:27','안녕하세요, 크라우드펀딩 오지랖입니다. \r\n결제예약하기를 누르시면 후원이 되고 구매예약이 되는것으로 진행됩니다. \r\n실제 결제는 프로젝트 마감일인 8/29일에 정리되어 8/30일 오전에 일괄결제 될 예정입니다. \r\n제품을 받게 되시는 날짜는 9/20일 이후로 받으 실 수 있을 예정입니다. \r\n후원과 관심에 감사드리며 더 궁금한 사항 있으시면 메시지나 메일 보내주시기 바랍니다. 진심으로 감사드립니다^^',122,0,139),(141,612,564,'2016-08-19 11:16:17','2016-08-19 13:17:00','배송지수정 어케하나요',122,0,141),(142,612,564,'2016-08-19 11:27:02','2016-08-19 13:21:10','통관고유번호는필요없나요  진공백은 나중에 따로구매할수잇나요',122,0,114),(143,564,612,'2016-08-19 13:21:05','2016-08-19 18:55:22','안녕하세요, 크라우드펀딩 오지랖입니다.\r\n통관고유번호는 따로 필요 없으며, 배송지 수정은 로그인 후 우측 상단에 아이디를 클릭하시어 \'후원결제내역\'을 클릭합니다.  해당 프로젝트를 클릭하시어 수정이 가능합니다. ^^',122,0,141),(144,564,612,'2016-08-19 13:22:43','2016-08-19 18:56:05','진공백은 현재 저희 사이트에서 구매가 가능합니다. 크라우드 펀딩이 종료 된 후 진공백 판매와 관련된 내용은 업데이트를 통하여 안내드리도록 하겠습니다.',122,0,141),(145,1117,564,'2016-08-24 07:51:51','2016-08-24 09:15:18','10월21일 출국인데 그전까지 받을수있울까용?\r\n',122,0,145),(146,564,1117,'2016-08-24 09:16:21',NULL,'안녕하세요,\r\n크라우드펀딩 오지랖입니다. 먼저 관심가져주셔서 감사드립니다.\r\n제품은 9월20~9월30일 이내에 배송 예정입니다. 정확한 날짜는 변동될 수 있으나 10월 20일 이전에는 받아보실 수 있을것 같습니다.^^ 이상입니다.',122,0,145),(147,834,564,'2016-08-24 10:48:05','2016-08-24 11:00:38','안녕하세요~  시판 제품이랑 호환 되는지 테스트는 아직 진행이 안된건가 궁금합니다.  펀딩 끝나는날이 얼마 남지 않아서요^^',122,0,129),(148,564,834,'2016-08-24 11:03:10','2016-08-24 13:39:59','안녕하세요 허지님. \r\n시판 제품과의 호환테스트는 일정상 펀딩이 종료 된 후 진행될것 같습니다.\r\n 현재 제조사에서 다음 주 내로 국내 안전인증을 위한 초판 제품을 보내주기로 하여 받아볼 예정이며  그 제품을 통해서 테스트를 진행 할 예정입니다. 현재 제조사에서 보내준 사진 샘플로 보아서는 호환되지 않을것 같습니다. 금일 내로 제품 샘플사진 추가 업데이트 할 예정입니다.\r\n관심가져주셔서 정말 감사드립니다.^^',122,0,147),(149,840,564,'2016-08-26 18:44:57','2016-08-26 18:56:37','전용진공팩만 사용 가능한거죠?\r\n진공팩은 어디서 구매해야 하나요?',122,0,149),(150,564,840,'2016-08-26 18:58:27','2016-08-30 10:29:08','안녕하세요. 크라우드펀딩 오지랖입니다.\r\n진공백 만으로는 사용이 불가능하며 vago에 결합시켜서만 사용이 가능합니다. 관심가져주셔서 감사합니다^^',122,0,149),(151,982,564,'2016-08-29 08:32:00','2016-08-29 10:36:22','가장큰고민이 AS인것같은데 사후관리는 어떻게되나요?',122,0,151),(152,1366,564,'2016-08-29 23:34:38','2016-08-30 08:48:30','Vogo 고민하다가 40분 남기고 사려고 했는데...\r\n\r\n후원가능한 상태가 아니라니요.ㅠㅠ\r\n\r\n이러면 어떡하나요......',122,0,152),(153,564,982,'2016-08-30 08:54:21',NULL,'안녕하세요. 오지랖 지원팀입니다.\r\nA/S 관련해서 현재 VAGO와의 협의 된 것은 사용하다가 고장난 건에 대해서는 정상동작 새 제품으로 교체해드리는 방식으로 진행될 예정입니다.\r\n- 지원팀 드림 -',122,0,151),(154,564,1366,'2016-08-30 08:58:31',NULL,'안녕하세요. 오지랖 지원팀입니다. \r\nVAGO와 협의된 독점 펀딩 일정이 어제 8월 29일 11시 30분까지만 협의가 되어서요. 죄송하지만 이 이후에 구매는 사실상 어려운 상황입니다.\r\n- 오지랖 지원팀 드림 -',122,0,152),(155,564,1366,'2016-08-30 08:59:39',NULL,'이번 펀딩이 완료된 후, 별도 구매할 수 있도록 오지랖에 페이지를 만들 예정입니다. 이때 다시 연락드리겠습니다.',122,0,152),(156,635,564,'2016-08-30 10:28:43','2016-08-30 13:53:34','결제 예정이었던 카드가 바꼈습니다.\r\n교체 가능할까요?',122,0,156),(157,871,564,'2016-08-30 10:34:09','2016-08-30 13:53:38','진공팩을 추가적으로 주문 더하고싶은데 가능한가요?',122,0,157),(158,588,564,'2016-08-30 10:34:41','2016-08-30 13:53:41','안녕하세요. 먼저 프로젝트 대성공 축하드립니다. 배송지연 내용은 안내주셔서 감사합니다. 다름이 아니오라 현재 결제 진행중인 것같은데 제가 현재 해외에 체류중인 관계로 문자 수신에 오류가 발생한 것 같습니다. 저의 메일 주소로 무통장입금 계좌번호 알려주시면 한국에 부탁해서 입금하도록 하겠습니다.  번거롭게 해드려 죄송합니다. 메일주소는 \r\nmujili@naver.com  입니다. 감사합니다!',122,0,158),(159,645,564,'2016-08-30 10:42:22','2016-08-30 13:53:54','안녕하세요 \r\n이거 결제 해놓은 카드를 정지시키면서 교체를 해서\r\n결제가 안됬을텐데 어떻게 해야 하나요?ㅠㅠ',122,0,159),(160,840,564,'2016-08-30 10:45:36','2016-08-30 13:54:00','제가 진공팩으로 몇번 문의드렸는데요\r\n압축기는 당연히 현재 후원 상태여서 구입하는데\r\n전용진공팩은 어디서 구입해야 하는지를 문의한거거든요\r\n동문서답이어서 당황했어요\r\n전용진공팩만으로는 사용불가라고 해서요\r\n당연히 같이 사용해야 하는거 알고 있으니 진공팩을 어디서 언제 구입 가능 한지를 알려주세요\r\n',122,0,160),(161,652,564,'2016-08-30 10:56:31','2016-08-30 13:54:19','안녕하세요. 홍성구 이름으로 44,000원 입금하였습니다. 블랙 VAGO 후원입니다. 확인 부탁드립니다. 또한, 진공팩을 추가로 후원하고 싶은데 현재 불가능한지 문의 드립니다.',122,0,161),(162,923,564,'2016-08-30 14:13:51','2016-08-30 14:18:19','깜빡하고 결제 금액을 잘못 넣어둬서 결제 실패가 됬는데\r\n다시 결제가 가능한가요??\r\n원래 결제계좌에 다시 돈은 넣어 뒀습니다.',122,0,162),(163,564,923,'2016-08-30 14:30:13',NULL,'안녕하세요, 다이스키님.\r\n 크라우드펀딩 오지랖입니다.\r\n문의주신 내용을 확인한 후, 결제를 진행하여 완료하였습니다. \r\nVAGO에 보내주신 관심과 후원 감사드립니다.\r\n좋은 하루 보내시길 바랍니다^^',122,0,162),(164,564,652,'2016-08-30 14:42:01','2016-09-06 13:29:11','홍성구님의 이름으로 무통장입금 44,000원 입금확인되셨습니다^^ \r\n추가로 문의주신 진공팩 답변드리겠습니다.\r\n빠른시일내 \'진공팩만\'을 프리오더로 진행할 예정입니다. VAGO제품과 함께 배송받으실 수 있도록 일정을 맞추어 진행할 예정이오니 참고해 주시기 바랍니다. VAGO 진공팩 프리오더오픈과 동시에 SMS로 안내드리겠습니다. \r\nVAGO에 보내주신 관심과 후원 다시한번 감사드립니다.\r\n좋은하루 보내시기 바랍니다.\r\n\r\n감사합니다^^ ',122,0,161),(165,564,840,'2016-08-30 14:46:09','2016-09-05 19:54:02','안녕하세요, 크라우드펀딩 오지랖입니다.\r\n우선, 이전의 만족스럽지 못한 답변에 사과드립니다.\r\n\r\nVAGO 전용 진공팩은 빠른 시일내로 \'진공팩만\'을 프리오더로 진행할 예정입니다. 금번에 후원하신 VAGO압축기와 함께 받아보실 수 있도록 일정을 맞추어 진행할 예정이오니, 참고 부탁드립니다. \r\nVAGO 진공팩 프리오더오픈과 동시에 SMS로 안내드리겠습니다. \r\nVAGO에 보내주신 관심과 후원 다시한번 감사드립니다.\r\n좋은하루 보내시기 바랍니다.',122,0,160),(166,564,645,'2016-08-30 14:49:12','2016-08-30 15:54:20','안녕하세요, 이하나님.\r\n크라우드펀딩 오지랖입