1,200원 (퍼플VAGO, 진공백M 4개, 진공백S 4개)\r\n\r\n보내주신 관심에 진심으로 감사드립니다.',122,0,198),(200,1246,564,'2016-09-19 14:41:25','2016-09-19 15:10:33','vago 크라우드펀딩신청해서 10월 15~30일쯤 받아 볼 수 있을 거라 생각합니다. 음 여기서 여쭤볼것이..  압축백을 어떻게 구매해야하나요? 사실 받아보질 않아서 실물로 와닿지 않아 정확한 수량및 사이즈를 알려드릴수는 없지만.. 2~3개 정도 더 구매할 요량이구요,.\r\n그리고 다른 압축백에서는 할 수 없는건가요?\r\n1. 압축백 구매하는 방법\r\n2. 타 압축백 사용가능여부',122,0,200),(201,564,1246,'2016-09-19 16:12:00','2016-10-06 16:49:56','안녕하세요, 아칸짱구님^^ \r\n문의주신 두 가지 관련하여 안내드리겠습니다.\r\n\r\n1. 압축백 구매는 현재 펀딩은 종료된 상태이나 제조사와 이야기 한 결과 추가구매는 가능하다고 합니다. \r\n다만 펀딩이 종료되어 무통장입금만 가능한 상태라, 구매하실 품목에 대하여 말씀해 주시면 확인후 입금안내 드리도록 하겠습니다. \r\n제품을 받아보신 후 나중에 추가 구매를 원하시면 1차 배송이 끝난 후 \'앵콜펀딩\'이 진행 될 예정입니다. 다만, 대량생산이 끝난 후 추가 펀딩이 진행됨에 따라 이번 펀딩과 약간의 가격적인 차이는 발생할 수 있습니다.\r\n\r\n2. 타 압축백 사용가능여부.\r\n현재 타 압축백은 사용이 불가능한 것으로 알고 있습니다. 9/22~9/29일 사이에 인증 통과 및 테스트를 위한 제품이 극소량으로 들어오면 테스트하여 정확히 타 압축백 사용과 관련하여 업데이트 하도록 하겠습니다.\r\n\r\n후원해주시고 또 지속적으로 관심 가져주셔서 정말 감사드립니다 :D',122,0,200),(202,1374,564,'2016-09-20 10:23:35','2016-09-20 11:13:21','입금하였습니다.^^',122,0,199),(203,564,1374,'2016-09-20 11:17:19','2016-09-20 15:21:11','안녕하세요, 장은주님^^\r\n입금확인 완료되었습니다. 배송받으실 주소 및 연락처 메세지로 남겨주시면 확인 후 진행하도록 하겠습니다. 관심과 후원에 감사드립니다.^^',122,0,202),(204,1374,564,'2016-09-20 15:22:44','2016-09-20 15:28:45','주소 : 경기도 김포시 김포한강2로 83 가현초등학교\r\n연락처: 010-7123-1104\r\n좋은 하루 되세요~~~',122,0,203),(205,564,1374,'2016-09-20 16:33:21','2016-09-21 13:13:14','확인하였습니다!!\r\n감사합니다^^',122,0,204),(206,1378,564,'2016-09-21 16:38:45','2016-09-22 09:10:05','핑크+백 구성 하고 싶은데 \r\n펀딩 종료 된건가요?',122,0,206),(207,564,1378,'2016-09-22 09:12:44',NULL,'안녕하세요, Yeon Kyeong Kim님^^\r\n크라우드펀딩 오지랖입니다. 펀딩이 끝난 상태이지만 어제 제조사와 연락해 본 결과 핑크 제품은 추가 구매가 가능하다고 합니다. \r\n\r\n말씀주신 핑크+백은 추가 백 포함하여 구매이신지요?\r\n구매하실 품목에 대하여 메시지를 통해서 말씀해 주시면 확인후 입금안내 드리도록 하겠습니다. 감사합니다.^^',122,0,206),(208,1381,564,'2016-09-26 01:48:07','2016-09-26 09:06:03','VAGO의 존재를 지금 알았네요.\r\n킥스타터는 성공적으로 마무리 했는데 차 후 구매방법이 궁금합니다.\r\n참여하지 못해 너무나 아쉬운데 추가 판매는 없나요?',122,0,208),(209,564,1381,'2016-09-26 13:39:25','2016-10-25 17:46:29','안녕하세요, 크라우드펀딩