INSERT INTO `nest_newsletter` VALUES (1,'{NAME} 님 안녕하세요.','<div align=\"center\" valign=\"top\" style=\"background-color:#fff;\">\r\n    <table width=\"600px\" style=\"font-size:0px;color:#707070;font-family: \'나눔바른고딕\',\'맑은 고딕\', \'AppleSDGothicNeo Bold\', \'AppleSDGothicNeo\', \'Apple SD Gothic Neo\',\'NanumBarunGothic\',\'HelveticaNeue-Light\',\'돋움\',Dotum,sans-serif;\">\r\n        <thead>\r\n            <tr>\r\n                <th style=\"border-bottom:3px double #3b3b3b;\">\r\n                    <a href=\"https://www.ozr.kr\" target=\"_blank\" alt=\"오지랖\">\r\n                        <img src=\"https://www.ozr.kr/resources/email/title.png\" alt=\"\" style=\"width:450px;\"/>\r\n                    </a>\r\n                </th>\r\n            </tr>\r\n        </thead>\r\n\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table id=\"contents\" width=\"600px\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\" style=\"border-collapse:collapse;background-color:#f2f2f2;\">\r\n                        <tbody>\r\n                            <tr>\r\n                                <td align=\"center\" style=\"padding:10px;\">\r\n                                    \r\n                                    <!-- 1st -->\r\n                                    <table id=\"contents01\" cellpadding=\"10\" cellspacing=\"0\" border=\"0\" style=\"width:100%;padding:30px 0 20px 0;text-align:center;border-bottom:1px dashed #cccccc;\">\r\n                                        <tr>\r\n                                            <td>\r\n                                                <h3 style=\"font-size:14pt;color:#3b3b3b;font-weight:bold;padding:0;margin:0;letter-spacing:-1px;\">사랑과 존경을 담은 5월의 품격있는 선물</h3>\r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td align=\"center\">\r\n                                                <a href=\"https://www.ozr.kr/project/109/detail.do\" target=\"_blank\"><img src=\"https://www.ozr.kr/resources/email/n1.jpg\" alt=\"\" width=\"100%\" align=\"absmiddle\" border=\"0\" style=\"display:block;\"></a>\r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td>\r\n                                                <a href=\"https://www.ozr.kr/project/109/detail.do\" target=\"_blank\" style=\"margin:0;display:block;color:#3b3b3b;font-size:12pt;line-height:15pt;font-weight:bold;text-align:left;\">\r\n                                                    조명, 일상을 담다\r\n                                                </a>\r\n                                                <p style=\"font-size:10pt;text-align:left;width:auto;margin:0;padding:0 0 10px 0;color:#3b3b3b;font-weight:bold;letter-spacing:-0.5px;\">\r\n                                                    Studio IGI의 고급 인테리어 조명 프로젝트\r\n                                                </p>\r\n                                                <p style=\"margin:0;padding:5px 0;font-size:10pt;line-height:14pt;letter-spacing:-0.3px;text-align:left;\">\r\n                                                    일상의 모습에서 가끔씩이지만 느낄 수 있는 상대방의 소중한 마음,<br/>\r\n                                                    나는 얼마나 자주 감사를 표현하고 있을까요?<br/>\r\n                                                    다가오는 5월, 가정과 스승의 달에<br/>\r\n                                                    사랑하는 분들께 감사의 마음을 표현해 보세요~ \r\n                                                </p>                                            \r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td style=\"padding:20px 10px;\" align=\"left\">\r\n                                                <a href=\"https://www.ozr.kr/project/109/detail.do\" style=\"width:250px;padding:15px 10px;font-size:10pt;line-height:10pt;font-weight:bold;background-color:#ea2e2f;color:#fff;outline:none;display:block;text-decoration:none;text-align:center;letter-spacing:-0.5px;\">프로젝트보러가기 ></a>\r\n                                            </td>\r\n                                        </tr>\r\n                                    </table>\r\n                                    \r\n                                    <!-- 2nd -->\r\n                                    <table id=\"contents02\" cellpadding=\"10\" cellspacing=\"0\" border=\"0\" style=\"width:100%;padding:30px 0 20px 0;text-align:center;border-bottom:1px dashed #cccccc;\">\r\n                                        <tr>\r\n                                            <td>\r\n                                                <h3 style=\"font-size:14pt;color:#3b3b3b;font-weight:bold;padding:0;margin:0;letter-spacing:-1px;\">당신의 냉장고에는 무엇이 붙어있나요?</h3>\r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td align=\"center\">\r\n                                                <a href=\"https://www.ozr.kr/project/108/detail.do\" target=\"_blank\" ><img src=\"https://www.ozr.kr/resources/email/n2.jpg\" alt=\"\" width=\"100%\" align=\"absmiddle\" border=\"0\" style=\"display:block;\"></a>\r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td>\r\n                                                <a href=\"https://www.ozr.kr/project/108/detail.do\" target=\"_blank\" style=\"margin:0;display:block;color:#3b3b3b;font-size:12pt;line-height:15pt;font-weight:bold;text-align:left;\">\r\n                                                    내 맘대로 꾸미는 나만의 자석사진\r\n                                                </a>\r\n                                                <p style=\"font-size:10pt;text-align:left;width:auto;margin:0;padding:0 0 10px 0;color:#3b3b3b;font-weight:bold;letter-spacing:-0.5px;\">\r\n                                                    포토#의 DIY 자석사진 프로젝트 \r\n                                                </p>\r\n                                                <p style=\"margin:0;padding:5px 0;font-size:10pt;line-height:14pt;letter-spacing:-0.3px;text-align:left;\">\r\n                                                    매일매일 접하는 소중한 순간들을<br/>\r\n                                                    핸드폰 안에만 저장해 두시지 않으셨나요?<br/>\r\n                                                    냉장고나 오븐에 더덕더덕 붙어있는 전단지를 떼어내고,<br/>\r\n                                                    사진으로 아름답게 꾸며보는 것은 어떨까요?? \r\n                                                </p>                                            \r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td style=\"padding:20px 10px;\" align=\"left\">\r\n                                                <a href=\"https://www.ozr.kr/project/108/detail.do\" style=\"width:250px;padding:15px 10px;font-size:10pt;line-height:10pt;font-weight:bold;background-color:#ea2e2f;color:#fff;outline:none;display:block;text-decoration:none;text-align:center;letter-spacing:-0.5px;\">프로젝트보러가기 ></a>\r\n                                            </td>\r\n                                        </tr>\r\n                                    </table>\r\n                                    \r\n                                    <!-- 3rd -->\r\n                                    <table id=\"contents03\" cellpadding=\"10\" cellspacing=\"0\" border=\"0\" style=\"width:100%;padding:30px 0 20px 0;text-align:center;\">\r\n                                        <tr>\r\n                                            <td>\r\n                                                <h3 style=\"font-size:14pt;color:#3b3b3b;font-weight:bold;padding:0;margin:0;letter-spacing:-1px;\">나도 진짜가 될 수 있을까?</h3>\r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td align=\"center\">\r\n                                                <a href=\"https://www.ozr.kr/project/107/detail.do\" target=\"_blank\" ><img src=\"https://www.ozr.kr/resources/email/n3.jpg\" alt=\"\" width=\"100%\" align=\"absmiddle\" border=\"0\" style=\"display:block;\"></a>\r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td>\r\n                                                <a href=\"https://www.ozr.kr/project/107/detail.do\" style=\"margin:0;display:block;color:#3b3b3b;font-size:12pt;line-height:15pt;font-weight:bold;text-align:left;\">\r\n                                                    ‘Be Real’의 ART TOY 프로젝트\r\n                                                </a>\r\n                                                <p style=\"font-size:10pt;text-align:left;width:auto;margin:0;padding:0 0 10px 0;color:#3b3b3b;font-weight:bold;letter-spacing:-0.5px;\">\r\n                                                    내 자리에서 진짜가 되고 싶은 디자이너의 아트토이 프로젝트\r\n                                                </p>\r\n                                                <p style=\"margin:0;padding:5px 0;font-size:10pt;line-height:14pt;letter-spacing:-0.3px;text-align:left;\">\r\n                                                    출근은 매일 하지만 일을 하는 것은 내가 아닌 것 같은 느낌,<br/>\r\n                                                    혹시 한번이라도 느껴보신 적 있으신가요?<br/>\r\n                                                    힘들고 어렵더라도 내가 진정으로 원하는 길을 걸어보기로 결정한 한 디자이너의 꿈을 응원해 주세요~  \r\n                                                </p>                                            \r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <td style=\"padding:20px 10px;\" align=\"left\">\r\n                                                <a href=\"https://www.ozr.kr/project/107/detail.do\" style=\"width:250px;padding:15px 10px;font-size:10pt;line-height:10pt;font-weight:bold;background-color:#ea2e2f;color:#fff;outline:none;display:block;text-decoration:none;text-align:center;letter-spacing:-0.5px;\">프로젝트보러가기 ></a>\r\n                                            </td>\r\n                                        </tr>\r\n                                    </table>\r\n                                    \r\n                                </td>\r\n                            </tr>   \r\n                        </tbody>\r\n                    </table>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td align=\"center\">\r\n                    <table id=\"footer\" bgcolor=\"#fff\" width=\"600px;\" style=\"padding:10px 0;border-top:1px solid #ccc;\">\r\n                        <tbody>\r\n                            <tr>\r\n                            <td style=\"font-size:10pt;text-align:right;\">\r\n                                <span style=\"font-size:7pt;font-weight:bold;color:#3b3b3b;padding: 0 10px 0 0;\">Fllow me!</span>\r\n                                <a href=\"https://www.facebook.com/oziraper/\" target=\"_blank\"><img src=\"https://www.ozr.kr/resources/email/icon_nl_fb.png\" style=\"width:40px;height:40px;margin:0 10px 0 0;\" alt=\"페이스북\" valign=\"middle\"/></a>\r\n                                <a href=\"https://www.instagram.com/ozr.kr/\" target=\"_blank\"><