INSERT INTO `nest_product_review` VALUES (2,'굿엔레더 가죽 카드지갑 리뷰','u3_1465344147681.jpg','Vol 01.','제품 Review','가죽, 공예, DIY, 팔찌, 카드, 지갑, 여권, 케이스, 굿앤레더, 네이버, 카페','굿엔레더의 가죽공예 대중화 프로젝트','<br><p style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; unicode-bidi: embed; direction: ltr; -ms-word-break: keep-all; language: ko; mso-line-break-override: none; punctuation-wrap: hanging;\">가끔 백화점에 가서 HER***나 PRA** 등 수 많은 명품 매장을 지나갈 때면,</p><p>\'대체 저 가방들은 왜 저렇게 비싸지?\'<br>\'가죽이 그렇게 비싼가?\'<br>\'브랜드 때문에 비싼건가?\'</p><p>라고 생각하고는 했습니다.</p><p>그리고 문득 들었던 생각이 바로 <br>\'내가 직접 만들면 어떨까?\' 였습니다.</p><p>그런데 잠시 돌이켜보니 국민학교시절에(저는 8X년생입니다…)<br>만들었던 수 많은 방학생활 숙제들과<br>중학교 가정실습 시간에 만들었던 물건들,<br>나도 만들어보겠다고 손댔던 하드보드지 필통 등 뭐하나 제대로 만들었던 기억이 없습니다.</p><p>그때 마침 오지랖에 찾아온 제품이 있었으니…<br>바로 DIY 가죽공예 제품이었습니다.</p><br><p>요즘 대세인 미니멀리즘을 따라서 최소한의 필요한 것만 들고 다닐 수 있는 카드지갑을 소개해 드립니다.<br><br><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: en-US; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\"><img src=\"/data/project/null/attach/u3_1465291204961.jpg\"></span></p><p>초보자도 좀 더 쉽고 간단하게 직접 만들 수 있는 DIY 제품입니다.</p><p>보통 가죽을 가지고 카드지갑을 만들기 위해서는 다음과 같은 과정이 필요합니다.</p><p><img src=\"/data/project/null/attach/u3_1465291462421.png\">이 같은 과정에서 많은 문제가 발생하는데요,<br>카드 지갑을 위해서는 최소 1평 이상의 가죽이 필요합니다. </p><br><p>가죽을 사러 여기저기 시장을 돌아다니거나 인터넷을 통해 구매 해야합니다.<br>심지어 1평만 가죽을 사려면 가죽시장에 가서 발품을 팔아야 하죠.</p><br><p>여러가지 쓰임새를 고려해 카드지갑 시안도 그려야 하고,<br>가죽도 반듯하게 잘라야 하고 송곳으로 구멍을 뚫고 바느질을 해야합니다.</p><p><br> <img src=\"/data/project/null/attach/u3_1465291570231.PNG\"><br></p><p>위 사진처럼 집에 있는 송곳으로는 깔끔하게 구멍을 뚫기 힘든게 사실입니다.</p><p><font face=\"Trebuchet MS, Helvetica, Verdana, sans-serif\"><br></font><br></p><p><img src=\"/data/project/null/attach/u3_1465291640058.jpg\"></p><p>그래서 사진처럼 \'목타\'라는 공구를 사용하죠.</p><br><br><p><img src=\"/data/project/null/attach/u3_1465291780913.jpg\"></p><p>구성품은 이렇습니다.</p><p>- 가죽 조각 2장, 지갑 안감 2장, 실, 바늘 그리고 본드 접착이 필요 없도록 양면 테잎이 붙어있습니다.</p><br><img src=\"/data/project/null/attach/u3_1465293859375.png\"><br><p>자세히 보시면 구멍을 뚫을 필요 없이<br>이렇게 작업이 되어 나오기에 더 깔끔하게 제작이 가능합니다.</p><br><br><br><br><br><br><p><a href=\"https://youtu.be/fhsYGw0V6OE\"></a></p><p><iframe width=\"100%\" height=\"360\" src=\"https://www.youtube.com/embed/fhsYGw0V6OE\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p><p>동영상을 보고 따라 만들면 더욱 쉽겠죠?</p><p><img src=\"/data/project/null/attach/u3_1465292153362.png\">짜잔, 완성된 카드지갑 입니다.</p><p>이젠 지갑없이 꼭 필요한 카드만 두 어장 가지고 다닐 수 있습니다.</p><br><p><img src=\"/data/project/null/attach/u3_1465292220650.jpg\"></p><p>추가적으로 나만의 이니셜을 새겨 넣을 수 있습니다.<br>위&nbsp;제품은 이니셜을 새겨 넣을 수 있는 \'불박기\'라는 기계입니다.<br><br></p><br><p><img src=\"/data/project/null/attach/u3_1465292336409.jpg\"></p><p>이렇게 나만의 이니셜이 예쁘게 찍혀 나오죠.</p><br><p><img src=\"/data/project/null/attach/u3_1465292432191.png\"></p><p>어때요?</p><p>이젠 카드지갑은 쉽게 만들 수 있겠죠?</p><br><br><br><p><img src=\"/data/project/null/attach/u3_1465292482855.png\"><br><br> </p><p style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; unicode-bidi: embed; direction: ltr; -ms-word-break: keep-all; language: ko; mso-line-break-override: none; punctuation-wrap: hanging;\"><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: ko; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">이외에도 수 많은 </span><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: en-US; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">DIY<span style=\"mso-spacerun: yes;\"><font face=\"나눔고딕\">&nbsp; </font></span></span><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: ko; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">제품들이 </span><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: ko; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">여러분을 기다리고 </span><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: ko; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">있습니다</span><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: en-US; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">.</span></p> <br> <p style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; unicode-bidi: embed; direction: ltr; -ms-word-break: keep-all; language: ko; mso-line-break-override: none; punctuation-wrap: hanging;\"><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: ko; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">한 번</span><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: en-US; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">, </span><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: ko; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">도전해 보세요</span><span style=\"color: black; font-family: 나눔고딕; font-size: 12pt; language: en-US; mso-ascii-font-family: 나눔고딕; mso-fareast-font-family: 나눔고딕; mso-bidi-font-family: +mn-cs; mso-bidi-theme-font: minor-bidi; mso-color-index: 1; mso-font-kerning: 12.0pt; mso-style-textfill-type: solid; mso-style-textfill-fill-themecolor: text1; mso-style-textfill-fill-color: black; mso-style-textfill-fill-alpha: 100.0%;\">!</span></p> <br><br><br><br><br>','Y','2016-06-07 00:00:01',240),(3,'크라우드 펀딩이란?','u3_1465364264034.png','Vol 01.','Information','펀딩, 크라우드펀딩, 크라우드 펀딩, 티끌모아태산, 오지랖, 디자이너, 메이커','크라우드 펀딩이란 무엇인가','<p style=\"text-align: center;\"><img style=\"line-height: 1.45em;\" src=\"/data/project/null/attach/u3_1465363687788.PNG\"><img style=\"line-height: 1.45em;\" src=\"/data/project/null/attach/u3_1465363697448.PNG\"><img style=\"line-height: 1.45em;\" src=\"/data/project/null/attach/u3_1465363705629.PNG\"><img style=\"line-height: 1.45em;\" src=\"/data/project/null/attach/u3_1465363724070.PNG\"><img style=\"line-height: 1.45em;\" src=\"/data/project/null/attach/u3_1465363731679.PNG\"></p><p style=\"text-align: center;font-size:1.45em;\"><img src=\"/data/project/null/attach/u3_1465432507943.png\"></p><br><p style=\"text-align: center;\"><strong><a href=\"https://www.ozr.kr/project/112/detail.do\"><img style=\"line-height: 1.45em;\" src=\"/data/project/null/attach/u3_1465376252102.png\"></a></strong></p><p style=\"text-align: center;\"><br></p>','Y','2016-06-08 00:00:01',305),(4,'프리오더(Pre-order)란?','u3_1465806107319.PNG','Vol 01.','Information','프리오더, Preorder, Pre-order, 크라우드펀딩, 펀딩, 크라우드 펀딩, 티끌모아태산, 오지랖, 디자이너, 메이커','프리오더란 무엇인가','<p style=\"text-align: center;\"><img src=\"/data/project/null/attach/u3_1465800277554.png\" style=\"line-height: 1.45em;\"><img src=\"/data/project/null/attach/u3_1465800063757.PNG\" style=\"line-height: 1.45em;\"><img src=\"/data/project/null/attach/u3_1465800074654.PNG\" style=\"line-height: 1.45em;\"><img src=\"/data/project/null/attach/u3_1465956683761.PNG\" style=\"line-height: 1.45em;\"><img src=\"/data/project/null/attach/u3_1465800094615.PNG\" style=\"line-height: 1.45em; background-color: initial;\"><img src=\"/data/project/null/attach/u3_1465800103741.png\" style=\"line-height: 1.45em; background-color: initial;\"><a href=\"https://www.ozr.kr/project/add.do\" style=\"line-height: 1.4em;\"><img src=\"/data/project/null/attach/u3_1465806532351.png\" style=\"line-height: 1.45em;\"></a></p><p style=\"text-align: center;\"><br></p>','Y','2016-06-13 00:00:01',403),(5,'QUBE, 스마트 LED 가성비 시대','u3_1466067683324.png','Version 1.0','제품 Review','IoT, LED, QUBE','집에 있는 \'이XX\' 스탠드에 브레인을 탑재하세요','\r\n<p style=\"font-size:22px;line-height:28px;font-weight:700;margin:10px 0 25px 0;color:#3b3b3b;\">World\'s Most Affordable Wi-Fi Smart Bulb, QUBE</p>\r\n\r\n<p style=\"font-size:14px;font-weight:500;line-height: 1.7em; text-align:left;text-indent:5px;margin: 10px 0 15px 0;\">\r\n    오늘은 INDIEGOGO에서 약 6억 3천만원($54만불)의 펀딩금액을 <span style=\"font-family: &quot;Trebuchet MS&quot;, Helvetica, Verdana, sans-serif; line-height: 1.7em; background-color: initial;\">확보한 스마트 LED QUBE를 소개하겠습니다.&nbsp;</span></p><p style=\"font-size:14px;font-weight:500;line-height: 1.7em; text-align:left;text-indent:5px;margin: 10px 0 15px 0;\"><br><span style=\"font-family: &quot;Trebuchet MS&quot;, Helvetica, Verdana, sans-serif; line-height: 1.7em; background-color: initial;\">&nbsp;지난 1월 CES 2016에서도 다양한 IoT(Internet of Things)&nbsp;스마트 홈 제품들을 볼 수 있었습니다.&nbsp;스마트 LED 제품 역시 블루투스 스피커, 도어벨 소리를 학습하는 등&nbsp;다양한 스마트 기능을 탑재한 제품들이 소개되었습니다. </span><span style=\"font-family: &quot;Trebuchet MS&quot;, Helvetica, Verdana, sans-serif; line-height: 1.7em; background-color: initial;\">2013년 출시된 필립스 ‘Hue’가 스마트 LED시장을 열었다면,&nbsp;</span><span style=\"font-family: &quot;Trebuchet MS&quot;, Helvetica, Verdana, sans-serif; line-height: 1.7em; background-color: initial;\">3년이 지난 올해부터 다양한 제품들이 합리적인 가격으로 출시될 것으로 예상합니다.&nbsp;</span></p><img src=\"/data/project/null/attach/u3_1466123491354.jpg\"><p>[필립스 \'Hue\' - www2.meethue.com]<br><br>\r\n</p><p style=\"font-size:14px;font-weight:500;line-height: 1.7em; text-align:left;margin:10px 0 15px 0;\">\r\n    QUBE의 가장 큰 특징은 뭘까요?\r\n</p>\r\n<p style=\"font-size:14px;font-weight:500;line-height: 1.7em; text-align:left;text-indent:5px;margin: 10px 0 15px 0;\">\r\n가장 큰 차이점은, Bluetooth와 Wi-Fi 일체형이라는 점입니다.<br>큰형님 \'Hue\'와는 달리 Bridge와 같은 네트웍 기기없이 작동이 되어 설치가 간편하고&nbsp;또한&nbsp;&nbsp;$19(Smart Bulb 기준)이라는 가격 경쟁력을 확보하고 있습니다.&nbsp;이 가격도 불구하고 QUBE는앱을 통해 다양한 기능을 지원, 스마트 전구로써 최고의 가성비를 느낄 수 있는 제품입니다<br>(큰 형님에 대한 예우 차원에서 \'Hue\' 가격은 밝히지 않겠습니다^^)\r\n</p>\r\n\r\n<p>\r\n<img src=\"/data/project/null/attach/u3_1466055920276.jpg\">\r\n</p>\r\n<p style=\"font-size:12px;font-weight:700;line-height: 1.7em; text-align:left;text-indent:5px;margin: 10px 0 15px 0;\">[보기엔 그냥 \'다마\'일뿐? - www.qube-smarthome.com]\r\n</p>\r\n\r\n<p style=\"font-size:14px;font-weight:700;line-height: 1.7em; text-align:left;text-indent:5px;margin: 10px 0 15px 0;\">\r\n    그럼 QUBE의 주요 기능들을 간략히 살펴보도록 하겠습니다.\r\n</p>\r\n\r\n<p style=\"font-size:14px;font-weight:500;line-height: 1.7em; text-align:left;border:2px solid #d4d4d4;padding:10px;margin: 10px 0 15px 0;\">\r\n1. QUBE Sense: 사용자 위치 파악을 통한 자동 On/Off<br>\r\n2. QUBE Notifications: 메세지/전화수신/날씨등을 알려줌<br>\r\n3. QUBE Moods: 사용 환경에 따른 최적의 색 온도 제공<br>\r\n4. QUBE Schedules: 셋팅된 스케쥴에 따른 On/Off 기능<br>\r\n5. QUBE Remote: 인터넷 접근가능한 어디에서도 원격 조정<br>\r\n6. QUBE Energy: 5만시까지 사용 가능\r\n</p>\r\n\r\n<p>\r\n<img src=\"file:///C:/Users/%EA%B9%80%ED%83%9C%EA%B2%BD/AppData/Local/Temp/msohtmlclip1/01/clip_image010.jpg\" alt=\"https://c1.iggcdn.com/indiegogo-media-prod-cld/image/upload/c_limit,w_620/v1444806733/kgdsh22nlbvoziotjflq.png\">\r\n<img src=\"/data/project/null/attach/u3_1466065938220.PNG\">\r\n<img src=\"/data/project/null/attach/u3_1466065953740.PNG\">\r\n<img src=\"/data/project/null/attach/u3_1466065967401.PNG\">\r\n</p>\r\n    \r\n<p style=\"font-size:12px;font-weight:500;line-height: 1.7em; text-align:left;margin:10px 0 15px 0;\">\r\n[QUBE 홈페이지 - www.qube-smarthome.com]</p>\r\n<p style=\"font-size:14px;font-weight:500;line-height: 1.7em; text-align:left;text-indent:5px;margin: 10px 0 15px 0;\">  \r\nQUBE 홈페이지를 방문하시면, 국가별 소켓 정보도 나와 있어서<br>관심있으신 분들은 방문해보시면 좋을 것 같습니다.(한국은 \"E27 bulbs\"네요)</p>\r\n\r\n<p style=\"font-size:14px;font-weight:500;line-height: 1.7em; text-align:left;text-indent:5px;margin: 10px 0 25px 0;\">  \r\n\"<span style=\"background-color:#cdfcfb;font-weight:700;\">오지LAB</span>\"에서는 국내외 메이커/디자이너 제품들을 지속적으로 소개할 예정이며, 많은 관심을 보여주시는 제품에 대해서는 오지랖 싸이트를 통해 Crowdfunding/Pre-order 형태로&nbsp;쉽고 저렴하게 구매할 수 있는 프로젝트를 만들도록 하겠습니다.</p>','Y','2016-06-16 00:00:01',168),(6,'VAGO, 더 편해진 여행 준비','u3_1466157713556.jpg','Version 1.0','제품 Review','여행, 캐리어, 압축기','짐쌀 시간에 맛집 하나 더 찾아보기','<p class=\"MsoNormal\"><span lang=\"EN-US\">VAGO – Smallest way to get biggest luggage\r\nspace<br>\r\n<br></span>&nbsp;여름 휴가 계획은 세우셨는지요?<br>네이버 <span lang=\"EN-US\">Data Lab을 통해 &nbsp;15년 월별 \"</span>국내여행<span lang=\"EN-US\">/</span>해외여행\" 검색어 트랜드를 조회해 보니<span lang=\"EN-US\">, 확실히 6</span>월<span lang=\"EN-US\">~8</span>월에 검색량이 늘어나네요.<br><span lang=\"EN-US\">&nbsp;<img src=\"/data/project/null/attach/u3_1466155108018.PNG\"><br>&nbsp;[\'15.1월~12월 국내여행/해외여행 키워드 트랜드 - 네이버 Data Lab]<br><br>\r\n<br></span>&nbsp;큰 캐리어를 쓰는 분이나 작은 캐리어를 쓰는 분들이나, 공간부족은 항상 큰 스트레스중에 하나죠.<br>짐을 싸면서 안갖고 가자니 아쉬워서 손에 들었다 놨다했던 경험이 누구나 있으실 것 같습니다.<br><span lang=\"EN-US\"><br><img src=\"/data/project/null/attach/u3_1466156572801.PNG\"><br>&nbsp;[다들 이정도는 하시는거죠? ‘</span>모르면 손해<span lang=\"EN-US\">’ &nbsp;</span>짐싸기 꿀팁 <span lang=\"EN-US\">– </span>캐시슬라이드\r\n블로그 <span lang=\"EN-US\"><a href=\"http://blog.cashslide.kr/220625080774]\">http://blog.cashslide.kr/220625080774]</a><br><br>\r\n<br>\r\n&nbsp;&nbsp;VAGO</span>는&nbsp;옷<span lang=\"EN-US\">, </span>가방 등 부피 큰 물건을 압축해주는 제품입니다.<span lang=\"EN-US\"><br>\r\n</span>이런 물건들을 압축하면 최대&nbsp;<span lang=\"EN-US\">50% </span>까지 공간을 늘려줄 수 있다고 하네요.<br><span lang=\"EN-US\"><br><img src=\"/data/project/null/attach/u3_1466155347707.jpg\"><br>\r\n<br><img src=\"/data/project/null/attach/u3_1466155430091.jpg\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 1.45em;\"><br><span style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 1.4em; background-color: initial;\">&nbsp; [짐싸기는 더이상 문제가 안된다? 압축해버리니까! -&nbsp;<a href=\"http://www.creationcell-vago.com]\">http://www.creationcell-vago.com]</a></span></span></p><p><span lang=\"EN-US\"><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 20.3px;\"><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif;\"><span lang=\"EN-US\"><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 20.3px;\"><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif;\">&nbsp;사용 방법은 간단합니다.<br>먼저 전용 진공백에 옷을 넣고 VAGO를 체결합니다. &nbsp;그리고 전원을 연결한 후, 버튼을 누르면 끝!!<br></span></span></span><br style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif;\"></span><img src=\"/data/project/null/attach/u3_1466155483059.jpg\"><br><br>&nbsp; 압축이 끝나면 자동으로 멈추는 스마트한 기능도 갖춰져 있네요. 또한</span></span><span style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 20.3px; background-color: initial;\">&nbsp;길이 7Cm, 무게 85그램으로 휴대성이 좋으며,&nbsp;</span><span style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 20.3px; background-color: initial;\">보조 배터리로도 동작할 수 있어 사용이 편리합니다.&nbsp;</span></p><p><span lang=\"EN-US\"><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 20.3px;\">&nbsp;<img src=\"/data/project/null/attach/u3_1466156105457.jpg\"><br><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 19.6px;\"><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 20.3px;\">&nbsp; <br>현재 4가지 색상이 개발되어 있으며 추가 색상도 준비중이라고 합니다.<br></span></span><br><img src=\"/data/project/null/attach/u3_1466156129389.jpg\"></span></span></p><p><span lang=\"EN-US\"><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 20.3px;\"><br>&nbsp;현</span></span><span lang=\"EN-US\"><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, &quot;Spoqa Han Sans JP&quot;, sans-serif; line-height: 20.3px;\">재 킥스타터에서 펀딩을 진행중이며, VAGO &nbsp;홈페이지를 방문하시면 보다 상세한 정보를 얻으실 수 있습니다.<br>(<a href=\"http://www.creationcell-vago.com)\">http://www.creationcell-vago.com)</a><br><br><br><span style=\"font-family: &quot;Trebuchet MS&quot;, Helvetica, Verdana, sans-serif; line-height: 19.6px; text-indent: 5px;\">&nbsp;\"</span><span style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; line-height: 19.6px; text-indent: 5px; font-weight: 700; background-color: rgb(205, 252, 251);\">오지LAB</span>\"에서는 국내외 메이커/디자이너 제품들을 지속적으로 소개할 예정이며, 많은 관심을 보여주시는 제품에 대해서는 오지랖 싸이트를 통해 Crowdfunding/Pre-order 형태로&nbsp;쉽고 저렴하게 구매할 수 있는 프로젝트를 만들도록 하겠습니다.<br><br></span></span></p>','Y','2016-06-17 00:00:01',554),(8,'test','u3_1466414936127.gif','1','test','','','<img src=\"/data/smarteditor/attach/u3_1469172073373.jpg\" title=\"u3_1469172073373.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u3_1469172081253.jpg\" title=\"u3_1469172081253.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u3_1469172087781.jpg\" title=\"u3_1469172087781.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u3_1469172095039.jpg\" title=\"u3_1469172095039.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u3_1469172101161.jpg\" title=\"u3_1469172101161.jpg\"><br style=\"clear:both;\"><br style=\"clear:both;\">','N','2016-06-20 00:00:01',0),(9,'CHIP - 가격은 Cheap, 성능은 Chief','u3_1467007214563.png','Version 1.0','제품 Review','#PC, #Pocket, #Open Source','일단 사고 뭐에 쓸지 고민해도 될만한 PC','<p>\"C.H.I.P. - The World\'s First $9 Computer\"<br><br><span lang=\"EN-US\" style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt;\">PC는 어디까지 작아질까요? 초등학생들에게 컴퓨터를 그려보라고 하면 요즘은 죄다 접히는 형태인 노트북을 그린다고 합니다. 저는 아직 PC하면 모니터와 본체가 분리가 먼저 생각나는데, 앞으로 PC하면 오늘 소개드리는 C.H.I.P. 처럼 작은 모듈만을 기억할수도 있을 것 같네요.<br style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\">&nbsp;<br style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\"></span><span style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt; background-color: initial;\">C.H.I.P은 미국 캘리포니아의 스타트업인 넥스트 씽</span><span lang=\"EN-US\" style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt; background-color: initial;\">(Next Thing)</span><span style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt; background-color: initial;\">에서 개발한 지금까지 출시된 컴퓨터 중 가장 작고 싼&nbsp;</span><span lang=\"EN-US\" style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt; background-color: initial;\">9</span><span style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt; background-color: initial;\">달러 미만의 초소형&nbsp;</span><span lang=\"EN-US\" style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt; background-color: initial;\">PC</span><span style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt; background-color: initial;\">입니다</span><span lang=\"EN-US\" style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; line-height: 19.2pt; font-size: 12pt; background-color: initial;\">.&nbsp;</span><br><br><br><img src=\"/data/project/null/attach/u3_1467005423225.png\"></p><br><p><font style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\"><span style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; line-height: 20.3px;\">작다고 성능까지 낮을수는 없죠!!<br style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\"></span></font></p><br style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; line-height: 20.3px;\"><p align=\"left\" style=\"margin-bottom: 0pt; line-height: 19.2pt;\"><span lang=\"EN-US\" style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; font-size: 12pt;\">1GHz&nbsp;</span><span style=\"font-family: 나눔고딕; letter-spacing: -0.4pt; font-size: 12pt;\">프로세서<span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\">,&nbsp;</span>그래픽 칩<span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\">, 512MB RAM, 4GB&nbsp;</span>메모리<span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\">,&nbsp;</span>와이파이와 블루투스<span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\">&nbsp;4.0</span>을 지원하고 있어서 기본적으로&nbsp;<span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\">PC</span>가 할 수 있는 거의 모두 기능을 할 수 있을 뿐만 아니라 휴대성도 뛰어납니다<span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif;\">.</span></span></p><br><br><span lang=\"EN-US\" style=\"letter-spacing: -0.4pt; font-family: 나눔고딕; font-size: 12pt;\"></span><img src=\"/data/project/null/attach/u3_1467005919020.png\"><br><br><p><img src=\"/data/project/null/attach/u3_1467005945518.png\" style=\"line-height: 1.45em;\"></p><p><span style=\"font-family: 나눔고딕; font-size: 16px; letter-spacing: -0.533333px; line-height: 19.6px;\">이 녀석과 </span><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; font-size: 16px; line-height: 19.6px;\">HDMI</span><span style=\"font-family: 나눔고딕; font-size: 16px; letter-spacing: -0.533333px; line-height: 19.6px;\">와&nbsp;</span><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; font-size: 16px; line-height: 19.6px;\">VGA를&nbsp;</span><span style=\"font-family: 나눔고딕; font-size: 16px; letter-spacing: -0.533333px; line-height: 19.6px;\">&nbsp;각종 모니터 또는&nbsp;</span><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; font-size: 16px; line-height: 19.6px;\">TV</span><span style=\"font-family: 나눔고딕; font-size: 16px; letter-spacing: -0.533333px; line-height: 19.6px;\">와 연결하여 큰 화면으로 디스플레이 된 형태로 사용할 수 있습니다</span><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; font-size: 16px; line-height: 19.6px;\">. 또한&nbsp;</span><span style=\"font-family: 나눔고딕; font-size: 16px; letter-spacing: -0.533333px; line-height: 19.6px;\">무선 키보드와 무선 마우스를 연결하면 웹 서핑과 문서 작성을 할 수 있고</span><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; font-size: 16px; line-height: 19.6px;\">,&nbsp;</span><span style=\"font-family: 나눔고딕; font-size: 16px; letter-spacing: -0.533333px; line-height: 19.6px;\">게임 컨트롤러를 연결하면 다양한 게임을 즐길 수 있습니다</span><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; font-size: 16px; line-height: 19.6px;\">. MIDI&nbsp;</span><span style=\"font-family: 나눔고딕; font-size: 16px; letter-spacing: -0.533333px; line-height: 19.6px;\">키보드와 스피커를 연결하면 연주뿐만 아니라 음악을 듣는데도 사용할 수도 있습니다</span><span lang=\"EN-US\" style=\"font-family: &quot;Spoqa Han Sans&quot;, sans-serif; font-size: 16px; line-height: 19.6px;\">. &nbsp;웬만한 PC의 역할을 하고도 남을 녀석이죠!!</span></p><br><img src=\"/data/project/null/attach/u3_1467006025816.png\"><br><p><img src=\"/data/project/null/attach/u3_1467006034115.png\"><br><br><br>&nbsp;</p><p align=\"left\" style=\"line-height: 19.2pt; margin-bottom: 0pt; -ms-word-break: keep-all;\"><span style=\"letter-spacing: -0.4pt; font-family: 나눔고딕; font-size: 12pt;\"><span lang=\"EN-US\"><br><br></span></span><img src=\"/data/project/null/attach/u3_1467006215203.png\"></p><br><p align=\"left\" style=\"line-height: 19.2pt; margin-bottom: 0pt; -ms-word-break: keep-all;\"><img src=\"/data/project/null/attach/u3_1467006225298.png\"></p><p align=\"left\" style=\"line-height: 19.2pt; margin-bottom: 0pt; -ms-word-break: keep-all;\"><img src=\"/data/project/null/attach/u3_1467006240278.png\"></p><br><p align=\"left\" style=\"line-height: 19.2pt; margin-bottom: 0pt; -ms-word-break: keep-all;\"><img src=\"/data/project/null/attach/u3_1467006250138.png\"></p><p align=\"left\" style=\"line-height: 19.2pt; margin-bottom: 0pt; -ms-word-break: keep-all;\"><img src=\"/data/project/null/attach/u3_1467006276201.png\"></p><p align=\"left\" style=\"line-height: 19.2pt; margin-bottom: 0pt; -ms-word-break: keep-all;\"><span style=\"font-family: 나눔고딕; font-size: 12pt; letter-spacing: -0.4pt; line-height: 19.2pt; background-color: initial;\">무료 게임도 가능합니다!! 칩은 오픈소스 기반의 자체 운영체제와 공개되어 있는</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 19.2pt; background-color: initial;\"> 1000</span><span style=\"font-family: 나눔고딕; font-size: 12pt; letter-spacing: -0.4pt; line-height: 19.2pt; background-color: initial;\">여개 이상의 어플리케이션을 무료로 사용할 수 있어서 각 개인의 사용 용도에 맞게 얼마든지 변형해서 사용할 수 있는 점은 큰 장점으로 보입니다</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 19.2pt; background-color: initial;\">.</span></p><img src=\"/data/project/null/attach/u3_1467006340323.png\"><br><br><span lang=\"EN-US\" style=\"letter-spacing: -0.4pt; font-family: 나눔고딕; font-size: 12pt;\"></span>&nbsp;<p align=\"left\" style=\"line-height: 19.2pt; margin-bottom: 0pt; -ms-word-break: keep-all;\"><span style=\"letter-spacing: -0.4pt; font-family: 나눔고딕; font-size: 12pt;\">또한 칩을 <span lang=\"EN-US\">4.3</span>인치 터치스크린이 장착된 휴대용 포켓 칩에 끼어서 사용하면 휴대용 <span lang=\"EN-US\">PC</span>로 사용할 수 있습니다<span lang=\"EN-US\">. </span>이 포켓 칩은 <span lang=\"EN-US\">300mAH </span>배터리<span lang=\"EN-US\">(5</span>시간 사용가능<span lang=\"EN-US\">)</span>와 <span lang=\"EN-US\">QWERTY </span>키보드<span lang=\"EN-US\">, GPIO</span>로 구성되어 있는 포켓 사이즈의 케이스입니다<span lang=\"EN-US\">.</span></span></p><img src=\"/data/project/null/attach/u3_1467006424158.png\"><br><br><p>C.H.I.P.은 오픈 소스 기반의 하드웨어로서, 계속 진화된 모습을 보여 줄 것을 기대합니다.</p><p>Source: <a href=\"https://www.kickstarter.com/projects/1598272670/chip-the-worlds-first-9-computer/description\" target=\"_blank\">https://www.kickstarter.com/projects/1598272670/chip-the-worlds-first-9-computer/description</a></p><p><br></p>','Y','2016-06-27 00:00:01',483),(10,'3 in 1 스마트 텀블러 Golchi','u3_1468229651855.png','Version 1.0','제품 Review','','뜨겁거나 차갑거나 혹은 둘다 가져라','<p>Golchi(골치) - 세계에서 가장 다재다능한 텀블러</p><p><a class=\"se_mediaArea __se_image_link __se_link\" href=\"http://blog.naver.com/PostView.nhn?blogId=ozr_kr&amp;logNo=220753873873&amp;categoryNo=9&amp;parentCategoryNo=-1&amp;viewDate=&amp;currentPage=&amp;postListTopCurrentPage=&amp;isAfterWrite=true#\" _cssquery_uid=\"49\" data-linkdata=\"{&quot;imgId&quot; : &quot;SEDOC-1467691084366-1719067782_image_0_img&quot;, &quot;src&quot; : &quot;http://postfiles13.naver.net/20160705_140/ozr_kr_1467677908563mWjwT_PNG/Golchi_1.png?type=w773&quot;, &quot;linkUse&quot; : &quot;false&quot;,&quot;link&quot; : &quot;&quot;}\" data-linktype=\"img\" style=\"line-height: 1.5;\"><img id=\"SEDOC-1467691084366-1719067782_image_0_img\" class=\"se_mediaImage __se_img_el\" alt=\"\" src=\"http://postfiles13.naver.net/20160705_140/ozr_kr_1467677908563mWjwT_PNG/Golchi_1.png?type=w773\" width=\"680\" height=\"425\" data-attachment-id=\"IOmRTKHHMdfT3vKxVXktQdTLzaOE\"></a></p><div class=\"se_component se_paragraph default\">\r\n<div class=\"se_sectionArea\">\r\n<div class=\"se_editArea\">\r\n<div class=\"se_viewArea se_ff_nanumgothic se_fs_T3 se_align-left\" style=\"LINE-HEIGHT: 230%\">\r\n<div class=\"se_editView\">\r\n<div class=\"se_textView\">\r\n<p class=\"se_textarea\"><!-- SE3-TEXT { -->&nbsp;새로운 제품을 보다보면, 저는 불편한걸 느끼지 못한 제품인데 누군가는 불편하다고 이의(?)를 제기하고 그걸 멋지게 바꿔놓는 제품을 종종 보게 됩니다. 오늘 소개해드릴 Golchi라는 텀블러가 바로 그런 제품 같습니다. 저에게는 그저 뜨거운 물, 차가운 물 한가지를 담기 위한 목적이 텀블러였는데 Golchi는 \"너 다가질 수 있어!. 욕심을 가져\" 라고 소심한 저에게 말해주는 것 같습니다.<br><br><!-- } SE3-TEXT --></p></div></div></div></div></div></div><div class=\"se_component se_image default\">\r\n<div class=\"se_sectionArea se_align-left\">\r\n<div class=\"se_editArea\">\r\n<div class=\"se_viewArea\" style=\"MAX-WIDTH: 680px\"><a class=\"se_mediaArea __se_image_link __se_link\" href=\"http://blog.naver.com/PostView.nhn?blogId=ozr_kr&amp;logNo=220753873873&amp;categoryNo=9&amp;parentCategoryNo=-1&amp;viewDate=&amp;currentPage=&amp;postListTopCurrentPage=&amp;isAfterWrite=true#\" _cssquery_uid=\"52\" data-linkdata=\"{&quot;imgId&quot; : &quot;SEDOC-1467691084366-1719067782_image_1_img&quot;, &quot;src&quot; : &quot;https://ksr-ugc.imgix.net/assets/011/249/372/2222bac7356a5047622ea0a8e04662a6_original.gif?w=680&amp;fit=max&amp;v=1463610562&amp;q=92&amp;s=5cdd38de0e57d8c639e2246d37b11055&quot;, &quot;linkUse&quot; : &quot;false&quot;,&quot;link&quot; : &quot;&quot;}\" data-linktype=\"img\"><img id=\"SEDOC-1467691084366-1719067782_image_1_img\" class=\"se_mediaImage __se_img_el\" alt=\"\" src=\"https://ksr-ugc.imgix.net/assets/011/249/372/2222bac7356a5047622ea0a8e04662a6_original.gif?w=680&amp;fit=max&amp;v=1463610562&amp;q=92&amp;s=5cdd38de0e57d8c639e2246d37b11055\" width=\"680\" height=\"383\" data-attachment-id=\"\"> </a></div></div></div></div><div class=\"se_component se_paragraph default\">\r\n<div class=\"se_sectionArea\">\r\n<div class=\"se_editArea\">\r\n<div class=\"se_viewArea se_ff_nanumgothic se_fs_T3 se_align-left\" style=\"LINE-HEIGHT: 230%\">\r\n<div class=\"se_editView\">\r\n<div class=\"se_textView\">\r\n<p class=\"se_textarea\"><!-- SE3-TEXT { --><span lang=\"EN-US\"><br>&nbsp;Golchi는 일반적인 \r\n텀블러처럼<span class=\"Apple-converted-space\">&nbsp;</span><span lang=\"EN-US\">1</span>단으로도<span lang=\"EN-US\">,<span class=\"Apple-converted-space\">&nbsp;</span></span>서로 다른 \r\n음료를 보관하기 위해서<span class=\"Apple-converted-space\">&nbsp;</span><span lang=\"EN-US\">3</span>단으로도 사용할 수 있는 \r\n장점이 있습니다<span lang=\"EN-US\">.</span><br>분리변신이 된다고 기본 기능을 소홀히 할 수는 없죠! 우선&nbsp;<span lang=\"EN-US\">두 개의 \r\n진공벽으로 뜨거운 음료는<span class=\"Apple-converted-space\">&nbsp;</span><span lang=\"EN-US\">12</span>시간<span lang=\"EN-US\">,<span class=\"Apple-converted-space\">&nbsp;</span></span>차가운 \r\n음료는<span class=\"Apple-converted-space\">&nbsp;</span><span lang=\"EN-US\">24</span>시간 동안 온도를 \r\n유지시켜줍니다<span lang=\"EN-US\">.<span class=\"Apple-converted-space\">&nbsp;</span></span>또한 여러 \r\n테스트를 걸쳐 만든<span class=\"Apple-converted-space\">&nbsp;</span><span lang=\"EN-US\">3</span>중 보호장치로 외부로 \r\n음료가 새지 않도록 해줍니다(긴장해라 락엔락)<span lang=\"EN-US\">.<span class=\"Apple-converted-space\">&nbsp;</span></span>마지막으로&nbsp;넓은 입구는 위생을 위한 필수!!<br></span></span><br><!-- } SE3-TEXT --></p></div></div></div></div></div></div><div class=\"se_component se_image default\">\r\n<div class=\"se_sectionArea se_align-left\">\r\n<div class=\"se_editArea\">\r\n<div class=\"se_viewArea\" style=\"MAX-WIDTH: 680px\"><a class=\"se_mediaArea __se_image_link __se_link\" href=\"http://blog.naver.com/PostView.nhn?blogId=ozr_kr&amp;logNo=220753873873&amp;categoryNo=9&amp;parentCategoryNo=-1&amp;viewDate=&amp;currentPage=&amp;postListTopCurrentPage=&amp;isAfterWrite=true#\" _cssquery_uid=\"54\" data-linkdata=\"{&quot;imgId&quot; : &quot;SEDOC-1467691084366-1719067782_image_2_img&quot;, &quot;src&quot; : &quot;https://ksr-ugc.imgix.net/assets/011/249/390/6556ab48edb686e2136468e2cb37f8bf_original.gif?w=680&amp;fit=max&amp;v=1463610730&amp;q=92&amp;s=48f477ebef5d1922a89eff7c37bd517d&quot;, &quot;linkUse&quot; : &quot;false&quot;,&quot;link&quot; : &quot;&quot;}\" data-linktype=\"img\"><img id=\"SEDOC-1467691084366-1719067782_image_2_img\" class=\"se_mediaImage __se_img_el\" alt=\"\" src=\"https://ksr-ugc.imgix.net/assets/011/249/390/6556ab48edb686e2136468e2cb37f8bf_original.gif?w=680&amp;fit=max&amp;v=1463610730&amp;q=92&amp;s=48f477ebef5d1922a89eff7c37bd517d\" width=\"680\" height=\"383\" data-attachment-id=\"\"> </a></div></div></div></div><div class=\"se_component se_paragraph default\">\r\n<div class=\"se_sectionArea\">\r\n<div class=\"se_editArea\">\r\n<div class=\"se_viewArea se_ff_nanumgothic se_fs_T3 se_align-left\" style=\"LINE-HEIGHT: 230%\">\r\n<div class=\"se_editView\">\r\n<div class=\"se_textView\">\r\n<p class=\"se_textarea\"><!-- SE3-TEXT { --><br>&nbsp;높이는 \r\n약&nbsp;<span lang=\"EN-US\">29 cm(11.3</span>인치<span lang=\"EN-US\">)</span>이고 두 개의 냉음료 \r\n통은&nbsp;<span lang=\"EN-US\">300 ml(11 Oz), 380 ml(13 Oz)</span>의 냉온음료를 보관하여 마실 수 있어서 넉넉한 용량을 갖고 있네요. 그리고 중간에 \r\n통은&nbsp;<span lang=\"EN-US\">100 ml(3.25 Oz)로 활용할 수 있습니다.<br></span><span lang=\"EN-US\"><br></span><span lang=\"EN-US\"></span><!-- } SE3-TEXT --></p></div></div></div></div></div></div><div class=\"se_component se_image default\">\r\n<div class=\"se_sectionArea se_align-left\">\r\n<div class=\"se_editArea\">\r\n<div class=\"se_viewArea\" style=\"MAX-WIDTH: 679px\"><a class=\"se_mediaArea __se_image_link __se_link\" href=\"http://blog.naver.com/PostView.nhn?blogId=ozr_kr&amp;logNo=220753873873&amp;categoryNo=9&amp;parentCategoryNo=-1&amp;viewDate=&amp;currentPage=&amp;postListTopCurrentPage=&amp;isAfterWrite=true#\" _cssquery_uid=\"55\" data-linkdata=\"{&quot;imgId&quot; : &quot;SEDOC-1467691084366-1719067782_image_3_img&quot;, &quot;src&quot; : &quot;https://ksr-ugc.imgix.net/assets/012/936/927/e6804a23300d0522d8a9fbb20b465fdb_original.png?w=680&amp;fit=max&amp;v=1467487838&amp;auto=format&amp;lossless=true&amp;s=1811b0db589d21c3511d3afd02d3cc07&quot;, &quot;linkUse&quot; : &quot;false&quot;,&quot;link&quot; : &quot;&quot;}\" data-linktype=\"img\"><img id=\"SEDOC-1467691084366-1719067782_image_3_img\" class=\"se_mediaImage __se_img_el\" alt=\"\" src=\"https://ksr-ugc.imgix.net/assets/012/936/927/e6804a23300d0522d8a9fbb20b465fdb_original.png?w=680&amp;fit=max&amp;v=1467487838&amp;auto=format&amp;lossless=true&amp;s=1811b0db589d21c3511d3afd02d3cc07\" width=\"679\" height=\"478\" data-attachment-id=\"\"> </a></div></div></div></div><div class=\"se_component se_paragraph default\">\r\n<div class=\"se_sectionArea\">\r\n<div class=\"se_editArea\">\r\n<div class=\"se_viewArea se_ff_nanumgothic se_fs_T3 se_align-left\" style=\"LINE-HEIGHT: 230%\">\r\n<div class=\"se_editView\">\r\n<div class=\"se_textView\">\r\n<p class=\"se_textarea\"><!-- SE3-TEXT { --><span lang=\"EN-US\"><br>&nbsp;킥스타터에 나와 있듯이 아기를 키우시는 부모님들은 뜨거운 물과 차가운 물을 동시에 갖고 다니실 수 있어 편리할 것 같습니다. 그리고 생뚱맞게 TRAVEL에도 잘 맞다고 되어있는데... 잘 모르겠군요^^</span><br><br><!-- } SE3-TEXT --></p></div></di