함께 LP의 세계로 빠져보는건 어떨까요?</span></font></div><div><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><span style=\"line-height: 30.4px; background-color: rgb(255, 255, 255);\"><img src=\"/data/smarteditor/attach/u435_1470728918476.jpg\" title=\"u435_1470728918476.jpg\"><br style=\"clear:both;\"></span></font><span style=\"font-family: 나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei; line-height: 30.4px; background-color: rgb(255, 255, 255);\">사용법은 매우 간단합니다.</span><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><span style=\"line-height: 30.4px; background-color: rgb(255, 255, 255);\"><br></span></font></div><div><span style=\"background-color: rgb(255, 255, 255);\"><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><div style=\"line-height: 30.4px;\">Spinbox 턴테이블 위에 LP판을 올려놓기만 하면 끝.</div><div style=\"line-height: 30.4px;\">하나 \'Spinbox\'가 다른 턴테이블과 다른점이 있다면 DIY가 가능하다는 것입니다.</div><div style=\"line-height: 30.4px;\"><br></div><div style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470728954851.jpg\" title=\"u435_1470728954851.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470728962680.jpg\" title=\"u435_1470728962680.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470728979552.gif\" title=\"u435_1470728979552.gif\"><br style=\"clear:both;\"><iframe width=\"100%\" height=\"390\" src=\"https://www.youtube.com/embed/kNjpAPrEXBg\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<br></div><div><div><span style=\"line-height: 30.4px;\"><br></span></div><div><span style=\"line-height: 30.4px;\">Spinbox는 드라이버 하나만 있다면,</span></div><div><span style=\"line-height: 30.4px;\">간단하게 조립이 가능합니다.<img src=\"/data/smarteditor/attach/u435_1470729207707.jpg\" title=\"u435_1470729207707.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470729219671.jpg\" title=\"u435_1470729219671.jpg\"><br style=\"clear:both;\"></span></div></div></font></span></div><iframe width=\"100%\" height=\"390\" src=\"https://www.youtube.com/embed/GZr8p2JVlWA\" frameborder=\"0\" allowfullscreen=\"\"></iframe><div><div><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><span style=\"line-height: 30.4px;\"><br></span></font></div><div><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><span style=\"line-height: 30.4px;\">동영상처럼 한번만 살짝 돌려주면 LP판이 돌아가면서 바로 음악을 들을 수 있습니다.</span></font></div><div><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><span style=\"line-height: 30.4px;\"><br></span></font></div><div><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><span style=\"line-height: 30.4px;\">기본색상은 두가지로 아래와 같습니다. 그리고 대리석으로 만든 제품도 있군요.</span></font></div></div><div><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><span style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470729291379.gif\" title=\"u435_1470729291379.gif\"><br style=\"clear:both;\"><br></span></font></div><div><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><span style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470729272074.jpg\" title=\"u435_1470729272074.jpg\"><br style=\"clear:both;\"><br></span></font></div><div><font face=\"나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei\"><div><span style=\"line-height: 30.4px;\">제품의 설정은 크게 세가지로 가능한데요,</span></div><div><span style=\"line-height: 30.4px;\">① SPEED : LP재생 속도는 33rpm, 45rpm, 78rpm 세 가지 속도로 설정이 가능합니다.</span></div><div><span style=\"line-height: 30.4px;\">② AUTO STOP : LP를 자동으로 재생하고 멈추는 기능을 합니다.</span></div><div><span style=\"line-height: 30.4px;\">③ TONERARM LIFTER : 이를 통해 톤암 레버를 들어올려 조정이 가능합니다.</span></div><div><span style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470729361114.jpg\" title=\"u435_1470729361114.jpg\"></span><br style=\"clear:both;\"><span style=\"line-height: 30.4px;\"><br></span></div><div><span style=\"line-height: 30.4px;\">Spinbox는 7inch, 10inch, 12inch, 세가지 크기의 LP Record가 재생이 가능합니다.</span><br></div><div><span style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470729387755.gif\" title=\"u435_1470729387755.gif\"></span><br style=\"clear:both;\"><div><span style=\"line-height: 30.4px;\">제품은 종이로 제작되었는데요, APPLE 제품의 포장에 들어가는 내구성이 높은 하드커버로 만들어졌다고 합니다.</span></div><div><span style=\"line-height: 30.4px;\">아래 동영상을 보면 기본적인 생활방수 정도 지원이 되는듯 합니다.</span></div><iframe width=\"100%\" height=\"390\" src=\"https://www.youtube.com/embed/6YxEXlpw_Oo\" frameborder=\"0\" allowfullscreen=\"\"></iframe><div style=\"line-height: 30.4px;\"><br></div><div style=\"line-height: 30.4px;\">콘센트를 이용한 전원공급 이외에도 간단하게 보조배터리로도 사용이 가능합니다.</div></div><div><span style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470729453370.gif\" title=\"u435_1470729453370.gif\"></span><br style=\"clear:both;\"><span style=\"line-height: 30.4px;\"><br></span></div><div><span style=\"line-height: 30.4px;\">Spinbox는 내장 된 3.5mm 표준 오디오 출력 이외에도 헤드폰이나 스피커를 연결하여 음악을 들을 수 있습니다.</span><br></div><div><span style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470729480580.jpg\" title=\"u435_1470729480580.jpg\"><br style=\"clear:both;\"><br></span></div><div><div><span style=\"line-height: 30.4px;\">Spinbox의 또 하나의 장점은 LP를 재상하지 않을 때는 스마트폰과 연결하여 스피커로도 이용이 가능합니다.</span></div><div><span style=\"line-height: 30.4px;\">일반 스피커처럼 말이죠.</span></div></div><div><span style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470729501067.jpg\" title=\"u435_1470729501067.jpg\"><br style=\"clear:both;\"><br></span></div><div><span style=\"line-height: 30.4px;\"><img src=\"/data/smarteditor/attach/u435_1470729513224.jpg\" title=\"u435_1470729513224.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470729522147.jpg\" title=\"u435_1470729522147.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470729525728.jpg\" title=\"u435_1470729525728.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470729531780.jpg\" title=\"u435_1470729531780.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470729546832.jpg\" title=\"u435_1470729546832.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470729554532.jpg\" title=\"u435_1470729554532.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470729559440.jpg\" title=\"u435_1470729559440.jpg\"><br style=\"clear:both;\"><br></span></div><div><br></div><div style=\"text-align: center;\" align=\"center\"><span style=\"line-height: 30.4px;\">어때요, 갑자기 LP판으로 음악 한 곡 듣고싶지 않으세요?</span></div><div style=\"text-align: center;\" align=\"center\"><span style=\"line-height: 30.4px;\"><br></span></div><div style=\"text-align: center;\" align=\"center\"><span style=\"line-height: 30.4px;\"><br></span></div><div></div></font></div>','Y','2016-08-09 00:00:01',691),(13,'Petcube Bites & Play - 마음의 짐을 조금은 덜어줄 애완(반려)동물을 위한 아이템','u435_1470791378630.png','version 1.0','제품 Review','애완동물, 반려동물, 애완견, 애완묘, 장난감, 간식주기, Petcube, petcubebites, petcubeplay','애완(반려)동물을 혼자 집에두고 자리를 비울 수 있겠다!','<p>\'개나 고양이를 키우고 싶은데, 출근을 하거나 집을 비우면 혼자 살아서 동물을 방치하는 것 같아 마음이 무거워...\'</p><p>&nbsp;</p><p>라고 생각한다면,</p><p>당신의 마음의 짐을 조금은 덜어줄 애완(반려)동물을 위한 아이템인</p><p>Petcube Bites와 Petcube Play를 소개합니다.</p><p><img src=\"/data/smarteditor/attach/u435_1470790298461.png\" title=\"u435_1470790298461.png\" style=\"line-height: 1.5;\">&nbsp;</p><p>&nbsp;</p><p>요즘은 1인 가구도 많아지고,</p><p>아이를 낳지 않는 가구도 많아짐에 따라 애완(반려)동물을 키우는 사람들이 부쩍 늘어나고 있습니다.</p><p>&nbsp;</p><p>실제로 아래 통계청 자료를 참조하면&nbsp;관련소비가 확실히 눈에 띄게 증가함에 따라 애완(반려)동물을 키우는 가구도 늘어나고 있다고 추측할 수 있는데요,</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470790346665.jpg\" title=\"u435_1470790346665.jpg\"></p><p>&nbsp;</p><p>이런 애완(반려)동물에 대해 집을 비우게되면 걱정이 많이 하게됩니다.</p><p>하지만 이 아이템들 이라면 걱정을 조금은 덜게 될것 같습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><span style=\"font-weight: 600; color: rgb(0, 175, 239); font-family: 나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei; font-size: 19px; line-height: 36.1px; background-color: rgb(255, 255, 255);\">먼저 소개할 제품은 \'Petcube Bites\'입니다.</span>&nbsp;</p><p><span style=\"font-weight: 600; color: rgb(0, 175, 239); font-family: 나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei; font-size: 19px; line-height: 36.1px; background-color: rgb(255, 255, 255);\">&nbsp;</span></p><p>Petcube Bites는 애완(반려)동물에게 간식(밥)을 줄 수 있는 기능을 가지고 있는데요</p><p>&nbsp;</p><p>어떻게 주냐면...?</p><p>&nbsp;</p><p>이렇게 통에 간식을 넣기만 하면 끝입니다.</p><p><img src=\"/data/smarteditor/attach/u435_1470790496229.gif\" title=\"u435_1470790496229.gif\"></p><p>&nbsp;</p><p>넣기만 하고 스마트폰으로 설정을 하면 간식(밥)이 쏙쏙! 튀어나옵니다.</p><p>바로 이렇게요.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470790544785.gif\" title=\"u435_1470790544785.gif\"></p><p>&nbsp;</p><p>블루투스 연결을 통해 주인의 목소리로 애완(반려)동물을 불러낼 수 있습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470790583876.png\" title=\"u435_1470790583876.png\"><br style=\"clear:both;\"><br>최대 1인치 사이즈 100개 정도 들어간다고 하니</p><p>하루 이틀 집을 비울시에는 충분할 것 같습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470790639416.png\" title=\"u435_1470790639416.png\"></p><p>&nbsp;</p><p><span style=\"font-weight: 600; color: rgb(0, 175, 239); font-family: 나눔고딕, nanumgothic, se_NanumGothic, AppleSDGothicNeo-Regular, sans-serif, simhei; font-size: 19px; line-height: 36.1px; background-color: rgb(255, 255, 255);\">두번째 제품은 \'Petcube Play\'입니다.</span><br style=\"clear:both;\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470790685827.png\" title=\"u435_1470790685827.png\"><br style=\"clear:both;\">&nbsp;</p><p>Petcube bites와는 다르게 정육면체로 보입니다.</p><p>&nbsp;</p><p>Petcube Play는 애완(반려)동물과 레이저 포인트로 놀아주는 기능을 가지고 있습니다.</p><p>바로 이렇게 말이죠.</p><p><img src=\"/data/smarteditor/attach/u435_1470790725632.gif\" title=\"u435_1470790725632.gif\"><br style=\"clear:both;\">&nbsp;</p><p>심지어 레이저는 스마트폰을 통하여 손가락으로 조종이 가능하다고 합니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470791098846.png\" title=\"u435_1470791098846.png\"></p><p><img src=\"/data/smarteditor/attach/u435_1470791113778.png\" title=\"u435_1470791113778.png\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>Petcube Bites와 Petcube Play 모두 카메라가 있어&nbsp;</p><p>스마트폰 APP을 통하여 애완(반려)동물의 상태를 지켜볼 수 있습니다.<img src=\"/data/smarteditor/attach/u435_1470791133230.png\" title=\"u435_1470791133230.png\" style=\"line-height: 1.5;\"></p><p>&nbsp;</p><p>또한 Night Vision 모드로 어두운 밤에도 확인이 가능합니다.</p><p><img src=\"/data/smarteditor/attach/u435_1470791199643.gif\" title=\"u435_1470791199643.gif\"></p><p>&nbsp;</p><p>&nbsp;</p><p>Petcube Bites, Petcube Play 두 제품의 차이점은</p><p>&nbsp;</p><p>Bites는 간식(밥)을 줄 수 있는 기능이 있다는 것</p><p>Play는 레이저 포인터로 놀아줄 수 있는 기능이 있다는거죠.</p><p>&nbsp;</p><p>&nbsp;</p><p><span style=\"color: rgb(102, 102, 102); font-family: 나눔명조, nanummyeongjo, se_NanumMyeongjo, serif, simsun; font-size: 19px; font-style: italic; line-height: 32.3px; text-align: center; background-color: rgb(255, 255, 255);\">하루 이틀정도 집을 비워도 마음이 조금은 편하지 않을까요?</span>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','Y','2016-08-10 00:00:01',256),(14,'나무크레용 - 우리 주위에 존재하는 나무들을 색으로 만나다.','u435_1470813236377.jpg','version 1.0','제품 Review','크레용, 식물성왁스, 천연 콩 왁스, 크라우드펀딩, 대만, 나무모양 크레용, 나무크레용','우리 주위 자연의 색상을 가득 머금은 크레용, 보기만 해도 예쁘다.','<p><iframe width=\"100%\" height=\"354\" src=\"https://www.youtube.com/embed/kgGm4PTeiJw\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p><p>&nbsp;</p><p>이 제품은 나무의 모양을 본 떠 만든 나무크레용입니다.</p><p>&nbsp;</p><p>이 나무크레용의 특징은 나무의 모양으로 만들어 졌다는 것과&nbsp;<span style=\"line-height: 1.5;\">나무들의 색상을 표현하여 만들었다는 점입니다.</span></p><p>&nbsp;</p><p>각각의 나무크레용은 대만에 있는 나무들의 색상을, 일부는 나뭇잎의 색상을, 또 일부는 꽃잎의 색상을 따라서 만들었다고 합니다.</p><p>&nbsp;</p><p><img title=\"u435_1470811340724.jpg\" src=\"/data/smarteditor/attach/u435_1470811340724.jpg\"><br style=\"clear: both;\"><img title=\"u435_1470811367174.jpg\" src=\"/data/smarteditor/attach/u435_1470811367174.jpg\"><br style=\"clear: both;\">&nbsp;</p><p><iframe width=\"100%\" height=\"332\" src=\"https://www.youtube.com/embed/Yvg6JRO5yVo\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p><p>&nbsp;</p><p>&nbsp;</p><p>크레용의 색상은 Warm tone(따뜻한)과 Cool tone(시원한)의 두 가지로 나뉘어집니다.</p><p>&nbsp;</p><p>박스로 포장되어&nbsp;<span style=\"line-height: 1.5;\">신축성 있는 밴드로 고정되어집니다.</span></p><p>박스에는 나무모양으로 음각처리되어 있네요.</p><p>&nbsp;</p><p><img title=\"u435_1470811519292.jpg\" src=\"/data/smarteditor/attach/u435_1470811519292.jpg\"></p><p>&nbsp;</p><p>&nbsp;</p><p>아래 그림에는 여러가지 색상을 활용하여 각각의 나무크레용으로 자신이 생각하는 각기 다른 나무를 그릴 수 있겠네요,</p><p>&nbsp;</p><p><img title=\"u435_1470812316057.jpg\" src=\"/data/smarteditor/attach/u435_1470812316057.jpg\"><br style=\"clear: both;\">&nbsp;</p><p>&nbsp;</p><p>이 나무 크레용으로 그려진 그림들을 보면&nbsp;</p><p>굉장히 느낌이 있어보입니다.</p><p>&nbsp;</p><p><img title=\"u435_1470811766022.jpg\" src=\"/data/smarteditor/attach/u435_1470811766022.jpg\"></p><p><img title=\"u435_1470812107720.jpg\" src=\"/data/smarteditor/attach/u435_1470812107720.jpg\"><br style=\"clear: both;\"><img title=\"u435_1470812111963.jpg\" src=\"/data/smarteditor/attach/u435_1470812111963.jpg\"><br style=\"clear: both;\"><img title=\"u435_1470812135184.jpg\" src=\"/data/smarteditor/attach/u435_1470812135184.jpg\"><br style=\"clear: both;\">&nbsp;</p><p>&nbsp;</p><p>아래 사진을 보면 색상별로</p><p>어떤 나무나 꽃 혹은 풀에서 색을 가져왔는지 나와 있습니다.</p><p>&nbsp;</p><p><img title=\"u435_1470812679159.jpg\" src=\"/data/smarteditor/attach/u435_1470812679159.jpg\"><br style=\"clear: both;\">&nbsp;</p><p><img title=\"u435_1470812400676.jpg\" src=\"/data/smarteditor/attach/u435_1470812400676.jpg\"></p><p><br style=\"clear: both;\"><img title=\"u435_1470812405841.jpg\" src=\"/data/smarteditor/attach/u435_1470812405841.jpg\"><br style=\"clear: both;\"><br><br style=\"clear: both;\"><img title=\"u435_1470812418142.jpg\" src=\"/data/smarteditor/attach/u435_1470812418142.jpg\"><br style=\"clear: both;\">&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470876220992.jpg\" title=\"u435_1470876220992.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>아, 그렇다고 이 나무크레용이&nbsp;<span style=\"line-height: 1.5;\">나무로 만들어진 것은 아닙니다.</span></p><p>&nbsp;</p><p>나무크레용은&nbsp;<span style=\"line-height: 1.5;\">대만에서 SGS 검사를 받았으며,</span></p><p>피부나 인체에 해가되지 않는 콩으로 만든 천연 식물성 왁스로 만들어졌다고 합니다.</p><p>&nbsp;</p><p>느낌있는 그림 하나 그려보시는건 어떨까요?</p><p>&nbsp;</p>','Y','2016-08-10 00:00:01',195),(15,'Wristocat - 공중부양 손목받침대','u435_1470891711491.png','version 1.0','제품 Review','공중부양손목받침대, 공중부양, 손목받침대, 터널증후군, 크라우드펀딩, 인디고고','열심히 일하는 직원들에게 하나씩 선물해주실 마음 따뜻한 대표님께 바칩니다.','<p><img src=\"/data/smarteditor/attach/u435_1470891151802.png\" title=\"u435_1470891151802.png\"></p><p>&nbsp;</p><p>얼핏보면 마우스가 공중에 떠 있는 모습같습니다만</p><p>이 제품은 마우스는 아닙니다.</p><p>&nbsp;</p><p>공중에 둥둥 떠 있어서 UFO를 연상시키는 이 아이템의 정체는 여러분의 손목을 편안하게 만들어줄 공중부양(?) 손목 받침대 입니다</p><p>현재 인디고고에서 펀딩이 완료되었으며 16년 9월에 배송예정이라고 합니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>제품이&nbsp;<span style=\"line-height: 1.5;\">어떻게 쓰는지 아래 사진을 참고 하시기 바랍니다.</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><img src=\"/data/smarteditor/attach/u435_1470891270971.gif\" title=\"u435_1470891270971.gif\"><br style=\"clear:both;\">&nbsp;</p><p>얼핏 보면 자기부상 열차가 생각나기도 합니다.</p><p>이 제품은 양극의 자석을 활용하여 만들어진 제품인데요,</p><p>\'Wristocat\'이라는 이름이 붙은 이유는 아래 그림과 같이 고양이가 쥐(mouse)를 잡으러 가는 모양을 연상시키기 때문이라고 합니다.</p><p><img src=\"/data/smarteditor/attach/u435_1470891368020.gif\" title=\"u435_1470891368020.gif\"></p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470891390563.gif\" title=\"u435_1470891390563.gif\"><br style=\"clear:both;\"><br><br><br>실제로 제품을 사용하면 이런 느낌일 것 같습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470891407644.gif\" title=\"u435_1470891407644.gif\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470891412138.gif\" title=\"u435_1470891412138.gif\"><br style=\"clear:both;\"><br>키보드나 마우스 이외에도 책상에서 다양하게 사용이 가능할 것 같습니다.</p><p>&nbsp;</p><p>책상 모서리에 손목을 올려도 되지 않으니 나름대로 괜찮을지도 모르겠네요.</p><p>&nbsp;</p><p>어때요? 터널증후군을 극복하고&nbsp;<span style=\"line-height: 1.5;\">소중한 내 손목을 위해 하나정도 구비해도 좋지 않을까요?</span></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>.</p><p>&nbsp;</p>','Y','2016-08-11 00:00:01',423),(16,'OvRcharge - 스마트폰 공중부양 무선 충전기','u435_1470897975000.jpg','version 1.0','제품 Review','공중부양충전기, 무선충전기, 공중부양충전, 스마트폰충전기, 킥스타터, 크라우드펀딩','언젠가는 별다방에서 핸드폰 수십대가 공중에 떠 있는 모습을 볼 수 있지 않을까?','<p><img src=\"/data/smarteditor/attach/u435_1470895848124.jpg\" title=\"u435_1470895848124.jpg\"></p><p>&nbsp;</p><p>요즘은 공중에 뜨는게 유행인걸까요?</p><p>&nbsp;</p><p>이 제품은 간단하게 설졍하자면</p><p>\'스마트폰 공중부양 무선 충전기\' 입니다.</p><p>&nbsp;</p><p>저렇게 아래 사진처럼 무언가 잡지 않아도 정말로 뜹니다.</p><p>물론, 공중에 뜬다는거죠.</p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470895915944.jpg\" title=\"u435_1470895915944.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>아래 영상을 한 번 참고하시기 바랍니다.</p><p>&nbsp;</p><p><iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/OKtuwJUi1WU\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p><p>&nbsp;</p><p>&nbsp;</p><p>물론 그냥 떠서 빙글빙글 돌아가는건 아닙니다.</p><p>무려, 둥둥 떠서 스마트폰 충전이 가능하다는거죠.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470896025243.gif\" title=\"u435_1470896025243.gif\"></p><p>&nbsp;</p><p>이 제품의 이름은 \'OvRcharge\' 입니다.</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470896184393.gif\" title=\"u435_1470896184393.gif\"></p><p>손실을 최소화 하기 위한 고품질의 Copper를 사용했다고 하네요.</p><p>&nbsp;</p><p>&nbsp;</p><p>제품은 아래 사진과 같이 충전을 위한 나무박스(?)와 스마트폰 케이스, 그리고 냉장고에 흔히 붙어있을 법한 조그만 자석으로 구성되어 있습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470896482811.jpg\" title=\"u435_1470896482811.jpg\"></p><p><img src=\"/data/smarteditor/attach/u435_1470897330009.png\" title=\"u435_1470897330009.png\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1470896312667.jpg\" title=\"u435_1470896312667.jpg\"></p><p>나무상자(?) 처럼 생긴 베이스 위에 저 조그만 자석을 잘 띄우면 자석으로 서로 밀어내며 균형을 잡는 구조입니다.</p><p>그래서 아래 사진처럼 스마트폰이 공중부양을 할 수 있는거죠.<br style=\"clear:both;\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470897268766.jpg\" title=\"u435_1470897268766.jpg\"></p><p>&nbsp;</p><p>스마트폰만 띄울 수 있냐면?</p><p>아닙니다.</p><p>&nbsp;</p><p><span style=\"color: rgb(61, 61, 102); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Liberation Sans&quot;, FreeSans, sans-serif; font-size: 14px; font-style: italic; line-height: 20px; text-align: center; background-color: rgb(255, 255, 255);\">10.1\"</span><span style=\"color: rgb(61, 61, 102); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Liberation Sans&quot;, FreeSans, sans-serif; font-size: 14px; font-style: italic; line-height: 20px; text-align: center; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;</span>태블릿도 띄울 수 있습니다.</p><p>바로 이렇게요.</p><p><img src=\"/data/smarteditor/attach/u435_1470897532639.gif\" title=\"u435_1470897532639.gif\"><br style=\"clear:both;\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1470897744705.jpg\" title=\"u435_1470897744705.jpg\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>OvRcharge가 사용 가능한 기계들은 아래와 같습니다.</p><p>&nbsp;</p><p>- Apple</p><p>Iphone 6,6s, Iphone 6Plus, 6s Plus, Iphone 5,5S, IPhone 5C, Iphone SE</p><p>&nbsp;</p><p>- Samsung</p><p>Galaxy S7, S7 edge, Galaxy S6, S6 edge, Galaxy J7,J2, Galaxy Note 5 &amp; will be for Note7</p><p>&nbsp;</p><p>- Sony</p><p>Xperia E5, Xperia XA, Xperia X, Xperia Z6, Xperia M5</p><p>&nbsp;</p><p>- LG</p><p>X Skin, X5, X Power, V10, Nexus 5X, G5</p><p>&nbsp;</p><p>- Huawei</p><p>Honor Note 8, Honor 8, Honor 5A, Nexus 6P</p><p>&nbsp;</p><p>- HTC 10, ONEPLUS 3</p><p>(More models will be added later)</p><p>&nbsp;</p><p>&nbsp;</p><p>생각보다 많은 기계를 지원하는데요,</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/-wqbwQto208\" frameborder=\"0\" allowfullscreen=\"\"></iframe><p>&nbsp;</p><p>언젠가는 커피숍에 가면 수십명의 사람들이 스마트폰을 동동 띄워서 충전하는 모습을 볼 수 있겠네요.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','Y','2016-08-11 00:00:01',669),(17,'Cowarobot - 당신의 손을 가볍게 만들어 줄 캐리어','u3_1472715892872.jpg','version 1.0','제품 Review','무인캐리어, 자동캐리어, 로봇캐리어, cowarobot, 여행캐리어','더 이상 캐리어를 끌고 다닐 필요가 없다.','<p><img src=\"/data/smarteditor/attach/u435_1471410439789.jpg\" title=\"u435_1471410439789.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>화보같은 사진이 한 장 있습니다.</p><p>&nbsp;</p><p>사진 속에 보이는 캐리어가 바로 오늘의 주인공입니다.</p><p>&nbsp;</p><p>이게 뭐가 특별하냐구요?</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471410993939.gif\" title=\"u435_1471410993939.gif\"><br style=\"clear:both;\">&nbsp;</p><p>따라옵니다!!!!</p><p>사람이 직접 캐리어를 손으로 끌지 않아도,</p><p><span style=\"line-height: 1.5;\">센서(?), 혹은 위치추적 장치(?)를 통해 사용자를 따라옵니다.</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><span style=\"line-height: 1.5;\">\'Cowarobot R1\' 이라 불리우는 이 제품은 세계 최초의 기내 반입 크기의 캐리어입니다.</span></p><p>사진처럼 자율주행 및 장애물 회피 같은 첨단 기능을 탑재 했다고 합니다.</p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><img src=\"/data/smarteditor/attach/u435_1471411122001.gif\" title=\"u435_1471411122001.gif\"></p><p>&nbsp;</p><p><span style=\"line-height: 1.5;\">15˚ 정도의 경사는 극복이 가능하며 약&nbsp;</span><span style=\"line-height: 1.5;\">4.5mph(mile per hour)의 속도로 이동이 가능하며</span></p><p><span style=\"line-height: 1.5;\">완전 충전 시 약 12.5miles 갈 수 있다고 합니다.</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><span style=\"line-height: 1.5;\"><img src=\"/data/smarteditor/attach/u435_1471411410616.gif\" title=\"u435_1471411410616.gif\"><br style=\"clear:both;\">&nbsp;</span></p><p>&nbsp;</p><p>윗 사진처럼 장애물도 알아서 쓱-쓱 잘 피해갑니다.</p><p>(실제로 잘 피하는지에 대해서는 제품이 나와봐야 알겠죠?)</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471411558737.gif\" title=\"u435_1471411558737.gif\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>이 제품의 또 다른 매력은 R1팔찌에 간단한 더블-Tab하여&nbsp;</p><p>Co-Move 시스템을 통해 가만히 앉아 있어도 캐리어가 주인을 찾아서 이동합니다.</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471411695133.gif\" title=\"u435_1471411695133.gif\"></p><p>&nbsp;</p><p>이게 끝이 아닙니다.</p><p>소지품을 안전하게 보호하기 위해 자동 잠금장치도 설정되어 있습니다.</p><p>R1팔찌를 통해 열쇠가 없어도 원격으로 사용이 가능하며</p><p>잠금 또는 잠금이 해제 된 경우에는 LED링을 통하여 상태를 알려줍니다.</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471411767881.jpg\" title=\"u435_1471411767881.jpg\"></p><p>&nbsp;</p><p>R1팔찌를 통해 근접 경보 및 GPS추적도 가능하여,</p><p>캐리어가 멀리 떨어져 있어도 쉽게 찾을 수 있습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471412644219.png\" title=\"u435_1471412644219.png\"></p><p>&nbsp;</p><p>기내용 캐리어인 20인치의 사이즈인데요,.</p><p>정확하게 말하자면 21.6X15Inch 입니다.</p><p>&nbsp;</p><p>전체 가방의 4%정도가 Robotic으로 구성되어 있습니다.&nbsp;</p><p style=\"margin-left: 0px;\">나머지 96%에는 짐으로 가득 채울 수 있겠네요.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471412928069.gif\" title=\"u435_1471412928069.gif\"><br style=\"clear:both;\">&nbsp;</p><p>배터리 충전도 가능합니다.</p><p>휴대가 가능한 96.6와트의 용량으로 아이폰 6S를 9번정도 충전이 가능합니다.&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471413187318.jpg\" title=\"u435_1471413187318.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471413116439.jpg\" title=\"u435_1471413116439.jpg\"></p><p>&nbsp;</p><p>알류미늄 프레임과 카보네이트 재질로 케이스를 만들었다고 합니다.</p><p><br style=\"clear:both;\">&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471413324715.jpg\" title=\"u435_1471413324715.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>이젠 캐리어도 들고다니거나</p><p>끌고 다닐 필요 없이 알아서 척척척 입니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','Y','2016-08-17 00:00:01',666),(18,'Cronzy Pen - 16만가지 이상의 색상을 펜 하나에','u3_1472716010494.jpg','version 1.0','제품 Review','펜, 16만가지색상, 16만색상펜, 컬러스캔펜, 스캔펜 , PEN, CRONZY, 인디고고, 크라우드펀딩','가격만 저렴하면 당장이라도 구매하고 싶은 펜','<p>PEN 하나에 16만가지 색상을 담아서 쓸 수 있다면..</p><p>잉크가 16만가지 색일까요?&nbsp;</p><p>아니면 여러가지 색을 조합해서 16만가지 색을 나타내는 것일까요?&nbsp;</p><p>&nbsp;</p><p>아니,</p><p>애초에 16만가지 색을 나타낼 수 있는 펜이 있기는 한 걸까요?</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471843942024.png\" title=\"u435_1471843942024.png\"><br style=\"clear:both;\">&nbsp;</p><p>정답은</p><p>네. 있습니다.</p><p>&nbsp;</p><p>바로 Cronzy Pen 입니다.</p><p>이 제품은 Cronzy 스캔을 통해 우리가 주위에서 볼 수 있는 기존의 색상들과 음영을 펜에서 사용할 수 있게 만들어줍니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471844553364.jpg\" title=\"u435_1471844553364.jpg\"></p><p>&nbsp;</p><p><br style=\"clear:both;\">어떤 내용인지 감이 안오신다면 아래 <span style=\"line-height: 1.5;\">영상을 참고하세요.</span></p><p>&nbsp;</p><iframe width=\"851\" height=\"479\" src=\"https://www.youtube.com/embed/Z0ewjKLyKlk\" frameborder=\"0\" allowfullscreen=\"\"></iframe><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471845723797.jpg\" title=\"u435_1471845723797.jpg\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</p><p>실제로 16만가지 색상이 들어있는 것이 아니라,</p><p>내장된 센서를 통하여 색상을 스캔하고 그 색을 PEN으로 재현해 주는 방법입니다.</p><p>마치 포토샵에서 색상을 가져오는것과 마찬가지죠.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471844228769.png\" title=\"u435_1471844228769.png\"></p><p><img src=\"/data/smarteditor/attach/u435_1471844234702.png\" title=\"u435_1471844234702.png\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</p><p>그렇다고 해도 매우 신기합니다.</p><p>&nbsp;</p><p>아래 사진처럼 다양한 모양의 펜이 존재합니다.</p><p>펜 촉의 모양과 크기도 다르네요.</p><p><img src=\"/data/smarteditor/attach/u435_1471846043785.png\" title=\"u435_1471846043785.png\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1471846047579.png\" title=\"u435_1471846047579.png\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>카트리지는 아래 사진처럼 교환이 가능하다고 합니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471845029129.gif\" title=\"u435_1471845029129.gif\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>Cronzy은 아래 사진과 같은 프로토 타입의 모델을 거쳐 탄생하게 되었습니다.</p><iframe width=\"603\" height=\"415\" src=\"https://www.youtube.com/embed/HdLG1rSQKiY\" frameborder=\"0\" allowfullscreen=\"\"></iframe><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471845115692.png\" title=\"u435_1471845115692.png\">&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471845176310.png\" title=\"u435_1471845176310.png\"></p><p><img src=\"/data/smarteditor/attach/u435_1471845191684.png\" title=\"u435_1471845191684.png\"></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>기본적으로 IOS, Android, Windows Phone의 APP을 통하여 사용이 가능하다고 합니다.</p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1471845209623.png\" title=\"u435_1471845209623.png\"></p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471845344942.png\" title=\"u435_1471845344942.png\"></p><p>&nbsp;</p><p><br style=\"clear:both;\"><br style=\"clear:both;\"><br>제품의 전체적인 스펙은 아래와 같습니다.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471844935940.png\" title=\"u435_1471844935940.png\"></p><p>&nbsp;<img src=\"/data/smarteditor/attach/u435_1471846076305.gif\" title=\"u435_1471846076305.gif\">&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1471846870993.png\" title=\"u435_1471846870993.png\"><img src=\"/data/smarteditor/attach/u435_1471846878959.png\" title=\"u435_1471846878959.png\"><br style=\"clear:both;\"><br style=\"clear:both;\"><br style=\"clear:both;\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1471845714904.png\" title=\"u435_1471845714904.png\">&nbsp;</p><p>&nbsp;</p><p>정말 이 세상의 모든 색상을 이렇게 뽑아 낼 수 있다면</p><p>의외로 필수품 일지도 모르겠습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','Y','2016-08-22 00:00:01',980),(19,'podo - 포스트잇 같은 셀카 카메라?','u3_1479630983405.jpg','Version 1.0','제품 Review','#카메라#포도#블루투스#HWBC#셀카#셀피','','<p>여러분들은 셀카를 어떻게 찍으시나요?&nbsp;</p><p>&nbsp;</p><p>2013년 옥스포드 대학 출판사가 선정한 단어이기도 한 \'셀피(Selfie)\' 열풍은 아직까지 사그러들지 않고 있습니다.</p><p>최근에는 보기 힘들지만 길쭉한 셀카봉을 들고 다니면서 여기저기에서 촬영을 하시거나, 촬영을 하고 있는 사람들을 많이 보셨을 겁니다. 이렇게 불편하게 찍는게 아니라 포스트 잇 처럼 붙이고 싶은데 부착해놓고 여러분들이 찍고 싶은 사진을 편하게 찍는 카메라가 있으면 어떨까요?</p><p>&nbsp;</p><p>금속 표면이나 평평한 곳 어디에든 쉽게 붙여 여러분의 핸드폰으로 조정할 수 있는 podo 카메라를 소개합니다.&nbsp;</p><p>&nbsp;</p><p><img title=\"u3_1479630009749.gif\" src=\"/data/smarteditor/attach/u3_1479630009749.gif\"><br style=\"clear: both;\">&nbsp;</p><p>마치 초소형 삼각대를 붙여 놓은 듯이 자유자재로 각도 조절이 가능 합니다.</p><p>&nbsp;</p><p><img title=\"u3_1479630077129.png\" src=\"/data/smarteditor/attach/u3_1479630077129.png\"><br style=\"clear: both;\">&nbsp;</p><p>또한 여러번 붙였다 떼었다 하면서 쓸 수 있고, 앱을 통해 자유자재로 촬영이 가능합니다.</p><p>&nbsp;</p><p><img title=\"u3_1479630158351.png\" src=\"/data/smarteditor/attach/u3_1479630158351.png\"><br style=\"clear: both;\"><img title=\"u3_1479630169370.png\" src=\"/data/smarteditor/attach/u3_1479630169370.png\"><br style=\"clear: both;\"><img title=\"u3_1479630179327.png\" src=\"/data/smarteditor/attach/u3_1479630179327.png\"><br style=\"clear: both;\">&nbsp;</p><p>셀피 촬영은 기본이고, 아이나 애완 동물들이 자주가는 장소에 부착하면 여러분들이 몰랐던 순간의 기쁨을 느껴보실 수 있습니다.</p><p>&nbsp;</p><p><img title=\"u3_1479630268871.png\" src=\"/data/smarteditor/attach/u3_1479630268871.png\"><br style=\"clear: both;\">&nbsp;</p><p>이렇게 방수기능도 있어서 야외 활동을 촬영하기에도 무척 편리합니다.</p><p>&nbsp;</p><p><img title=\"u3_1479630359064.png\" src=\"/data/smarteditor/attach/u3_1479630359064.png\">&nbsp;</p><ul><li>Size: 1.3\" x 1.3\" x 1.5\" (3 x 3 x 4.5 cm)</li><li>Weight: 1.5 oz (43 g)</li><li>Sensor: 5 MP (2.2 μm pixels)</li><li>Video: 720p 30fps</li><li>Lens: 90° wide-angle, glass</li><li>Memory: 8 GB</li><li>8-LED ring</li><li>Bluetooth 4.2 LE + Classic</li><li>Accelerometer</li><li>Rechargeable battery (up to 1.5 hrs. video)<br></li></ul><div>매우 가볍고 충전을 쉽게 할 수 있어서 더 편리하게 사용할 수 있겠네요.</div><div><br></div><div><a href=\"https://youtu.be/LPzaW35TLD8\">https://youtu.be/LPzaW35TLD8</a><br></div><div><br></div><div>현재 킥스타터 프로젝트를 성공적으로 마쳤으며(목표 5만불/펀딩 76만불 달성), 현재는 Pre-order 가능하네요.(인디고고)</div><div><br></div><div><br></div><p>&nbsp;</p>','Y','2016-11-20 00:00:01',141),(20,'POMO WAFFLE - 스마트 & 패셔너블 키즈폰','u3_1483345063374.jpg','Version 1.0','제품 Review','#kids phone#wearable#POMO#ASIA','','<p>The First Fashionable GPS Smart Watch for Kids</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u3_1483344833805.png\" title=\"u3_1483344833805.png\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>국내 키즈폰이 도입된 것도 벌써 3년이 되었네요.</p><p>14년 SK텔레콤을 통해 키즈폰이 한국에 처음 출시되었고, 지금은 KT와 유플러스에도 독자적인 단말기를 통해 출시되어 이통 3사 모두 키즈폰을 판매하고 있습니다.</p><p>대부분 키즈폰을 구매하는 이유는 자녀와의 원활한 커뮤니케이션과 안전을 목적으로 많은 아이들의 손목과 목에 자리잡고 있어, 처음에 보았던 어색함 보다는 많이 대중화된 것이 아닌가 생각되네요.</p><p>&nbsp;</p><p>이러한 키즈폰의 대중화를 맞아 다양한 차별화를 내세워 고객들에게 다가가고 있습니다.</p><p>소개해드릴 POMO WAFFLE의 경우도 기존의 키즈폰에서는 볼 수 없었던 스마트한 디자인과 새로운 기능으로 고객과 만날 준비를 하고 있네요.</p><p>&nbsp;</p><p>\r\n이 키즈폰은 부모님들에게만 맞춰진 기기가 아닙니다.</p><p>어린이들의 자립심과 창의력을 키워줄 수 있는 컨셉으로 제품이 기획되었습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u3_1483344881357.jpg\" title=\"u3_1483344881357.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u3_1483344893682.jpg\" title=\"u3_1483344893682.jpg\"><br style=\"clear:both;\">저는 기존에 폰에 없는 \"Take me home\" 기능이 마음에 드네요.</p><p>아무래도 정신없이 놀다보면 여기가 어딘지 잘 모르는 경우가 많을텐데, 이 기능이 있으면 아이들이 집을 쉽게 찾아갈 수 있겠네요.</p><p>&nbsp;</p><p>그리고 방수, 버클, 인체공학적 디자인 등 여러모로 아이들을 위해 고민한 제품입니다.</p><p>실제 회사 CEO도 두 딸을 키우고 있고, 놀이동산에서 아이를 잃어버리고 난 뒤 실종되는 아이들이 더이상 생기지 않았으면 하는 마음으로 제품을 기획했다고 하네요.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u3_1483344968261.jpg\" title=\"u3_1483344968261.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u3_1483344943113.png\" title=\"u3_1483344943113.png\">&nbsp;</p><p><img src=\"/data/smarteditor/attach/u3_1483344921534.png\" title=\"u3_1483344921534.png\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>그리고 무엇보다도 POMO Store를 통해 다양한 어플리케이션을 다운로드할 수 있어서, 보통 2년 계약으로 사용하시는 기간동안 새로운 기능들을 자주 접하실 수 있습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u3_1483344993382.png\" title=\"u3_1483344993382.png\"><br style=\"clear:both;\">&nbsp;</p><p><img src=\"/data/smarteditor/attach/u3_1483345010476.png\" title=\"u3_1483345010476.png\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>현재 킥스타터 프로젝트를 진행중이며, 금주 토요일(~1/7)까지 펀딩 프로젝트가 진행 될 예정이며 3월에 배송이 가능하오니 늦어도 4월이면 국내에도 만나볼 수 있는 제품 같습니다.</p><p>&nbsp;</p><p>*킥스타터 바로가기:<a href=\"https://www.kickstarter.com/projects/pomohouse/pomo-waffle-smartwatch-for-kids-independence-and-c?ref=city\">https://www.kickstarter.com/projects/pomohouse/pomo-waffle-smartwatch-for-kids-independence-and-c?ref=city</a></p>','Y','2017-01-02 00:00:01',44);
