INSERT INTO `nest_project` VALUES (102,0,5,12,'p102_1459240243547.jpg','당신의 마음을 전해주는 메세지조명','Interior','2016-01-11 00:00:00','2016-02-10 00:00:00',3000000,'헤세드, 조명, 메세지, 메세지조명',2,'<p><img alt=\"\" src=\"/data/project/102/p102_e1452500405598.jpg\" /></p>\r\n\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size: 11pt;letter-spacing:-1px;line-height:16pt;\">메세지조명은 나만의 메세지를 넣을 수 있는 주문제작형 무드램프입니다.&nbsp;너무 가까이 있어 당연하게 생각했던 가족과 연인, 친구들에게....&nbsp;2016년, 미처 전하지 못했던 마음을 빛으로 전해보세요.</span></strong></p>\r\n','헤세드 조명의 첫번째 크라우드펀딩 프로젝트','hesed','Y','CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'N','N'),(103,0,57,13,'p103_1459240606008.jpg','아프리카 아이들에게 꿈과 희망을 주는 Buy 1, Dream 1 프로젝트','Outdoor','2016-01-18 00:00:00','2016-02-23 00:00:00',10000000,'아프리카, 축구, 자이크로, 트렉수트',2,'<p><img alt=\"\" src=\"/data/project/103/p103_e1453347854400.jpg\" /></p>\r\n','축구를 통해 세상을 바꾸는 자이크로의 펀딩 프로젝트','zaicro','Y','CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'N','N'),(104,0,104,12,'p104_1459240616412.jpg','캠핑 버너 마에스트로 - DSR 1005  ','Outdoor','2016-01-27 00:00:00','2016-02-26 00:00:00',1500000,'동성정밀, 해바라기버너, 캠핑',2,'<p><img alt=\"\" src=\"/data/project/104/p104_e1453862989254.jpg\" /></p>\r\n','캠핑 버너의 끝판왕, 동성정밀 해바라기버너 2016 ','dongsung','Y','CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'N','N'),(105,0,310,12,'p105_1459240358628.jpg','아날로그 감성 나무 장난감','Interior','2016-02-16 00:00:00','2016-03-17 00:00:00',2000000,'원목 장난감, 아이, 나무, 동물',2,'<p><img alt=\"\" src=\"/data/project/105/p105_e1455673144523.jpg\" /></p>\r\n','목수 아빠의 고군분투 크라우드 펀딩 프로젝트','muna','Y','CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'N','N'),(107,0,353,13,'p107_1458821387005.jpg','&#39;Be Real&#39; - Art Toy 프로젝트','Kidult','2016-03-08 18:00:00','2016-04-23 00:00:00',6000000,'아트토이, 아이언마이크, art toy, iron mike, be real',2,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"383\" src=\"https://www.youtube-nocookie.com/embed/SIrqwfTKx0w?rel=0&amp;showinfo=0\" width=\"100%\"></iframe></p>\r\n','내 자리에서 진짜가 되고 싶은 디자이너의 아트토이 프로젝트','ironmike',NULL,'CF',0,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'N','N'),(108,0,378,13,'p108_1459240637186.jpg','내 맘대로 꾸미는 나만의 자석사진','Interior','2016-03-23 12:00:00','2016-04-22 00:00:00',1500000,'자석액자, DIY, 포토액자',2,'<p style=\"font-size:14px;line-height:22px;\"><img alt=\"\" src=\"/data/project/108/p108_e1458701484527.jpg\" />더포토샵의 제품은 삭막한&nbsp;디지털 시대에 아날로그 감성을 원하는 분들을 위해 시작되었습니다. 디자인부터 가공에 이르기까지 사랑하는 사람에게 감동을 전하는 마음을 생각하며 제작해 나갑니다.&nbsp;</p>\r\n','포토#의 DIY 자석사진 프로젝트','photosharp','Y','CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'N','N'),(109,0,380,12,'p109_1459240652145.jpg','조명, 일상을 담다','Interior','2016-03-29 09:00:00','2016-04-28 00:00:00',1000000,'조명, 인테리어, 기도, 골프, 독서, 프로포즈, 결혼, 고급',2,'<p><iframe allowfullscreen=\"\" frameborder=\"0\" src=\"https://www.youtube-nocookie.com/embed/KYYCBugAJOQ?rel=0\" width=\"640\" height=\"360\"></iframe></p>\r\n','Studio IGI의 고급 인테리어 조명 프로젝트','studioigi','Y','CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'N','N'),(111,0,434,12,'p111_1462507419715.jpg','금손? 아니어도 괜찮아!!','Fashion','2016-05-06 17:00:00','2016-06-19 23:59:00',1000000,'가죽, 공예, DIY, 팔찌, 카드, 지갑, 여권, 케이스, 굿앤레더, 네이버, 카페',2,'<img src=\"/data/project/111/attach/u3_1462507402560.jpg\"><br><br><br><br>','굿앤레더의 \'가죽공예 대중화\' 프로젝트','LeatherDIY','Y','CF',0,0,'','','','','','','','',3,'N','N'),(112,0,461,12,'p112_1464852670047.jpg','청년의 열정을 응원하다','Fashion','2016-06-02 18:00:00','2016-07-04 23:59:00',1000000,'청년, 열정, 양말, 티셔츠, GEO, LAW, 응원, 패션, 축구',0,'<img src=\"/data/project/112/attach/u3_1464852687350.jpg\">','Right Route의 열정 응원 프로젝트','PassionSocks','Y','CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'N','N'),(113,0,496,13,'p113_1466153349152.jpg','감성캠핑 프로젝트 첫번째 꿈','Outdoor','2016-06-17 18:00:00','2016-07-08 23:30:00',1000000,'',2,'','꿈속에서 길을 잃지 마세요','campsign','Y','CF',0,0,'','p113_1466153349144.jpg,p113_1466155832472.jpg,','<img src=\"/data/project/113/attach/u3_1466152846729.jpg\">\r\n\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;\">\r\n당신만의 보금자리를 나타낼 수 있는 캠핑용 감성 표지판입니다.\r\n수 많은 캠핑 텐트 속에서도 자신만의 감성을 나타낼 수 있습니다. \r\n</p>\r\n\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;\">\r\n자유로이 문구와 그림들을 선택할 수 있어 캠핑이 아니더라도 \r\n외부행사의 문패나 집안에서의 인테리어로 활용이 가능합니다.\r\n</p>\r\n\r\n<img src=\"/data/project/113/attach/u3_1466153043439.jpg\"><br><p><img src=\"/data/project/113/attach/u3_1466158286546.jpg\" style=\"line-height: 1.45em;\">\r\n\r\n    \r\n</p><p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;\">\r\n사이즈\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.3em;color:#3b3b3b;\">\r\n감성캠핑 문패 A형(육각형 - 200 x 230mm)<br>\r\n감성캠핑 문패 A형(오각형 - 156 x 137mm)\r\n</p>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;\">\r\n소재\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.3em;color:#3b3b3b;\">\r\n아크릴\r\n</p>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;\">\r\n제조사\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.3em;color:#3b3b3b;\">\r\nMQ201\r\n</p>\r\n<br>\r\n\r\n<p style=\"text-align: center;font-size:1.5em;line-height:1.5em;font-weight:700;margin:50px 0 15px 0;color:#139b4f;\">\r\n누구나 한 번쯤<br>\r\n경험해보지 않으셨나요?\r\n</p>\r\n<img src=\"/data/project/113/attach/u3_1466153060517.jpg\">\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;\">\r\n잠시 자리를 비웠을 뿐인데...<br>\r\n우리 텐트가 어디 있는지 알 수 없고...<br>\r\n만약 내 텐트를 쉽게 찾을 수 있다면...?\r\n</p>\r\n    \r\n<p style=\"text-align: center;font-size:1.5em;line-height:1.5em;font-weight:700;margin:50px 0 15px 0;color:#000;\">\r\n감성표지판은 <span style=\"color:#139b4f;\">자신만의 문구</span>를 넣어 <br>찾아가기 쉽게 도와줍니다.\r\n</p>\r\n<img src=\"/data/project/113/attach/u3_1466153102302.jpg\">\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:5px 0 20px 0;\">\r\n<span style=\"color:#139b4f;\">자신만의 문구</span>를 넣을 수 있기에 가족, 멤버들만의 엠블럼으로 우리만의 <span style=\"color:#139b4f;\">특별한 추억</span>을 심어드립니다.\r\n</p>\r\n    \r\n\r\n<img src=\"/data/project/113/attach/u3_1466153095464.jpg\">\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:5px 0 20px 0;\">\r\n텐트 뿐 아니라 길목마다 걸어 이정표로도 사용할 수 있어 길을 찾기 쉽습니다.\r\n</p>\r\n\r\n\r\n<p style=\"font-size:1.3em;font-weight:700;text-align:center;padding:50px 0 25px 0;color:#000;text-decoration:underline;\">detail</p>\r\n\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:20px 0 10px 0;\">\r\n아크릴 표면처리와 열처리 방식으로 한 글자, 한 글자 매끄럽고 정성스럽게 표현하여 더욱 고급스러워 보입니다.\r\n</p>\r\n<img src=\"/data/project/113/attach/u3_1466154648020.jpg\">\r\n\r\n\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:20px 0 10px 0;\">\r\n캠핑 좋아하는 메이커들이 직접 매듭법을 이용해 바로 사용할 수 있도록 고급스럽게 선처리까지 마무리 해 제품의 완성도를 높였습니다.\r\n</p>\r\n<img src=\"/data/project/113/attach/u3_1466154663992.jpg\">\r\n\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;\">\r\n제품을 적절한 판매 금액으로 제작하기 위해서는 적당한 생산 수량이 확보되어야 합니다. 펀딩 금액은 이 목적을 달성하는 데 사용하게 됩니다. 감성표지판이 많은 분들을 만날 수 있도록 도움을 주시면 감사하겠습니다.\r\n</p>\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.5em;line-height:1.5em;font-weight:700;margin:50px 0 15px 0;color:#139b4f;\">\r\n선택사항\r\n</p>\r\n\r\n<img src=\"/data/project/113/attach/u3_1466155535011.jpg\">\r\n<img src=\"/data/project/113/attach/u3_1466155545516.jpg\">\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:500;line-height:1.5em;\">\r\n꼭, 제품에 들어갈 문구와 폰트를 댓글로 남겨주시기 바랍니다.</p>\r\n\r\n<p style=\"background-color:#f4f4f4;padding:20px;border:2px soilid #fff;font-weight:500;font-size:1em;\">\r\n\r\n<span style=\"display:block;font-weight:700;line-height:1.2em\">+ 상단</span>\r\n<span style=\"display:block;text-indent:10px;margin-bottom:15px;line-height:1em\">\r\n<span style=\"background-color:yellow;\">한글/영문 6자</span> 이내<br>\r\n(폰트 선택 가능 고딕체/필기체)\r\n</span>\r\n\r\n<span style=\"display:block;font-weight:700;line-height:1.2em\">+ 하단</span>\r\n<span style=\"display:block;text-indent:10px;margin-bottom:15px;line-height:1em\">\r\n<span style=\"background-color:yellow;\">한글/영문 10자</span> 이내<br>\r\n(하단은 고딕체로 디자인됩니다.)\r\n</span>\r\n\r\n<span style=\"display:block;\">\r\nEX) 상단 : 오지랖\'s / 하단 : Sweet Home\r\n</span>\r\n\r\n</p>','','<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n프로젝트 후원 내역은 어디서 확인할 수 있나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트를 후원해주신 내역은 우측 상단의 이미지 클릭 &gt; 후원 프로젝트 에서 확인하실 수 있습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n배송지를 변경하고 싶습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n아래의 메뉴에서 배송지 주소를 직접 변경하실 수 있습니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 후원 변경하기 &gt; 배송지 수정</span>  \r\n<br>\r\n직접 수정이 어려운 경우, 고객센터로 연락주시면 빠르게 조치하여 드리겠습니다. \r\n<br>\r\n<span style=\"display:block;font-weight:700;font-size:14px;line-height:17px;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n언제 배송되나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n보상품 제작은 일반적으로 프로젝트가 성공적으로 종료된 시점에서 최종 후원 내역을 확인한 이후에 시작됩니다.\r\n제작 기간은 보상품 종류에 따라 달라서, 짧게는 2~3주에서부터 2~3개월까지 소요될 수 있지만, 준비 가능한 가장 빠른 시점에 보내드릴 수 있도록 노력하겠습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n보상품을 변경하고 싶습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트가 진행중인 기간에는 언제든지 후원하신 보상품 내용을 변경하실 수 있습니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n후원 취소가 가능한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트가 종료되기 전에는 언제든지 후원 변경/취소가 가능합니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n상품을 받은 후에, 교환이나 반품/환불이 가능한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n보상품은 먼저 후원을 받고, 최종 내역에 따라 제품을 생산하기 때문에 교환이나 반품/환불이 불가능합니다. <br>\r\n단, 제품의 불량으로 인한 하자는 언제든지 필요한 조치를 취해 드리고 있사오니,  언제든지 고객 센터로 문의 부탁드립니다. \r\n\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n\r\n<span style=\"display:block;font-weight:700;font-size:14px;line-height:17px;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n\r\n</p>','','','6/17|펀딩 시작$7/8|펀딩 종료$7/9|생산 시작$7/11|배송 시작$7/15|배송 완료',0,'N','N'),(115,0,513,12,'p115_1467016039994.jpg','여름, 그리고 부채','Fashion','2016-06-27 17:00:00','2016-07-07 23:30:00',NULL,'담양, 부채, 장인, 김대석,',2,'<p style=\"padding: 0 0 0 10px; font-weight:700;line-height:1.5em;\">[김대석 장인 부채]<br>14,000원</p>','대한민국 유일한 접선장 김대석 장인의 민합죽선부채','Hfan','Y','PO',5,50,'','p115_1467001600330.jpg,p115_1467001600333.jpg,p115_1467001600335.jpg,','<p><img src=\"/data/project/115/attach/u3_1466746005940.jpg\"></p>\r\n<p><img src=\"/data/project/115/attach/u3_1467001428933.jpg\"></p>\r\n\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n본 프로젝트는 값싼 중국산 부채나 휴대용 선풍기에 밀려 사라져가는 우리나라 전통 서민부채인 접선을 널리 알리고, 이젠 찾아보기도 힘든 우리시대의 장인들의 소중함에 대해 다시 한 번 생각하고 관심을 가질 수 있도록 하기 위해 시작되었습니다.\r\n</p>\r\n\r\n<img src=\"/data/project/115/attach/u3_1466746076239.jpg\">\r\n\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n부채에 대한 가장 오래된 기록은 문헌상에 따르면<br>\r\n「삼국사기(三國史記)」&lt;견훤조&gt;에 \'후백제의 견훤이 고려 태조에게 공작선을 바쳤다\' 는 기록이 보입니다.<br>\r\n부채는 원선(圓扇, 일명 방구부채)과 접선(接線, 일명 합죽선)으로 대별되는데 본 제품은 접선(합죽선)에 해당합니다.\r\n</p>\r\n\r\n<p><img src=\"/data/project/115/attach/u3_1466746147737.jpg\"></p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n김대석 장인은 접선장으로써, 민합죽선을 제작하고 있는 장인이며 50~60년대 부채생산 절정기 때부터 부채 제작기술을 전수받아 담양지방에서 유일하게 민합죽선을 제작하고 있습니다.\r\n</p>\r\n\r\n<p><img src=\"/data/project/115/attach/u3_1466746356366.jpg\"></p>\r\n\r\n<p><img src=\"/data/project/115/attach/u3_1466746372041.jpg\"></p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n분명, 인터넷을 찾아보면 더 값싼 중국산 부채를 쉽게 찾아 볼 수 있습니다.<br>\r\n이 프로젝트에서 후원하는 제품이 값싸고 품질 좋은 합리적인 소비와는 맞지 않을지 모릅니다. 그럼에도 장인의 부채를 이야기 하는 이유는 홍보를 위한 마케팅도 판매를 위한 감성팔이도 아닙니다.\r\n</p>\r\n\r\n<p><img src=\"/data/project/115/attach/u3_1466747052742.jpg\"></p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n지금 당장은 아니지만 가까운 미래에 대한민국에 민합죽선을 만드는 사람은 없어질지도 모릅니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n이 프로젝트는 대한민국 장인들의 명맥이 끊어지지 않게 널리 알리고 국가와 사회 차원에서 뿐 아니라 우리 모두 관심을 가지기 위해 진행됩니다.\r\n</p>\r\n\r\n<p style=\"padding:0 0 50px 0;\"><img src=\"/data/project/115/attach/u3_1466747188503.jpg\"></p><br>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1467015372261.jpg\" title=\"u3_1467015372261.jpg\"><br style=\"clear:both;\">&nbsp;</p>\r\n<p><img src=\"/data/project/115/attach/u3_1466747283449.jpg\"></p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n수입이 아닌 담양의 국산 대나무와 한지로 제작된 전통 부채입니다.<br>\r\n한지에 그림을 프린트하여 만들어졌습니다.<br>\r\n그림은 좌측부터 순서대로 <b>매화, 대나무, 국화</b>의 순서 입니다.\r\n</p>\r\n\r\n<p><img src=\"/data/project/115/attach/u3_1466747357576.jpg\"></p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n부채 살에는 담양의 민합죽선을 상징하는 박쥐문이 들어가 있습니다.<br>\r\n박쥐문은 복과 장수의 의미를 가지고 있습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n접으면 한 손에 쥐기에 적당한 사이즈를 자랑합니다.\r\n</p>\r\n\r\n<p><img src=\"/data/project/115/attach/u3_1466749790528.jpg\"></p>\r\n\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;padding:20px 0 0 0;font-weight:700;\">\r\n제품을 적절한 판매 금액으로 제작하기 위해서는<br>\r\n적당한 생산 수량이 확보되어야 합니다.<br>\r\n펀딩 금액은 이 목적을 달성하는 데 사용하게 됩니다.<br>\r\n민합죽선이 많은 분들을 만날 수 있도록 도움을 주시면 감사하겠습니다.\r\n</p>\r\n\r\n\r\n','<p>&nbsp;</p>','<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n프로젝트 후원 내역은 어디서 확인할 수 있나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n프로젝트를 후원해주신 내역은 우측 상단의 이미지 클릭 &gt; 후원 프로젝트 에서 확인하실 수 있습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n배송지를 변경하고 싶습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n아래의 메뉴에서 배송지 주소를 직접 변경하실 수 있습니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 후원 변경하기 &gt; 배송지 수정</span>  \r\n<br>\r\n직접 수정이 어려운 경우, 고객센터로 연락주시면 빠르게 조치하여 드리겠습니다. \r\n<br>\r\n<span style=\"display:block;font-weight:700;font-size:14px;line-height:17px;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n언제 배송되나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n보상품 제작은 일반적으로 프로젝트가 성공적으로 종료된 시점에서 최종 후원 내역을 확인한 이후에 시작됩니다.\r\n제작 기간은 보상품 종류에 따라 달라서, 짧게는 2~3주에서부터 2~3개월까지 소요될 수 있지만, 준비 가능한 가장 빠른 시점에 보내드릴 수 있도록 노력하겠습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n보상품을 변경하고 싶습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n프로젝트가 진행중인 기간에는 언제든지 후원하신 보상품 내용을 변경하실 수 있습니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n후원 취소가 가능한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:margin:10px 0 20px 0;color:#3b3b3b;\">\r\n프로젝트가 종료되기 전에는 언제든지 후원 변경/취소가 가능합니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n상품을 받은 후에, 교환이나 반품/환불이 가능한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n보상품은 먼저 후원을 받고, 최종 내역에 따라 제품을 생산하기 때문에 교환이나 반품/환불이 불가능합니다. <br>\r\n단, 제품의 불량으로 인한 하자는 언제든지 필요한 조치를 취해 드리고 있사오니,  언제든지 고객 센터로 문의 부탁드립니다. \r\n\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n\r\n<span style=\"display:block;font-weight:700;font-size:14px;line-height:17px;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n\r\n</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','',3,'N','N'),(116,0,515,12,'p116_1467019667461.jpg','선풍기의 변신, 팬포머','Smart','2016-06-27 18:30:00','2016-07-07 23:30:00',NULL,'에어서큘레이터, 팬포머, 서풍기, 여름, 공기순환',2,'<p style=\"padding: 0 0 0 10px; font-weight:700;line-height:1.5em;\">[팬포머 에어서큘레이터 KIT]<br>15,840원 ~ 23,760원 (20% 할인 이벤트)\r\n</p>','비체룸의 시원한 여름나기 프로젝트  ','fanformer','Y','PO',20,100,'','p116_1467018377462.jpg,p116_1467018377464.jpg,p116_1467018377465.jpg,','<p style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1467018387477.jpg\"></p>\r\n<p style=\"text-align: center; font-size: 0px; line-height: 0;\" align=\"center\">에어서큘레이터란?</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n일반 선풍기와는 달리,바람을 일직선으로 모아서 쏘아주어 내부 공기의 전체적인 순환을 일으켜 주는 제품입니다.<br>\r\n효율이 좋기 때문에 외국에서는 이미 에어컨과 함께 쓰이는 여름 냉방의 필수 아이템으로 자리잡고 있습니다.\r\n</p>\r\n<p style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1467018420124.jpg\"></p><p style=\"text-align: center;\" align=\"center\">&nbsp;</p>\r\n<p style=\"text-align: center; font-size: 0px; line-height: 0;\" align=\"center\">\r\n에어서큘레이터의 효과\r\n    <span>1. 냉방효과 (에어컨과 함꼐 에너지를 절약)</span>\r\n    <span>2. 냄새,미세먼지 제거 (답답한 집안의 공기를 창밖으로 제거, 새집증후군 완화)</span>\r\n    <span>3. 공기전달 과(거실의 에어컨 바람을 침실로 전달)</span>\r\n</p>\r\n\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;\">\r\n    이렇게 좋은 점이 많은 에어서큘레이터지만, 한국에서는 아직 <span style=\"color:#3c8bd3\">만만치 않은 가격</span> 때문에 효과를 아시는 분들도 많이 사용하지 못하고 계시죠.ㅠㅠ\r\n</p>\r\n\r\n<p style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1467018531372.jpg\" title=\"u3_1467018531372.jpg\"></p>\r\n<p style=\"font-size:0;line-height:0;\">\r\n그래서, 팬포머를 출시하였습니다!<br>\r\n- 출시시기 : 2016년 5월<br>\r\n쾌적한 바람을 집안 구석구석까지!\r\n선풍기 1단만 틀어도 2단이상의 효과를 보실 수 있으며, 멀리서도 바람이 끊기지 않고 목표에 도달합니다. 선풍기 바람은 가까이서 사용하는 것보다 가능한 멀리서 사용하는 것이 자극이 적은 건강한 바람입니다.\r\n</p>\r\n\r\n\r\n<p style=\"text-align: center; \" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1467018594267.jpg\"></p>\r\n<p style=\"text-align: center; font-size: 0px; line-height: 0;\" align=\"center\">\r\n    이번 프리오더에서는 싱글 50개, 더블 50개 한정수량으로 20% 할인된 가격에 진행합니다. 오직 오지랖에서!\r\n</p>\r\n\r\n','<p style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1467018888363.jpg\"></p>\r\n<p style=\"text-align: center;font-size:1.3em;line-height:1.5em;color:#616161;padding:30px 0 15px 0;\" align=\"center\">\r\n    12m 유량 측정 동영상\r\n</p>\r\n<div style=\"text-align: center;\" align=\"center\"><iframe width=\"697px\" height=\"360px\" src=\"https://www.youtube.com/embed/CdfGLzwg9F4\" frameborder=\"0\" allowfullscreen=\"\" style=\"line-height: 1.5;\"></iframe></div><p style=\"text-align: center;font-size:1.3em;line-height:1.5em;color:#616161;padding:30px 0 15px 0;\" align=\"center\">\r\n    풍선 징집 동영상 <span style=\"font-size:0.8em;\">(냄새, 먼지 징집 효과)</span>\r\n</p>\r\n<div style=\"text-align: center;\" align=\"center\"><iframe width=\"697px\" height=\"360px\" src=\"https://www.youtube.com/embed/zSpmzSPlgI4\" frameborder=\"0\" allowfullscreen=\"\" style=\"line-height: 1.5;\"></iframe></div><div style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1467177793994.jpg\" title=\"u3_1467177793994.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u3_1467177748205.jpg\" title=\"u3_1467177748205.jpg\"><br style=\"clear:both;\"></div><div style=\"text-align: center;\" align=\"center\"><br></div><div style=\"text-align: center;\" align=\"center\"><br></div><div style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1467018971939.jpg\"></div>','<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n    컬러는 몇가지가 있나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n파스텔 민트와 화이트 2가지 색상이 준비되어 있습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n아무 선풍기나 장착가능 한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n대부분의 가정에서 많이 쓰시는 기본형선풍기(날개 35cm, 14inch)는 모두 장착 가능합니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n바람이 너무 강해지는 건 아닌가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n본 제품은 바람을 강하게 하는 제품이 아닙니다. 바람을 멀리까지 보내는 장치입니다. 초미풍 선풍기와 사용하시면 잔잔한 바람을 멀리까지도 보내실 수 있습니ㅣ다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n왜? 에너지 절약이 된다는 거죠?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n기존 에어 서큘레이터나 일반적선풍기보다 더 빠르게 공기를 순환시켜 드립니다. 또한 2단으로 사용하지 않고 1단만 사용해도 바람이 정확히 전달되기 때문에 에너지가 절약됩니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<div style=\"background-color:#f4f4f4;padding:15px;\">\r\n    <p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;text-align:center;\">\r\n        교환 및 환불 안내\r\n    </p>\r\n    <p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:margin:10px 0 20px 0;color:#3b3b3b;\">\r\n        상품 수령일로부터 7일 이내에 반품, 환불이 가능합니다.\r\n        <span style=\"display:block;\">* 제품 교환시 왕복 배송비가 추가됩니다.(왕복 배송비 5,000원)</span>\r\n        <span style=\"display:block;\">* 제품의 문제일 경우, 반송비를 포함한 재배송비용은 비체룸에서 지불합니다.</span>\r\n        <span style=\"display:block;\">* 제품 개봉 후, 제품과 패키지 및 구성품의 사용 및 훼손시 반품 및 환불이 불가능합니다.</span>\r\n        <span style=\"display:block;\">* 모니터에 따른 실제 색상과의 차이로 인한 교환.환불은 구매자 변심으로 왕복 배송비(5,000원)가 발생됩니다.</span>\r\n        <span style=\"display:block;\">* 교환/환불을 원하실 경우, 우선 비체룸 고객센터를 통해 문의 부탁드립니다.</span>\r\n        <span style=\"display:block;\">* 교환/환불 신청을 하지 않았거나, 고객센터를 통하지 않은 임의 반송과 타 택배사를 통한 배송은 반송 또는 분실이 발생할 수 있습니다.</span>\r\n        <span style=\"display:block;\">* 교환주소 : 전북 전주시 상리1길 34번지 별관 3동</span>\r\n        <span style=\"display:block;\">* 교환문의 : 070-8688-7107 / sgear001@naver.com</span>\r\n    </p>\r\n</div>\r\n','<p>&nbsp;</p>','<p style=\"text-align: center; \" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1467019040363.jpg\" title=\"u3_1467019040363.jpg\"></p>\r\n<p style=\"text-align: center;font-size:1.5em;line-height:1.5em;font-weight:700;margin:50px 0 15px 0;color:#434343;\">\r\n감사합니다.\r\n</p><p style=\"text-align: center;font-size:1.5em;line-height:1.5em;font-weight:700;margin:50px 0 15px 0;color:#434343;\">&nbsp;<img src=\"/data/smarteditor/attach/u3_1467019346769.jpg\" title=\"u3_1467019346769.jpg\">&nbsp;</p><p style=\"text-align: center;font-size:1.5em;line-height:1.5em;font-weight:700;margin:50px 0 15px 0;color:#434343;\">&nbsp;</p>\r\n','',3,'N','N'),(117,0,519,13,'p117_1467102366060.jpg','와토토의 킬리만자로 구하기','Fashion','2016-06-28 17:00:00','2016-07-27 23:30:00',2000000,'펜, 가방, 탄자니아, 웅가',2,'<p style=\"padding: 0px 0px 0px 10px; font-weight: 700;\">[탄자니아 나무/가죽으로 만든 펜과 가방] <br>39,000원 ~ 99,000원</p>\r\n','탄자니아 NOW의 착한 펜과 가방 프로젝트','Watoto','Y','CF',0,0,'','p117_1467094148398.jpg,p117_1467094148400.jpg,p117_1467094148402.jpg,p117_1467094148403.jpg,','<p style=\"margin: 0px; text-align: center;\"><img alt=\"세상의 모든 아이들은 보살핌 받을 권리가 있습니다. UNICEF 아동권리 선언 내용 중.\" src=\"/data/smarteditor/attach/u3_1467094200385.jpg\"></p>\r\n\r\n\r\n<p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1.3em; font-weight: 700;\">\r\n어려운 아이들을 찾아 나선 아프리카 여행\r\n</p>\r\n<p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">안녕하세요, 저는 이 프로젝트의 개설자인 김태균입니다.</p><p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">제가 가진 꿈은 어려운 제3세계 국가의 아이들이 건강하게 자라나고 기본적인 교육을 받을 수 있도록 돕는 일이었습니다.&nbsp;<span style=\"font-size: 1em; line-height: 1.5em;\">그 꿈을 이루기 위해서&nbsp;</span><span style=\"font-size: 1em; line-height: 1.5em;\">2009년, 삼성전자를 퇴직하고 아프리카로 떠났습니다. 나이지리아에서 수년간 현지인 지원 사역을 마치고 탄자니아로 넘어왔을 때, 물과 식량이 없는 열악함 속에서도 항상 얼굴에 미소를 잃지 않는 아이들이 있는 것을 보게 되었습니다.</span></p>\r\n\r\n\r\n<p style=\"margin: 0px; text-align: center;\"><img alt=\"웅가를 품에 앉고 있는 탄자니아 아이\" src=\"/data/smarteditor/attach/u3_1467094425240.jpg\"></p>\r\n<p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1.3em; font-weight: 700;\">\r\n탄자니아의 생명이 담긴 제품\r\n</p>\r\n<p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\r\n(지금은 많이 사라졌지만) 우리나라에서도 흔히 볼 수 있었던 아이들의 순수한 웃음을 어떻게 하면 지켜줄 수 있을까를 고민하다가, 온전히 탄자니아에서 생산되는 재료로 제품을 만들고, 그 수익금을 탄자니아 아이들에게 돌려주는 프로젝트를 기획하게 되었습니다.</p>\r\n\r\n<p style=\"margin: 0px; padding: 85px 0px 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467176199799.jpg\"></p>\r\n\r\n<p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\'와토토(WATOTO)\'는 스와힐리어로 \'아이들\'이라는 뜻입니다.</p><p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">&nbsp;</p><p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\r\n직업 교육을 통해 만들어진 펜과 가방의 판매 수익금으로 탄자니아의 가난한 농어촌 마을, 그리고 도시의 길거리 아이들이 굶지 않도록 양식을 지원합니다.<br>\r\n(2차로는 신생아 위생용품 지원도 준비하고 있습니다.)</p>\r\n\r\n<p style=\"margin: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467094867928.jpg\"></p>\r\n<p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1em; font-size: 0.9em;\">기술 교육을 통해 직업 소명을 발견하는 아이들</p>\r\n<p style=\"margin: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467094982508.jpg\"></p>\r\n<p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1em; font-size: 0.9em;\">옥수수가루(웅가)를 전달받은 아이들</p>\r\n\r\n<p style=\"margin: 20px 0px 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467099493208.jpg\"></p>\r\n<p style=\"margin: 0px; line-height: 0; font-size: 0px;\">\r\n펜 한자루는 웅가 5kg을 후원할 수 있습니다. 웅가 5kg은 한 아이가 2주동안 생활할 수 있는 양의 옥수수 가루입니다.<br>\r\n가방은 웅가 10kg을 후원합니다. 웅가 10kg은 한 아이가 4주동안 생활할 수 있는 양의 옥수수 가루 입니다.\r\n</p>\r\n\r\n<p style=\"margin: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467100236296.jpg\"></p>\r\n<p style=\"margin: 0px 0px 10px; padding: 5px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1.3em; font-weight: 700; box-shadow: inset 0px -4px 0px #dcdcdc;\">상세스펙</p>\r\n<p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\r\n1) 몸통 : 탄자니아 산 홍단(Rose Wood), 흑단(Ebony)<br>\r\n2) 펜심 : 독일산<br>\r\n3) 포장 : 소가죽 천\r\n</p><p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">4) 이니셜각인 :  영문 성함 각인 </p>\r\n<p style=\"margin: 0px; padding: 25px 0px 0px; text-align: center;\"><img alt=\"나무가 펜이 되어가는 과정\" src=\"/data/smarteditor/attach/u3_1467098179308.jpg\"></p>\r\n\r\n<p style=\"margin: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467100352122.jpg\"></p>\r\n<p style=\"margin: 5px 0px 10px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1.3em; font-weight: 700; box-shadow: inset 0px -4px 0px #dcdcdc;\">상세스펙</p>\r\n<p style=\"margin: 0px 0px 10px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\r\n1) 가죽과 뿔 : 탄자니아산 소가죽, 소뿔<br>\r\n2) 천 : Iringa 지역 생산 특산무늬천<br>\r\n3) 이니셜각인 :  영문 성함 각인\r\n</p>\r\n<p style=\"margin: 15px 0px 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467336501159.jpg\"></p>\r\n<p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1.3em; font-weight: 700;\">\r\n※ 이니셜 각인을 하실 후원자분들은 댓글로 꼭! 꼭! 남겨주세요!\r\n<span style=\"font-size: 1em; display: block;\">이니셜은 영문 10글자까지 가능합니다 ;-)</span>\r\n</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>','<p>&nbsp;</p>','<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.3em; font-weight: 700;\">\r\n프로젝트 후원 내역은 어디서 확인할 수 있나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 1em; font-weight: 500;\">\r\n프로젝트를 후원해주신 내역은 우측 상단의 이미지 클릭 &gt; 후원 프로젝트 에서 확인하실 수 있습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.3em; font-weight: 700;\">\r\n배송지를 변경하고 싶습니다.\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 1em; font-weight: 500;\">\r\n아래의 메뉴에서 배송지 주소를 직접 변경하실 수 있습니다.\r\n<span style=\"text-decoration: underline; display: block;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 후원 변경하기 &gt; 배송지 수정</span>  \r\n<br>\r\n직접 수정이 어려운 경우, 고객센터로 연락주시면 빠르게 조치하여 드리겠습니다. \r\n<br>\r\n<span style=\"line-height: 17px; font-size: 14px; font-weight: 700; display: block;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.3em; font-weight: 700;\">\r\n언제 배송되나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 1em; font-weight: 500;\">\r\n보상품 제작은 일반적으로 프로젝트가 성공적으로 종료된 시점에서 최종 후원 내역을 확인한 이후에 시작됩니다.\r\n제작 기간은 보상품 종류에 따라 달라서, 짧게는 2~3주에서부터 2~3개월까지 소요될 수 있지만, 준비 가능한 가장 빠른 시점에 보내드릴 수 있도록 노력하겠습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.3em; font-weight: 700;\">\r\n보상품을 변경하고 싶습니다.\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 1em; font-weight: 500;\">\r\n프로젝트가 진행중인 기간에는 언제든지 후원하신 보상품 내용을 변경하실 수 있습니다.\r\n<span style=\"text-decoration: underline; display: block;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.3em; font-weight: 700;\">\r\n후원 취소가 가능한가요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 1em; font-weight: 500;\">\r\n프로젝트가 종료되기 전에는 언제든지 후원 변경/취소가 가능합니다.\r\n<span style=\"text-decoration: underline; display: block;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.3em; font-weight: 700;\">\r\n상품을 받은 후에, 교환이나 반품/환불이 가능한가요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 1em; font-weight: 500;\">\r\n보상품은 먼저 후원을 받고, 최종 내역에 따라 제품을 생산하기 때문에 교환이나 반품/환불이 불가능합니다. <br>\r\n단, 제품의 불량으로 인한 하자는 언제든지 필요한 조치를 취해 드리고 있사오니,  언제든지 고객 센터로 문의 부탁드립니다. \r\n\r\n<span style=\"text-decoration: underline; display: block;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n\r\n<span style=\"line-height: 17px; font-size: 14px; font-weight: 700; display: block;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n\r\n</p>','<p>&nbsp;</p>','<p style=\"text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467099692906.jpg\"></p>\r\n<p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\r\n<span style=\"font-size: 1.5em; font-weight: 700; display: block;\">NOW는</span>\r\n지난 2016년 1월부터 킬리만자로 와토토 프로젝트를 기획 진행해 왔습니다.</p><p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">지금까지 심한 가뭄을 겪은 지역과 마사이 지역의 아이들과 길거리의 아이들 등에게 웅가를 전달해왔습니다.</p><p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">&nbsp;</p><p style=\"margin: 0px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">NOW의 김태균대표는 지난 2009년부터 아프리카에서 현지인 지원사역을 진행해왔으며,  나이지리아와 탄자니아에 오지마을 초등학교 운영과 필름아카데미, 직업훈련 등의 일을 해왔습니다. <br><br>또한 아프리카내 한인 커뮤니티 활성화에도 힘을 다하고 있으며, 2011~2014 나이지리아 한인회 사무국장, 2016 탄자니아 한글학교 교장의 업무도 역임하고 있습니다.</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467099820603.jpg\"></p>\r\n<p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1em; font-size: 1em;\">탄자니아 한글학교</p><p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1em; font-size: 1em;\">&nbsp;</p><p style=\"margin: 0px; text-align: center;\"><font color=\"#616161\"><span style=\"line-height: 12px;\"><br></span></font></p><p style=\"margin: 0px; text-align: center;\"><font color=\"#616161\"><span style=\"line-height: 12px;\">NOW의 활동을 더 보고싶으시다면 아래 페이스북을 참고해주세요.^^</span></font></p><p style=\"margin: 0px; text-align: center;\"><font color=\"#616161\"><span style=\"line-height: 12px;\"><br></span></font></p><p style=\"margin: 0px; text-align: center;\"><font color=\"#616161\"><span style=\"line-height: 12px;\"><br></span></font></p><p style=\"margin: 0px; text-align: center;\"><font color=\"#616161\"><span style=\"line-height: 12px;\"><a href=\"https://www.facebook.com/kilimanjarowatoto\" target=\"_blank\">http://www.facebook.com/kilimanjarowatoto</a></span></font></p><p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1em; font-size: 1em;\">&nbsp;</p><p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1em; font-size: 1em;\">&nbsp;</p><p style=\"margin: 0px; text-align: center; color: rgb(97, 97, 97); line-height: 1em; font-size: 1em;\">&nbsp;</p>\r\n\r\n\r\n<p style=\"margin: 60px 0px 0px; text-align: center; color: rgb(97, 97, 97); font-size: 1.5em; font-weight: 700;\"><span style=\"color: rgb(0, 128, 1);\">감사합니다.</span></p><p style=\"margin: 60px 0px 0px; text-align: center; color: rgb(97, 97, 97); font-size: 1.5em; font-weight: 700;\">&nbsp;</p>\r\n<p style=\"margin: 30px 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1467100816885.jpg\"></p>\r\n','6/28|펀딩 시작$7/27|펀딩 종료$7/29|생산 시작$8/15|배송 준비$8/16|배송 시작$8/20|배송 완료',0,'N','N'),(118,0,9,1,NULL,'1,1','',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,'CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'N','N'),(119,0,548,13,'p119_1468298933634.jpg','정직하게 만드는 가죽','Fashion','2016-07-12 14:00:00','2016-08-02 23:30:00',500000,'',2,'<p><b>[amimoi의 핸드메이드 가죽제품 ]</b></p><p><b>\r\n13,000원 ~ 119,000원\r\n</b></p>','amimoi의 핸드메이드 가죽제품','amimoi','Y','CF',0,0,'','p119_1468220353425.jpg,p119_1468220353427.jpg,','<p style=\"text-align: left;font-size:1.3em;line-height:1.5em;color:#ce9c70;font-weight:700;margin:30px 0 0 0;\">Amimoi[아미므아]</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;margin:0;\">불어로 친구라는 뜻의 ami와 나의 라는 뜻의 moi의 합성어입니다.</p>\r\n\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#616161;margin:0;\">의상디자인을 전공한 친구와 공예를 전공한 친구가 만나 \'오랫동안 친구같은 가죽제품을 만들자\'라는 취지로 시작된 프로젝트입니다.</p>\r\n\r\n<p style=\"text-align:center;padding:45px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468220648889.jpg\" alt=\"천연 베지터블 가죽\"></p>\r\n<p style=\"text-align: left;font-size:1.3em;line-height:1.5em;color:#666;font-weight:700;margin:0;\">천연 베지터블 가죽</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0;\">모든 제품은 화학약품을 사용해 하루만에 무두질이 끝나는 크롬가죽이 아니라 40여일 가까이 걸리는 식물과 나무에서 추출한 탄닌으로 무두질하여 만들어지는 천연 베지터블 가죽으로 만들었습니다. 일반가죽에 비해 고가이지만 사용할수록 자연스럽게 테닝이 되어 멋스러우며 사용 할 수록 낡아서 망가지 것이 아니라 사용하는 시간에 따라 일어나는 변화와 개성으로 자연스러움을 만들어 줍니다.</p>\r\n\r\n<p style=\"text-align:center;padding:45px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468220711540.jpg\" alt=\"크리스페 가죽\"></p>\r\n<p style=\"text-align: left;font-size:1.3em;line-height:1.5em;color:#666;font-weight:700;margin:0;\">크리스페 가죽</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0 0 40px 0;\">크리스페 가죽은 프랑스 고트(산양)가죽으로 <span style=\"color: rgb(239, 103, 15);\">에르메스사에서 자사의 소품제작에 사용</span>하여 유명해진 최고가 가죽입니다. 선명하고 다양한 색상과 겉 표면의 크리스페는 다른가죽에 비해 상처가 잘 나지 않아 스크래치에 강한 가죽에 속합니다.</p>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;line-height:1.5em;color:#666;font-weight:700;margin:0;\">핸드 스티칭</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0;\">말의 안장을 만드는 기술에서 시작된 새들스티치를 사용하여 직접 손으로 한땀한땀 스티치했습니다. 유럽의 명품브랜드에서도 사용하는 방식이며 기계보다 튼튼하고 핸드스티치 고유의 멋스러움이 있습니다.</p>\r\n\r\n<p style=\"text-align:center;padding:45px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468220825717.jpg\" alt=\"린카블레 실\"></p>\r\n<p style=\"text-align: left;font-size:1.3em;line-height:1.5em;color:#666;font-weight:700;margin:0;\">린카블레 실</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0;\">프랑스에서 제조된 100%천연 린넨사(絲)로써,강도가 높아 잘 끊어지지 않으며, 광택이 적어 고급스러움이 특징입니다.</p>\r\n\r\n<p style=\"text-align:center;padding:50px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468220929272.jpg\" alt=\"아미므아 팔찌 컨셉사진\"><img src=\"/data/smarteditor/attach/u3_1468227264192.jpg\" title=\"u3_1468227264192.jpg\"></p>\r\n\r\n<p style=\"text-align:center;padding:50px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468285992724.jpg\" alt=\"아미므아 코스터 컨셉사진\"><img src=\"/data/smarteditor/attach/u3_1468221021355.jpg\"></p>\r\n\r\n<p style=\"text-align:center;padding:50px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468221044173.jpg\" alt=\"아미므아 카드지갑 컨셉사진\"><img src=\"/data/smarteditor/attach/u3_1468221067695.jpg\"></p>\r\n\r\n<p style=\"text-align:center;padding:50px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468221079948.jpg\" alt=\"아미므아 지갑 컨셉사진\"><img src=\"/data/smarteditor/attach/u3_1468221091161.jpg\"></p>\r\n\r\n<p style=\"text-align:center;padding:0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468221131198.jpg\" alt=\"아미므아의 모든 제품은 다음과 같은 패키지로 포장되어 배송됩니다.\"></p>\r\n\r\n\r\n<p style=\"text-align: left;font-size:1.3em;line-height:1.5em;color:#666;font-weight:700;margin:30px 0 0 0;\">제작과정</p>\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0;\">저희 제품은 대량 생산이나 외주업체에 맡겨 작업하지 않습니다. 직접 손으로 패턴을 제작하고, 재단하며 본드칠과 목타 그리고 새들스티치와 마감 과정을 거치며 한땀한땀 정직하게 손으로 꼼꼼하게 제작되어 집니다.</p>\r\n\r\n<p style=\"text-align:center;padding:50px 0 20px 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468286018596.jpg\"></p>\r\n<iframe width=\"697px\" height=\"360px\" src=\"https://www.youtube.com/embed/-WZNnYcA964\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;line-height:1.5em;color:#666;font-weight:700;margin:0;\">제품별 색상 예시 이미지</p>\r\n<p style=\"text-align:center;padding:20px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468221427021.jpg\" title=\"u3_1468221427021.jpg\"></p>\r\n<p style=\"text-align:center;padding:20px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468221437209.jpg\" title=\"u3_1468221437209.jpg\"></p>\r\n<p style=\"text-align:center;padding:20px 0 0 0;margin:0;\"><img src=\"/data/smarteditor/attach/u3_1468286140822.jpg\" title=\"u3_1468286140822.jpg\"></p>\r\n<p style=\"text-align:center;padding:20px 0 0 0;margin:0;\">&nbsp;</p>\r\n\r\n\r\n<div style=\"padding:10px;border:2px solid #ba1b20;margin:0 0 45px 0;\">\r\n    <p style=\"text-align: left;font-size:1.3em;line-height:1.5em;color:#ba1b20;font-weight:700;margin:0 0 15px 0;text-align:center;\">전 제품의 각인 서비스는 무료입니다.</p>\r\n    <p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#222;font-weight:500;margin:0;\">\r\n    - 각인은 두가지 색상(금색/은색)으로 가능하며 최대 영문 15글자까지 가능합니다.</p><p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#222;font-weight:500;margin:0;\">- 후원하신 상품에 새길 각인을 댓글에 남겨주세요.<br>\r\n    - 후원하신 코스터의 종류 및 색상을 댓글에 남겨주세요.<br>\r\n    - 후원하신 팔찌의 색상을 댓글에 남겨주세요.<br>\r\n    - 후원하신 카드지갑과 반지갑의 색상을 댓글에 남겨주세요.\r\n    </p><p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0;\">&nbsp;</p><p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0;\">*댓글예시&nbsp;</p><p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0;\">코스터/블랙/원형/금색각인/I love you</p><p style=\"text-align: left;font-size:1em;line-height:1.5em;color:#666;font-weight:500;margin:0;\">코스터/그레이/플라워형/은색각인/amimoi 로 부탁드립니다~</p>\r\n</div>','<p>&nbsp;</p>','<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n프로젝트 후원 내역은 어디서 확인할 수 있나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트를 후원해주신 내역은 우측 상단의 이미지 클릭 &gt; 후원 프로젝트 에서 확인하실 수 있습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n배송지를 변경하고 싶습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n아래의 메뉴에서 배송지 주소를 직접 변경하실 수 있습니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 후원 변경하기 &gt; 배송지 수정</span>  \r\n<br>\r\n직접 수정이 어려운 경우, 고객센터로 연락주시면 빠르게 조치하여 드리겠습니다. \r\n<br>\r\n<span style=\"display:block;font-weight:700;font-size:14px;line-height:17px;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n언제 배송되나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n보상품 제작은 일반적으로 프로젝트가 성공적으로 종료된 시점에서 최종 후원 내역을 확인한 이후에 시작됩니다.\r\n제작 기간은 보상품 종류에 따라 달라서, 짧게는 2~3주에서부터 2~3개월까지 소요될 수 있지만, 준비 가능한 가장 빠른 시점에 보내드릴 수 있도록 노력하겠습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n보상품을 변경하고 싶습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트가 진행중인 기간에는 언제든지 후원하신 보상품 내용을 변경하실 수 있습니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n후원 취소가 가능한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트가 종료되기 전에는 언제든지 후원 변경/취소가 가능합니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n상품을 받은 후에, 교환이나 반품/환불이 가능한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n보상품은 먼저 후원을 받고, 최종 내역에 따라 제품을 생산하기 때문에 교환이나 반품/환불이 불가능합니다. <br>\r\n단, 제품의 불량으로 인한 하자는 언제든지 필요한 조치를 취해 드리고 있사오니,  언제든지 고객 센터로 문의 부탁드립니다. \r\n\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n\r\n<span style=\"display:block;font-weight:700;font-size:14px;line-height:17px;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n\r\n</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','7/12|펀딩시작$8/2|펀딩종료$8/3|생산시작$8/8|배송시작$8/12|배송완료',0,'N','N'),(120,0,3,13,'p120_1470733167943.jpg','환성 돈봉투','Fashion','2016-07-18 15:00:00','2016-08-25 23:30:00',100000,'곡성, 돈봉투, 추석, 용돈, 봉투, ',2,'<p>&nbsp;</p>','So cool 작가 이성우님과의 콜라보-환호성 돈 들린 봉투','100won','N','CF',0,0,'','p120_1468819998278.jpg,p120_1468820079695.jpg,p120_1468820079697.JPG,p120_1468820079757.JPG,','<p><b style=\"line-height: 1.5;\"><span style=\"font-size: 18pt; color: rgb(81, 143, 187);\">\'절대 현혹되는 돈 들린 봉투\'</span></b>&nbsp;</p><p>&nbsp;</p><p><span style=\"font-size: 14pt; color: rgb(81, 143, 187);\">영화 「곡성」을 \'오마주\'한 돈 봉투.</span></p><p>&nbsp;</p><p>즐겁게 돈봉투를 주고 받을 계절이 돌아오고 있습니다.</p><p>하지만 한번쯤 돈봉투를 보며 있는 그대로의 돈의 모습을 보았으면 좋겠다는 생각에&nbsp;<span style=\"line-height: 1.5;\">‘절대 현혹되는 돈 들린 봉투’를 디자인하게 되었습니다.</span></p><p>&nbsp;</p><p>물론 이 돈봉투에도 엄연히 이름이 있습니다.</p><p><span style=\"color: rgb(81, 143, 187); font-size: 14pt;\"><b>‘환성’</b></span><span style=\"font-size: 14pt;\">&nbsp;</span></p><p><span style=\"font-size: 14pt;\">&nbsp;</span></p><p>겉으로든, 아니면 속으로라도 우리는 돈봉투를 받으면 뒤돌아 조용히 ‘환성’을 지릅니다.&nbsp;<span style=\"line-height: 1.5;\">그것은 돈 자체가 아니라 그것이 가져다 줄 만족을 기대하며 기뻐하게 됩니다.</span></p><p>그렇다면 우리는 어떻게 ‘현혹’될 수 있는가?&nbsp;<span style=\"line-height: 1.5;\">돈의 어떤 면이 우리를 속일 수 있는가?</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p>영화 ‘곡성’은 마을 사람들 전체가 환각에 빠져있는 상황이 묘사됩니다.&nbsp;<span style=\"line-height: 1.5;\">그리하여 믿고 싶은 대로 보고, 보고 싶은 대로 사물이 보이게 됩니다.&nbsp;</span><span style=\"line-height: 1.5;\">어쩌면 현대 자본주의 사회에서 우리는 돈에 힘에 집단적 환상을 보는 것을 아닐까요?&nbsp;</span><span style=\"line-height: 1.5;\">그래서 &nbsp;‘뭣이 중헌디?’를 다시 한번 깨우칠 필요가 있을지 모르겠습니다.</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p>신성한 노동으로 얻은 소중한 가치를 기꺼이 내어주는 우리의 사랑하는 사람들의 마음을</p><p>더 중요하게 보고 감사해 하는 계절이 되었으면 합니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><span style=\"color: rgb(225, 225, 225);\">는 개뿔....</span></p><p><span style=\"color: rgb(194, 194, 194);\">여기까지 다 읽었다면 미끼를 문것이여..</span></p><p><span style=\"color: rgb(172, 172, 172);\">뭐더러 이걸 다 읽었디야.&nbsp;</span></p><p><span style=\"color: rgb(154, 154, 154);\">100원에 봉투 2장, 200원에 봉투 4장 주는 오지랖 이벤트여.</span></p><p><span style=\"color: rgb(125, 125, 125);\">싸다고 현혹되지 말어...&nbsp;</span></p><p><font color=\"#7d7d7d\"><span style=\"color: rgb(70, 70, 70);\">니들이 살 수 있는 수량은 어차피 한정되어 있응게..</span></font></p><p>&nbsp;</p><div><br></div><div><br></div><div><br></div><div><img src=\"/data/smarteditor/attach/u3_1468819603976.jpg\" title=\"u3_1468819603976.jpg\"></div><div>▲ 봉투안에 돈을 넣어 주세요. 봉투의 절개된 부분으로 세종대왕님과 신사임당님이 나타나게 됩니다.</div><div>봉투에 얼마가 들어있는지는 아무도 모릅니다.기대감에 봉투를 열면 \'미끼를 물어\' 버리는 셈이죠.</div><div><br></div><div><br></div><div><br></div><div><img src=\"/data/smarteditor/attach/u3_1468819721903.jpg\" title=\"u3_1468819721903.jpg\"><br style=\"clear:both;\">▲ 봉투 뒷면에는 \'절대 현혹되지 마라\' 라고 쓰여있습니다.</div><div>과연 돈 봉투를 받고 현혹되지 않는 사람이 몇이나 있을까요?</div><div><br></div><div><br></div><div><br></div><div><br style=\"clear:both;\"><br style=\"clear:both;\"><br></div><div><br></div><p>&nbsp;<img src=\"/data/smarteditor/attach/u3_1468548182712.jpg\" title=\"u3_1468548182712.jpg\"></p><p><span style=\"line-height: 1.5;\">* 상세 스펙</span>&nbsp;</p><p>1. 돈봉투(1만원권)</p><p>&nbsp; &nbsp;가) 재질: 종이</p><p>&nbsp; &nbsp;나) 크기: 149mm X 73mm (가로X세로)</p><p>&nbsp;</p><p>&nbsp;</p><p>2. 돈봉투(5만원권)</p><p>&nbsp; &nbsp;가) 재질: 종이</p><p>&nbsp; &nbsp;나) 크기: 155mm X 73mm (가로X세로)</p><p>&nbsp;</p><div><br></div>','<p>&nbsp;</p>','<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n프로젝트 후원 내역은 어디서 확인할 수 있나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트를 후원해주신 내역은 우측 상단의 이미지 클릭 &gt; 후원 프로젝트 에서 확인하실 수 있습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n배송지를 변경하고 싶습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n아래의 메뉴에서 배송지 주소를 직접 변경하실 수 있습니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 후원 변경하기 &gt; 배송지 수정</span>  \r\n<br>\r\n직접 수정이 어려운 경우, 고객센터로 연락주시면 빠르게 조치하여 드리겠습니다. \r\n<br>\r\n<span style=\"display:block;font-weight:700;font-size:14px;line-height:17px;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n언제 배송되나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n보상품 제작은 일반적으로 프로젝트가 성공적으로 종료된 시점에서 최종 후원 내역을 확인한 이후에 시작됩니다.\r\n제작 기간은 보상품 종류에 따라 달라서, 짧게는 2~3주에서부터 2~3개월까지 소요될 수 있지만, 준비 가능한 가장 빠른 시점에 보내드릴 수 있도록 노력하겠습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n보상품을 변경하고 싶습니다.\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트가 진행중인 기간에는 언제든지 후원하신 보상품 내용을 변경하실 수 있습니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n후원 취소가 가능한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n프로젝트가 종료되기 전에는 언제든지 후원 변경/취소가 가능합니다.\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n상품을 받은 후에, 교환이나 반품/환불이 가능한가요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0px;color:#3b3b3b;\">\r\n보상품은 먼저 후원을 받고, 최종 내역에 따라 제품을 생산하기 때문에 교환이나 반품/환불이 불가능합니다. <br>\r\n단, 제품의 불량으로 인한 하자는 언제든지 필요한 조치를 취해 드리고 있사오니,  언제든지 고객 센터로 문의 부탁드립니다. \r\n\r\n<span style=\"display:block;text-decoration: underline;\">* 후원프로젝트 &gt; 해당프로젝트 선택 &gt; 보상품 변경 &gt; 후원 변경하기</span>\r\n\r\n<span style=\"display:block;font-weight:700;font-size:14px;line-height:17px;\">\r\n전화번호: 02-548-1510 (평일 10시 ~ 19시)<br>\r\n이메일: support@ozr.kr  \r\n</span>\r\n\r\n</p>','<p><img src=\"/data/smarteditor/attach/u3_1468552405921.jpg\" title=\"u3_1468552405921.jpg\"><br style=\"clear:both;\">▲ 코리아헤럴드에 실린 작가의 작품</p><p>&nbsp;</p><p>&nbsp;</p><p>&lt; So Cool - The Coolest Thoughts For The Hottest Heart&gt;의 저자&nbsp;</p><p><span style=\"font-size: 14pt;\"><b>이성우</b></span> (필명: Artier Lee)</p><p>&nbsp;</p><p>작가는</p><p>“참된 예술은 창의적 예술가의 저항할 수 없는 충동으로 특징지어진다.”<br><span style=\"line-height: 1.5;\">“재능이란 신이 준 것이다. 그것을 가지고 하는 일은 신에게 주는 당신의 선물이다.” 라는&nbsp;<br></span><span style=\"line-height: 1.5;\">아인슈타인과 레오 버스카글리아의 말을&nbsp;</span><span style=\"line-height: 1.5;\">누구보다도 음미하고 즐긴다.</span></p><p><span style=\"line-height: 1.5;\">초등학교 1학년 때 만화를 처음 본 순간을 결코 잊지 못하는 그는&nbsp;</span><span style=\"line-height: 1.5;\">그 이후 저항할 수 없는 충동에 시달리게 되는데&nbsp;</span><span style=\"line-height: 1.5;\">그것은 바로 그림을 따라 그리는 일이었다.&nbsp;</span><span style=\"line-height: 1.5;\">그가 음미하던 말마따나 부모님, 선생님의 만류에도 불구하고 자신의&nbsp;</span><span style=\"line-height: 1.5;\">재능을 확신한 그에게는&nbsp;</span><span style=\"line-height: 1.5;\">그 선물을 통하여 무엇을 세상에 선물할 것인가가 유일한 관심사였다.</span></p><p><span style=\"line-height: 1.5;\">그의 선물이 세상에 알려지기까지는 수십년의 세월이 필요했다.&nbsp;</span><span style=\"line-height: 1.5;\">학습지 삽화가, 캐릭터 디자이너, 웹 디자이너 등의 경력을 거쳐 디자인 회사를 운영하던 삼십대 후반</span></p><p>그가 처음으로 시도한 연재만화 &lt;쏘미와 호보&gt;는 2007년 10월 코리아 헤럴드 신문 문화면에 영문판으로 처음 등장하게 되었고,&nbsp;<span style=\"line-height: 1.5;\">2008년 11월 부터는 한겨레 신문 인터넷판에 한국어로 동시 연재되기 시작하였다.</span></p><p><span style=\"line-height: 1.5;\">작가는 자신의 작품이 자신의 꿈의 산물이라는 것을 서슴없이 인정한다.&nbsp;</span><span style=\"line-height: 1.5;\">그리고 행복해한다. 그리고 이제 그의 꿈은 더 큰것으로 옮겨가고 있다.</span></p><p>자신의 작품들이 문화적 아이콘이 되는 것, 세계적 문화 컨텐츠로 발돋움 하는것이다.&nbsp;<span style=\"line-height: 1.5;\">영문으로 연재를 시작한 이유도 그러한 미래를 꿈꾸었기 때문이라고 한다.</span></p><p><span style=\"line-height: 1.5;\">겁도 없고 틀도 없으며 늘 자유를 꿈꾸는 그의 노래가 더욱 많은 공감대를 이루며</span></p><p><span style=\"line-height: 1.5;\">\"So Cool\"이라고 외칠 날을 그는 꿈꾸고 있다.</span></p>','<p>&nbsp;</p>','7/18|펀딩 시작$8/25|펀딩 종료$8/26|생산 시작$9/1|배송 시작$9/9|배송 완료',0,'N','N'),(121,0,3,0,'p121_1469172795075.jpg','VAGO_네이버팜스토어','Smart','2016-07-19 19:00:00','2016-08-26 23:30:00',5000000,'',2,'<p><img src=\"/data/smarteditor/attach/u435_1480481330626.JPG\" title=\"u435_1480481330626.JPG\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1480481334659.JPG\" title=\"u435_1480481334659.JPG\"><br style=\"clear:both;\">&nbsp;</p>','None','vava',NULL,'CF',0,0,'','','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','',0,'N','Y'),(122,0,564,12,'p122_1469438608220.jpg','Vago, 휴대용 진공 압축기','Smart','2016-07-25 18:30:00','2016-08-29 23:30:00',5000000,'vago,여행,여행짐싸기,여행짐줄이기,여행가방싸기,여행가방,진공팩,travle,travellife,travelbag',2,'<p style=\"padding: 0px 0px 0px 10px; font-weight: 700;\">[VAGO - 휴대용 진공 압축기] <br>35,000원 ~ </p>\r\n','당신의 여행가방의 부피를 줄여드립니다!','vago','Y','CF',0,0,'1144224442300776','p122_1468891148203.jpg,','<div style=\"text-align: center;\" align=\"center\"><br></div>\r\n\r\n<p style=\"margin: 0px 0px 30px 0px; padding: 0px; text-align: center;\">\r\n<img src=\"/data/smarteditor/attach/u28_1481274214100.jpg\" title=\"u28_1481274214100.jpg\">\r\n<a href=\"http://storefarm.naver.com/hwbc/products/570739019\" target=\"_blank\" style=\"border:0px;\"><img src=\"/data/smarteditor/attach/u28_1481274224463.jpg\" title=\"u28_1481274224463.jpg\"></a></p>\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\">\r\n<img title=\"u3_1472533118821.jpg\" src=\"/data/smarteditor/attach/u3_1472533118821.jpg\"></p><p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><img alt=\"Why creat VAGO?\" src=\"/data/smarteditor/attach/u3_1468891511879.jpg\"></p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\r\n해외 여행이 대중화 되니 요즘 여행을 다녀오면서 가방의 부피때문에 고민할 때가 많은데요.<br>\r\n특히 여행의 마지막날 쇼핑한 물건들과 가족과 지인들에게 주려고 산 선물들로 닫히지 않는 가방을 보면..<br>\r\n심하게 고민이 되고는 합니다.<br>그래서 만들어진 제품이 바로 VAGO입니다.VAGO는 바로 이럴 때, 가장 필요한 제품(여행용품)입니다.</p>\r\n<p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\">\r\n<img src=\"/data/smarteditor/attach/u3_1468891627445.jpg\">\r\n</p>\r\n\r\n<p style=\"margin: 0px; padding: 45px 0px 0px; text-align: center;\"><img alt=\"What is VAGO?\" src=\"/data/smarteditor/attach/u3_1468891651462.jpg\"></p>\r\n\r\n<p style=\"margin: 30px 0px 0px; text-align: left; color: rgb(27, 230, 87); line-height: 1.5em; font-size: 1.3em; font-weight: 700;\">VAGO란?</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">VAGO는 휴대용 진공 압축기 입니다.<br>여행을 위한 짐의 부피를 줄여주고, 더 많은 공간을 사용할 수 이도록 도와주는 제품으로 사이즈가 작아 여행하는 동안 쉽게 가지고 다닐 수 있다는게 가장 큰 장점이죠.</p>\r\n\r\n<p style=\"margin: 0px; padding: 30px 0px 0px; text-align: center;\"><img alt=\"VAGO의 장점- 효율적인 공간활용\" src=\"/data/smarteditor/attach/u3_1468891919258.gif\"></p>\r\n<p style=\"padding: 15px 0px; text-align: center;\"><span style=\"padding: 10px; color: rgb(0, 0, 0); font-weight: 700; display: inline-block; background-color: rgb(114, 226, 147);\">VAGO의 장점1 _ 효율적인 공간활용</span></p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">일반적으로(보통) 여행 시 가방속은 티셔츠, 바지, 속옷 등 의류가 대부분을 차지합니다. 이러한 의류의 옷과 옷 사이 빈 공간에는 공기로 가득 차 있습니다. 어쩌면 사실 우리 캐리어 속에는 공기가 반정도 차 있을지도 모르는 일이죠.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">이렇게 공기로 인하여 부피를 가득 차지하는 의류들을 진공압축기인 VAGO를 통해 빼내어 더 많은 공간을 만들어 줄 수 있습니다.</p>\r\n<p style=\"margin: 0px 0px 35px; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1468891943820.jpg\"></p>\r\n\r\n\r\n<p style=\"margin: 0px; padding: 30px 0px 0px; text-align: center; border-top-color: rgb(204, 204, 204); border-top-width: 1px; border-top-style: dashed;\"><img alt=\"VAGO의 장점- 세균 및 냄새방지\" src=\"/data/smarteditor/attach/u3_1468891980033.jpg\"></p>\r\n<p style=\"padding: 15px 0px; text-align: center;\"><span style=\"padding: 10px; color: rgb(0, 0, 0); font-weight: 700; display: inline-block; background-color: rgb(114, 226, 147);\">VAGO의 장점2 _ 세균 및 냄새방지</span></p>\r\n<p style=\"margin: 15px 0px 35px; text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">여행하는 동안 세탁하지 못한 옷들을 비닐에 싸서 그대로 들고 다녀서 가방 안에 좋지 않은 냄새가 베고는 하는데요. 이때 VAGO를 활용하면 냄새나는 옷들을 여행 팩에 압축하여 냄새 문제를 깔끔하게 해결할 수 있습니다.</p>\r\n\r\n<p style=\"margin: 0px; padding: 30px 0px 0px; text-align: center; border-top-color: rgb(204, 204, 204); border-top-width: 1px; border-top-style: dashed;\"><img alt=\"VAGO의 장점- 휴대성\" src=\"/data/smarteditor/attach/u3_1468892019019.jpg\"></p>\r\n<p style=\"padding: 15px 0px; text-align: center;\"><span style=\"padding: 10px; color: rgb(0, 0, 0); font-weight: 700; display: inline-block; background-color: rgb(114, 226, 147);\">VAGO의 장점3 _ 휴대성</span></p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">VAGO는 제품의 높이가 70mm이고 무게는 85그램으로 매우 작아서 간편하게 휴대가 가능합니다.</p>\r\n\r\n<p style=\"margin: 0px; padding: 30px 0px 0px; text-align: center; border-top-color: rgb(204, 204, 204); border-top-width: 1px; border-top-style: dashed;\"><img alt=\"VAGO의 장점- 편의성 &amp; 범용성\" src=\"/data/smarteditor/attach/u3_1468892049220.jpg\"></p>\r\n<p style=\"padding: 15px 0px; text-align: center;\"><span style=\"padding: 10px; color: rgb(0, 0, 0); font-weight: 700; display: inline-block; background-color: rgb(114, 226, 147);\">VAGO의 장점4 _ 편의성 및 범용성</span></p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">VAGO는 편의성과 범용성을 두루 갖춘 제품입니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">VAGO를 위해 별도의 어댑터나 베터리를 가지고 다닐 필요가 없습니다. 스마트폰 등에 사용되는 micro-USB 케이블과 어댑터를 사용하여 전원을 연결하거나 스마트폰의 외장 베터리와 연결하여 편리하게 사용하실 수 있습니다.(쇼핑을 좋아하는 여행자들에게 더 좋은 제품입니다.)</p>\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1468892098995.gif\"></p>\r\n\r\n\r\n<p style=\"margin: 0px; padding: 45px 0px 0px; text-align: left; color: rgb(27, 230, 87); line-height: 1.5em; font-size: 1.3em; font-weight: 700;\">VAGO의 사용법</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">VAGO를 사용하는 방법은 아주 간단합니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em; font-weight: 700;\">\r\n1) 비닐팩에 옷을 넣고,<br>2) VAGO를 그 위에 장착합니다.<br>3) USB전원을 연결하고,<br>4) 푸쉬 버튼을 누르기만 하면 작동합니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">압축이 완료되면 VAGO의 압력센서에서 이를 인식하고 자동으로 정지합니다.</p>\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><img title=\"VAGO 사용법\" src=\"/data/smarteditor/attach/u3_1468892158586.jpg\"></p>\r\n\r\n\r\n<p style=\"margin: 45px 0px 0px; padding: 0px; text-align: center;\"><img title=\"VAGO Specification\" src=\"/data/smarteditor/attach/u3_1468892270577.jpg\"></p>\r\n<p style=\"text-align: left; color: rgb(51, 51, 51); line-height: 1.5em; font-size: 1em;\">무게 : 86g &nbsp;|&nbsp; 가로 : 3.6cm &nbsp;|&nbsp; 높이 : 7cm &nbsp;|&nbsp; 흡입력 : 225mm Hg(수은주밀리미터) &nbsp;|&nbsp; OPEN Flow : 1.8L/Min</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><img alt=\"제품상세컷\" src=\"/data/smarteditor/attach/u3_1468892298284.gif\"></p>\r\n\r\n\r\n<p style=\"margin: 0px; padding: 45px 0px 10px; text-align: left; color: rgb(27, 230, 87); line-height: 1.5em; font-size: 1.3em; font-weight: 700;\"><img alt=\"How VAGO got here?\" src=\"/data/smarteditor/attach/u3_1468892331747.jpg\"></p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">VAGO를 개발하기에 앞서, 저희는 많은 여행자들과 직접 만나 수많은 인터뷰를 진행했습니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">인터뷰를 통해 여행자들이 여행을 할 때 충분히 짐을 담을 수 있는 공간을 확보 하는 것에 관심이 많다는 것을 알게 되었습니다. 환경적 측면을 고려했을 때 새로운 타입의 여행가방을 만들기 보다는 VAGO와 같은 제품을 개발하는 것이 좋다고 생각했습니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">지금의 VAGO와 같은 제품을 개발하는데 약 1년 이상의 시간이 걸렸습니다. 그 과정에서 가장 힘들었던 일은 진공펌프의 사이즈를 줄이는 일이었습니다. 또한 펌프 업체와의 협력을 통하여 오직 VAGO만을 위한 완전히 새로운 재료로 제품을 디자인하였습니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">저희는 여러 채널을 통해 최고 품질의 제품을 생산해 낼 수 있는 제조업체들과 만났습니다.<br>그러한 길고 힘든 과정에서 많은 분들의 지원으로 VAGO를 개발할 수 있었습니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">도와주신 모든 분들께 정말 감사합니다.</p>\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1468892377255.jpg\"></p>\r\n\r\n\r\n<p style=\"margin: 0px; padding: 45px 0px 0px; text-align: center;\"><img alt=\"VAGO color\" src=\"/data/smarteditor/attach/u3_1468892468064.jpg\"></p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">VAGO는 현재 4가지 색으로 제작되고 있습니다.<br>스페셜 에디션으로 아이언맨을 연상시키는 메탈로 코팅된 <span style=\"color: rgb(231, 82, 85);\">IRON VAGO</span>와 캡틴 아메리카를 떠올리게되는 <span style=\"color: rgb(61, 93, 230);\">CAPTAIN VAGO</span>도 있습니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">향후 더 많은 색상으로 제작할 예정입니다.</p>\r\n\r\n<p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\">\r\n    <img src=\"/data/smarteditor/attach/u3_1468892498260.gif\"><img src=\"/data/smarteditor/attach/u3_1468892505437.gif\">\r\n</p><p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\"><span style=\"color: rgb(255, 0, 0); font-size: 18pt;\"><strong><br></strong></span></p><p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\"><span style=\"color: rgb(255, 0, 0); font-size: 18pt;\">&nbsp;</span></p><p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\"><span style=\"color: rgb(255, 0, 0); font-size: 18pt;\">&nbsp;</span></p><p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\"><span style=\"color: rgb(255, 0, 0); font-size: 18pt;\">&nbsp;</span></p><p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\"><span style=\"color: rgb(255, 0, 0); font-size: 18pt;\">&nbsp;</span></p><p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\"><span style=\"color: rgb(255, 255, 255); font-size: 24pt; background-color: rgb(97, 185, 119);\"><strong>모든 제품은 무료배송으로 진행됩니다.</strong></span></p>','<p>&nbsp;</p>','<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\n국가마다 전원이 다른데요, VAGO를 다른 나라에서도 사용이 가능한가요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n네, VAGO는 USB 커넥터를 사용하며 Micro-USB 케이블과 어댑터로 작동합니다. 스마트폰 케이블과 어댑터를 여행가는 다른 나라에서 사용할 수 있는 것과 같습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\nVAGO를 사용해서 짐을 압축하려면 시간이 얼마나 걸리나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n가장 최근 프로토타입 제품으로 테스트 한 결과, 약 5분 가량이면 압축 작업을 마칠 수 있습니다만 진공백에 얼마나 많은 짐이 들어있느냐에 따라 조금 차이는 발생할 수 있습니다.<br>\r\n실제 대량 생산하는 제품에는 새 모터를 사용할 예정이며 이에 따라 진공압축 작업 시간이 더욱 단축될 것으로 예상됩니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\nVAGO를 이용해서 압축할 때 소음이 발생하나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n평균적으로 50dB 정도의 소음이 발생하는데요, 신경에 거슬릴 정도는 아닙니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\nVAGO의 진공백 사이즈 크기는 어떻게 되나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n진공백의 사이즈는 50cm(가로)x60cm(세로) 이며, 일반적인&nbsp;기내용 캐리어의 사이즈에 넣을 수 있도록 제작되었습니다.</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\n진공백 안에 옷을 얼마나 넣을 수 있나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n비디오에 나온 것을 기준으로 셔츠4장 스웨터 4장, 팬츠2장, 속옷 6장, 양말 3켤레가 들어갑니다만 실제 옷 사이즈에 따라 들어갈 수 있는 양이 조금 다릅니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\n진공백은 아무데서나 구매해서 사용이 가능한가요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n일반 진공청소기로 사용하는 진공백과는&nbsp;흡입구의 규격이 다르기 때문에 혼용하여 사용하실 수 없으며 VAGO에서 제작한 전용 진공백만 사용이 가능합니다.</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\n전용 진공백을 추가로 주문이 가능한가요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n금번 크라우드펀딩에서는 진공백을 추가로 주문할 수는 없습니다만, 크라우드 펀딩이 끝난 후 추가적으로 진공백을 구매하실 수 있도록 진행할 예정입니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\n오지랖에서 프로젝트가 끝나면 추가로 진공백을 어떻게 구매하나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n향후 다양한 채널로 구매할 수 있도록 파트너십을 진행중에 있습니다. 구매하신 모든 분들께 메일을 통하여 알려드리도록 하겠습니다. 추가 백 구매는 걱정하지 않으셔도 됩니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\nVAGO의 색상과 배송 주소 등의 정보를 입력할 수 있나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n오지랖에서 크라우드펀딩 후원을 진행하면 제품의 색상 및 배송지 등의 정보를 입력할 수 있습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\nAC를 사용해서 VAGO의 충전이 가능 한가요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\nMicro-USB 케이블과 Adapt 또는 휴대용 배터리를 사용하여 VAGO를 충전할 수 있습니다.<br>\r\nVAGO에는 내장 배터리가 별도로 없으며 가정용 VC를 직접 연결하는 방법은 없습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\nVAGO에 품질보증기간이 있나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n네, 품질보증기간은 1년입니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">\r\n진공백은 재사용이 가능한가요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">\r\n가능합니다.&nbsp;진공백은 매우 튼튼한 재질로 제작되었으며 일반적으로 사용하는데 있어서는 여러번 재사용이 가능합니다.</p>','<p>&nbsp;</p>','<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\r\n    안녕하세요, 저희는 대만에서 온 <span style=\"color: rgb(34, 34, 34); font-weight: 700;\">CREATION CELL</span> 입니다.</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">\r\n    저희는 혁신적인 아이디어를 바탕으로 멋진 제품을 만드는데 노력하고 있습니다.<br>더욱더 많은 분들이 저희 제품을 통해 새로운 경험을 할 수 있길 바랍니다.</p>\r\n<p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center;\"><img title=\"Maker Creation Cell\" src=\"/data/smarteditor/attach/u3_1468892606093.jpg\"></p>','7/25|펀딩 시작$8/29|펀딩 종료$9/1|제품 제작$9/20|배송 시작(배송지연)$9/30|배송 완료(배송지연)$10/15|배송 시작(변동 후)$10/25|배송 완료(변동 후)',3,'N','N'),(123,0,564,13,'p123_1473153119498.jpg','Pick-Up Bike ','Outdoor','2016-09-06 17:30:00','2016-10-25 23:30:00',5500000,'카고자전거, bike, bicycle, Cargobicycle, 이런자전거처음',2,'<p><span style=\"font-weight: bold;\">[Pick-Up Bike - 카고 바이크]&nbsp;</span><br style=\"font-weight: bold;\"><span style=\"font-weight: bold;\">599,000원 ~&nbsp;</span></p>','다양하게 활용이 가능한 카고 바이크','pickup','Y','CF',0,0,'','p123_1472106412643.jpg,p123_1472106412648.jpg,p123_1472106412785.jpg,p123_1472112504820.jpg,','<p style=\"padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">Pick-Up Bike란?</span></p>\r\n\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\"><span style=\"font-weight:bold\">Pick-Up Bike</span>는 짐을 싣고 다닐 수 있는 자전거. 소위 말하는 카고 바이크(Cargo Bike) 입니다.<br>한국에서는 조금 생소하지만 유럽이나 미국 등지에서는 다양한 방법으로 활용하며 쓰이고 있으며 그 활용법은 무궁무진합니다.<br><br>최근에는 신사동에 있는 유명 샐러드 카페에서 카고 바이크(Cargo Bike)로 배달을 시작하여 주목을 끌기도 했습니다.<br>자전거로 유명한 대만에서 제작된 Pick-Up Bike는 유럽이나 미국이 아닌 아시아의 특성에 맞게 디자인하여 찾아왔습니다.</p>\r\n\r\n\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u435_1472103782710.jpg\" title=\"u435_1472103782710.jpg\"></p>\r\n\r\n<p style=\"margin: 10px 0; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u435_1472174418139.gif\" title=\"u435_1472174418139.gif\" style=\"line-height: 1.5;\">&nbsp;</p>\r\n\r\n\r\n<hr style=\"border:1px dashed #eaeaea;margin:10px 0 20px 0;\">\r\n\r\n\r\n<p style=\"margin:30px 0 0 0; padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">Pick-Up Bike로는 무엇을 할 수 있나요?</span></p><p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">우리는 일상에서 쇼핑백이나 가방, 봉투 혹은 박스에 물건을 담고는 합니다. 하지만 그런 짐들이 많아지면 두 손으로 들기도 벅차고 자연스레 움직이기도 불편합니다. 뿐만 아니라 강아지나 고양이 같은 반려동물을 케이지에 넣어 이동할 때도 마찬가지 입니다. <br>가까운 곳은 그나마 괜찮지만 버스 2~3정거장 거리라면 걸어서 가기에는 무겁고 멀게 느껴지고 대중교통이나 자동차를 이용하기도 애매합니다. 그렇다고 반려 동물을 위한 트레일러나 자동차를 구입하기엔 가격이 큰 걸림돌이 됩니다.</p><p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\"><span style=\"font-size: 1em; line-height: 1.5em;\">Pick-Up Bike는 이러한 문제를 해결 할 수 있도록 여러가지로 활용이 가능합니다. 기본적인 용도로는 짐을 싣거나 아이를 태우거나 반려동물을 태우고 다닐 수도 있습니다. 뿐만 아니라 예쁘게 꾸며 소품으로도 활용이 가능하며 비싼 푸드트럭 대신에 저렴한 비용으로 상업적 활용도 가능합니다.</span></p>\r\n\r\n<p style=\"margin: 15px 0 30px 0; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u435_1472104599026.gif\" title=\"u435_1472104599026.gif\"></p><p style=\"margin: 15px 0 30px 0; padding: 0px; text-align: center;\">&nbsp;</p>\r\n\r\n\r\n<hr style=\"border:1px dashed #eaeaea;margin:10px 0 20px 0;\">\r\n\r\n\r\n<p style=\"margin:30px 0 0 0; padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">Pick-Up Bike의 특징 - 합리적인 가격</span></p>\r\n<p style=\"font-size: 1em; line-height: 1.5em; color: rgb(97, 97, 97);\">카고 바이크(Cargo Bike)는 대부분 유럽이나 미국에서의 수입이 대부분이며 가격 또한 무시할 수 없습니다.<br>처음부터 이러한 자전거를 구매하려면 아무래도 비용에 대한 걱정이 생기는 것은 당연한 일입니다. 일반 자전거에 트레일러를 부착시키거나 그 이외에도 다른 옵션을 추가하기 위해서는 적지 않은 비용이 들어갑니다.<br>Pick-Up Bike는 이러한 소비자의 부담을 덜어주기 위해 양질의 부품을 사용하면서도 최대한 합리적인 가격을 유지할 수 있도록 노력 하였습니다.</p><p style=\"font-size: 1em; line-height: 1.5em; color: rgb(97, 97, 97);\"><span style=\"font-size: 1em; line-height: 1.5em;\">&nbsp;</span></p>\r\n\r\n<p style=\"text-align:center;\">\r\n<iframe width=\"560\" height=\"315\" src=\"//www.youtube.com/embed/PZD7Ig3ozMs?autoplay=1&amp;playlist=PZD7Ig3ozMs&amp;loop=1&amp;controls=0&amp;showinfo=0&amp;fs=0&amp;rel=0\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n</p>\r\n<p style=\"text-align:center;\"><iframe width=\"560\" height=\"315\" src=\"//www.youtube.com/embed/sdMlExSgtTQ?autoplay=1&amp;playlist=sdMlExSgtTQ&amp;loop=1&amp;controls=0&amp;showinfo=0&amp;fs=0&amp;rel=0\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n</p>\r\n<hr style=\"border:1px dashed #eaeaea;margin:10px 0 20px 0;\">\r\n\r\n<p style=\"margin:30px 0 0 0; padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">Pick-Up Bike의 특징 - 디자인과 설계</span></p>\r\n<p style=\"font-size: 1em; line-height: 1.5em; color: rgb(97, 97, 97);\">\'Pick-Up Bike\' 형태의 카고 바이크(Cargo Bike)는 기본적으로 유럽에서 많이 사용되어 대부분이 유럽의 사람들과 그들의 환경에 맞추어 설계가 되어있습니다.</p><p style=\"font-size: 1em; line-height: 1.5em; color: rgb(97, 97, 97);\"><span style=\"font-size: 1em; line-height: 1.5em;\">하지만 저희는 아시아의 환경에 맞추어 카고 바이크(Cargo Bike)를 디자인하였고, 운전자가 편안하게 자전거를 탈 수 있도록 승차 위치도 조정했습니다.</span></p><p style=\"font-size: 1em; line-height: 1.5em; color: rgb(97, 97, 97);\">&nbsp;</p><p style=\"margin-bottom: 30px; text-align: center;\"><img src=\"https://www.ozr.kr/data/smarteditor/attach/u435_1472103989831.jpg\" title=\"u435_1472103989831.jpg\"></p>\r\n\r\n\r\n<hr style=\"border:1px dashed #eaeaea;margin:10px 0 20px 0;\">\r\n\r\n\r\n<p style=\"margin:30px 0 0 0; padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">Pick-Up Bike의 특징 - 적재량</span></p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">Pick-Up Bike는 최대 150kg까지 적재할 수 있습니다.<br><span style=\"font-size: 1em; line-height: 1.5em;\">자전거의 폭에 맞는 Box만 있다면 무엇이든 넣을 수도 있습니다.<br></span><span style=\"font-size: 1em; line-height: 1.5em;\">위에서 말씀드렸듯이 여러가지 짐들이나 10세 이하의 아이 두 명, 혹은 중대형의 강아지 같은 반려동물, 가까운 피크닉에 들고 갈 음료나 맥주 3BOX정도는 무리없이 넣고 달릴 수 있습니다.<br>연인의 몸무게가 150kg이 넘지 않는다면 연인도 태울 수 있겠죠.</span><span style=\"font-size: 1em; line-height: 1.5em;\">&nbsp;</span></p>\r\n\r\n<p style=\"margin: 15px 0 30px 0; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u435_1472104694033.jpg\" title=\"u435_1472104694033.jpg\"></p>\r\n\r\n\r\n<hr style=\"border:1px dashed #eaeaea;margin:10px 0 20px 0;\">\r\n\r\n\r\n<p style=\"margin:30px 0 0 0; padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">Pick-Up Bike의 특징 - 기술</span></p>\r\n\r\n\r\n<p style=\"text-align: left; color: #2d2d2d;font-weight:bold; line-height: 1.5em; font-size: 1.1em;\">Pick-Up Bike의 다양한 고유기능</p>\r\n\r\n<p style=\"margin:15px 0 5px 0;text-align: left; color: #e96931;line-height: 1.5em; font-size: 1em;\">ESS (Extend Steering System)&nbsp;</p>\r\n<p style=\"margin:0 0 15px 0;text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">범용 베어링으로 방향조정 장치를 연장하여 뛰어난 운전감을 유지하도록 하였습니다.</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u435_1472105359677.jpg\" title=\"u435_1472105359677.jpg\"></p>\r\n\r\n\r\n<p style=\"margin:15px 0 5px 0;text-align: left; color: #e96931;line-height: 1.5em; font-size: 1em;\">EMS (Easy Mount System) : 쉽고 빠른 조립 시스템</p>\r\n<p style=\"margin:0 0 15px 0;text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">사용자가 자신이 필요한용도로 사용할 수 있도록 플레이트(판넬)에 다양하게 구멍을 뚫어 각기 다른 모양의 상자를 싣기 위한 플레이트 조립을 간편하고 빠르게 할 수 있습니다.</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><iframe width=\"560\" height=\"315\" src=\"//www.youtube.com/embed/rwKN19PyEjE?autoplay=1&amp;playlist=rwKN19PyEjE&amp;loop=1&amp;controls=0&amp;showinfo=0&amp;fs=0&amp;rel=0\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n</p>\r\n\r\n<p style=\"margin: 0 0 30px 0; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u435_1472105492803.jpg\" title=\"u435_1472105492803.jpg\"></p>\r\n\r\n\r\n\r\n<p style=\"text-align: left; color: #2d2d2d;font-weight:bold; line-height: 1.5em; font-size: 1.1em;\">압축 프레임 디자인 - Compact Fame Design</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">대만에서 살며 생활환경을 접해본 뒤 여러 고민끝에 압축 프레임 디자인을 사용하였습니다. 비슷한 환경인 한국에서도 무리없이 잘 쓰일 거라 생각됩니다.\r\n</p>\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">Pick-Up Bike는 일반적인 700c 로드 바이크보다 45cm길지만, 라이딩 그립을 30cm 더 짧게 구성하여 운전자는 더 빠른 속도로 달리는 것 처럼 느낄 수 있습니다.</p>\r\n\r\n\r\n<p style=\"margin: 0 0 30px 0; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u435_1472105664240.jpg\" title=\"u435_1472105664240.jpg\"></p>\r\n\r\n\r\n<hr style=\"border:1px dashed #eaeaea;margin:10px 0 20px 0;\">\r\n\r\n\r\n<p style=\"margin:30px 0 0 0; padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">제원 및 SPEC</span></p>\r\n\r\n<div style=\"display:block;background-color:#f7f8f8;width:100%;padding:10px;margin-bottom:30px;\">\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">프레임</span> : CO2 수동 용접 강철 섀시(CO2 manual welding steel chassis)</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">포크 </span> : Cr-Mo fork heavy resistance</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">타이어</span> : 20x1.5 \'\'24x1.5 \"</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">링</span> : Wide aluminum heavy gauge aluminum ring</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">기어(大)</span> : 알루미늄 44T</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">브레이크</span> : 시마노 7 단 (Shimano 7-speed)</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">변속기</span> : Front &amp; rear V-brake</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">쿠션 핸들</span> : matte black braided leather sport</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">라이저 / 조향 메커니즘</span> : PickUP specially designed riser/ special bearing steering</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">접이식</span> : NO</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">크기</span> : 길이 230cm X 폭 50cm X 높이 110cm</p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 0.86em;\"><span style=\"font-weight:bold;color:#2d2d2d\">무게</span> : 21.5kg</p>\r\n</div>\r\n\r\n\r\n<hr style=\"border:1px dashed #eaeaea;margin:10px 0 20px 0;\">\r\n\r\n\r\n<p style=\"margin:30px 0 0 0; padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">Pick-Up Bike - 무한한 변화의 시작</span></p>\r\n\r\n<p style=\"text-align: left; color: rgb(97, 97, 97); line-height: 1.5em; font-size: 1em;\">Pick-Up Bike는 DIY를 하는 것 처럼 유모차가 될 수도 이고, 반려동물의 트레일러가 될 수도 있습니다. <br>여러분이 마음껏 만들어서 Pick-Up Bike의 옵션으로 끼워 넣거나 뺄 수 있으며, 그 활용도는 무궁무진 합니다.&nbsp;<br><span style=\"font-size: 1em; line-height: 1.5em;\">Pick-Up Bike의 변신의 여러분의 손에 달려 있습니다.</span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\"><img src=\"/data/smarteditor/attach/u435_1472105890566.gif\" title=\"u435_1472105890566.gif\"></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; text-align: center;\">&nbsp;</p>\r\n\r\n<hr style=\"border:1px dashed #eaeaea;margin:10px 0 20px 0;\">\r\n\r\n\r\n<p style=\"margin:30px 0 0 0; padding: 15px 0px; font-size:1.3em;text-align: center;\"><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\">일상 생활 속의 Pick-Up Bike</span><span style=\"padding: 10px 15px; color: #e96931; font-weight: 700; display:block;\"><img src=\"/data/smarteditor/attach/u435_1473234732432.jpg\" title=\"u435_1473234732432.jpg\"><img src=\"/data/smarteditor/attach/u435_1473234759235.jpg\" title=\"u435_1473234759235.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1473234675074.jpg\" title=\"u435_1473234675074.jpg\"><img src=\"/data/smarteditor/attach/u435_1473234869694.jpg\" title=\"u435_1473234869694.jpg\"><img src=\"/data/smarteditor/attach/u435_1473234936799.jpg\" title=\"u435_1473234936799.jpg\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1473234947884.jpg\" title=\"u435_1473234947884.jpg\"><br style=\"clear:both;\"><br style=\"clear:both;\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p><p style=\"margin-top: 30px; padding-top: 15px; padding-bottom: 15px; text-align: center; font-size: 1.3em;\"><span style=\"padding: 10px 15px; color: rgb(233, 105, 49); font-weight: 700; display: block;\"><img src=\"/data/smarteditor/attach/u435_1473228117689.jpg\" title=\"u435_1473228117689.jpg\" style=\"font-size: 1.3em; line-height: 1.5;\"><span style=\"font-size: 1.3em; line-height: 1.5;\">&nbsp;</span>&nbsp;</span></p><p><font color=\"#616161\"><span style=\"font-size: 11pt; color: rgb(0, 0, 0);\"><b>해외배송에 따른 관부가세 예시(표)</b></span></font></p><p><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\">▶ Pick Up Early Bird 구매 시</span><br>\r\n<img src=\"/data/smarteditor/attach/u435_1473227760191.png\" title=\"u435_1473227760191.png\"></p><p><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\">▶ Pick Up Early Bird + Pick Up Box 구매 시</span><img src=\"/data/smarteditor/attach/u435_1473227894638.png\" title=\"u435_1473227894638.png\"><br style=\"clear:both;\"><br>※오지랖에서 구매하시는 금액은 과세가격(상품+현지배송비+현지세금) 포함된 가격이며 관세(B) 및 부가세(C)는 구매자가 부담합니다.<br>※관부가세 기준에 따라 관세(B), 부가세(C)는 차이가 있을 수 있으며 이에따라 최종금액(D)는 예시(표)와 다를 수 있습니다.<br style=\"clear:both;\"><br>\r\n\r\n\r\n</p>','<p>&nbsp;</p>','<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">PICK UP BIKE는 누가 탈 수 있나요?</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); font-weight: 500;\"><span style=\"font-size: 0.9em; line-height: 1.5em;\">Pick Up Bike는 15세 이상, 자전거를 탈 수 있는 사람이면 누구나 가능합니다.</span><span style=\"font-size: 10.8px; line-height: 16.2px;\"><br></span><span style=\"font-size: 0.9em; line-height: 1.5em;\">자전거의 무게는 약 21.5KG이며 자전거를 포함한 최대 150KG 까지 탈 수 있습니다.</span></p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">PICK UP BIKE의 프레임은 긴 편인데 운전에 불편함은 없나요?\r\n</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); font-weight: 500;\"><span style=\"font-size: 0.9em; line-height: 1.5em;\">처음 자전거를 개발할 때 이 세상 모든 도로는 아니지만, 수 많은 도로의 폭을 계산하여 제작하였습니다. <br>Pick Up Bike는 일반적인 자전거의 바퀴보다 약 40cm 정도 앞에 바퀴가 위치해 있습니다. 자전거의 폭은 일반 성인의 어깨 폭과 비슷합니다. <br>두 세번 정도 타보면 아마 쉽게 운전할 수 있을 것입니다.&nbsp;</span></p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">PICK UP BIKE로 묘기가 가능한가요?</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; font-weight: 500;\">불가능합니다.<br>Pick Up Bike는 도시에서 Cargo Bike(카고바이크)로의 기능을 주 목적으로 만들어 졌습니다.<br>자전거를 직접 개조하여 다른 방식으로 탈 수는 있겠지만, BMX자전거 처럼 탈 수는 없습니다.<br>높은곳이나 영화에서 나올법한 스턴트 스킬을 구사할 수는 업습니다. 안전을 위해 자동차나 벽 등 다른 것들과의 충돌은 가급적 피해주시기 바랍니다.</p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">PICK UP BIKE의 재질은 무엇으로 만들어져있나요?</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); font-weight: 500;\"><span style=\"font-size: 0.9em; line-height: 1.5em;\">기본적인 재질은 알루미늄 합금과 고탄소강으로 만들어졌습니다.</span><span style=\"font-size: 10.8px; line-height: 16.2px;\"><br></span><span style=\"font-size: 0.9em; line-height: 1.5em;\">최종 제품이 나오기 전까지 수백번의 설계와 디자인 변경을 거쳐 프로토타입을 만들었으며 또한, 그에 알맞는 다양한 재료들을 테스트하여 알루미늄 합금과 고탄소강으로 제작하였습니다. 이를 통해 더 튼튼한 내구성과 좀 더 나은 승차감을 보장합니다.</span></p>\r\n\r\n<hr>\r\n\r\n<p style=\"margin: 20px 0px 5px; text-align: left; color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700;\">PICK UP BIKE의 품질보증 기간은 어떻게 되나요?</p>\r\n<p style=\"margin: 10px 0px 20px; text-align: left; color: rgb(59, 59, 59); font-weight: 500;\"><span style=\"font-size: 0.9em; line-height: 1.5em;\">본 제품은 비 소모품(브레이크 가죽, 타이어, 내부튜브 및 기타 소모품 제외)에 대하여 1년간 품질보증을 실시합니다.</span><span style=\"font-size: 10.8px; line-height: 16.2px;\"><br></span><span style=\"font-size: 0.9em; line-height: 1.5em;\">교체가 가능한 부품은 대만(제조사)에서 제작이 가능한 제품들입니다.<br>기간이 지난 제품에 대한 유지보수는 예비 부품을 구입하거나 지정된 공식 자전거SHOP 에서 수리가 가능합니다.</span></p>','<p>&nbsp;</p>','<p>&nbsp;</p>','9/6|펀딩시작$10/25|펀딩종료$11/5|얼리버드 배송 시작$11/15|얼리버드 배송 완료$1/5|일반 배송 시작$1/15|일반 배송 완료',0,'N','N'),(124,0,564,13,'p124_1474263920355.jpg','Treether','Fashion','2016-09-19 15:00:00','2016-10-25 23:30:00',2000000,'',2,'<span style=\"font-weight: bold;\">[Treether - 자연에 가까운 지갑]&nbsp;</span><br style=\"font-weight: bold;\"><span style=\"font-weight: bold;\">30,000원 ~ </span><br>','자연에 가까운 지갑','treether','Y','CF',0,0,'','p124_1473143250400.jpg,p124_1473143472852.jpg,p124_1473143472859.jpg,p124_1473143472862.jpg,p124_1473147029703.jpg,p124_1473147029712.jpg,','<p>&nbsp;<img title=\"u3_1474252332842.jpg\" src=\"/data/smarteditor/attach/u3_1474252332842.jpg\">&nbsp;</p><p><video width=\"100%\" autoplay=\"\" controls=\"\" name=\"media\"><source src=\"https://ksr-video.imgix.net/projects/2527537/video-691061-h264_high.mp4\" type=\"video/mp4\"></video>&nbsp;</p><p style=\"padding: 15px 0px; text-align: center; font-size: 1.3em;\"><span style=\"padding: 10px 15px; color: rgb(233, 105, 49); font-size: 14pt; font-weight: 700; display: block;\">친환경, 그리고 세상에 없는 특별함</span></p><p>&nbsp;</p><p>지금 이 순간에도 수 많은, 그리고 다양한 재질의 가죽 지갑들이 쏟아져 나오고 있습니다.<br>그렇기에 저희는 이번 프로젝트를 진행하면서<span style=\"color: rgb(255, 108, 0);\"> <span style=\"color: rgb(255, 108, 0);\">\'친환경\'</span></span>과 <span style=\"color: rgb(255, 108, 0);\">\'세상에 없는 특별함\'</span> 이라는 두 가지 키워드를 목표로 시작하게 되었습니다.<br>&nbsp;</p><p><img title=\"u3_1473141522398.jpg\" style=\"line-height: 1.5;\" src=\"/data/smarteditor/attach/u3_1473141522398.jpg\"></p><p><span style=\"line-height: 1.5;\">친환경적이고 자연을 상징하는 재료를 찾아보다가 나무를 떠올리게 되었는데요,&nbsp;\'나무로 지갑을 만들어보면 어떨까?\' 라는 생각과 함께 누구나 생각하는 딱딱한 나무를 이용해서 부드러운 지갑을 만들 수 있다면 <span style=\"color: rgb(255, 108, 0);\">\'</span><span style=\"color: rgb(255, 170, 0);\"><span style=\"color: rgb(255, 108, 0);\">세상에 없는 특별함\'</span> </span>이라는 프로젝트 키워드를 채워줄 수 있다고 생각하여 제품을 제작하였습니다.</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><img title=\"u3_1473141536287.jpg\" style=\"line-height: 1.5;\" src=\"/data/smarteditor/attach/u3_1473141536287.jpg\">&nbsp;</p><p><span style=\"line-height: 1.5;\">\'Treether Series\'는 단순한 지갑이 아니라 자연의 아름다움을 담고 있는 지갑입니다.</span></p><p><span style=\"line-height: 1.5;\">지갑의 겉 표면에는 나무의 질감을 접목시켜 자연의 아름다움을 내부 안감은 지갑 본연의 목적을 위해 천연 베지터블 가죽으로 제작하여 친환경적이며 더 튼튼한 내구성을 자랑합니다.<br></span><span style=\"line-height: 1.5;\">이러한 \'Treether Series\'의 Artwork(아트웍)은 제품을 사용하는 사람들로 하여금 자신만의 유니크함을 표현하고 직접 손으로 자연을 느낄 수 있게하여 그 아름다움을 다시 한 번 일깨워 줄 수 있습니다.</span></p><p><span style=\"line-height: 1.5;\">자연의 나무와 천연 베지터블 가죽으로 만들어진 \'Treether Series\'는 그 촉감 만으로도 당신의 손과 자연을 이어주는 연결고리가 될 것입니다.</span></p><p>&nbsp;</p><p style=\"padding: 15px 0px; text-align: center; font-size: 1.3em;\"><span style=\"padding: 10px 15px; color: rgb(233, 105, 49); font-size: 14pt; font-weight: 700; display: block;\">친환경을 위한 선택 : 100% 천연 소재</span></p><p><img title=\"u3_1473141586344.jpg\" src=\"/data/smarteditor/attach/u3_1473141586344.jpg\"></p><p><span style=\"line-height: 1.5;\">나무는 종류와 자르는 단면에 따라 서로 다른 독특한 무늬와 색을 가지며 그 자체로도 단단하여 관리만 잘 해준다면 매우 오랫동안 사용할 수 있습니다. 그래서 저희는 천연소재로써, 또한 자연의 생명력과 강함을 상징하는 소재로써 나무를 선택하였습니다.&nbsp;</span></p><p><img title=\"u435_1473127393409.png\" style=\"line-height: 1.5;\" src=\"/data/smarteditor/attach/u435_1473127393409.png\"></p><p><span style=\"line-height: 1.5;\">지갑의 소재를 나무 한 가지만으로 제작하기에는 보완해야 할 점이 많았습니다. 그래서 저희는 부족한 부분들을 채우기 위해 지갑의 내부를 가죽으로 제작하였습니다. \'친환경\'이라는 키워드 속에서 제품을 제작해야 했기에 화학약품을 사용하는 크롬가죽이 아닌 친환경적인 천연 베지터블 가죽을 선택하였습니다. 또한 크롬가죽에 비해 내구성이 좋아 제품의 품질을 더욱 높이 끌어 올릴 수 있습니다.</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p style=\"padding: 15px 0px; text-align: center; font-size: 1.3em;\"><span style=\"padding: 10px 15px; color: rgb(233, 105, 49); font-size: 14pt; font-weight: 700; display: block;\">Treether Wallet Series</span><span style=\"padding: 10px 15px; color: rgb(233, 105, 49); font-size: 14pt; font-weight: 700; display: block;\"><img title=\"u435_1473146943530.jpg\" src=\"/data/smarteditor/attach/u435_1473146943530.jpg\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0); font-size: 12pt;\"><b>Long Wallet : 장지갑</b></span></p><p><img title=\"u435_1473127531624.gif\" src=\"/data/smarteditor/attach/u435_1473127531624.gif\"></p><p>Treether의 장지갑은 단순한 지갑이 아닌, 신사 숙녀를 위한 액세서리가 될 수 있을 뿐 아니라 장지갑의 큰 장점인 지폐를 접을 필요 없이 쉽게 넣을 수 있는 사이즈와 많은 카드를 넣을 수 있는 수납 공간을 가지고 있습니다.<br><span style=\"line-height: 1.5;\">(19cm X 9cm X 1cm) or (7.5\" X 3.7\" X 0.8\")</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><img title=\"u3_1473141308372.gif\" src=\"/data/smarteditor/attach/u3_1473141308372.gif\">&nbsp;</p><p>20여장 이상의 지폐와 6인치 사이즈의 아이폰, 그리고 15장 이상의 카드를 수납할 수 있습니다.</p><p><img title=\"u435_1473127813446.png\" src=\"/data/smarteditor/attach/u435_1473127813446.png\"><img title=\"u435_1473127822659.png\" src=\"/data/smarteditor/attach/u435_1473127822659.png\"></p><p>&nbsp;</p><p><span style=\"color: rgb(0, 0, 0); font-size: 12pt;\"><b>Clip Wallet : 반지갑</b></span></p><p><span style=\"font-size: 12pt;\"><b><img title=\"u435_1473127932826.gif\" src=\"/data/smarteditor/attach/u435_1473127932826.gif\"><br></b></span></p><p>여러분의 일상에서 가장 많이 쓰이는 지갑입니다.<br><span style=\"line-height: 1.5;\">어떠한 주머니에나 쉽게 넣을 수 있어 휴대가 편하며, 일상에서도 다량의 카드와 지폐를 넣을 수 있는 충분한 수납공간을 가지고 있습니다.<br></span><span style=\"line-height: 1.5;\">(11.5cm X 9.6cm X 0.8cm) or (4.5\" X 3.8\" X 0.3\")</span></p><p>&nbsp;</p><p><img title=\"u3_1473141239144.gif\" src=\"/data/smarteditor/attach/u3_1473141239144.gif\"><br style=\"clear: both;\">&nbsp;</p><p><span style=\"line-height: 1.5;\">돈과 영수증을 따로 넣을 수 있도록 공간을 나누어 디자인 하였습니다.&nbsp;</span><span style=\"line-height: 1.5;\">또한 20여장 이상의 지폐와 10장 이상의 카드를 넣을 수 있습니다.</span></p><p><img title=\"u435_1473128110799.png\" style=\"line-height: 1.5;\" src=\"/data/smarteditor/attach/u435_1473128110799.png\"><img title=\"u435_1473128123083.png\" style=\"line-height: 1.5;\" src=\"/data/smarteditor/attach/u435_1473128123083.png\"></p><p>&nbsp;</p><p><b style=\"line-height: 24px; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Cardholder : 카드지갑</span></b></p><p><span style=\"line-height: 1.5;\"><img title=\"u435_1473128206945.gif\" src=\"/data/smarteditor/attach/u435_1473128206945.gif\"><br style=\"clear: both;\">개인이 휴대할 수 있는 가장 심플한 지갑입니다.<br></span><span style=\"line-height: 1.5;\">지폐나 영수증 등으로 지갑을 두껍게 만드는 것을 원하지 않는 사람들을 위해 디자인하였으며 우아한 나무의 느낌과 미니멀한 디자인이 가장 큰 장점인 카드홀더입니다.<br></span><span style=\"line-height: 1.5;\">(10cm X 6.5cm X 0.3cm) or (4.3\" X 2.5\" X 0.1\")</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><span style=\"line-height: 1.5;\"><img title=\"u3_1473141259408.gif\" src=\"/data/smarteditor/attach/u3_1473141259408.gif\"><br style=\"clear: both;\">&nbsp;</span></p><p><span style=\"line-height: 1.5;\">미니멀하고 세련된 디자인으로 무게 또한 매우 가벼워 부담없이 가지고 다닐 수 있습니다.&nbsp;</span><span style=\"line-height: 1.5;\">작아보이지만 지폐 4~5장이나 카드 2~3장 정도는 가볍게 넣을 수 있습니다.</span></p><p><span style=\"line-height: 1.5;\">&nbsp;</span></p><p><img title=\"u435_1473128430829.png\" src=\"/data/smarteditor/attach/u435_1473128430829.png\"><br style=\"clear: both;\"><img title=\"u435_1473128438840.png\" src=\"/data/smarteditor/attach/u435_1473128438840.png\"><br style=\"clear: both;\">&nbsp;</p><p style=\"padding: 15px 0px; text-align: center; font-size: 1.3em;\"><span style=\"padding: 10px 15px; color: rgb(233, 105, 49); font-weight: 700; display: block;\">Design Details</span></p><p><img title=\"u435_1473128699192.png\" src=\"/data/smarteditor/attach/u435_1473128699192.png\"></p><p><span style=\"line-height: 1.5;\">지갑의 가장자리는 베지터블 가죽으로 한번 더 커버하여 지갑 가장자리가 파손되거나 갈라지지 않도록 처리하였습니다.</span></p><p><span style=\"line-height: 1.5;\">Top quality high Stretching 실을 사용하여 꿰메었으며 몇 년을 사용해도 문제 없습니다.</span></p><p>&nbsp;</p><p><img title=\"u435_1473128726239.png\" src=\"/data/smarteditor/attach/u435_1473128726239.png\"></p><p><b>얇게, 그리고 튼튼하게.</b></p><p>\'Treether Series\'는 나무와 천연 베지터블 가죽을 사용하여 나무의 아름다움과 가죽의 내구성을 모두 가지게 되었습니다. 그 중 가장 중요한 부분을 차지하는 <span style=\"color: rgb(255, 108, 0);\">겉 표 면의 나무는 1mm 이하의 두께</span>로 유연성과 내구성을 모두 가지고 있습니다. 그래서 나무와 가죽의 특징이 그대로 살릴 수 있었으며 여러분의 손길에 오래 닿을수록 조금씩 그 모습이 달라지면서 이 세상에 하나뿐인 자신만의 지갑으로 변화합니다.</p><p>&nbsp;</p><p><img title=\"u435_1473128742011.png\" src=\"/data/smarteditor/attach/u435_1473128742011.png\"></p><p>\'Treether Wallet Series\'는 나무와 가죽의 자연적인 속성에 따라 사람의 손에서 자연스럽게 나오는 기름을 흡수하여 시간이 지남에 따라 자연스럽게 색이 변화합니다.<span style=\"line-height: 1.5;\">제품을 사용할 수록 더 진한색상으로 변하며 지갑 표면의 거친듯한 촉감 또한 점점 더 매끄럽고 부드러운 섬유처럼 변화합니다.&nbsp;</span><span style=\"line-height: 1.5;\">이러한 특징은 사용하는 사람마다 차이가 있기에 더욱 특별합니다.&nbsp;</span><span style=\"line-height: 1.5;\">오래 사용할 수록 여러분의 손으로 이 세상에 하나 뿐인 자신만의 지갑을 만들어가게 될 것입니다.</span></p><p>&nbsp;</p><p style=\"padding: 15px 0px; text-align: center; font-size: 1.3em;\"><span style=\"padding: 10px 15px; color: rgb(233, 105, 49); font-size: 14pt; font-weight: 700; display: block;\">Treether joins your life</span></p><p><img title=\"u435_1473129213227.gif\" src=\"/data/smarteditor/attach/u435_1473129213227.gif\">&nbsp;</p><p><img title=\"u3_1473142006466.jpg\" src=\"/data/smarteditor/attach/u3_1473142006466.jpg\"><img title=\"u3_1473142022224.jpg\" src=\"/data/smarteditor/attach/u3_1473142022224.jpg\"><br style=\"clear: both;\"><img title=\"u3_1473142026981.jpg\" src=\"/data/smarteditor/attach/u3_1473142026981.jpg\"><br style=\"clear: both;\"><img title=\"u3_1473142035976.jpg\" src=\"/data/smarteditor/attach/u3_1473142035976.jpg\"><br style=\"clear: both;\"><img title=\"u3_1473142041145.jpg\" src=\"/data/smarteditor/attach/u3_1473142041145.jpg\"><br style=\"clear: both;\"><img title=\"u3_1473142053690.jpg\" src=\"/data/smarteditor/attach/u3_1473142053690.jpg\"><br style=\"clear: both;\"><img title=\"u3_1473142058026.jpg\" src=\"/data/smarteditor/attach/u3_1473142058026.jpg\"><br style=\"clear: both;\"><img title=\"u3_1473142064136.jpg\" src=\"/data/smarteditor/attach/u3_1473142064136.jpg\"><br style=\"clear: both;\">&nbsp;</p><p align=\"center\" style=\"padding: 15px 0px; text-align: center; font-size: 1.3em;\"><span style=\"padding: 10px 15px; color: rgb(233, 105, 49); font-size: 14pt; font-weight: 700; display: block;\">제품 색상표</span><span style=\"padding: 10px 15px; text-align: center; color: rgb(233, 105, 49); font-weight: 700; display: block;\"><img title=\"u435_1473139365091.png\" src=\"/data/smarteditor/attach/u435_1473139365091.png\"><br style=\"clear: both;\">&nbsp;</span></p>','<p>&nbsp;</p>','<p style=\"color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700; margin-top: 20px; margin-bottom: 5px;\">제품은 언제 배송되나요?</p><p style=\"color: rgb(59, 59, 59); margin-top: 10px; margin-bottom: 20px;\"><span style=\"line-height: 1.5em; font-size: 0.9em;\">배송되는 각각의 품질을 최대한 보장하기 위해서 시간이 조금 필요하며, 2016년 11월 31일 이전에 배송될 예정입니다.<br>모든 제품은 직접 수작업으로 패키징하며 제품이 배송되면 e-mail을 통하여 알려드립니다.</span></p><hr><p style=\"color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700; margin-top: 20px; margin-bottom: 5px;\">왜 제품 표면에 균열(갈라짐)이나 움푹 파인 곳이 있나요?</p><p style=\"color: rgb(59, 59, 59); margin-top: 10px; margin-bottom: 20px;\"><span style=\"line-height: 1.5em; font-size: 0.9em;\">균열(갈라짐)이나 움푹 파인 것이 아닙니다. 모든 Treether 제품은 나무와 동물의 다양한 성장 환경에 따라 자연스럽게 만들어진 천연소재로 제작됩니다. 따라서 이러한 제품의 표면에 있는 것들은 자연적인 특성이며 자연 본연의 아름다움으로 봐 주시면 감사하겠습니다.</span></p><hr><p style=\"color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700; margin-top: 20px; margin-bottom: 5px;\">제품은 방수가 되나요?</p><p style=\"color: rgb(59, 59, 59); line-height: 1.5em; font-size: 0.9em; margin-top: 10px; margin-bottom: 20px;\">Treether 제품은 방수가 되지 않습니다. 물과 같은 액체와 접촉하게 되면 쉽게 흡수하여 얼룩이 생기므로 즉시 닦아내야 합니다. 배송 이전에 제품의 표면에 전용 컨디셔너를 왁싱하여 기본적인 최소한의 방수 기능을 제공합니다만 정말 최소한의 방수 기능이기에 제품이 젖은 경우 즉시 깨끗하게 닦고 말려주셔야 합니다.</p><hr><p style=\"color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700; margin-top: 20px; margin-bottom: 5px;\">지갑 내부 가죽색상을 선택할 수 있나요?</p><p style=\"color: rgb(59, 59, 59); margin-top: 10px; margin-bottom: 20px;\"><span style=\"line-height: 1.5em; font-size: 0.9em;\">별도로 가죽의 색상을 선택할 수는 없습니다. Treether 제품들의 내부 색상은 천연 가죽 본연의 색상입니다. 베지터블 가죽은 크롬가죽과 달리 화학약품 처리가 가해지지 않아 독성이나 화학물절이 없으며 이것은 가죽 본연의 색상을 나타내며 저희 프로젝트의 취지에 맞춘 자연적인 아름다움으로 볼 수 있습니다. 다만 구매자의 기호에 따라 가죽의 색상을 조금 더 어둡게 하고 싶다면 햇빛에 노출시켜 태닝이 가능합니다. 그렇게 가죽을 태닝시키면 좀 더 어두운 카라멜 색상으로 변하게 됩니다.</span></p><hr><p style=\"color: rgb(59, 59, 59); line-height: 1.3em; font-size: 1.1em; font-weight: 700; margin-top: 20px; margin-bottom: 5px;\">지갑을 구부리면 표면에 균열(갈라짐)이 생기나요?</p><p style=\"color: rgb(59, 59, 59); margin-top: 10px; margin-bottom: 20px;\"><span style=\"line-height: 1.5em; font-size: 0.9em;\">아닙니다. 균열(갈라짐)이 발생하지 않습니다. Treether의 제품은 \"나무도 가죽처럼 부드러울 수 있다\" 는 것을 증명하기 위해 디자인되었습니다. 각각의 나무는 1mm 이하의 두께이며 저희만의 특별한 방법으로 가죽과 완벽하게 결합되어 마치 일반 가죽 지갑처럼 사용하실 수 있습니다.</span><span style=\"line-height: 1.5em; font-size: 0.9em;\">.</span></p>','<p>&nbsp;</p>','<p>&nbsp;</p>','9/19|펀딩 시작$10/25|펀딩 종료$10/30|제품 제작$11/17|배송 시작$11/31|배송 완료',0,'N','N'),(125,0,564,12,'p125_1479449916323.jpg','역방향스피커 블루투스 이어폰 BT-100','Smart','2016-11-16 17:30:00','2016-12-16 23:30:00',1000000,'',2,'<span style=\"font-weight: bold;\">[역방향 블루투스 이어폰 / BT-100]&nbsp;</span><br style=\"font-weight: bold;\"><span style=\"font-weight: bold;\">33,000원 ~ </span><br>','당신의 귀를 즐겁게 해줄 가성비 최고의 역방향스피커 블루투스 이어폰','PSIKOREA','Y','CF',0,0,'','p125_1479774222302.JPG,p125_1479774222303.JPG,p125_1479774222304.JPG,','<span id=\"husky_bookmark_start_1479274661229\"></span><span id=\"husky_bookmark_end_1479274661229\"></span><p style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1479275376920.jpg\" title=\"u3_1479275376920.jpg\"><br style=\"clear:both;\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u3_1479111880942.jpg\" title=\"u3_1479111880942.jpg\">&nbsp;<img src=\"https://www.ozr.kr/data/smarteditor/attach/u435_1479280464791.png\" title=\"u435_1479280464791.png\"><img src=\"/data/smarteditor/attach/u3_1479275406277.jpg\" title=\"u3_1479275406277.jpg\"></p><p style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1479111894306.jpg\" title=\"u3_1479111894306.jpg\">&nbsp;<img src=\"/data/smarteditor/attach/u435_1479875810949.jpg\" title=\"u435_1479875810949.jpg\">&nbsp;</p><p style=\"text-align: center;\" align=\"center\">&nbsp;</p><p style=\"text-align: center;\" align=\"center\">&nbsp;</p><p style=\"text-align: center;\" align=\"center\"><b><span style=\"font-size: 24pt;\">&nbsp;<span style=\"color: rgb(0, 0, 0);\">&lt; 선택 색상 &gt;</span></span></b></p><p style=\"text-align: center;\" align=\"center\"><img src=\"/data/smarteditor/attach/u435_1479272336606.png\" title=\"u435_1479272336606.png\"><br style=\"clear:both;\">&nbsp;</p><p style=\"text-align: center;\" align=\"center\">&nbsp;</p><p style=\"text-align: center;\" align=\"center\"><b><span style=\"font-size: 14pt;\">- 10개 이상 구매하실 분은 댓글에 구매 색상을 알려주시기 바랍니다 -<br>(예시 : 홍길동/Green 3개, Red 4개, White 3개)</span></b></p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','11/16|펀딩 시작$12/16|펀딩 종료$12/20|배송 준비$12/31|배송 종료',3,'N','N'),(126,0,564,3,NULL,'테스트2','','2016-10-18 00:30:00','2016-10-19 01:00:00',NULL,'',0,'<p>&nbsp;</p>','','',NULL,'CF',0,0,'','','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','',0,'N','N'),(127,0,564,13,'p127_1479450158014.jpg','iKlips DUO + / ROMA','Smart','2016-11-09 17:30:00','2016-12-12 23:30:00',3000000,'아이폰, 아이폰외장메모리, otg, 아이폰메모리, SE외장메모리, SE메모리, 아이폰7메모리, 아이폰용량, ',2,'<p>&nbsp;</p><div style=\"text-align: justify;\" align=\"justify\"><span style=\"background-color: rgb(255, 255, 255); font-family: \" spoqa=\"\" han=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;=\"\" letter-spacing:=\"\" -0.5px;\"=\"\">[iKlips DUO + / ROMA - 스마트기기 외장 메모리]&nbsp;</span></div><span style=\"font-family: \" spoqa=\"\" han=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;=\"\" letter-spacing:=\"\" -0.5px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">46,800원 부터~&nbsp;</span><br><p>&nbsp;</p>','용량 부족에 허덕이는 기기들을 위한 외장 메모리','adam','Y','CF',0,0,'','p127_1478597054212.jpg,p127_1478597054214.jpg,p127_1478597054215.jpg,p127_1478597054216.jpg,p127_1478597054217.jpg,p127_1478597054219.png,p127_1478597054221.png,p127_1478597054222.jpg,p127_1478597054224