></a>\r\n</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','11/09|펀딩 시작$12/12|펀딩 종료$12/21|배송 준비$12/31|배송 완료',0,'N','N'),(128,0,564,0,NULL,'ROMA','Smart','2016-11-07 00:00:00','2016-12-07 23:30:00',3000000,'',0,'<p>&nbsp;</p>','Android 유저를 위한 간편한 외장 메모리','roma',NULL,'CF',0,0,'','','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','11/07|펀딩 시작$12/07|펀딩 종료$12/12|배송 시작$12/22|배송 완료',0,'N','N'),(129,0,564,13,'p129_1481862588408.jpg','철벽케이스 통통이','Fashion','2016-12-16 14:00:00','2017-01-15 23:30:00',1500000,'',2,'<p>&nbsp;</p>','당신의 눈화장과 가방의 안전을 위한 신개념 아이섀도우 보호케이스','tong','Y','CF',0,0,'','p129_1481849524605.jpg,p129_1481849656901.jpg,','<div style=\"text-align: center;\" align=\"center\"><iframe width=\"582\" height=\"360\" src=\"https://www.youtube.com/embed/boJ6fEG8lNI?autoplay=1&amp;playlist=boJ6fEG8lNI&amp;loop=1&amp;vq=highres&amp;showinfo=0&amp;fs=0&amp;rel=0\" \"=\"\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481865675909.jpg\"></p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481849497159.jpg\"></p>\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;\">\r\n섀도우를 들고 다니다보면\r\n꼭!!! 이런 일이 한번 쯤 발생하곤 합니다.\r\n</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481864718589.jpg\"></p>\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;\">\r\n그럼 가방 안에서는 더 슬픈 일이 발생하죠.. \r\n이렇게...\r\n</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481864815545.jpg\"></p>\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;\">\r\n그래서 대부분의 사람들은<br>\r\n휴지나 화장솜으로 채워 넣거나<br>\r\n고무줄로 감싸서 다니기도 합니다.\r\n</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481864875862.jpg\"></p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481781646358.jpg\"></p>\r\n\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;margin:30px 0 0 0;font-weight:bold;\">\r\n그래서 탄생했습니다!<br>\r\n분명 필요하지만 세상에 없던 바로 그 아이템!\r\n</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481781952555.jpg\"></p>\r\n<p><img src=\"/data/smarteditor/attach/u3_1481781968400.jpg\"></p>\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;\">\r\n사용법은 간단합니다.<br>\r\n섀도우에 그대로 쏙! 끼워 넣기만 하면 끝!\r\n</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481782049919.jpg\"></p>\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;\">\r\n내 섀도우는 저거보다 큰 건데 들어가냐구요?<br>\r\n걱정마세요!\r\n</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481782153762.jpg\"></p>\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;\">\r\n튼튼한 실리콘 재질로 왠만큼 잡아 당겨도 쉽게 끊어지지 않습니다!<br>\r\n그래서 이렇게 다양한 사이즈에 끼워 넣을 수 있죠.\r\n</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481782205542.jpg\"></p>\r\n\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;\">&nbsp;</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u3_1481782345344.jpg\"></p>\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;color:#616161;font-weight:bold;\">\r\n이제 \'통통이\'로 가방과 파우치를 안전하게 지켜주세요!\r\n</p>\r\n\r\n<p><img src=\"/data/smarteditor/attach/u435_1481813064182.jpg\" title=\"u435_1481813064182.jpg\"><br style=\"clear:both;\"><span style=\"color: rgb(59, 59, 59); font-size: 1.3em; font-weight: 700;\">왜 이 제품을 만들게 되었나요?</span></p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n보통 한 번 쯤 핸드폰을 손에서 떨어뜨려 액정을 깨뜨려보신 분들이 꽤 있으실 거라고 생각합니다.\r\n그럴 때면 정말 만감이 교차하는데요.\r\n‘아… 왜 내가…’ ‘케이스 씌워 놓을껄’ 등등,  마음이 쓰리고, 당황스럽고 정말 셀 수 없이 많은 생각이 순식간에 머릿속을 스쳐 지나가고는 합니다.<br><br> \r\n여성의 경우 아이섀도우가 이와 비슷한 경우라고 생각합니다.\r\n핸드폰은 케이스라도 있지만 아이섀도우에는 케이스가 없었으니까요.<br><br> \r\n아이섀도우는 조금의 충격에도 박살나고, 파우치나 가방안을 엉망으로 만드는 주범이기도 합니다. \r\n그래서 이 아이섀도우를 보호하기 위해 생각하다가 제품을 만들어보게 되었습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n제품 이름이 \'통통이\'인 이유가 있나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n아이섀도우가 바닥에 떨어졌을 때, ‘바삭-’하고 부숴지는 것이 아닌 통-하고 튀었으면 하는 마음으로 지었습니다.\r\n</p>\r\n\r\n<hr>\r\n\r\n<p style=\"text-align: left;font-size:1.3em;font-weight:700;line-height:1.3em;margin:20px 0 5px 0;color:#3b3b3b;\">\r\n지금의 \'통통이\'처럼 디자인을 하게 된 이유가 있나요?\r\n</p>\r\n<p style=\"text-align: left;font-size:1em;font-weight:500;line-height:1.5em;margin:10px 0 20px 0;color:#3b3b3b;\">\r\n여러가지 모양을 만들어 시험을 해보았는데요, 조금 더 작거나 얇게 제작해보니 아이섀도우를 끼워서 떨어뜨렸을때 깨지기도 했습니다.<br>\r\n깨지지 않게 하기위해 계속 만들다 보니 지금의 모양을 갖추게 되었습니다.<br><br>\r\n아, 그리고 현재 ‘통통이’는 디자인 특허출원 중에 있습니다.<br><br> \r\n각 모서리에 다음카카오, 라인, 미스터도넛의 케릭터 얼굴을 넣어 만드는 것도 굉장히 예쁠것 같습니다. 다음카카오, 라인, 미스터도넛 관계자님들 혹시나 이거 보시면 저희에게 연락 좀 주세요!! ㅎㅎㅎ\r\n</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','<p>&nbsp;</p>','12/15|펀딩 시작$01/15|펀딩 종료$01/20|배송 준비$02/06|배송 완료',0,'N','N'),(130,0,1579,0,NULL,'HWBC - HWBC,환상적인 제품','',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,'CF',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL);
