'2016-01-12 21:12:51','이인랑님 감사합니다! 힘이 되네요!\r\n사진은 카카오톡 친구검색에서 \'헤세드조명\'을 검색, 친구추가 해주신 후 보내주시면 됩니다~',0,0),(94,102,41,94,'2016-01-13 09:54:25','ㅎㅎㅎ~~^^\r\n느무느무 기대가\r\n기냥~아주그냥 막 그냥\r\n되네여\r\n모두홧팅임돠',0,0),(95,102,5,94,'2016-01-13 12:11:44','김대훈님 감사합니다~ 소중한 메세지를 항상 보실 수 있도록 예쁘게 제작해드릴게요^^',0,0),(96,102,26,96,'2016-01-13 21:01:00','세상  힘든 안식처  가족의 울타리가  최고의\r\n\r\n선물 아니겠어요\r\n',0,0),(97,102,37,97,'2016-01-13 22:19:25','세상에하나밖에없는 등이네요~~~^^\r\n기대됩니다~^^',0,0),(98,102,46,98,'2016-01-13 22:43:21','카드말고 다른결제수단도 있나용? 기대되네요 얼른 받고시퍼요~',0,0),(99,102,3,98,'2016-01-13 22:56:29','정아님, 세상에 하나뿐인 메세지 조명 프로젝트를 후원해 주셔서 감사합니다. ^^*\r\n\r\n크라우드펀딩은 목표금액 달성 여부에 따라 펀당 기간 종료시 결제 진행 여부가 결정됩니다. 국내에서 이와 같은 방식의 결제 서비스는 카드 결제를 제외하면 적당한 대안이 없는 상태입니다. \r\n\r\n지속적인 서비스 개선으로 보다 편리하게 후원을 하실 수 있도록 노력하겠습니다.',0,0),(100,102,47,100,'2016-01-14 00:18:32','보고싶은 아버지같은ᆢ원로목사님께 마음 전할 기회주셔서 감사ᆢ\r\n빛의소리ᆢ\r\n듣고싶다ᆢ',0,0),(101,102,9,98,'2016-01-14 07:21:44','후원자에 의해 글이 삭제되었습니다',0,0),(102,102,5,96,'2016-01-14 08:27:04','맞습니다 승수님 ^^ 승수님의 마음이 메세지조명에 잘 담기길 소망합니다. 귀한 후원 감사드려요.',0,0),(103,102,5,97,'2016-01-14 08:27:49','우영님 후원해주셔서 감사합니다. 기대에 부응할 수 있도록 예쁘게 디자인하겠습니다.',0,0),(104,102,5,100,'2016-01-14 08:29:37','영아님 감사합니다~ 저희도 마음을 전하는 통로가 되어 참 기쁘네요. 영아님의 마음이 사랑하는 원로목사님께 잘 전달될 수 있도록 예쁘게 신경써서 만들겠습니다.',0,0),(105,102,49,105,'2016-01-14 12:04:03','후원자에 의해 글이 삭제되었습니다',0,0),(106,102,49,106,'2016-01-14 12:06:34','멋져요^^ 어두운 세상을 따뜻한 빛으로 비추는 프로젝트가 되기를 기대하며 기도합니다!!!',0,0),(107,102,5,106,'2016-01-14 13:36:59','이승복님 감사합니다! 저희도 그렇게 되기를 소망합니다:) 그러기위해 먼저, 승복님의 메세지가 선하게 쓰임받을 수 있도록 신경써서 제작하겠습니다.',0,0),(108,102,53,108,'2016-01-15 11:48:34','멋있고 좋습니다 헤세드 조명과 오지랍의 성공적인 Launching을 기도합니다...',0,0),(109,102,5,108,'2016-01-15 12:43:19','최정환님 정말 감사합니다~! 앞으로 더 좋은 모습으로 보답하겠습니다',0,0),(110,102,22,110,'2016-01-16 13:53:22','ㅎㅎ 예쁘게 만들어주세요 메세지조명 화이팅!',0,0),(111,102,5,110,'2016-01-16 19:54:39','소중한 후원 감사합니다^^ 예쁘게 만들어드릴게요~',0,0),(112,102,55,112,'2016-01-17 17:29:35','개인화된 제품을 이렇게 만날수도 있네요.\r\n잘 모집되서 성공하시길~',0,0),(113,102,66,113,'2016-01-17 18:20:29','앞으로의 사업에도 환한 빛이 비추