INSERT INTO `nest_project_story` VALUES (13,102,'2016-01-11 17:13:17','2016-03-01 20:02:08','<img src=\"/data/project/102/p102_e1455780850137.jpg\"><br><p><br></p>\r\n<img src=\"/data/project/102/p102_e1452499726712.jpg\"><img src=\"/data/project/102/p102_e1452499794333.jpg\"><p><br><img src=\"/data/project/102/p102_e1452503909091.jpg\"></p><p><img src=\"/data/project/102/p102_e1452499825793.jpg\"></p><p><img src=\"/data/project/102/p102_e1452499838204.jpg\"></p><br><p><img src=\"/data/project/102/p102_e1452499848372.jpg\"></p><br><p><img src=\"/data/project/102/p102_e1452499863292.jpg\"></p><p><img src=\"/data/project/102/p102_e1452499873354.jpg\"></p><p><img src=\"/data/project/102/p102_e1452499885682.jpg\"></p><p><img src=\"/data/project/102/p102_e1452733989316.jpg\"></p><p><img src=\"/data/project/102/p102_e1452752592371.jpg\"></p><p><img src=\"/data/project/102/p102_e1452734055208.jpg\"></p><p><img src=\"/data/project/102/p102_e1452734068651.jpg\"></p><p><img src=\"/data/project/102/p102_e1452734084913.jpg\"></p><p><img src=\"/data/project/102/p102_e1452734096020.jpg\"></p><p><img src=\"/data/project/102/p102_e1452734105442.jpg\"></p><br><br><br>'),(14,103,'2016-01-18 17:06:07','2016-03-24 23:33:31','<p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: center; direction: ltr; unicode-bidi: embed;\">&nbsp;</p>\r\n\r\n<p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: center; direction: ltr; unicode-bidi: embed;\">&nbsp;</p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube-nocookie.com/embed/hoaRw_UtaDQ?rel=0&amp;showinfo=0\" width=\"640\"></iframe></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453347665814.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453104017470.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453104027147.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453347692833.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453104047316.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453104064267.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453347719601.jpg\" style=\"font-weight: inherit; line-height: inherit; text-align: inherit;\" />&nbsp;</p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453104227549.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453104240750.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453104251701.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453107425348.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453104285139.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453179560104.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453347769266.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453179591862.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453347802072.jpg\" /></p>\r\n\r\n<p><img src=\"/data/project/103/p103_e1453362682505.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><map name=\"zicrolink\">&nbsp; <area alt=\"아이들의 미래\" coords=\"170, 1378, 496, 1500\" href=\"http://www.kidsfuture.or.kr\" shape=\"rect\" target=\"_blank\" /> &nbsp; <area alt=\"1그램아프리카\" coords=\"523, 1378, 866, 1500\" href=\"http://www.1gramafrica.com\" shape=\"rect\" target=\"_blank\" /></map></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(15,104,'2016-01-25 17:27:38','2016-03-30 09:11:45','<p><img src=\"/data/project/104/p104_e1456730153028.jpg\" /></p>\r\n\r\n<p></p>\r\n\r\n<p style=\"font-size: 28px; line-height: 44px; color:#d83700;\">캠핑을 좋아하시는 분이라면 누구나 잘 알고 계시는 버너의 정석!! &nbsp;동성 해바라기 버너!!</p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p style=\"font-size: 19px; font-weight:400; line-height: 27px; color:#5a5a5a;\">그동안 동성정밀의 해바라기 버너를 사랑해 주신 고객분들께 감사의 마음을 보답하고자 2016년 신규 제품을 출시를 맞아 한정된 수량으로 크라우드 펀딩 프로젝트를 진행합니다.</p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/104/p104_e1458699074158.jpg\" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<img alt=\"\" src=\"/data/project/104/p104_e1458699102633.jpg\" style=\"width: 800px; height: 73px;\" /><br />\r\n<br />\r\n<img src=\"/data/project/104/p104_e1453798020627.jpg\" /></p>\r\n\r\n<p></p>\r\n\r\n<p style=\"font-size: 19px; font-weight:400; line-height: 27px; color:#5a5a5a;\">미세 화력 조절이 가능한 탭이 달려 있어, 기존 해바라기 버너 제품의 아쉬운 점을 해결하였습니다.<br />\r\n가스통의 밸브로 조절하실 때 보다 훨씬 더 정교한 화력 조절이 가능하며, 다양한 요리에 좀 더 적합하게 사용하실 수 있도록 설계되었습니다. 또한 &#39;화력 조절 탭&#39;이 2차적인 잠금 장치 역할을 하여, 안전성이 더욱 강화 되었으며, 고개를 숙여 가스통의 밸브를 찾아야 하는 번거로움도 사라졌습니다.</p>\r\n\r\n<p><img src=\"/data/project/104/p104_e1453798299933.jpg\" /></p>\r\n\r\n<p><br />\r\n<img src=\"/data/project/104/p104_e1453870328193.jpg\" /><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p style=\"font-size: 19px; font-weight:400; line-height: 27px; color:#5a5a5a;\">제품의 기존 강점 또한 더욱 완성도 높게 가공하였습니다.</p>\r\n\r\n<p><img src=\"/data/project/104/p104_e1453798315671.jpg\" /></p>\r\n\r\n<p><br />\r\n<br />\r\n<br />\r\n<br />\r\n<img alt=\"\" src=\"/data/project/104/p104_e1458699123555.jpg\" style=\"width: 800px; height: 449px;\" /></p>\r\n\r\n<p></p>\r\n\r\n<p><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<img data-pin-nopin=\"true\" src=\"/data/project/104/p104_e1453800232848.jpg\" /><br />\r\n<br />\r\n<br />\r\n<span style=\"color: rgb(90, 90, 90); font-size: 19px; line-height: 27px;\">그동안 저희 제품을 사용해 주시고 올려주신 고객분들의 리뷰를 소개드립니다.</span><br />\r\n<br />\r\n<br />\r\n<img src=\"/data/project/104/p104_e1453798524036.jpg\" /></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p style=\"font-size: 19px;font-weight:400; line-height: 24px; color:#5a5a5a; padding:8px;background-color:#f2f2f2;\">&quot;앞으로 돌콩이의 캠핑 요리는 강력한 화력으로 더욱더 멋진 요리를 만들 수 있을 것 같습니다. 1회 충전 시 장시간 캠핑에도 끄덕없는 동성 해바라기 캠핑 버너 좋아요 ^^&quot; - <a href=\"http://blog.naver.com/PostView.nhn?blogId=cookbad&amp;logNo=220149815535\" style=\"color:#d73801;text-decoration:underline;font-size:16px;\">&#39;돌콩이&#39; 님</a></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p style=\"font-size: 19px;font-weight:400; line-height: 24px; color:#5a5a5a; padding:8px;background-color:#f2f2f2;\">&quot;해바라기버너는 여러회사 제품이 있지만, 동성께 제일 나은 것 같습니다&quot; - <a href=\"http://blog.naver.com/PostView.nhn?blogId=wooksoo&amp;logNo=220544580824\" style=\"color:#d73801;text-decoration:underline;font-size:16px;\">&#39;연이원이&#39; 님</a></p>\r\n\r\n<p style=\"font-size: 19px;font-weight:400; line-height: 24px; color:#5a5a5a; padding:8px;background-color:#f2f2f2;\">&quot;동계 부탄의 빌빌거리는 화력을 보강할 막강 해바라기! 트렁크가 좁아지긴 하겠지만 이정도 크기 할애로 캠핑 주방의 화력 보강은 감수 해야 하지 않을까....ㅎ&quot; - <a href=\"http://blog.naver.com/PostView.nhn?blogId=jdh3662&amp;logNo=220160885430\" style=\"color:#d73801;text-decoration:underline;font-size:16px;\">&#39;존스캠핑&#39; 님</a></p>\r\n\r\n<p style=\"font-size: 19px;font-weight:400; line-height: 24px; color:#5a5a5a; padding:8px;background-color:#f2f2f2;\">&quot;요리하다 국물이 흘러넘쳐도 안심! 물받이가 깊숙히.. 화기구가 스텐레스로 되어있고, 바람막이 장치까지 되어있어 임여사 맘에 쏙쏙~~&quot;- <a href=\"http://blog.naver.com/PostView.nhn?blogId=yimjh47&amp;logNo=140201293569\" style=\"color:#d73801;text-decoration:underline;font-size:16px;\">&#39;내가제일잘나가&#39; 님</a></p>\r\n\r\n<p style=\"font-size: 19px;font-weight:400; line-height: 24px; color:#5a5a5a; padding:8px;background-color:#f2f2f2;\">&quot;지난 클캠 때 드디어 해바라기... 동성정밀의 해바라기 버너를 구입 했다. 3Kg LPG... 영하 10℃ 이하로 기온은 떨어지고... 야외에서 오뎅탕을 마구마구 끓여댔다. 역시 만족도 100% 이제는 해바라기 버너 하나로 OK&quot; - <a href=\"http://blog.naver.com/PostView.nhn?blogId=mokim640&amp;logNo=30133707227\" style=\"color:#d73801;text-decoration:underline;font-size:16px;\">&#39;애견캠퍼 코코빠&#39;님</a></p>\r\n\r\n<p style=\"font-size: 19px;font-weight:400; line-height: 24px; color:#5a5a5a; padding:8px;background-color:#f2f2f2;\">&quot;빨리 A/S를 받아야겠다는 생각에 덩이파파가 눈에 불을 켜고 이리저리 검색을 해도..... 비용도 얼마 들지 않고 깔끔하게 처리가 되어 아주 기쁜 덩아 패밀리입니다&quot; - <a href=\"http://blog.naver.com/PostView.nhn?blogId=nanna_sm&amp;logNo=220085445517\" style=\"color:#d73801;text-decoration:underline;font-size:16px;\">&#39;덩아 패밀리&#39; 님</a></p>\r\n\r\n<p style=\"font-size: 19px;font-weight:400; line-height: 24px; color:#5a5a5a; padding:8px;background-color:#f2f2f2;\">&quot;한번이라도 A/S차 동성정밀에 통화를 해 보신 분들은 사모님의 친절을 대하실 수 있었으리라 생각듭니다. 비용이 발생하는 것도 상황을 고려해 주시어, 무료 수리해 주신다고 칭찬이 자자했습니다&quot; - <a href=\"http://bosae87.blog.me/220222513423\" style=\"color:#d73801;text-decoration:underline;font-size:16px;\">&#39;생계형 캠퍼 반다이&#39; 님</a></p>\r\n\r\n<p><br />\r\n<img src=\"/data/project/104/p104_e1453800590441.jpg\" /></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p style=\"font-size: 19px; font-weight:400; line-height: 27px; color:#5a5a5a;\">본 제품 (DSR 1005)은 2월말 가스 안전공사 안정성 승인 획득과 함께 필요한 절차를 진행하고 있습니다. 승인이 완료되면 바로 양산을 시작하여 3월 중순경 후원자 분들께 제품을 배송해 드릴 예정입니다. 이번 크라우드 펀딩 프로젝트를 통해 가장 먼저, 가장 매력적인 가격으로 동성정밀의 새로운 해바라기 버너를 만나 보세요.</p>\r\n\r\n<p></p>\r\n\r\n<p><br />\r\n<img src=\"/data/project/104/p104_e1453862169334.jpg\" /></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n'),(16,105,'2016-02-16 19:16:07','2016-03-01 20:01:52','&nbsp;<p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">세상에 태어난 아이를 위해 하나하나씩 만들어온 나무 장난감입니다.\r\n내 아이에게 만들어 준 그대로 내 아이를 사랑하는 마음 그대로, 장난감에 담아 만듭니다.\r\n인위적인 색칠보다는 나무 본연의 느낌을 살려 솔직하고 정직하게 만들었습니다.\r\n플라스틱의 일회성이 아닌, 아빠, 엄마와의 추억을 오랫동안 간직할 수 있는 장난감을&nbsp;아이에게 선물 해 주세요.</p><br>\r\n\r\n<img src=\"/data/project/105/p105_e1455625373370.jpg\"><br><br><br><br><p><img src=\"/data/project/105/p105_e1455617350610.jpg\" style=\"margin-bottom:15px;\">&nbsp;&nbsp;<br><br><br><br><br></p><p><img src=\"/data/project/105/p105_e1455624017553.jpg\" data-pin-nopin=\"true\">&nbsp;</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">“쿵쾅쿵쾅”(코끼리), “꽥꽥“(오리), “꿀꿀“(돼지), “아악”(악어)\r\n아이가 동물을 배우면서 부르는 소리입니다.&nbsp;\r\n책과 포스터에 있는 동물 친구들이 입체적으로 다시 태어났습니다.\r\n아이들이 직접 조립하고 분해하면서, 소근육 발달과 창의성을 높여줄 수 있는&nbsp;\r\n<strong style=\"box-shadow: 0 -5px 0 #ffd942 inset;\">2.5D 멀티조각 동물 장난감(소) 세트</strong>를 소개합니다.\r\n</p>\r\n\r\n<img src=\"/data/project/105/p105_e1455617371010.jpg\">\r\n<p style=\"padding:5px;font-size:14px;font-weight:300;color:#7a7a7a;line-height:25px; letter-spacing:-0.3px;text-align:center;margin-bottom:15px;\">(악어, 코끼리, 기린, 코뿔소, 낙타, 닭, 오리, 펭귄, 양, 돼지, 캥거루, 고양이, 고래, 말, 다람쥐)</p>\r\n\r\n<img src=\"/data/project/105/p105_e1455617381992.jpg\">\r\n<p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">에코칼라보드(나무) - 친환경 소재로 내구성이 뛰어나며, 유치원, 놀이방에 사용되는 제품입니다.</p>\r\n\r\n<img src=\"/data/project/105/p105_e1455617392715.jpg\">\r\n\r\n<img src=\"/data/project/105/p105_e1455617403198.jpg\" style=\"margin-bottom:100px;\">&nbsp;&nbsp;<img src=\"/data/project/105/p105_e1455624168319.jpg\" data-pin-nopin=\"true\">&nbsp;<p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">아이장난감.... 철이 지났다고 버리시나요?\r\n이젠 버리지 마세요.\r\n아이가 성인이 될 때까지 두고두고 쓸 수 있어요.\r\n시간이 지날수록 멋을 더합니다. 마치 엔틱가구처럼...\r\n자석이 달려있어 조립/분해가 쉽고, 인테리어 소품으로도 훌륭한 <strong style=\"box-shadow: 0 -5px 0 #ffd942 inset;\">동물 장난감(대)</strong> 친구들을 소개합니다.\r\n</p>\r\n<img src=\"/data/project/105/p105_e1455617425017.jpg\">\r\n\r\n<img src=\"/data/project/105/p105_e1455617433514.jpg\">\r\n<p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">애쉬원목 – 탄성이 뛰어나고 나뭇결이 아름다워 고급 인테리어 실내장식에 쓰이는 나무입니다.</p>\r\n<img src=\"/data/project/105/p105_e1455617446927.jpg\">\r\n<p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">네오디뮴 자석을 사용하여 아이들이 가지고 놀기에 가장 적당한 세기를 맞추었습니다.</p><br>\r\n\r\n<img src=\"/data/project/105/p105_e1455617459311.jpg\">\r\n\r\n<p style=\"text-align:center; padding:0 15px;\"><iframe width=\"100%\" height=\"338\" src=\"https://www.youtube-nocookie.com/embed/htRcqhr7vmc?rel=0&amp;showinfo=0\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p><p style=\"padding:5px;font-size:14px;font-weight:500;color:#fe8687;line-height:25px; letter-spacing:-0.3px;text-align:center;margin-bottom:100px;\">※ 원하시는 동물 모양은 후원 후 댓글로 남겨 주시면, 펀딩 종료 후 반영하여 송부 드릴 예정입니다.</p>\r\n\r\n<img src=\"/data/project/105/p105_e1455624181600.jpg\" data-pin-nopin=\"true\">&nbsp;<p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">건들은 걸음마를 시작한 아이의 균형감각을 키워주기 위해 만들었습니다.\r\n한쪽은 엄마가, 한쪽은 아이가 앉아 바이킹 놀이도 하고, 시소 놀이도 하고,\r\n<strong style=\"box-shadow: 0 -5px 0 #ffd942 inset;\">부모님과 아이들이 함께, 즐겁게 놀 수 있는 장난감</strong>입니다.</p>\r\n<img src=\"/data/project/105/p105_e1455617483870.jpg\">\r\n\r\n<img src=\"/data/project/105/p105_e1455617493019.jpg\">\r\n<p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">자작나무 &amp; 천연오일 – 가장 친환경적인 합판으로 변형과 뒤틀림에 강한 제품입니다.\r\n나일론 로프 – MajorSurplus&amp;Survival사의 다용로 로프입니다. 600KG의 인장강도를 가지고 있습니다.</p>\r\n<img src=\"/data/project/105/p105_e1455617503323.jpg\">&nbsp;&nbsp;<img src=\"/data/project/105/p105_e1455624113057.jpg\"><br><p style=\"text-align:center; padding:0 15px;\"><iframe width=\"100%\" height=\"360\" src=\"https://www.youtube-nocookie.com/embed/QAP3HpfKK0s?rel=0&amp;showinfo=0\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p>\r\n\r\n<br><br><br><br><br><br><p><img src=\"/data/project/105/p105_e1455624196491.jpg\" style=\"font-weight: inherit; line-height: inherit; text-align: inherit;\" data-pin-nopin=\"true\">&nbsp;</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">13번의 디자인 변경, 4번의 나무 수종 변경, 수백번의 손길을 거쳐 완성된 트랜스포머 장난감입니다. 아이가 원할때 <strong style=\"box-shadow: 0 -5px 0 #ffd942 inset;\">1분이면 힙시트, 아이의자, 이유식 탁자, 목마로 변신할 수 있습니다.</strong></p><p>\r\n<img src=\"/data/project/105/p105_e1455617548346.jpg\">\r\n&nbsp;</p><br><p><img src=\"/data/project/105/p105_e1455617580014.jpg\">\r\n</p><p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">로즈우드 &amp; 천연오일 – 가장 최고급소재로 색감이 화려하며, 장미향이 납니다.&nbsp;로즈우드 추출오일은 노화방지, 면역력 증진의 효과가 있습니다.</p><p>\r\n<img src=\"/data/project/105/p105_e1455617589755.jpg\">\r\n\r\n<img src=\"/data/project/105/p105_e1455617599922.jpg\">\r\n</p><p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">균형 감각을 키워줄 수 있는 고급 원목 목마</p>\r\n<img src=\"/data/project/105/p105_e1455617613120.jpg\">\r\n\r\n<img src=\"/data/project/105/p105_e1455617627111.jpg\"><p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">걸음마 하는 우리 아이를 위한 맞춤형 의자와 식탁</p>\r\n<img src=\"/data/project/105/p105_e1455617639594.jpg\">\r\n\r\n<img src=\"/data/project/105/p105_e1455617653203.jpg\">\r\n<br><p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">TV볼 때, 밥먹을 때 효과 만점인 유아 의자에요~</p>\r\n<img src=\"/data/project/105/p105_e1455617664410.jpg\">\r\n\r\n<img src=\"/data/project/105/p105_e1455617675261.jpg\">\r\n<p style=\"padding:5px 5px 5px 30px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">아빠와 같은 곳을 볼 수 있는 신개념 힙시트, 무게도 850g밖에 하지 않아요~</p>\r\n<img src=\"/data/project/105/p105_e1455617687731.jpg\" style=\"margin-bottom:15px;\"><br><br><br><br><br><p><img src=\"/data/project/105/p105_e1455670779539.jpg\" style=\"font-weight: inherit; line-height: inherit; text-align: inherit;\">&nbsp;&nbsp;</p><br><br><p><img src=\"/data/project/105/p105_e1455617713977.jpg\" style=\"margin-bottom:15px;\" data-pin-nopin=\"true\">\r\n</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">무나의 모든 제품은 내 아이를 사랑하는 마음에서 시작되었습니다. 디자인부터 가공까지 사랑스런 아이를 생각하며 기쁜 마음으로 제작해 나갑니다. 제품에는 아이의 행동패턴과 감각발달을 위한 요소 뿐만 아니라, <strong style=\"box-shadow: 0 -5px 0 #ffd942 inset;\">안전성을 최우선으로</strong> 고려하여 만들었습니다.</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">2년 여간 직접 아이와 사용해 보며 즐거운 추억들을 만들었고, 그 기쁨을 더 많은 분들과 나누기를 바라며 크라우드 펀딩 프로젝트를 진행합니다. 프로젝트 성공시 어린이안전특별법에 따라 KC인증을 받고, 본격적인 판매를 진행할 예정입니다.</p><br><br>\r\n\r\n<img src=\"/data/project/105/p105_e1455621584390.jpg\" style=\"margin-bottom:15px;\" data-pin-nopin=\"true\">\r\n<p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">문화재 종사자로써 한옥을 짓고 단청을 하며 살아가는 제게는 디지털보다 아날로그 감성이 훨씬 많이 있습니다. 그런 제게 짠하고 나타나준 아이는 정말 커다란 선물이었습니다. 내 아이를 위하는 마음으로 관심과 사랑을 담아 제품을 만듭니다.</p>\r\n<img src=\"/data/project/105/p105_e1455617729124.jpg\" style=\"margin-bottom:15px;\">\r\n&nbsp;<br><br><br><p><img src=\"/data/project/105/p105_e1455617743304.jpg\" style=\"margin-bottom:15px;\">\r\n\r\n<img src=\"/data/project/105/p105_e1455617754127.jpg\" style=\"margin-bottom:15px;\" data-pin-nopin=\"true\">\r\n</p><p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">아이가 입에 물거나 빨아도 되나요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">동물멀티피스(대), 건들, 닝가는 원목소재와 천연오일을 사용하므로 아이가 입에 물거나 빨아도 됩니다.&nbsp;단 동물멀티피스(소)는 에코 제품이지만, 동시에 합판이므로 아이들이 물고 빠는 걸 권장하지는 않습니다.</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">나무가 너무 딱딱해서 아이들이 싫어하지 않을까요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">원목은 딱딱하지만 그만의 장점이 있습니다. 특히 항균성과 내구성은 플라스틱과 인형들이 줄 수 없는 큰 장점들입니다.</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">소재는 어떤 것을 쓰나요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">각 제품 설명에 명시되어 있는 친환경 나무 소재들을 사용합니다.</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">제품 배송은 어떻게 하나요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">동물장난감은 완제품 형태로 개별 포장하여 배송하며 닝가와 건들은 반제품 형태로 배송이 됩니다. 간단한 조립이니 아빠가 만들어 주세요. ^o^</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">닝가 제품을 아기가마로 사용하기에는 무겁지는 않나요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">어깨에 매는 아기가마 형태로 사용할 경우 닝가의 무게는 1kg 미만입니다. 사용자에 따라서 체감하는 것이 다르겠지만, 저와 같은 경우 21개월 아이가&nbsp;현재12kg 정도 하는데 하루에 2~3번 10분씩 태워주어도 무겁다고 느껴지지는 않습니다. 아기 가마로 사용하지 않을 경우 이유식 탁자나 의자 목마로 사용하시면 됩니다.</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">주문제작이 가능한가요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">가능합니다. 다만 소재의 크기 및 가공 공정에 따라 추가 비용이 발생할 수 있습니다.</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">지금 후원하면 언제 보상품을 받을 수 있나요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">4월 중에 받아보실 수 있습니다. 3월 17일 크라우드펀딩이 마감될 때 제작이 시작되어 순차적으로 배송이 됩니다.</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">여러 개를 후원하고 싶은데 어떻게 해야 하나요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">기본 보상품을 선택하신 후, 해당 추가금액을 직접 계산하여 수정해주세요. ^^ 사용이 어려우신 분이나 다량을 후원하시려는 분은 프로젝트개설자에게 알려주시면 안내해드리겠습니다.(프로젝트 개설자 Tel : 010-3284-4630)</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">하나를 추가로 후원할 때마다 배송료는 어떻게 되나요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">후원금에 배송료가 포함되어 있으니 추가배송료는 걱정하지 않으셔도 됩니다.</p>\r\n<p style=\"padding:5px 5px 0 0;font-size:18px;font-weight:900;color:#000;line-height:30px;letter-spacing:-0.3px;\">이미 후원했는데 더 후원하고 싶으면 어떻게 하나요?</p><p style=\"padding:5px;font-size:18px;font-weight:300;color:#7a7a7a;line-height:30px; letter-spacing:-0.3px;\">원래 크라우드 펀딩은 1인 1후원을 원칙으로 하고 있습니다. 추가 후원을 원하신다면, 기존의 후원을 취소하신 후 새로운 보상품을 선택해서 다시 후원해 주시기 바랍니다.\r\n<strong style=\"box-shadow: 0 -5px 0 #ffd942 inset;\">마이페이지 &gt; 후원프로젝트</strong>에 가시면 후원내역을 취소하실 수 있습니다.</p>\r\n<img src=\"/data/project/105/p105_e1455617763800.jpg\"><br><br><br><br><br><br><br><br><br>'),(17,107,'2016-03-08 18:24:21','2016-03-08 20:06:00','<p><img alt=\"\" src=\"/data/project/107/p107_e1457430271336.jpg\" /><img alt=\"\" src=\"/data/project/107/p107_e1457435083682.jpg\" /></p>\r\n'),(18,108,'2016-03-22 11:33:14','2016-03-24 11:36:10','<p style=\"font-size:20px;font-weight:700;color:red; line-height:22px;padding:0 0 5px 0;\"><img alt=\"\" src=\"/data/project/108/p108_e1458692713424.jpg\" /><img alt=\"\" src=\"/data/project/108/p108_e1458692729453.jpg\" /><img alt=\"\" src=\"/data/project/108/p108_e1458692742125.jpg\" /><img alt=\"\" src=\"/data/project/108/p108_e1458692505705.jpg\" /></p>\r\n\r\n<p style=\"font-size:20px;font-weight:700;color:red; line-height:22px;padding:0 0 5px 0;\"><img alt=\"\" src=\"/data/project/108/p108_e1458786856117.jpg\" /></p>\r\n\r\n<p style=\"font-size:20px;font-weight:700;color:red; line-height:22px;padding:0 0 5px 0;\"><img alt=\"\" src=\"/data/project/108/p108_e1458786835317.jpg\" /><img alt=\"\" src=\"/data/project/108/p108_e1458692554653.jpg\" /></p>\r\n\r\n<p style=\"font-size:20px;font-weight:700;color:red; line-height:22px;padding:0 0 5px 0;\"><img alt=\"\" src=\"/data/project/108/p108_e1458702265659.jpg\" /></p>\r\n\r\n<p style=\"font-size:20px;font-weight:700;color:red; line-height:22px;padding:0 0 5px 0;\"><img alt=\"\" src=\"/data/project/108/p108_e1458693607157.jpg\" /></p>\r\n\r\n<p style=\"font-size:20px;font-weight:700;color:red; line-height:22px;padding:0 0 5px 0;\"><img alt=\"\" src=\"/data/project/108/p108_e1458786955526.jpg\" /></p>\r\n\r\n<p style=\"font-size:20px;font-weight:700;color:red; line-height:22px;padding:0 0 5px 0;\"><img alt=\"\" src=\"/data/project/108/p108_e1458702293526.jpg\" /></p>\r\n'),(19,109,'2016-03-28 17:38:05','2016-03-29 09:29:19','<p><img alt=\"\" src=\"/data/project/109/p109_e1459211052806.jpg\" /></p>\r\n\r\n<p></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/109/p109_e1459154160579.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/109/p109_e1459154181833.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/109/p109_e1459211351703.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/109/p109_e1459154220159.jpg\" /></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/109/p109_e1459154234686.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/109/p109_e1459210776928.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/109/p109_e1459154264103.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/109/p109_e1459154275945.jpg\" /></p>\r\n'),(20,111,'2016-05-04 20:43:30','2016-05-20 13:49:15','<img src=\"/data/project/111/attach/u3_1462507892628.jpg\"><br><img src=\"/data/project/111/attach/u3_1462507956442.jpg\"><br><img src=\"/data/project/111/attach/u3_1462507976477.jpg\"><br><img src=\"/data/project/111/attach/u3_1462507991624.jpg\"><span style=\"line-height: 20.3px;\"><br></span><p><img src=\"/data/project/111/attach/u3_1462839847987.jpg\"><img src=\"/data/project/111/attach/u3_1463719632978.jpg\" style=\"font-weight: inherit; line-height: 1.45em; text-align: inherit;\"><img src=\"/data/project/111/attach/u3_1462508054640.jpg\" style=\"line-height: 1.4em; font-weight: inherit; text-align: inherit; background-color: initial;\"></p><p><img src=\"/data/project/111/attach/u3_1462839882218.jpg\"><br></p><p>\r\n<iframe width=\"697\" height=\"360\" src=\"https://www.youtube-nocookie.com/embed/YvWE3w7IOpQ?list=PLrCpOkCVOEEOV2AGd3QBYKxWqF5MbOugY\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<span style=\"line-height: 20.3px;\"><br></span></p><br><br><p><img src=\"/data/project/111/attach/u3_1462839923823.jpg\"></p><p>\r\n<iframe width=\"697\" height=\"360\" src=\"https://www.youtube-nocookie.com/embed/GLst-ZXsfU0?list=PLrCpOkCVOEEOV2AGd3QBYKxWqF5MbOugY\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n</p><br><br><p><img src=\"/data/project/111/attach/u3_1462840030804.jpg\"></p><p>\r\n<iframe width=\"697\" height=\"360\" src=\"https://www.youtube-nocookie.com/embed/lrj4E6BWkRM?rel=0&amp;showinfo=0\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n</p><br><br><img src=\"/data/project/111/attach/u3_1463105397088.jpg\"><br><br><br><p><img src=\"/data/project/111/attach/u3_1462840120551.jpg\"></p><p><img src=\"/data/project/111/attach/u3_1462508247850.jpg\" style=\"line-height: 1.4em; font-weight: inherit; text-align: inherit; background-color: initial;\"></p><p><img src=\"/data/project/111/attach/u3_1462520790693.jpg\"></p><p><img src=\"/data/project/111/attach/u3_1462840159923.jpg\"></p><p><img src=\"/data/project/111/attach/u3_1462508277205.jpg\"></p><br><br><br><br><br><br>'),(21,110,'2016-05-19 13:36:26','2016-05-19 13:36:26','<img src=\"/data/project/110/attach/u3_1463632580722.gif\">'),(22,112,'2016-06-02 11:39:49','2016-06-21 16:20:42','<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464857769404.jpg\"></p>\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;\">\r\n<span style=\"display:inline-block;padding:0 10px;border-left:5px solid #858585;border-right:5px solid #858585;color:#858585;margin-right:10px;\">메일주소</span>\r\n<span style=\"display:inline-block;color:#6f21cf;\">rightroute@naver.com</span>\r\n</p>\r\n\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464858103753.jpg\"></p>\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;\">\r\nFill Up Your Tummy 프로젝트는<br>\r\n\'열정\'이라는 메시지를 가지고 목표를 달성하기 위해<br>\r\n노력하는 청년들의 열정을 응원하는 프로젝트입니다.<br>\r\n</p>\r\n<br>\r\n<p style=\"text-align: center;\">\r\n<img src=\"/data/project/112/attach/u3_1464834033048.jpg\"></p>\r\n<p style=\"text-align: center;font-size:1em;line-height:1.5em;padding:0.5em;\">열정을 가지고 하루하루 바쁘게 살아가는<br>대한민국 청년들</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834100109.jpg\"></p>\r\n\r\n\r\n\r\n\r\n<br>\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;color:#696969;line-height:28px;\">이런 현실에도 자신의 목표를 위해 달리는 사람은 있습니다.</p>\r\n<br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;color:#e0233f;margin:15px 0 5px 0;\">사례1</p>\r\n<p style=\"margin:0;\"><span style=\"display:block;text-align:left;padding:10px;background-color:#fff;border:3px solid #eaeaea;font-size:1em;line-height:1.5em;font-weight:500;\">\r\n저는 24살 대학생입니다. 현재 야간 아르바이트를 하며 학비를 벌고 있습니다.<br>\r\n진짜 힘들지만 어쩔 수 없어요. 전 이루고 싶은 꿈이 있으니까요.<br>\r\n사실 학업에 큰 의의를 두고 있지는 않아요, 졸업만 하면 되거든요. 제가 진짜로 하고 싶은 일을 하기 위해서는 졸업장이 필요하니 어쩔 수 없죠. 제 목표를 향한 과정이라고 생각해요.\r\n</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;color:#e0233f;margin:15px 0 5px 0;\">사례2</p>\r\n<p style=\"margin:0;\"><span style=\"display:block;text-align:left;padding:10px;background-color:#fff;border:3px solid #eaeaea;font-size:1em;line-height:1.5em;font-weight:500;\">2년째 취업준비중인 올해로 30세 취업준비생입니다. 계속 실패하고 있지만 면접에서 말하는 저의 장점은 ‘열정과 성실’ 이예요. 저는 솔직히 스펙 좋고 학벌 좋다고 일을 잘하는건 아니라고 생각해요. 누구보다 이 일에 열정을 가지고, 하고 싶어하고, 성실하기 까지 한데.. 음… 이번엔 뽑히지 않을까요?</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;color:#e0233f;margin:15px 0 5px 0;\">사례3</p>\r\n<p style=\"margin:0;\"><span style=\"display:block;text-align:left;padding:10px;background-color:#fff;border:3px solid #eaeaea;font-size:1em;line-height:1.5em;font-weight:500;\">\r\n저는 30대 직장인입니다. 앞으로 직종에서 새로운 일을 시작하려 합니다. 사실, 다들 하지 말라고 해요. 왜 크고 안정적인 회사 그만두고 돈도 안되는 일을 하려고 하냐고.. 근데, 저는 이게 제 삶의 목표이자 꿈이거든요.</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<br><br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834323650.jpg\"></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<br>\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1em;padding:10px;background-color:#696969;color:#fff;margin:0 0 15px 0;\">청년들에게는 열정을 위한 에너지 공급이 필요합니다.</p>\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: left;font-size:1em;line-height:1.5em;\">바쁜 삶을 살고 있는 청년들의 열정을 위해 해줄 수 있는 것이 무엇일까 고민하다가 “청년을 위한 에너지 충전이 필요하다” 라고 생각하여 시작하였습니다.<br>충전이라는 Basic에 초점을 두고 이를 바탕으로 한국에서 바쁘게 사는 청년들의 끼니를 해결하기 좋은, 많은 사람들이 일상에서 접하는 패스트푸드를 주제로 독특한 일러스트가 담긴 양말을 제작하였습니다.</p>\r\n<br>\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834462830.jpg\">\r\n<img src=\"/data/project/112/attach/u3_1464834813695.jpg\"></p>\r\n<br><br><br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;border-top:5px solid #ffd84d;color:#000;font-weight:700;font-size:1.2em;width:250px;padding:0.5em 0 0 0;margin:1em auto; 0 auto;\">핫도그 (Yellow)</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834717789.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;border-top:5px solid #4da7e4;color:#000;font-weight:700;font-size:1.2em;width:250px;padding:0.5em 0 0 0;margin:1em auto; 0 auto;\">아이스크림 (Blue)</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834749420.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;border-top:5px solid #ff778d;color:#000;font-weight:700;font-size:1.2em;width:250px;padding:0.5em 0 0 0;margin:1em auto; 0 auto;\">프레즐 (Pink)</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834769051.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;border-top:5px solid #3b3b3b;color:#000;font-weight:700;font-size:1.2em;width:250px;padding:0.5em 0 0 0;margin:1em auto; 0 auto;\">콜라 (Black)</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834791069.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;border-top:5px solid #eaeaea;color:#000;font-weight:700;font-size:1.2em;width:250px;padding:0.5em 0 0 0;margin:1em auto; 0 auto;\">Text (White)</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834629692.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834844011.jpg\">\r\n<img src=\"/data/project/112/attach/u3_1464834875932.jpg\"></p>\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464846824677.jpg\"></p>\r\n<br><br><br><br>\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464834972179.jpg\"></p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464835022537.gif\"></p>\r\n<br><br>\r\n<p style=\"text-align: center;font-size:16px;border-top:2px solid #32b3dd;border-bottom:2px solid #32b3dd;margin:0 30px;\">\r\n<span style=\"display:block;font-size:18px;color:#fff;line-height:26px;margin:10px 0;background-color:#32b3dd;padding:1em;\">Geo Law는 이번 Right Route의 프로젝트를 통해 청년들의 “열정” 을 위한 작품들을 선보입니다.<br>\r\nSheffield를 주 무대로 삼은 팝컬처 일러스트레이터로 작품에서 뛰어난 색감을 느낄 수 있습니다. Geo의 작품은 일러스트는 물론 코믹북, 인테리어 데코레이션 등 다양한 분야에서 활용되고 있습니다.</span>\r\n</p>\r\n<br><br><br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:2em;font-weight:700;color:#FE2453;padding:0 0 20px 0;\">보상품 소개</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center; font-size: 1.2em; margin: 10px 0px 5px; color: rgb(0, 0, 0);\"><strong>핫도그 SET</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840251244.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;margin:10px 0 5px 0;color:#000;\">아이스크림 SET</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840275841.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;margin:10px 0 5px 0;color:#000;\">프레즐 SET</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840301708.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;margin:10px 0 5px 0;color:#000;\">콜라 SET</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840326411.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;margin:10px 0 5px 0;color:#000;\">푸드파이터 SET</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840354363.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;margin:10px 0 5px 0;color:#000;\">판타스틱4 SET</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840374468.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;margin:10px 0 5px 0;color:#000;\">I want it all SET</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840404467.jpg\"></p>\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.2em;font-weight:700;margin:10px 0 5px 0;color:#000;\">Double Fire SET</p>\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840437495.jpg\"></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<br><br><br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464840566753.jpg\"></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;font-size:1.5em;font-weight:700;color:#6f22ce;text-decoration:underline;\">[Right Route]</p>\r\n<p style=\"text-align: center;padding:0 0 0.5em 0;font-size:1.1em;line-height:1.4em;\">패션을 통해 가치있는 메시지를 전달하는 회사로 트렌디한 디자인과 함께 다양한 메시지를 전달하고 있습니다.</p>\r\n<p style=\"text-align: center;font-size:1.5em;font-weight:700;color:#ef5307;text-decoration:underline;\">[Hotdog Factory]</p>\r\n<p style=\"text-align: center;padding:0 0 0.5em 0;font-size:1.1em;line-height:1.4em;\">Hotdog Factory는 Right Route와 함께 열정 가득한 청년들이 일하는 곳으로 Hot Dog를 전달하여 청년들의 쉼없이 바쁜 삶에 에너지가 되어 줄 한 끼를 선물하려고 합니다.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<br><br>\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;color:#fff;font-size:1.6em;font-weight:700;padding:0.5em;margin:1em 0 0 0;background-color:#6f22ce;\">About Right Route</p>\r\n<p style=\"text-align: left;font-weight:500;padding:1em;background-color:#f3f3f3;color:#000;font-size:1em;line-height:1.4em;margin:0;\">단순히 옷을 디자인 하는 회사를 넘어서 소비자들과 소통하고 공감할 수 있는 메시지를 옷에 담아 디자인 합니다.Right Route는 사회적 이슈 또는 많은 사람들과 공감할 수 있는 스토리를 패션상품에 담아 소비자들에게 따뜻한 위로이자 공감 해 주는 브랜드 입니다.</p>\r\n<br><br><br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"color:#000;font-size:1.2em;text-align:left;\">1st. OUTCOME <span style=\"color:#d5d5d5;font-size:14px;\">Designer Project</span></p>\r\n<p style=\"text-align: left;padding:10px;border:2px solid #eaeaea;\">\r\n<span style=\"color:#000;font-size:1em;line-height:1.4em;\">\r\n온라인 유통 플랫폼 2곳 입점. (크램잇, Mesuem)<br>\r\n오프라인 유통 플랫폼 입점. (부산 크램잇)<br>\r\n연예인 및 인터넷 BJ 협찬 (크나큰, 베스티, 김이브등)<br>\r\n본 프로젝트 수익금으로 두 번째 패션소품 확장 <br>\r\n중국 치푸르 지역 신지누 쇼핑센터 전시회 참가<br>\r\n독도 디자인- 독도사랑협회 로고로 채탁<br>\r\n동물권 관련 컨텐츠 페이스북 라이크 약 3000개, 공유 4권</span>\r\n</p>\r\n<br><br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"color:#000;font-size:1.2em;text-align:left;\">2st. OUTCOME <span style=\"color:#d5d5d5;font-size:14px;\">Artist Project</span></p>\r\n<p style=\"text-align: left;padding:10px;border:2px solid #eaeaea;\">\r\n<span style=\"color:#000;font-size:1em;line-height:1.4em;\">\r\n사회적 기업 육성사업 선정<br>\r\n&nbsp;한국 #1 온라인 쇼핑몰 무신사 입점<br>\r\n현대백화점 UPLEX 타이니빅 오프라인 입점<br>\r\n청심환 페스티벌 강연 (05.01.2016) <br>\r\n미국 에이전시 Mattson 계약 체결<br>\r\n행복나눔 재단 sk 파일럿테스트 비용 채택</span>\r\n</p>\r\n<br><br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"color:#000;font-size:1.5em;text-align:center;font-weight:700;\">Right Route Mission</p>\r\n<p><span style=\"display:block;font-size:1.3em;text-align:center;line-height:1.4em;font-weight:700;color:#6f22ce;\">“디자이너, 아티스트와 함께 공생할 수 있는 환경을 만듭니다.”</span></p>\r\n<p style=\"text-align: left;padding:15px;border:2px solid #eaeaea;background-color:#f3f3f3;font-size:1em;line-height:1.4em;color:#555555;\">\r\nRight Route 는 디자이너 지망생, 아티스트들과 협업하는 패션 브랜드 입니다.<br>\r\n디자이너 지망생들과 함께 의류를 제작하는 과정을 통해 포토폴리오 및 교육을 제공하고, 신진 아티스트들에게 새로운 기회의 장을 마련하고 있습니다.<br>\r\n꿈을 찾는 젊은 청춘들에게 단순한 응원을 넘어, 함께 발전하는데 앞장서고 있습니다.\r\n</p>\r\n<br>\r\n\r\n<p style=\"text-align: center;\"><img src=\"/data/project/112/attach/u3_1464919040978.jpg\" data-pin-nopin=\"true\"></p><br><br>\r\n\r\n\r\n\r\n'),(23,122,'2016-08-09 09:13:42','2016-08-09 09:16:34','<p><br style=\"clear: both;\">&nbsp;</p>');
