INSERT INTO `nest_project_story_update` VALUES (11,102,'2016-01-22 18:43:54','2016-03-25 00:40:45','<p><img src=\"/data/project/102/p102_e1453455819715.jpg\" /></p>\r\n','원본보다 더 예쁜 우리아이 사진조명!','Y'),(12,102,'2016-02-18 16:35:02','2016-03-25 00:40:33','<p><img src=\"/data/project/102/p102_e1455780890832.jpg\" /></p>\r\n','메세지조명 제작 타임라인','Y'),(13,102,'2016-02-25 16:09:19','2016-03-25 00:40:21','<p><img src=\"/data/project/102/p102_e1456384137111.jpg\" /></p>\r\n','메세지조명 옷 입히는 중!','Y'),(14,104,'2016-03-02 09:28:22','2016-03-24 23:31:32','<p style=\"font-size:17px;font-weight:bold;line-height:18px;margin-bottom:7px;letter-spacing:-0.5px;\">&#39;캠핑 마에스트로&#39; 동성 해바라기 버너 프로젝트를 후원해 주셔서 감사합니다.&nbsp;</p>\r\n\r\n<p style=\"font-size:15px;line-height:23px;margin-bottom:5px;letter-spacing:-0.5px;\">여러분들의 후원으로 목표금액을 달성하고, 본격적인 제작/배송 준비를 진행하고 있습니다.<br />\r\n지난 2월초 한국 가스안전공사에 신제품 안전 승인을 신청하여, 안전 검사 승인 대기 중인 상황입니다.<br />\r\n저희는 2월말까지 승인이 완료될 것으로 예상되었으나, 조금 지연되어 금주 중 완료될 것으로 판단하고 있습니다.<br />\r\n늦어도 3월 10일이전에는 가능할 것 같습니다.</p>\r\n\r\n<p style=\"font-size:15px;line-height:23px;margin-bottom:5px;letter-spacing:-0.5px;\">승인과는 별개로 현재 양산을 위한 자재 구매와 일부 가공 작업은 내부 계획대로 진행 중에 있습니다.<br />\r\n가스 안전 공사의 승인이 완료되면, 바로 양산 진행 후 가스 안전 공사 개별 출하 심사를 진행하여 배송해 드릴 수 있도록 최선을 다해 준비해 가겠습니다.</p>\r\n\r\n<p style=\"font-size:15px;line-height:23px;margin-bottom:5px;letter-spacing:-0.5px;\"><span style=\"color:#fe5339;\"><b>여기서 한가지 팁!</b></span><br />\r\n<ins><b>Made in Korea</b></ins>이기 때문에 모든 제품은 출하 시점에 <ins><b>가스 안전 공사 시험 검사관이 양산 공장에 직접 방문</b></ins>하여 해당 출하 제품을 선별 검사를 통해 안전성을 확보하고 있습니다.<br />\r\n법으로 정해져 있는 것입니다. Made in China와는 안전성 측면에서 비교할 수 없죠^^</p>\r\n','\'캠핑 마에스트로\' - 프로젝트 후원 감사!!',NULL),(16,102,'2016-03-11 13:40:57','2016-03-25 00:40:09','<p><img alt=\"\" src=\"/data/project/102/p102_e1457671228024.jpg\" /></p>\r\n','메세지조명 ','Y'),(17,102,'2016-03-11 13:41:36','2016-03-24 23:29:19','<p><img alt=\"\" src=\"/data/project/102/p102_e1457671281679.jpg\" style=\"width: 800px; height: 710px;\" /></p>\r\n','배송 일정 연기',NULL),(18,104,'2016-03-11 14:56:43','2016-03-24 23:31:50','<h1>안전 공사 인증 현황 및 양산 진행 상황</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>동성정밀 해바라기 버너를 사랑해 주시는 분들께 감사 말씀 드립니다.&nbsp;</h3>\r\n\r\n<h3>가스 안전 공사 인증이 계획보다 조금 지연되고 있습니다. 이번 신제품에 처음 채택된 &#39;<span class=\"marker\">화력 조절 탭</span>&#39;&nbsp;형상에 대한 안전 인증 부분에 수정사항이 필요할 것 같습니다.</h3>\r\n\r\n<h3>현재, 화력 조절 탭 부분이 작고&nbsp;재질이 금속으로 되어 있는 부분이 안정상 문제가 될 수 있다는 지적이 있었습니다. 내부 안정성 검사에서는 문제 없는 것으로 생각되었지만, 정부 기관의 지적을 수용해야 겠지요?&nbsp;</h3>\r\n\r\n<h3>최초 프로젝트 때 보셨던 <ins><strong>&#39;화력 조절 탭&#39;&nbsp;디자인이 조금 달라질 수 있을 것 같습니다.&nbsp;</strong></ins></h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>현재 해당 조절 탭 부분만 수정하면 되기 때문에, 나머지 양산 자재는 준비가 완료되었습니다.&nbsp;</h3>\r\n\r\n<h3>차주 중 양산 후 출하 승인 절차를 진행할 수 있도록 여러 방면으로&nbsp;&nbsp;최선의 노력을 다하고 있습니다.</h3>\r\n\r\n<h3>추가되는 정보는 계속 업데이트 드리도록 하겠습니다.&nbsp;</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>감사합니다.&nbsp;</p>\r\n','안정공사 인증 현황 및 양산 진행 상황 안내',NULL),(19,104,'2016-03-18 17:36:27','2016-03-24 23:32:16','<h1>캠프 마에스트로 - 동성&nbsp;해바라기 버너&nbsp;배송 시작</h1>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<p>2016년 신모델 DSR 1005 제품이 가스 안전 공사 최종 승인 후 <strong>어제&nbsp;첫 양산품의 출고 검사가 완료</strong> 되었습니다.&nbsp;</p>\r\n\r\n<p>그리고 오늘 드디어 후원해 주신 모든 분들께 포장 및 배송처리가 되었습니다. 후원해 주신 분들은&nbsp;대한민국에서</p>\r\n\r\n<p>가장 먼저 신제품을 받아 보시게 되었습니다</p>\r\n\r\n<p>후원해 주셔서 다시 한번 감사 드리며, 최근 동성 해바라기 버너를 모방한 카피 제품들이 많이 나오기 시작했습니다.&nbsp;</p>\r\n\r\n<p>그간의 시장에서&nbsp;인정 받은 동성 해바라기 버너의&nbsp;안정성과 A/S를 믿기에 걱정은 되지 않지만, 소비자분들께서&nbsp;</p>\r\n\r\n<p>자칫 품질이 떨어지는 유사 해바라기 버너를 구입하시게 될까 염려가 됩니다.&nbsp;</p>\r\n\r\n<p>주변 분들께 <strong>&quot;캠핑 버너의 끝판왕은 동성 해바라기 버너&quot;</strong>임을 많이 알려 주세요~</p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/104/p104_e1458290150596.jpg\" style=\"width: 800px; height: 1646px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','캠프 마에스트로 - 동성 해바라기 버너 배송 시작','Y'),(20,102,'2016-04-14 16:41:02','2016-04-14 16:41:02','<p><img alt=\"\" src=\"/data/project/102/p102_e1460619507522.jpg\" style=\"width: 800px; height: 1296px;\" /></p>\r\n','메세지 조명 배송 완료! 감사합니다~','Y'),(21,105,'2016-04-19 10:46:31','2016-04-19 10:46:31','<p>제목 그대로 고군분투하는 프로젝트이었음에도 불구하고, 함께 믿어주시고 응원해 주신 후원자 분들께 감사드립니다. ^^</p>\r\n\r\n<p>프로젝트가 종료되고 열심히 생산하기 시작해서, 건들과 같이 큰 사이즈의 제품들은 모두 완성을 하였고,</p>\r\n\r\n<p>현재는 사진과 같이 동물 장난감들을 제작하고 있는 중입니다.&nbsp;</p>\r\n\r\n<p>이번주&nbsp;중에는 대부분의 제품들이 완성될 것으로 보이고, 다음주부터 한분 한분께 정성껏 배송해 드릴수 있을 것 같습니다.&nbsp;</p>\r\n\r\n<p>다시 한번 후원과 기다림에 감사드립니다. ^O^/&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p></p>\r\n\r\n<p>아울러 저희 홈페이지에서도 크라우드펀딩 제품과 더 많은 신규 제품들을 구매하실 수 있으니,&nbsp;</p>\r\n\r\n<p>관심있으신 분들의 많은 방문 부탁드립니다. ^^ (www.muna.co.kr)</p>\r\n\r\n<p>감사합니다. &nbsp;&nbsp;</p>\r\n\r\n<p></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/105/p105_e1461029749258.jpg\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/data/project/105/p105_e1461029769538.jpg\" /></p>\r\n','작품 생산이 거의 완료되었습니다. ^^','Y'),(22,105,'2016-04-27 18:59:30','2016-04-27 18:59:30','<p>4/26일 어제자로 1차 배송을 진행하였습니다. 와~~ ^O^/</p><p>동물 장난감 (소) 또는 (대) 를 주문해 주신 분들을 대상으로 1차 배송이 진행되었고,&nbsp;</p><p>건들이나 닝가와 함께 후원해 주신 분들은 다음주 중으로 2차 배송을 진행할 예정입니다.&nbsp;</p><p>감사합니다. ~~<p><br><br><p><img src=\"/data/project/105/attach/u3_1461750749982.jpg\"></p><p><br></p></p></p>','1차 배송 시작 (동물 장난감 소, 대)','Y'),(23,109,'2016-05-13 13:46:40','2016-05-13 13:46:40','<p>후원자 여러분,</p><p>기다려 주셔서 감사합니다. ^^</p><p>사진과 같이 제품 제작 및 포장을 완료하여, 적어주신 배송지로 소중하게 발송하였습니다.&nbsp;</p><p>다행히 저희에게 알려주신 일정들에 차질없이 보내드릴 수 있게 되었네요~&nbsp;</p><p>다시 한번 감사드리고, 선물하시는 분과 받는 분 모두에게 행복한 5월 한달이 되었으면 좋겠습니다. &nbsp;<span style=\"font-family: \'Trebuchet MS\', Helvetica, Verdana, sans-serif; line-height: 19.6px;\">^O^/</span></p><img src=\"/data/project/109/attach/u3_1463114755445.jpg\"><br><br><img src=\"/data/project/109/attach/u3_1463114777041.jpg\">','보상품 배송합니다.~','Y'),(24,111,'2016-06-21 17:22:32','2016-06-21 17:23:30','<p>후원자 분들의 도움으로 프로젝트를 성공적으로 마무리 하였습니다.&nbsp;</p><p>후원해 주신 제품 내역들은 빠른 시일 내에 정리하여 배송해 드리도록 하겠습니다.&nbsp;</p><p>(사실 수량이 그렇게 많진 않아서 빨리 준비할 수 있을 것 같아요~ ^^ㅎ)</p><p>이번 크라우드펀딩을 계기로 프로젝트를 어떻게 준비하고, 진행해야 하는지 조금은 알게된 것 같습니다.&nbsp;</p><p>이번에 배운 것들을 바탕으로 다음 번엔 좀 더 매력적인 제품으로 찾아 뵙도록 하겠습니다.&nbsp;</p><br><p>모든 후원자 여러분, 그리고 응원해 주신 여러분들&nbsp;</p><p>진심으로 감사드립니다. ^O^/</p><br><p>- 굿앤레더 드림 -</p>','후원자 여러분 감사드립니다. ^^','Y'),(25,122,'2016-07-28 11:31:33','2016-07-28 15:14:12','<div style=\"padding:10px;\"><p>안녕하세요,</p><p>오지랖의 오지라퍼입니다.</p><p>&nbsp;</p><p>저희 오지랖에서 해외 \'Kickstarter\'에서 성공적으로 크라우드 펀딩이 진행된 휴대용 진공압축기 \'VAGO\'를 제조사인 대만의 \'Creation Cell\'과의 협의를 통해 한국에서 크라우드 펀딩을 진행하고있는데요, \'VAGO\'는 현재 정식 판매 제품이 나와있지 않으며 지속적인 테스트와 양산을 위해 준비중이며 전 세계적으로 배송일은 저희 오지랖과 비슷하게 진행됩니다.</p><p>&nbsp;</p><p>크라우드 펀딩이기에 그리고 해외배송이기에 걱정하시고 기다리시는 분들이 많습니다.</p><p>&nbsp;</p><p>그래서 어떻게 진행되는지 직접 저희가 대만까지 날아가서 \'Creation Cell\'팀과 만나 이야기를 해보기로 했습니다.</p><p>&nbsp;</p><p>저희는 열심히 발로 뛰는 오지라퍼니까요!!!</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>본 인터뷰는 현재 크라우드 펀딩 진행중에 있는 제품인 \'VAGO\'와 이 제품을 제작한 \'Maker\'들을 만나기 위해 대만으로 날아간 <span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);\"><u><b>오지랖의 장태선이사(이하: J)</b></u></span>가 진행해 주셨습니다.</p><p>타이페이 국제공항에서 만나 공항 건물 내 작은 카페에서<span style=\"color: rgb(42, 217, 122);\"> </span><b><font color=\"#07bf3e\">Creation Cell 팀의 공동창업자이신 Leon Chao 이사(이하: L), 판매 매너지인 Brian Tsai, 마케팅 메니저인 Chloe Tsai와 Daisy</font></b>를 만나서 \'VAGO\'의 제품 제작 진행사항을 점검하고 인터뷰를 진행하였습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);\"><b>J : 타이페이 공항이 타이페이 시와 멀리 떨어져 있는 것으로 알고 있는데 이렇게 4명이나 먼 길 와주셔서 정말 감사합니다. 지금 이 인터뷰에 앞서서 혹시 전에 다른 온라인 매체나 신문 등 인터뷰를 진행 한 적이 있었나요?</b></span></p><p><span style=\"color: rgb(7, 191, 62); background-color: rgb(255, 255, 255);\">L : 안녕하세요. 다른 온라인에서 회사 소개글이 올라간 적은 많은데 이렇게 인터뷰를 하는 건 처음입니다.&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\"><b style=\"\"><br></b></span></p><p><span style=\"color: rgb(0, 0, 0);\"><b>J : 그럼 간단한 인터뷰를 시작하겠습니다. 우선 \'Creation Cell\'이 어떤 회사인지가 궁금합니다. Creation Cell은 어떤 회사인가요?</b></span></p><p><span style=\"color: rgb(7, 191, 62);\">L : 저희 Creation Cell은 제품 디자인을 전문으로 하는 회사에요. 회사를 설립한지는 5년정도 되었고요. 그동안은 주로 B2B 형태로 스마트폰 디자인과 로봇 디자인을 진행했었구요. 이번에 처음으로 B2C 시장을 대상으로 \'VAGO\'의 상품기획과 제품 개발을 하였고, 이번에 미국 크라우드펀딩 사이트인 Kickstarter에서 성공적으로 크라우드펀딩을 마쳤습니다.</span></p><p><b><span style=\"color: rgb(0, 0, 0);\"><br></span></b></p><p><span style=\"color: rgb(0, 0, 0);\"><b>J : Kickstarter에서 성공을 다시 한 번 축하드립니다. 이렇게 Kickstarter에서 성공적으로 프로젝트를 성공시킨 비결이 있을 것 같은데요? Creation Cell 자체적으로 파악하고 있는 성공 비결이 무엇인가요?</b></span></p><p><span style=\"color: rgb(7, 191, 62);\">L : 저희 내부적으로는 Damanwoo.com(새롭고 신기한 디자인, 예술, 제품 등을 소개하는 사이트)을 통해서 대만 사람들에게 홍보를 했었는데요. 그 내용을 보신 분들이 초기에 Kickstarter 모금에 많이 참여해줘서 성공시키는데 큰 도움이 된 거 같아요.&nbsp;</span><font color=\"#07bf3e\">저희가 자체적으로 파악하기에는 크라우드펀딩이 일반적으로 빠르게 증가하다가 완만해지면서 종료가 되는 형태인데요. 저희는 처음부터 끝까지 꾸준히 증가하는 형태로 된 것을 보며 지속적으로 관심이 있는 사람들에게 전달되어서 그러한 결과를 얻을 수 있었던 거 같아요.&nbsp;</font></p><p>&nbsp;</p><p><b><span style=\"color: rgb(0, 0, 0);\">J : 이렇게 \'VAGO\' 샘플을 보니 예상보다 크기가 작은 느낌입니다.&nbsp;</span></b><b style=\"line-height: 1.5;\">계속 사진으로만 봐와서 크다는 느낌이었는데 실제 보니 한 손에 들어가는 크기네요.&nbsp;</b><b style=\"line-height: 1.5;\">하지만 작은 크기에 비해서는 약간 묵직한 느낌도 있어요. 플라스틱 마감은 (사진에서는 잘 드러나지 않지만) 밋밋한 플라스틱이 아닌 꽤 고급스러운 느낌이네요. 디자인 회사에서 만든 제품답다라는 생각이 듭니다.</b></p><p><span style=\"color: rgb(7, 191, 62);\">L : 네, 감사합니다.(미소) 이 제품은 3번째 시제품이에요. 처음 제품은 정말 이거 보다 3배 이상은 컸어요. 그런 제품을 작게 만들기 위해서 정말 많은 노력을 했었지요. 실제 제품의 표면도 이와 같은 표면으로 제작 중에 있습니다. 사진에 잘 안나타난다니 안타깝네요.(T-T 아쉬움...)</span></p><p><span style=\"color: rgb(7, 191, 62);\">&nbsp;</span></p><p><img src=\"/data/smarteditor/attach/u435_1469671950501.jpg\" title=\"u435_1469671950501.jpg\"></p><p>&nbsp;</p><p><span style=\"color: rgb(0, 0, 0);\"><b>J : 아, 많은 분들이 궁금해 하시는 내용인데요, 현재 프로세스 진행은 어떻게 되어가고 있나요?</b></span></p><p><span style=\"color: rgb(7, 191, 62);\">L : 현재 VAGO 생산을 준비중이에요. 제품이 나오는대로 8월에 미국과 유럽의 전자파 인증을 진행할 예정이구요. 해외 바이어들한테도 연락이 많이 오는데요. 현재 많은 논의를 진행이라서 한창 바쁜 시간을 보내고 있습니다.</span></p><p><b><span style=\"color: rgb(0, 0, 0);\"><br></span></b></p><p><b><span style=\"color: rgb(0, 0, 0);\">J : 사용설명서는 각 나라마다 다르게 하나요? 다르게 한다면 혹시 한국어도 들어가 있을까요?</span></b></p><p><span style=\"color: rgb(7, 191, 62);\"><span style=\"color: rgb(7, 191, 62);\">L : 사용설명서는 한장으로 구성되어있어요. 아주 긴 종이에 앞뒤로 영어, 프랑스어, 스페인어, 일본어 등이 들어가고요. 이번에 한국어도 넣어요. 그런데 설명서를 꼭 보지 않아도... 동영상만 봐도 사용할 수 있을 정도로 사용법은 간단합니다</span>.&nbsp;</span></p><p><span style=\"color: rgb(7, 191, 62);\">L : 어... 근데... 동영상을 보지 않아도 할 수 있을것 같지 않나요? (웃음)</span></p><p><b><span style=\"color: rgb(0, 0, 0);\"><br></span></b></p><p><b><span style=\"color: rgb(0, 0, 0);\">J : 네, 제가 봐도 그렇긴 해요.(웃음) 이번에 VAGO를 제품기획하고, 디자인, 크라우드펀딩, 제작, 판매 등을 진행하셨는데요. 가장 힘들었던 일은 무엇인가요?</span></b></p><p><span style=\"color: rgb(7, 191, 62);\">L : 제 생각은 B2C 고객 대응이 가장 어려웠다고 생각해요. 물론, 지금도 어렵고요. 저희가 원래 B2B를 주로 하기 때문에 그 전에는 하나의 고객에게만 집중해서 그 고객이 원하는대로 일을 진행하면 되었어요. 하지만 이번에 크라우드펀딩을 시작하면서 정말 많은 고객들을 많이 만나게 되었어요. 그런데 고객마다 원하는 내용이 다양하잖아요. 그래서 그 다양한 Needs에 맞추는 일이 가장 어려웠어요.</span></p><p><b><span style=\"color: rgb(0, 0, 0);\"><br></span></b></p><p><b><span style=\"color: rgb(0, 0, 0);\">J : 아, 저도 굉장히 공감하는 내용이네요. 남일같지 않아서...</span></b></p><p><span style=\"color: rgb(7, 191, 62);\">J와 L : (서로 토닥토닥...)</span></p><p><b><span style=\"color: rgb(0, 0, 0);\"><br></span></b></p><p><b><span style=\"color: rgb(0, 0, 0);\">J : 앞으로 \'Creation Cell\'의 계획은 무엇인가요?</span></b></p><p><span style=\"color: rgb(7, 191, 62);\">L : 우선 \'VAGO\'를 생산하고 배송하는데 집중할 계획이에요. 고객들과의 약속을 지켜야 하니까요. 그리고 저희 멤버들이 Challenge를 좋아해서 향후에는 B2C를 대상으로 또 다른 제품을 만들어 볼 계획입니다. 다음에 만들 제품도 많이 기대해주세요.</span></p><p><b><span style=\"color: rgb(0, 0, 0);\"><br></span></b></p><p><b><span style=\"color: rgb(0, 0, 0);\">J : 다음 만드는 제품도 저희와 함께 해야 하는거 아시죠? (웃음) 마지막으로 한국에서 크라우드 펀딩에 참여해 주신 분들에게 해주고 싶은 말 해주세요.</span></b></p><p><span style=\"color: rgb(7, 191, 62);\">L : 한국에서도 좋은 성과가 나왔으면 좋겠어요. 한국 시장이 대만과도 가깝고 그리고 무엇보다도 대만 시장보다 커서 기대가 커요. 그리고 현재 오지랖을 통해 진행되는 크라우드펀딩으로 구매해 주시는 모든 분께 감사의 말씀을 전합니다.</span></p><p><b><span style=\"color: rgb(0, 0, 0);\"><br></span></b></p><p><b><span style=\"color: rgb(0, 0, 0);\">J : 오늘 유익한시간 정말 감사했습니다. 다음에 또 봐요 \"씨 유 어게인\"</span></b></p><p><span style=\"color: rgb(7, 191, 62);\">L : 네, 그런데 여기 또 오실건가요?</span></p><p><b><span style=\"color: rgb(0, 0, 0);\"><br></span></b></p><p><b><span style=\"color: rgb(0, 0, 0);\">J : ........</span></b></p><p><b style=\"line-height: 1.5;\"><br></b></p><p><b style=\"line-height: 1.5;\">Creation Cell을 만나서 짧은 1시간 동안 자신이 좋아하는 일을 하는 사람들의 즐거움이 느껴졌습니다. 제품 디자인 회사와 하드웨어 스타트업을 하면서 겪었던 일에 대해서 이야기를 할 때는 프로페셔널한 느낌이었지만, 인터뷰 중간중간 장난도 치면서 진행해서 밝고 긍정적인 에너지를 가진 젊은 스타트업 느낌이 많이 났습니다. VAGO와 더불어서 더 좋은 디자인 제품들을 많이 만들어서 훌륭한 회사로 성장했으면 좋겠다는 생각을 여러번 했습니다.&nbsp;</b></p><p><b style=\"line-height: 1.5;\"><br></b></p><p><b style=\"line-height: 1.5;\">그리고 인터뷰 후 멤버들과의 사진 촬영입니다.^^&nbsp;</b><b style=\"line-height: 1.5;\">인터뷰 해준 4명 모두 감사합니다.</b></p><p><b style=\"line-height: 1.5;\"><br></b></p><p><img src=\"/data/smarteditor/attach/u435_1469672596888.jpg\" title=\"u435_1469672596888.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>지금까지 긴(?) 인터뷰 읽어주셔서 감사드립니다.</p><p>&nbsp;</p><p>차후 더 알찬 업데이트로 찾아뵙겠습니다.^^</p><p>&nbsp;</p><p>감사합니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></div>','VAGO \'Creation Cell\'과의 단독 인터뷰!','Y'),(26,122,'2016-08-03 14:58:49','2016-08-03 14:58:49','<p><img title=\"u435_1470203912177.png\" src=\"/data/smarteditor/attach/u435_1470203912177.png\"><br style=\"clear: both;\">&nbsp;</p>','VAGO가 목표금액을 100% 달성하였습니다.','Y'),(27,122,'2016-08-09 09:15:26','2016-08-09 09:16:42','<p><img title=\"u435_1470701693018.jpg\" src=\"/data/smarteditor/attach/u435_1470701693018.jpg\"><br style=\"clear: both;\">&nbsp;</p>','VAGO 진공백 추가 구매 시작 안내','Y'),(28,122,'2016-08-11 14:09:40','2016-08-11 14:09:40','<p>&nbsp;</p><div style=\"text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1470892146674.jpg\" title=\"u3_1470892146674.jpg\"><br style=\"clear:both;\"><br></div><div style=\"text-align: center;\" align=\"center\"><br></div><p>&nbsp;</p>','VAGO가 또! 200% 달성하였습니다.','Y'),(29,122,'2016-08-19 14:08:48','2016-08-19 14:08:48','<p style=\"text-align: center; \" align=\"center\"><img src=\"/data/smarteditor/attach/u3_1471583320313.jpg\" title=\"u3_1471583320313.jpg\"><br style=\"clear:both;\">&nbsp;</p>','VAGO의 300% 달성 소식!','Y'),(30,122,'2016-08-24 14:50:21','2016-08-24 14:50:21','<p><iframe width=\"100%\" height=\"480\" src=\"https://www.youtube.com/embed/hT5kj-LI064\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p><p><img src=\"/data/smarteditor/attach/u435_1472017578166.jpg\" title=\"u435_1472017578166.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p>','VAGO의 새로운 소식 업데이트!','Y'),(31,122,'2016-08-26 17:17:39','2016-08-26 17:17:39','<p><img src=\"/data/smarteditor/attach/u435_1472199417388.jpg\" title=\"u435_1472199417388.jpg\"><br style=\"clear:both;\">&nbsp;</p>','VAGO 배송지연 상세 안내','Y'),(32,122,'2016-08-30 14:00:55','2016-08-30 14:01:01','<p>&nbsp;</p><div style=\"text-align: center;\"><img src=\"/data/smarteditor/attach/u3_1472533247554.jpg\" title=\"u3_1472533247554.jpg\" style=\"line-height: 1.5;\"></div><div style=\"text-align: center;\" align=\"center\"><br></div><p>&nbsp;</p>','VAGO가 성공적으로 후원종료되었습니다.','Y'),(33,122,'2016-10-10 12:32:38','2016-10-11 09:44:33','<p>안녕하세요,</p><p>크라우드펀딩 오지랖입니다.</p><p>현재 VAGO의 제품 제작과 최신 현황을 전해드립니다.</p><p>조금은 안타까운 소식입니다. 9월말 <b><span style=\"background-color: rgb(30, 235, 58);\">대만 태풍 17호 메기(MEGI)의 영향</span></b>으로 대만 전국적으로 태풍의 피해가 매우 크다고 합니다. 안타깝지만 VAGO의 제조 공장 또한 침수를 당하는 등 태풍의 영향을 피하지는 못했다고 합니다.</p><p><img title=\"u435_1476067673926.png\" src=\"/data/smarteditor/attach/u435_1476067673926.png\"><br>▲ VAGO의 제작사인 \'Creation Cell\'로 부터 전달 받았던 대만 현지의 피해상황입니다.<br style=\"clear: both;\">&nbsp;</p><p>대만 현지에서는 제품 양산과 배송을 위해 최대한 빠른 공장 가동 정상화를 위해 휴일도 반납하며 일하고 있다고 하는데요,</p><p><span style=\"color: rgb(14, 241, 11); font-family: 나눔고딕, NanumGothic;\"><b>직접 가서 현재 상황을 확인</b></span>하고 오지랖 회원님들이 하루라도 더 빨리 받을 수 있도록 제품의 양산과 배송일정을 확인하기 위해 대만 현지를 방문하였습니다.</p><p>&nbsp;</p><div align=\"center\" style=\"text-align: center;\"><img title=\"u435_1476067872709.png\" src=\"/data/smarteditor/attach/u435_1476067872709.png\"></div><div align=\"left\" style=\"text-align: left;\">제조사인 \'Creation Cell\'에 따르면 공장 침수로 인하여 며칠간 가동이 멈추긴 했지만, 다행히도 일정에는 큰 변동이 없을것 같다고 합니다.</div><div align=\"left\" style=\"text-align: left;\"><br></div><div align=\"left\" style=\"text-align: left;\">이번 대만 방문을 통해 제품의 국내 정식 통관을 위한 각종 인증 심사를 위해 실제로 작동이 가능한 완성된 시제품을 가지고 돌아왔습니다.</div><div align=\"left\" style=\"text-align: left;\"><br></div><div align=\"left\" style=\"text-align: left;\">3</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"left\" style=\"text-align: left;\">2</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"left\" style=\"text-align: left;\">1</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"left\" style=\"text-align: left;\">.</div><div align=\"center\" style=\"text-align: center;\"><b><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\">킥스타터보다 빠르게, <span style=\"color: rgb(14, 241, 11);\">전 세계에서 가장 빠르게,</span>&nbsp;</span></b></div><div align=\"center\" style=\"text-align: center;\"><b><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\"><span style=\"background-color: rgb(30, 235, 58);\">오지랖에서만 볼 수 있는 VAGO</span>의 시제품입니다!!!</span></b></div><p>&nbsp;</p><div align=\"left\" style=\"text-align: center;\"><br></div><div align=\"left\" style=\"text-align: left;\"><div align=\"left\" style=\"text-align: left;\"><div align=\"center\" style=\"text-align: center;\"><img title=\"u435_1476070309562.jpg\" src=\"/data/smarteditor/attach/u435_1476070309562.jpg\"></div><br style=\"clear: both;\"><br></div></div><div align=\"center\" style=\"text-align: center;\"><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\"><b><span style=\"color: rgb(14, 241, 11);\">VAGO의 실제 작동 모습</span>입니다</b></span></div><div align=\"center\" style=\"text-align: center;\"><br></div><p align=\"center\" style=\"text-align: center;\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/-1KN14Rxgmo\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p><p align=\"left\" style=\"text-align: left;\">&nbsp;</p><p>이제 배송을 위한 각종 인증 심사 통과만 남아있습니다. 이와 관련하여 어느정도 기간이 필요한 점에 대하여 구매하신 분들의 이해 부탁드립니다.<br><span style=\"font-size: 8pt;\">(이 부분을 진행하지 않을 시. 제품에 대한 A/S 문제점과 일반 커머스 사이트처럼 개개인의 통관고유번호를 입력하게 되고, 개별적으로 구매를 진행 할 수 밖에 없으며 많은 수량을 구매하신 분은 관/부가세 문제가 발생할 수 있기에 부득이하게 정식통관 및 인증심사를 거칠 수 밖에 없는 점 이해해 주시기 바랍니다.)</span></p><p><span style=\"font-size: 7pt;\">&nbsp;</span></p><p><span style=\"font-family: 나눔고딕, NanumGothic;\"><b>다음주에는 VAGO의 진공백</b></span>의 시제품이 도착하는 즉시 다양한 테스트를 통해 업데이트를 진행하도록 하겠습니다.</p><p><b><span style=\"font-family: 나눔고딕, NanumGothic;\">배송관련 사항도 지속적으로 업데이트</span></b>를 통해 알려드릴 예정이오니 많은 관심 부탁드립니다.</p><p>감사합니다.^^</p>','세계에서 가장 빠른 VAGO의 새로운 소식!!!','Y'),(34,123,'2016-10-12 18:13:26','2016-10-14 13:36:53','<p align=\"center\" style=\"text-align: center;\"><strong><span style=\'color: rgb(255, 108, 0); font-family: \"나눔고딕\",NanumGothic; font-size: 14pt;\'><span style=\"color: rgb(0, 0, 0);\">카고바이크</span> 『</span><span style=\'color: rgb(255, 108, 0); font-family: \"나눔고딕\",NanumGothic; font-size: 14pt;\'>Pick-Up Bike』<span style=\"color: rgb(0, 0, 0);\">가</span></span></strong></p><p align=\"center\" style=\"text-align: center;\"><span style=\'color: rgb(255, 108, 0); font-family: \"나눔고딕\",NanumGothic; font-size: 14pt;\'><strong>오지랖<span style=\"color: rgb(0, 0, 0);\">에 도착했습니다.</span></strong></span></p><p>&nbsp;</p><p>안녕하세요,</p><p>크라우드펀딩 오지랖입니다.</p><p>Pick-Up Bike를 <span style=\"background-color: rgb(30, 235, 58);\"><strong>직접 확인</strong></span>하고 <span style=\"background-color: rgb(30, 235, 58);\"><strong>타볼 수 있도록</strong></span> 하기 위해 <span style=\"background-color: rgb(30, 235, 58);\"><strong>한국으로 들고</strong></span>왔습니다.</p><p><img title=\"u435_1476419423964.gif\" src=\"/data/smarteditor/attach/u435_1476419423964.gif\"></p><p>엄청 큰거 보이시죠?</p><p>정말 우여곡절 끝에 무사히 공항에서 싣고 올 수 있었습니다.</p><p>&nbsp;</p><p>자 그럼 한번 타 볼까요?</p><p>직접 자전거 앞에 타서 동영상을 찍어보았습니다.</p><p>&nbsp;</p><iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/fN0IYgKrDFE\" frameborder=\"0\" allowfullscreen=\"\"></iframe><p>&nbsp;</p><p>근사하게 사진도 한 컷!</p><p>&nbsp;</p><p>&nbsp;</p><p><img title=\"u435_1476419679893.JPG\" src=\"/data/smarteditor/attach/u435_1476419679893.JPG\">&nbsp;</p><p>&nbsp;</p><p>직접 자전거가 보고싶다면</p><p>아래 장소와 시간을 참고하시고 언제든 방문해주세요!</p><p>&nbsp;</p><p><img title=\"u435_1476263585929.jpg\" src=\"https://www.ozr.kr/data/smarteditor/attach/u435_1476263585929.jpg\"></p><p>&nbsp;</p>','카고바이크 용산에 상륙!!!','Y'),(35,122,'2016-10-20 17:51:21','2016-10-20 17:51:21','<div style=\"text-align: center;\" align=\"center\">\r\n<img src=\"/data/smarteditor/attach/u3_1476953232972.gif\" title=\"u3_1476953232972.gif\">\r\n<a href=\"https://www.ozr.kr/project/122/detail/update_view.do?x=31\" target=\"_blank\" style=\"border:0;\">\r\n<img src=\"/data/smarteditor/attach/u3_1476953237491.gif\" title=\"u3_1476953237491.gif\">\r\n</a>\r\n<a href=\"https://www.ozr.kr/project/122/detail/update_view.do?x=33\" target=\"_blank\" style=\"border:0;\">\r\n<img src=\"/data/smarteditor/attach/u3_1476953242674.gif\" title=\"u3_1476953242674.gif\">\r\n</a>\r\n<img src=\"/data/smarteditor/attach/u3_1476953246975.gif\" title=\"u3_1476953246975.gif\">\r\n</div>','VAGO 지연 안내','Y'),(36,122,'2016-10-24 15:45:27','2016-10-24 15:46:54','<p>안녕하세요,</p><p>크라우드펀딩 오지랖입니다.</p><p>&nbsp;</p><p>인증 및 테스트를 위해 가져온 VAGO의 테스트 영상입니다.</p><p>&nbsp;</p><p>페이지 댓글이나 페이스북 등 궁금해 하셨던 점들을 기준으로 몇가지 테스트를 해보았습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1477289276866.jpg\" title=\"u435_1477289276866.jpg\"></p><p>&nbsp;</p><p>날이 추워지니 두께감 있는 패딩과 얇은 두께의 패딩, 자켓, 구김감을 체크하기 위한 셔츠, 수건 4장을 준비했습니다.</p><p>세로로 쌓아 놓으니 꽤 높습니다.<br style=\"clear:both;\">&nbsp;</p><p>위 사진만큼은 Bag에 꽉 차게 담을 수 있었습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1477289523934.jpg\" title=\"u435_1477289523934.jpg\"></p><p>&nbsp;</p><p>M size Bag의 크기는 약 50x60cm의 사이즈입니다.&nbsp;</p><p>VAGO를 통해 압축하기 전 Bag에 가득 담았을 때의 모습과 사이즈를 재 보았습니다.</p><p>Bag에 넣을 때 방법에 따라 조금 차이는 생길 수 있습니다.</p><p>&nbsp;</p><p>꾸역꾸역(?) 넣어 높이는 전체적으로 균일하지 못하여 높은 부분과 낮은 부분이 발생합니다.</p><p>(차후 VAGO를 사용하시는 분들 께서는 가능하면 Bag 사이즈에 맞게 고르고 넓게 펴서 넣을 때 가장 큰 효과를 볼 수 있을것 같습니다.)</p><p>&nbsp;</p><p>&nbsp;</p><p>\r\n<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/PnvZzlBky4c\" frameborder=\"0\" allowfullscreen=\"\"></iframe></p><p>&nbsp;</p><p>VAGO를 이용하여 테스트 해 본 영상입니다.</p><p>현재 약 20배속 가량으로 빠르게 재생한 영상입니다.</p><p>&nbsp;</p><p>이외에도 다른 옷 들을 넣고 테스트를 해본 결과</p><p>Bag 내부에 옷이 많을수록 압축하는 시간은 오래걸렸습니다.</p><p>니트류나 섬유간의 공간이 많은 옷이 많을수록 시간은 오래걸립니다.</p><p>&nbsp;</p><p><b><span style=\"background-color: rgb(255, 239, 0);\">완전히 압축되는데 까지는 옷의 수량이나 차지하는 부피에 따라 약5~10분 정도의 시간이 소요</span></b>됩니다.</p><p>&nbsp;</p><p>휴대용에 걸맞게 여행지에서 압축실행을 해 놓은 상태로 머리를 감고 온다거나 세수를 하고 오면 압축이 끝나 있을 시간입니다.</p><p>완전히 압축되면 VAGO는 자동으로 꺼집니다.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1477290446394.jpg\" title=\"u435_1477290446394.jpg\"></p><p>압축된 Bag의 모습입니다.<br style=\"clear:both;\">좀 더 깔끔하게 짐을 싼다면... 더 좋겠죠??</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1477290432393.jpg\" title=\"u435_1477290432393.jpg\"></p><p>&nbsp;</p><p>압축된 상태의 사이즈를 재 보았습니다.</p><p>변화된 사이즈는 아래와 같습니다.</p><p>&nbsp;</p><p><b>가장 높은 부분 : 20cm &gt;&gt;&gt; 17cm<span style=\"color: rgb(255, 0, 0);\"> (-3cm)</span></b></p><p><b>가장 낮은 부분 : 17cm &gt;&gt;&gt; 12.5cm <span style=\"color: rgb(255, 0, 0);\">(-4.5cm)</span></b></p><p><b>세로 가장 긴 부분 : 36cm &gt;&gt;&gt; 31cm <span style=\"color: rgb(255, 0, 0);\">(-5cm)</span></b></p><p><b>가로 가장 긴 부분 : 47cm &gt;&gt;&gt; 33cm <span style=\"color: rgb(255, 0, 0);\">(-14cm)</span></b></p><p>&nbsp;</p><p>옷의 재질에 따라 줄어드는 부분도 많은 차이가 발생합니다.&nbsp;</p><p>전 후를 비교해보면 아래와 같습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1477290978115.jpg\" title=\"u435_1477290978115.jpg\"></p><p>&nbsp;</p><p>옷의 구김에 대해 궁금했던 점에 대해서 말씀드리겠습니다.</p><p>Vago의 Bag 안에서 <b><span style=\"color: rgb(255, 0, 0);\">약 6시간 가량 압축해 있던 상태의 셔츠</span></b>입니다.</p><p>&nbsp;</p><p>가장 바닥에 넣고 실험을 했으며, 생각보다는 구김이 없었습니다.</p><p>물론, 셔츠의 재질에 따라 구김이 많이 가는 재질이라면 다를 수 있습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1477291087738.jpg\" title=\"u435_1477291087738.jpg\"><br style=\"clear:both;\"><br><br>&nbsp;</p><div align=\"center\" style=\"text-align: center;\"><b><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\">이상 &nbsp;<span style=\"color: rgb(14, 241, 11);\">전 세계에서 가장 빠르게&nbsp;</span></span></b><b><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\">VAGO의 사용기를 작성해 보았습니다.</span></b></div><div align=\"center\" style=\"text-align: center;\"><b><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\"><span style=\"background-color: rgb(30, 235, 58);\">최대한 빠른 시일 내 받을 수 있도록</span>&nbsp;노력하는 오지랖이 되겠습니다.</span></b></div><div align=\"center\" style=\"text-align: center;\"><b><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\">감사합니다.</span></b></div><div align=\"center\" style=\"text-align: center;\"><b><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\"><br></span></b></div><div align=\"center\" style=\"text-align: center;\"><b><span style=\"font-family: 나눔고딕, NanumGothic; font-size: 18pt;\"><br></span></b></div><div align=\"center\" style=\"text-align: center;\"><font face=\"나눔고딕, NanumGothic\"><span style=\"font-size: 24px;\"><b>테스트에 더 궁금한 사항이 있으시면 댓글 달아주세요!</b></span></font></div><p>&nbsp;</p><p>&nbsp;</p>','VAGO 실제 사용기!','Y'),(37,122,'2016-11-03 15:43:19','2016-11-03 16:24:36','<p>안녕하세요,</p><p>크라우드펀딩 오지랖입니다.</p><p>&nbsp;</p><p>현재 VAGO는 통관을 모두 마친 상태이며,</p><p>금일 물류센터 입고 및 배송을 준비하고 있습니다.</p><p>&nbsp;</p><p>오랜시간 기다려주신 후원자분들께 감사의 말씀드립니다.</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"text-align: center; \" align=\"center\"><span style=\"font-size: 14pt; color: rgb(255, 108, 0);\"><b>박스들과 함께 단체샷!</b></span></p><p style=\"text-align: center; \" align=\"center\"><span style=\"font-size: 14pt; color: rgb(255, 108, 0);\"><b><br></b></span></p><p><img src=\"/data/smarteditor/attach/u435_1478153860052.jpg\" title=\"u435_1478153860052.jpg\"></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"text-align: center; \" align=\"center\"><b style=\"color: rgb(255, 108, 0); font-size: 18.6667px;\">색상별 VAGO의 모습입니다.</b></p><p style=\"text-align: center; \" align=\"center\"><b style=\"color: rgb(255, 108, 0); font-size: 18.6667px;\"><br></b></p><p style=\"text-align: center; \" align=\"center\"><font color=\"#ff6c00\"><span style=\"font-size: 18.6667px;\"><b><img src=\"/data/smarteditor/attach/u435_1478155112282.png\" title=\"u435_1478155112282.png\"><br style=\"clear:both;\"><br><br>Bag과 Vago가 BOX에 담겨있는 모습입니다.</b></span></font></p><p style=\"text-align: center; \" align=\"center\"><font color=\"#ff6c00\"><span style=\"font-size: 18.6667px;\"><b><br></b></span></font></p><p style=\"text-align: center; \" align=\"center\"><font color=\"#ff6c00\"><span style=\"font-size: 18.6667px;\"><b><img src=\"/data/smarteditor/attach/u435_1478155182958.jpg\" title=\"u435_1478155182958.jpg\">&nbsp;<img src=\"/data/smarteditor/attach/u435_1478155192646.jpg\" title=\"u435_1478155192646.jpg\">&nbsp;<img src=\"/data/smarteditor/attach/u435_1478155221144.jpg\" title=\"u435_1478155221144.jpg\">&nbsp;</b></span></font></p><p style=\"text-align: center; \" align=\"center\"><font color=\"#ff6c00\"><span style=\"font-size: 18.6667px;\"><b><br></b></span></font></p><p style=\"text-align: center; \" align=\"center\"><font color=\"#ff6c00\"><span style=\"font-size: 18.6667px;\"><b><br></b></span></font></p><p style=\"text-align: center; \" align=\"center\">분류 작업까지 완벽하게 끝이 났습니다.</p><p style=\"text-align: center; \" align=\"center\">이제 배송만 남아있습니다.&nbsp;</p><p style=\"text-align: center; \" align=\"center\">&nbsp;</p><p style=\"text-align: center; \" align=\"center\">&nbsp;</p><p style=\"text-align: center; \" align=\"center\"><img src=\"/data/smarteditor/attach/u435_1478155378213.jpg\" title=\"u435_1478155378213.jpg\"><br style=\"clear:both;\">&nbsp;</p><p style=\"text-align: center; \" align=\"center\">&nbsp;</p><p style=\"text-align: center; \" align=\"center\"><b><span style=\"font-size: 14pt;\">빠르게 배송하도록 노력하겠습니다.</span></b></p><p style=\"text-align: center; \" align=\"center\"><b><span style=\"font-size: 14pt;\">감사합니다 :D</span></b></p><p style=\"text-align: center; \" align=\"center\"><font color=\"#ff6c00\"><span style=\"font-size: 18.6667px;\"><b><br style=\"clear:both;\">&nbsp;<br style=\"clear:both;\"><br></b></span></font></p>','VAGO 배송 준비 관련','Y'),(38,122,'2016-11-04 18:04:28','2016-11-04 18:04:28','<p>안녕하세요,</p><p>크라우드펀딩 오지랖입니다.</p><p>&nbsp;</p><p>금일 크라우드 펀딩을 후원해주신 모든 분들께&nbsp;</p><p>택배발송 처리가 완료되었습니다.</p><p>&nbsp;</p><p>택배사 사정에 따라 조금 차이가 있을 수 있지만</p><p>빠르면 11/07(월) 까지 받아 보실 수 있을 예정입니다.</p><p>&nbsp;</p><p>보내주신 관심과 후원에 다시 한 번 감사드립니다.</p><p><img src=\"/data/smarteditor/attach/u435_1478249917636.jpg\" title=\"u435_1478249917636.jpg\"><br style=\"clear:both;\">&nbsp;</p>','VAGO 발송 완료.','Y'),(39,122,'2016-11-11 14:02:31','2016-11-11 16:54:50','<p>안녕하세요,</p><p>크라우드 펀딩 오지랖입니다.</p><p>&nbsp;</p><p>저희에게 첫 해외 크라우드 펀딩 프로젝트였고,&nbsp;</p><p>가장 큰 금액으로 모금이 진행된 프로젝트였던 \'VAGO\'가 배송까지 무사히 끝났습니다.</p><p>&nbsp;</p><p>이후 VAGO와 압축팩의 추가 구매를 위해 눈코뜰새 없이(는 과장이지만) 바쁘게 움직이고 있습니다.</p><p>&nbsp;</p><p>이번 프로젝트를 진행하며 다양한 사건 사고도 있었고,&nbsp;</p><p>또한, 구매하신 분들 중.</p><p>현재 사용 중 파손되는 경우도 발생하여 파손을 방지하기 위한 방법을 알려드립니다.</p><p>&nbsp;</p><p>동영상으로 간단하게 설명드리겠습니다.</p><p>&nbsp;</p>\r\n\r\n<iframe width=\"640\" height=\"360\" src=\"//www.youtube.com/embed/vG5qV4iVc8E?autoplay=1&amp;playlist=vG5qV4iVc8E&amp;loop=1&amp;showinfo=0&amp;fs=0&amp;rel=0\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n\r\n<p>&nbsp;</p><p>&nbsp;</p><p>잘 모르시겠다구요? 좀 더 자세히 부분 동작으로 보겠습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1478840052563.JPG\" title=\"u435_1478840052563.JPG\"></p><p>자세히 보면 OPEN과 CLOSE가 보입니다.</p><p><img src=\"/data/smarteditor/attach/u435_1478840089916.JPG\" title=\"u435_1478840089916.JPG\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1478840099587.JPG\" title=\"u435_1478840099587.JPG\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1478840110305.JPG\" title=\"u435_1478840110305.JPG\"><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1478840120862.JPG\" title=\"u435_1478840120862.JPG\"><br style=\"clear:both;\"><br>몇바퀴 돌려야 하는지 잘 모르시겠다면!<br>연속 동작으로 보실까요?</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1478840451729.gif\" title=\"u435_1478840451729.gif\"></p><p>&nbsp;</p><p>감사합니다!!<br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</p>','VAGO 사용법 관련 업데이트','Y'),(40,127,'2016-11-15 17:38:05','2016-11-17 11:46:48','<p><img src=\"/data/smarteditor/attach/u435_1479344821578.jpg\" title=\"u435_1479344821578.jpg\">&nbsp;</p><p>iPhone을 쓰다보면 부족한 메모리에 시달릴때가 많습니다. iCloud나 다른 클라우드 서비스, 혹은 꽉꽉 찰 때마다 사진이나 동영상을 PC로 옮겨야 하는건 Apple 사용자라면 당연하게 되어버렸죠.</p><p>&nbsp;</p><p>가장 큰 문제는 영화를 하나 보려해도 자막과 함께 인코딩을 한다거나 APP을 다운받아 아이튠즈를 통해 영화를 넣어야 한다는 점입니다.</p><p>&nbsp;</p><p>이러한 문제를 간단하게 해결해 줄 아이템이 바로 iKlips DUO + 입니다.</p><p>&nbsp;</p><p><img src=\"https://www.ozr.kr/data/smarteditor/attach/u435_1479343748332.jpg\" title=\"u435_1479343748332.jpg\"></p><p>&nbsp;</p><p>왠 USB? 라고 생각하시는 분들도 분명 계실거라 생각합니다. 이 제품의 이름은 \'iKlips DUO +\' 안드로이드처럼 외장메모리가 없는 Apple 유저들을 위한 기기입니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479346915910.jpg\" title=\"u435_1479346915910.jpg\"></p><p>&nbsp;</p><p>기본적으로 iPhone에 \'iKlips DUO +\'를 연결하면 자동으로 인식하고 APP설치를 유도하는데요, \'App Store\'를 누르지 않고 \'무시\'를 선택하면 나중에 직접 \'App Store\'에서 찾아서 설치를 해야합니다.&nbsp;</p><p>\'App Store\'를 선택하면 바로 APP을 설치할 수 있는데요, APP이 설치되고 나면, 통신을 연결하기 위한 메시지 창이 나타나는데요 여기서 \'허용\'을 눌러주면 iPhone이 \'iKlips APP\'을 자동으로 실행하며 연결이 이루어 집니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479347341325.jpg\" title=\"u435_1479347341325.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>연결하고나면 다음과 같은 화면이 처음 맞이해줍니다.</p><p>해외 크라우드 펀딩으로 한국 뿐 아니라 다양한 국가에 제공되는 제품이다 보니 다양한 언어로 나와있습니다. 이외에도 옆으로 넘기면 간단한 제품에 대한 설명들이 나오는데요, 귀찮으신 분들은 <b><span style=\"color: rgb(255, 0, 0);\">슥슥~ 넘어가셔도 괜찮습니다.</span></b></p><p><b><span style=\"color: rgb(255, 0, 0);\"><br></span></b></p><p>그 중 마지막 페이지는 ADAM ID 등록 페이지가 나오는데요, \'등록\'을 통해 더 다양한 지원을 받을 수 있습니다.</p><p>여기까지 완료하면 내 사진첩에 접근을 하려합니다. 유용하게 쓰려고 만들고 구입하는 제품이니 자연스럽게 \'승인\'을 눌러줍니다!</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479347771863.jpg\" title=\"u435_1479347771863.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>본격적으로 APP을 실행하고 상단을 드래그 하면 iPhone에 남아있는 용량과 외장메모리에 남아있는 용량을 볼 수 있습니다.</p><p>&nbsp;</p><p>그리고 오른쪽 위 사진처럼 가운데 빨간 제조사의 마크를 클릭하면 다양한 기능들을 더 볼 수 있습니다. 카메라, 녹음기, YouTue, 사진백업, 연락처백업, 달력백업, 페이스북백업, 인스타그램 백업등 실생활에서 많이 사용하는 다양한 기능들이 있습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479347904858.gif\" title=\"u435_1479347904858.gif\"><br style=\"clear:both;\">&nbsp;</p><p>역시 뭐니뭐니해도 가장 편리한건 USB처럼 사용할 수 있다는거죠!! iTunes를 사용할 필요 없이, 별도의 동영상 재생 APP이 필요 없이 PC에 연결해서 영화를 휙휙 넣어서 담아놓기만 하면 됩니다. Ctrl+C &amp; Ctrl+V 참 쉽죠?</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479348154549.jpg\" title=\"u435_1479348154549.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>그리고 다시 iPhone에 연결해서 동영상을 누르면!!! 내가 넣었던 자료들이 뙇!!!</p><p>&nbsp;</p><p>그리고 또!!!!!! 가장 매우 베리베리 머치 매니 마니 좋았던 이유는 바로바로...</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479348939570.jpg\" title=\"u435_1479348939570.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>자막재생!!! A***, K**, G***, 등 여러가지 플레이어를 써봤지만 자막이 깨진다거나 혹은 함께 인코딩을 해야 볼 수 있었는데요, 인코딩 없이 볼 수 있습니다. 영화나 드라마를 넣을때 자막파일(*.smi)파일만 같은 폴더안에 넣어준다면요!!</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479349062671.jpg\" title=\"u435_1479349062671.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>플레이어 설정에서는 다양한 설정과 이어보기가 가능합니다.</p><p>사무실 구석에서 숨어서 영화를 보다가 황급히 종료시켜도 다시 이어서 볼 수 있습니다. 정말 유용하지 않을 수가 없습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479349713284.jpg\" title=\"u435_1479349713284.jpg\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</p><p>메인 화면에서 iKlips 카메라를 통해 Direct로 촬영이 가능한데요, 이 기능을 사용하게 되면 iPhone이 아닌 iKlips DUO +로 바로 저장이 가능합니다.&nbsp;</p><p>핸드폰에 용량이 1MB밖에 없어도 사진과 동영상을 촬영할 수 있다는 이야기죠!!</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479349754900.jpg\" title=\"u435_1479349754900.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>핸드폰 사진을 PC에 옮기려면 iTunes를 켤 필요 없이 iKlips DUO + 에 담아서 USB처럼 PC에 연결하면 더 쉽습니다 ㅋㅋㅋ</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479349835608.jpg\" title=\"u435_1479349835608.jpg\"><br style=\"clear:both;\">&nbsp;</p><p>이렇게 휙휙 옮겨집니다. 생각보다 전송 속도도 빨라요!!</p><p>&nbsp;</p><p>이쯤에서 종합 정리를 해보도록 하겠습니다.</p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479350442349.jpg\" title=\"u435_1479350442349.jpg\"></p><p>&nbsp;</p><p>감사합니다 :D<br style=\"clear:both;\">&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','간편한 iKlips APP 사용기','Y'),(41,127,'2016-11-16 10:56:33','2016-11-16 11:00:19','<p>&nbsp;</p><p>iKlips DUO + 는 누가 보아도 한 눈에 사용법을 알 수 있도록 직관적이고 심플하게 디자인되었습니다.</p><p><br>제품에 사용되는 아연 합금은 iKlips DUO +의 내구성과 방진에 도움을주어 장기간 사용에도 문제없이 사용할 수 있습니다.&nbsp;</p><p>&nbsp;</p><p>또한 표면에는 Apple의 iPhone6와 동일한 프리미엄 알루미늄을 사용하여 또 하나의 iPhone을 만지는 듯한 느낌을 주었습니다.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://www.ozr.kr/data/smarteditor/attach/u435_1479259754941.jpg\" title=\"u435_1479259754941.jpg\"></p><p>&nbsp;</p><p><img src=\"https://www.ozr.kr/data/smarteditor/attach/u435_1479257821638.jpg\" title=\"u435_1479257821638.jpg\"></p><p>&nbsp;</p><p><img src=\"https://www.ozr.kr/data/smarteditor/attach/u435_1479257827734.jpg\" title=\"u435_1479257827734.jpg\"></p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479259736437.jpg\" title=\"u435_1479259736437.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479259748699.jpg\" title=\"u435_1479259748699.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479257675165.jpg\" title=\"u435_1479257675165.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479257710009.jpg\" title=\"u435_1479257710009.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479257720869.jpg\" title=\"u435_1479257720869.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479257743489.jpg\" title=\"u435_1479257743489.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479257780802.jpg\" title=\"u435_1479257780802.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479257979280.jpg\" title=\"u435_1479257979280.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479259882307.jpg\" title=\"u435_1479259882307.jpg\"></p><p><br style=\"clear:both;\"><img src=\"/data/smarteditor/attach/u435_1479259891791.jpg\" title=\"u435_1479259891791.jpg\"></p><p>&nbsp;</p><p><img src=\"/data/smarteditor/attach/u435_1479259953152.jpg\" title=\"u435_1479259953152.jpg\"></p><p>&nbsp;</p>','iKlips DUO + 의 감각적 디자인 상세사진','Y');
