CREATE TABLE `nest_project_wait` (
  `IDX` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '관리연번',
  `UID` int(10) unsigned DEFAULT NULL COMMENT '등록자계정연번',
  `PID` int(10) unsigned DEFAULT NULL COMMENT '프로젝트참조연번',
  `STATE` int(10) unsigned DEFAULT '1' COMMENT '심사상태',
  `REG_DAT` datetime DEFAULT NULL COMMENT '등록일시',
  `WHAT` text COLLATE utf8_unicode_ci COMMENT '주제',
  `HURDLE` text COLLATE utf8_unicode_ci COMMENT '장애요소',
  `REWARD` text COLLATE utf8_unicode_ci COMMENT '보상품',
  `PLEDGE` text COLLATE utf8_unicode_ci COMMENT '자금',
  `CATEGORY` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '분야',
  `PORTFOLIO` text COLLATE utf8_unicode_ci COMMENT '포트폴리오',
  `MOBILE` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '연락처',
  `PROJECT_TYPE` varchar(2) COLLATE utf8_unicode_ci DEFAULT 'CF',
  `MNAME` text COLLATE utf8_unicode_ci,
  `GOAL` text COLLATE utf8_unicode_ci,
  `HOPE_PLEDGE` text COLLATE utf8_unicode_ci,
  `PROMOTION` text COLLATE utf8_unicode_ci,
  `MININUM` text COLLATE utf8_unicode_ci,
  `MAXINUM` text COLLATE utf8_unicode_ci,
  PRIMARY KEY (`IDX`)
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='프로젝트 개설 신청정보';
