INSERT INTO `nest_report` VALUES (1,'문의','2016-04-27 17:59:35',0,2,'운영서버 적용 후 문의 기능 테스트 입니다.','운영서버 적용 후 문의 기능 테스트 입니다.','woo@howoocast.com',''),(2,'신고','2016-04-27 17:59:53',0,2,'조명, 일상을 담다','- 프로젝트: 조명, 일상을 담다 (PID:109)<br/>- 로그인 여부: 로그인하지 않음 (Email:woo@howoocast.com)<br/>- 신고유형: 이 프로젝트의 내용이 사실과 달라 사기의 우려가 있습니다.<br/>- 신고본문: 운영서버 적용 후 테스트 입니다.<br/>','woo@howoocast.com',''),(4,'문의','2016-06-09 10:51:13',401,2,'real art toy  프로젝트가 취소 됐는데 카드결제 예정상태가 자동취소 되지 않아서 취소처리 해주세요','real art toy  프로젝트가 취소 됐는데 카드결제 예정상태가 자동취소 되지 않아서 취소처리 해주세요','davidtaste@yahoo.com',''),(5,'문의','2016-07-08 15:33:42',0,2,'팬포머 재판매 안하나요? 어제 끝났네요 ㅜㅜ','팬포머 재판매 안하나요? 어제 끝났네요 ㅜㅜ','amehuyu81@gmail.com','고객님\r\n\r\n죄송합니다만 프리오더 기간이 지났습니다.\r\n다른 좋은 프로젝트로 다시 만나기를 희망합니다.\r\n\r\n좋은하루 되세요~'),(6,'문의','2016-08-29 11:45:44',1032,0,'제가 지금 결제한 프로젝트 환불하고싶은데 어떻게해야하나요? \r\n\r\n10월 11일에 여행가서 그 전에 받을 수 있어서 구입한건데 10월 15일에 배송시작이면 필요가 없어집니다. ','제가 지금 결제한 프로젝트 환불하고싶은데 어떻게해야하나요? \r\n\r\n10월 11일에 여행가서 그 전에 받을 수 있어서 구입한건데 10월 15일에 배송시작이면 필요가 없어집니다. ','hyunhobbit@naver.com',NULL),(7,'문의','2016-08-31 11:12:59',875,0,'카드가 새로 발급되어서 결제가 안되는데\r\n결제변경을 어디서 해야하나요?','카드가 새로 발급되어서 결제가 안되는데\r\n결제변경을 어디서 해야하나요?','jjoom007@naver.com',NULL),(8,'문의','2016-09-12 18:44:21',783,0,'안녕하세요 vago 압축팩 펀딩을 했는데 압축팩 추가 구매를 못해서 혹시 압축팩 추가 구매가 가능한지?? 가능 하다면 어떻게 해야하는지 궁금하여 문의 드립니다 ','안녕하세요 vago 압축팩 펀딩을 했는데 압축팩 추가 구매를 못해서 혹시 압축팩 추가 구매가 가능한지?? 가능 하다면 어떻게 해야하는지 궁금하여 문의 드립니다 ','artks283@naver.com',NULL),(9,'문의','2016-10-18 10:49:17',1036,0,'vago 제품을 후원하여 구매한 고객입니다.\r\n혹시 언제쯤 배송이 될까요?\r\n\r\n이름 : 고석우\r\n이메일 : kosuk1231@gmail.com','vago 제품을 후원하여 구매한 고객입니다.\r\n혹시 언제쯤 배송이 될까요?\r\n\r\n이름 : 고석우\r\n이메일 : kosuk1231@gmail.com','kosuk1231@gmail.com',NULL),(10,'문의','2016-10-18 17:42:46',1146,0,'안녕하세요. \r\n8월29일날 vago구매했는데요. \r\n혹시 언제 받을수 있을까요??\r\n','안녕하세요. \r\n8월29일날 vago구매했는데요. \r\n혹시 언제 받을수 있을까요??\r\n','ssun228@gmail.com',NULL),(11,'문의','2016-12-17 11:55:04',1497,0,'블루투스 이어폰 후원했는데요.\r\n무통장 입금하기로했는데 결제계좌는 어디 있죠?\r\n그리고 언제까지 입금해야하나요???','블루투스 이어폰 후원했는데요.\r\n무통장 입금하기로했는데 결제계좌는 어디 있죠?\r\n그리고 언제까지 입금해야하나요???','calintsz@naver.com',NULL),(12,'문의','2016-12-19 10:19:11',1497,0,'무통장 입금하려는데 문자로 받은 예금주 명과 계좌 예금주 명이 다릅니다.  주) 에이치더블유 맞나요? 문자에는 더네스트 라고 나오는데요','무통장 입금하려는데 문자로 받은 예금주 명과 계좌 예금주 명이 다릅니다.  주) 에이치더블유 맞나요? 문자에는 더네스트 라고 나오는데요','calintsz@naver.com',NULL),(13,'문의','2017-01-16 22:41:49',690,0,'\r\n안녕하세요 진공팩에 끼우고 돌렸더니 플라스틱 채로 떨어졌습니다.. 바고에 껴서 빠지지도 않습니다 ㅠ.ㅠ a/s 받고싶은데 어떻게해야하나요?\r\n','\r\n안녕하세요 진공팩에 끼우고 돌렸더니 플라스틱 채로 떨어졌습니다.. 바고에 껴서 빠지지도 않습니다 ㅠ.ㅠ a/s 받고싶은데 어떻게해야하나요?\r\n','enqn311@naver.com',NULL);
